        public static ReadOnlyDictionary<PBESpecies, PBELocalizedString> Entries { get; } = new ReadOnlyDictionary<PBESpecies, PBELocalizedString>(new Dictionary<PBESpecies, PBELocalizedString>()
        {
            { PBESpecies.Bulbasaur, new PBELocalizedString("うまれてから　しばらくの　あいだは\nせなかの　タネから　えいようを\nもらって　おおきく　そだつ。", "태어나서부터 얼마 동안은\n등의 씨앗으로부터 영양을\n공급받아 크게 성장한다.", "Au matin de sa vie, la graine sur\nson dos lui fournit les éléments\ndont il a besoin pour grandir.", "Nach der Geburt nimmt es für eine\nWeile Nährstoffe über den Samen\nauf seinem Rücken auf.", "Después de nacer, crece alimentándose\nde la semilla de su lomo.", "Dopo la nascita, cresce traendo\nnutrimento dal seme piantato\nsul suo dorso.", "For some time after its birth, it\ngrows by gaining nourishment from\nthe seed on its back.") },
            { PBESpecies.Ivysaur, new PBELocalizedString("せなかの　つぼみが　ふくらみだすと\nあまい　においが　ただよいはじめる。\nたいりんの　はなが　さく　まえぶれ。", "등의 봉오리가 부풀어오르면\n달콤한 냄새가 감돌기 시작한다.\n큰 꽃이 필 조짐이다.", "Lorsque le bourgeon sur son dos\néclot, il répand un doux parfum\npour célébrer sa floraison.", "Sobald die Knospe auf seinem Rücken\nein süßes Aroma abgibt, steht die\nBlüte kurz bevor.", "Cuando el capullo de su lomo se hincha,\ndesprende un dulce aroma para indicar\nel florecimiento.", "Quando il bocciolo che ha sul dorso\nsi gonfia, emana un dolce profumo.\nÈ indice dell'imminente fioritura.", "When the bud on its back starts\nswelling, a sweet aroma wafts to\nindicate the flower's coming bloom.") },
            { PBESpecies.Venusaur, new PBELocalizedString("あめの　ふった　よくじつは　せなかの\nはなの　かおりが　つよまる。かおりに\nさそわれ　ポケモンが　あつまる。", "비가 내린 다음 날은 등의\n꽃향기가 강해진다. 향기에\n이끌려 포켓몬이 모여든다.", "Le parfum de sa fleur se fait plus\npénétrant les lendemains de pluie.\nCela appâte les autres Pokémon.", "Nach einem Regentag riecht die\nBlume auf seinem Rücken intensiver.\nDas Aroma zieht andere Pokémon an.", "Después de un día de lluvia, la flor de\nsu lomo tiene un aroma más potente\ny atrae a otros Pokémon.", "Dopo la pioggia, il fiore sul suo dorso\nemana un profumo più intenso e attira\ngli altri Pokémon.", "After a rainy day, the flower on\nits back smells stronger. The\nscent attracts other Pokémon.") },
            { PBESpecies.Charmander, new PBELocalizedString("ヒトカゲの　しっぽの　ほのおは\nいのちの　ともしび。げんきな　ときは\nほのおも　ちからづよく　もえあがる。", "파이리 꼬리의 불꽃은\n생명의 등불이다. 건강할 때는\n불꽃도 강하게 타오른다.", "La flamme de sa queue symbolise sa\nvitalité. Elle est intense quand il\nest en bonne santé.", "Lodert die Flamme auf seiner\nSchweifspitze hell, ist Glumanda gesund.", "La llama de la punta de su cola indica\nsu salud. Si Charmander está sano,\narderá con más fuerza.", "La fiamma sulla punta della coda indica\nla sua vitalità. Se sta bene, la fiamma\nè più ardente.", "The fire on the tip of its tail is a\nmeasure of its life. If healthy,\nits tail burns intensely.") },
            { PBESpecies.Charmeleon, new PBELocalizedString("リザードが　くらす　いわやまを\nよなかに　みあげると　しっぽの\nほのおが　ほしのように　みえる。", "리자드가 사는 바위산을\n한밤중에 올려다보면 꼬리의\n불꽃이 별처럼 보인다.", "La nuit, la queue ardente du Reptincel\nbrille comme une étoile dans son\nrepaire montagneux.", "Glutexo leben in den Bergen.\nDie Flammen auf ihren Schweifspitzen\nleuchten in der Nacht wie Sterne.", "En las montañas rocosas donde viven\nlos Charmeleon, sus colas ardientes\nbrillan como estrellas.", "Sui monti rocciosi, sua dimora, la coda\ndi Charmeleon brilla come una stella\nnella notte.", "In the rocky mountains where\nCharmeleon live, their fiery\ntails shine at night like stars.") },
            { PBESpecies.Charizard, new PBELocalizedString("くるしい　たたかいを　けいけんした\nリザードンほど　ほのおの　おんどが\nたかくなると　いわれている。", "힘든 싸움을 경험한\n리자몽일수록 불꽃 온도가\n높아진다고 전해진다.", "On raconte que la flamme du\nDracaufeu s'intensifie après\nun combat difficile.", "Man sagt, Gluraks Feuer lodert stärker,\nwenn es harte Kämpfe überstanden hat.", "Se dice que el fuego de Charizard\narde con más fuerza si ha vivido\nduras batallas.", "Pare che la temperatura della fiamma\ndi Charizard aumenti dopo che ha\naffrontato dure lotte.", "It is said that Charizard's fire\nburns hotter if it has\nexperienced harsh battles.") },
            { PBESpecies.Squirtle, new PBELocalizedString("こうらに　とじこもり　みを　まもる。\nあいての　すきを　みのがさず\nみずを　ふきだして　はんげきする。", "등껍질에 숨어 몸을 보호한다.\n상대의 빈틈을 놓치지 않고\n물을 뿜어내어 반격한다.", "Il se réfugie dans sa carapace\net réplique en éclaboussant\nl'ennemi à la première occasion.", "Es zieht sich in seinen Panzer zurück\nund greift dann mit Wasserstrahlen\nseine Gegner an.", "Se protege con su caparazón y luego\ncontraataca lanzando agua a presión\ncuando tiene oportunidad.", "Si ritira nel suo guscio e, alla prima\noccasione, contrattacca colpendo\nil nemico con spruzzi d'acqua.", "It shelters itself in its shell\nthen strikes back with spouts of\nwater at every opportunity.") },
            { PBESpecies.Wartortle, new PBELocalizedString("いちまんねんの　じゅみょうを　もつと\nいわれている。ふさふさの　しっぽは\nながいきの　シンボルとして　にんき。", "만년의 수명을 가지고 있다고들\n말한다. 치렁치렁한 꼬리는\n장수의 상징으로써 인기가 있다.", "On prétend qu'il vit 10 000 ans.\nSa queue duveteuse est un\nsymbole de longévité populaire.", "Man sagt, es werde 10 000 Jahre alt.\nSein buschiger Schweif ist ein Symbol\nfür langes Leben.", "Se dice que vive 10 000 años.\nSu peluda cola es un símbolo\nde longevidad.", "Pare che viva 10.000 anni. Ha la coda\nricoperta da una folta pelliccia, indice\ndi longevità.", "It is said to live 10,000 years.\nIts furry tail is popular as a\nsymbol of longevity.") },
            { PBESpecies.Blastoise, new PBELocalizedString("こうらの　ロケットほうから　ふきだす\nすいりゅうは　ぶあつい　てっぱんも\nいっぱつで　つらぬく　はかいりょく。", "등껍질의 로켓포로부터 뿜어내는\n수류는 두꺼운 철판도\n한 번에 꿰뚫는 파괴력이 있다.", "Les trombes d'eau projetées par\nles canons de sa carapace peuvent\npercer le métal le plus résistant.", "Der Wasserstrahl, der aus den\nWasserdüsen schießt, kann sogar\nStahlwände durchdringen.", "Los chorros de agua que lanza\npor los tubos de su caparazón\npueden atravesar el acero.", "I getti d'acqua lanciati dai cannoni sul\nsuo guscio riescono a perforare\npersino l'acciaio.", "The jets of water it spouts from\nthe rocket cannons on its shell\ncan punch through thick steel.") },
            { PBESpecies.Caterpie, new PBELocalizedString("あかい　しょっかくから　においを\nだして　てきを　おいはらう。\nだっぴを　くりかえし　おおきくなる。", "빨간 더듬이로부터 냄새를\n내어 상대를 쫓아 버린다.\n탈피를 반복하여 자라게 된다.", "Ses antennes rouges libèrent une\npuanteur qui repousse l'ennemi.\nIl grandit par mues régulières.", "Seine roten Antennen sondern einen\nGestank ab, der Feinde verjagt.\nEs wächst, indem es sich häutet.", "Su antena roja desprende un gran\nhedor para repeler a los enemigos.\nCrece mudándose repetidamente.", "Dalle antenne rosse emana un puzzo che\nrespinge il nemico. Cresce cambiando\npiù volte la pelle.", "It releases a stench from its red\nantenna to repel enemies. It\ngrows by molting repeatedly.") },
            { PBESpecies.Metapod, new PBELocalizedString("こうてつのように　かたい　カラで\nやわらかい　なかみを　まもっている。\nしんかするまで　じっと　たえている。", "강철같이 단단한 껍질로\n부드러운 몸을 보호하고 있다.\n진화할 때까지 가만히 참고 있다.", "Son corps frêle est protégé par sa\ncarapace d'acier. Il encaisse les\ncoups durs en attendant d'évoluer.", "Der stahlharte Panzer schützt\nseinen zarten Körper. Es wartet\ngeduldig auf seine Entwicklung.", "Su frágil cuerpo está recubierto\nde una coraza dura como el acero.\nPermanece quieto en su desarrollo.", "Ha una corazza dura come l'acciaio che\nprotegge il suo fragile corpo. Attende\nimmobile di evolversi.", "A steel-hard shell protects its\ntender body. It quietly endures\nhardships while awaiting evolution.") },
            { PBESpecies.Butterfree, new PBELocalizedString("はなの　ミツが　だいこうぶつ。\nわずかな　かふんで　はなばたけの\nばしょを　さがしだすことが　できる。", "꽃의 꿀을 매우 좋아한다.\n약간의 꽃가루만으로 꽃밭이\n있는 장소를 찾아낼 수 있다.", "Il raffole du nectar des fleurs. Il\nest capable de repérer la plus\npetite quantité de pollen.", "Es liebt Blütenhonig. Es findet\nselbst Blumen, die sehr wenig\nPollen haben.", "Adora el néctar de las flores.\nPuede localizar hasta las más\npequeñas cantidades de polen.", "Adora il nettare dei fiori e riesce a\nlocalizzare i campi in cui si trova\nanche una minima quantità di polline.", "It loves the honey of flowers and\ncan locate flower patches that\nhave even tiny amounts of pollen.") },
            { PBESpecies.Weedle, new PBELocalizedString("まいにち　じぶんと　おなじ　おもさの\nはっぱを　たべる。あたまの　ハリで\nおそってきた　てきを　げきたい。", "매일 자신과 똑같은 무게의\n잎사귀를 먹는다. 머리의 침으로\n달려드는 상대를 물리친다.", "Il mange chaque jour son poids en\nfeuilles. Il utilise l'aiguillon sur sa\ntête pour repousser l'ennemi.", "Es frisst täglich sein Gewicht in\nBlättern. Die Nadel auf seinem Kopf\ndient der Verteidigung.", "Come el equivalente a su peso en\nhojas todos los días. Se defiende\ncon el aguijón de su cabeza.", "Divora ogni giorno una quantità di foglie\npari al suo peso. Respinge i nemici con\nl'aculeo sulla testa.", "It eats its weight in leaves every\nday. It fends off attackers with\nthe needle on its head.") },
            { PBESpecies.Kakuna, new PBELocalizedString("てんてきに　みつからないように\nはっぱの　うらや　えだの　すきまに\nかくれて　しんかの　ときを　まつ。", "천적에 발견되지 않도록\n잎사귀 뒷면이나 가지의 틈새에\n숨어서 진화할 때를 기다린다.", "Il se cache sous les feuilles et les\nbranches pour fuir les prédateurs\nen attendant d'évoluer.", "Während es auf seine Entwicklung\nwartet, versteckt es sich unter\nBlättern und zwischen Ästen.", "Se esconde de sus atacantes\nentre las ramas de los árboles\nmientras espera a evolucionar.", "Si nasconde dai predatori dietro le foglie\ne fra i rami, in attesa dell'evoluzione.", "While awaiting evolution, it\nhides from predators under\nleaves and in nooks of branches.") },
            { PBESpecies.Beedrill, new PBELocalizedString("こうそくで　とびまわり　どくバリで\nこうげきしたあと　すぐに　とびさる\nせんぽうが　とくいわざだ。", "고속으로 날아다니며 독침으로\n공격한 뒤 바로 날아가 버리는\n전법이 특기다.", "Il virevolte rapidement autour de\nl'ennemi et frappe de son dard\nempoisonné avant de décamper.", "Sein bester Angriff: schnell auf den\nGegner zufliegen, mit Giftstacheln\nzustechen und davonfliegen.", "Atacan volando alrededor del objetivo\ny usando su aguijón venenoso antes\nde huir.", "Vola intorno al nemico ad alta velocità,\nattacca con i pungiglioni avvelenati e\nsi allontana rapido.", "Its best attack involves flying\naround at high speed, striking with\npoison needles, then flying off.") },
            // { PBESpecies.16, new PBELocalizedString("たたかいを　このまない　おとなしい\nせいかくだが　へたに　てを　だすと\nきょうれつに　はんげきされるぞ。", "싸움을 좋아하지 않는 얌전한\n성격이지만 어설프게 건드리면\n강력한 반격을 당하게 된다.", "Ce Pokémon docile préfère éviter\nle combat. Toutefois, il se montre\ntrès féroce quand on l'agresse.", "Reizt man dieses an sich gutmütige\nPokémon, wehrt es sich wütend.", "Es manso y prefiere evitar\nlos problemas. Sin embargo,\nsi le molestan, atacará ferozmente.", "È docile e preferisce evitare i conflitti.\nMa se viene disturbato, contrattacca\nferocemente.", "It is docile and prefers to avoid\nconflict. If disturbed, however,\nit can ferociously strike back.") },
            // { PBESpecies.17, new PBELocalizedString("ひろい　なわばりを　とびまわりながら\nえものを　さがす。はったつした\nあしの　ツメで　えものを　しとめる。", "넓은 영역을 날아다니며\n먹이를 찾는다. 발달한 발톱으로\n먹이를 꼼짝 못하게 한다.", "Il survole son vaste territoire en\nquête d'une proie avant de fondre\nsur elle toutes griffes en avant.", "Auf der Suche nach Nahrung, in die es\nseine scharfen Krallen schlägt, fliegt es\ndurch riesiges Territorium.", "Sobrevuela su extenso territorio\nen busca de presas y ataca con\nsus poderosas garras.", "Sorvola il suo ampio territorio a caccia\ndi prede, afferrandole con i suoi artigli\naffilati.", "It flies over its wide territory in\nsearch of prey, downing it\nwith its highly developed claws.") },
            // { PBESpecies.18, new PBELocalizedString("ピジョットが　ちからいっぱい\nはばたくと　たいぼくも　しなるほどの\nきょうふうを　まきおこす。", "피죤투가 힘껏 날개를 치면\n큰 나무도 휠 정도의\n강풍을 일으킨다.", "En battant des ailes de toutes ses\nforces, Roucarnage génère une\nrafale à en déraciner les arbres.", "Schlägt Tauboss mit ganzer Kraft\nseine Flügel, beugen sich selbst\ngroße Bäume durch den Windstoß.", "Aleteando con toda su fuerza, Pidgeot\ncrea corrientes de aire capaces de\ndoblar grandes árboles.", "Sbattendo le ali a più non posso, Pidgeot\ncrea un vento tanto forte da piegare\nalberi possenti.", "By flapping its wings with all its\nmight, Pidgeot can make a gust of\nwind capable of bending tall trees.") },
            // { PBESpecies.19, new PBELocalizedString("\xFF11にちじゅう　エサを　さがしている。\nキバは　しぬまで　のびつづけるので\nかたいものを　かじって　けずる。", "온종일 먹이를 찾고 있다.\n앞니는 죽을 때까지 계속 자라기 때문에\n딱딱한 것을 갉아 댄다.", "Toujours à la recherche de nourriture.\nIl croque des objets durs pour émousser\nses crocs qui poussent constamment.", "Sucht den lieben langen Tag nach Futter.\nDa seine Nagezähne immer nachwachsen,\nwetzt es sie an harten Objekten ab.", "Busca comida durante todo el día.\nLima sus colmillos, que crecen durante\ntoda su vida, royendo objetos duros.", "Passa le giornate in cerca di cibo. Le sue\nzanne crescono in continuazione e per\nlimarle mordicchia cose dure.", "It searches for food all day. It gnaws\non hard objects to wear down its fangs,\nwhich grow constantly during its lifetime.") },
            // { PBESpecies.20, new PBELocalizedString("いがいと　きょうぼうな　ポケモン。\nながく　のびた　キバは　ぶあつい　\nコンクリートも　かんたんに　けずる。", "의외로 난폭한 포켓몬.\n길게 자란 앞니는 두꺼운\n콘크리트도 가볍게 갉는다.", "Beaucoup plus féroce qu'il n'en a l'air,\nce Pokémon peut facilement ronger le\nbéton le plus dur grâce à ses crocs.", "Ein überraschend brutales Pokémon.\nSeine langen Nagezähne sind äußerst\nstark und durchbrechen selbst Beton.", "De carácter violento, en contra de lo\nque parece. Puede desgarrar fácilmente\nincluso hormigón con sus largos colmillos.", "È molto più feroce di quanto non sembri.\nLe sue zanne possono frantumare anche\nil cemento più duro con facilità.", "With its long fangs, this surprisingly\nviolent Pokémon can gnaw away\neven thick concrete with ease.") },
            // { PBESpecies.21, new PBELocalizedString("ちいさな　つばさを　いそがしく\nはばたかせて　とぶ。くさむらにいる\nえものを　くちばしで　さがしだす。", "작은 날개를 쉴 새 없이 쳐서\n날아오른다. 풀밭에 있는\n먹이를 부리로 찾아낸다.", "Il fait battre vigoureusement ses\npetites ailes pour voler et cherche\nà manger dans l'herbe avec le bec.", "Im Flug schlägt es eifrig mit den\nFlügeln. Mit seinem Schnabel\nsucht es im Gras nach Beute.", "Agita continuamente sus alitas\npara volar. Busca presas entre\nla hierba con su pico.", "Sbatte con foga le sue alette per\nsollevarsi in volo. Cerca le prede\nbeccando nell'erba.", "It flaps its small wings busily to\nfly. Using its beak, it searches\nin grass for prey.") },
            // { PBESpecies.22, new PBELocalizedString("おおきな　つばさで　\xFF11にちじゅう\nとびまわる　たいりょくの　もちぬし。\nするどい　くちばしで　たたかう。", "큰 날개로 온종일\n날아다닐 수 있는 체력의 소유자다.\n날카로운 부리로 싸운다.", "Il a assez d'énergie pour voler\ntoute la journée avec ses grandes\nailes. Il frappe de son bec acéré.", "Es hat genügend Ausdauer, den\nganzen Tag zu fliegen. Sein\nscharfer Schnabel dient als Waffe.", "Tiene energía para volar todo el día\ncon sus grandes alas. Lucha con su\nafilado pico.", "Le sue ampie ali robuste gli permettono\ndi volare tutto il giorno. Combatte\nusando il becco aguzzo.", "It has the stamina to fly all\nday on its broad wings. It\nfights by using its sharp beak.") },
            // { PBESpecies.23, new PBELocalizedString("おとを　まったく　たてずに　くさちの\nなかを　すすむ。ゆだんしている\nえものに　はいごから　おそいかかる。", "소리를 전혀 내지 않고 풀밭\n속을 나아간다. 방심하고 있는\n먹이를 배후에서 덮친다.", "Il se faufile dans l'herbe sans un\nbruit et frappe dans le dos quand\nsa proie s'y attend le moins.", "Es bewegt sich ohne einen Laut\ndurch das Gras und greift seine\nahnungslose Beute von hinten an.", "Se mueve por la hierba en silencio\ny sorprende a sus presas atacando\npor detrás.", "Striscia nell'erba senza fare il minimo\nrumore e colpisce alle spalle le prede\nignare del pericolo.", "It sneaks through grass without\nmaking a sound and strikes\nunsuspecting prey from behind.") },
            // { PBESpecies.24, new PBELocalizedString("おなかの　もようで　てきを　いかく。\nもように　おびえて　うごけなくなった\nすきに　からだで　しめつける。", "배의 무늬로 상대를 위협한다.\n무늬에 겁을 먹고 움직일 수 없게 된\n사이에 몸으로 조인다.", "Il utilise la marque sur son ventre\npour intimider l'ennemi. Il étouffe\nl'ennemi pétrifié par la peur.", "Das Muster auf seinem Bauch\nschüchtert Gegner ein. Sind sie vor\nAngst erstarrt, umklammert es sie.", "Arbok intimida a sus presas con el dibujo\nde su panza y luego las asfixia con su\ncuerpo.", "Prima paralizza i nemici con il\nterrificante disegno che ha sul\nventre, poi gli si avvinghia intorno.", "The pattern on its belly is for\nintimidation. It constricts foes\nwhile they are frozen in fear.") },
            { PBESpecies.Pikachu, new PBELocalizedString("よわった　なかまの　ピカチュウに\nでんきをながし　ショックをあたえて\nげんきを　わけることも　ある。", "약해진 동료 피카츄에게\n전기를 흘려보내 쇼크를 줘서\n힘을 나눠주는 때도 있다.", "Il lui arrive de remettre d'aplomb\nun Pikachu allié en lui envoyant\nune décharge électrique.", "Es verwendet hin und wieder\nElektrizität, um ein anderes,\ngeschwächtes Pikachu aufzuladen.", "A veces utiliza la electricidad de\nsus mejillas para recargar a un\nPikachu amigo que esté débil.", "Di tanto in tanto ricarica gli altri\nPikachu indeboliti usando una\nscarica elettrica.", "It occasionally uses an electric\nshock to recharge a fellow Pikachu\nthat is in a weakened state.") },
            { PBESpecies.Raichu, new PBELocalizedString("しっぽが　アースの　やくめをはたして\nでんきを　じめんに　にがすので\nじぶんじしんは　しびれたりしない。", "꼬리가 어스 역할을 하여\n전기를 지면으로 흘려보내\n자신은 감전되거나 하지 않는다.", "Il se protège des décharges grâce\nà sa queue qui dissipe l'électricité\ndans le sol.", "Es entlädt Elektrizität in den Boden,\num sich auf diese Weise vor\nelektrischen Schlägen zu schützen.", "Su cola descarga electricidad al suelo,\ny eso le protege de los calambrazos.", "La sua coda scarica elettricità a terra,\nproteggendolo dalle scosse elettriche.", "Its tail discharges electricity into\nthe ground, protecting it from\ngetting shocked.") },
            // { PBESpecies.27, new PBELocalizedString("ふかいあなを　ほって　せいかつ。\nきけんが　せまると　からだを　まるめ\nてきの　こうげきを　じっと　たえる。", "깊은 구멍을 파서 생활한다.\n위험이 닥치면 몸을 말아\n상대의 공격을 가만히 견딘다.", "Il vit dans les tunnels qu'il creuse.\nEn cas de danger, il se roule en boule et\nencaisse les coups de ses prédateurs.", "Fristet sein Leben in selbst gegrabenen\nLöchern. Bei Gefahr rollt es sich\nzusammen und sitzt den Angriff aus.", "Cava madrigueras profundas en las que\nvive. Cuando lo atacan sus enemigos, se\nhace una bola y aguanta sus embates.", "Scava profondi tunnel in cui poi vive.\nSe fiuta un pericolo o se viene attaccato\nsi ripara appallottolandosi su se stesso.", "It digs deep burrows to live in.\nWhen in danger, it rolls up its\nbody to withstand attacks.") },
            // { PBESpecies.28, new PBELocalizedString("トゲは　ひふが　かたくなったもの。\nからだを　まるめて　トゲトゲを\nさすように　あいてを　こうげきする。", "가시는 피부가 단단해진 것.\n몸을 말아 날카로운 가시를\n찌르듯 상대를 공격한다.", "Ses épines sont faites de peau durcie.\nIl se roule en boule et les utilise pour\nattaquer ses ennemis.", "Seine Stacheln sind erhärtete Haut. Im\nKampf rollt es sich zusammen und greift\nden Gegner mit den Stacheln an.", "Sus afiladas púas, con las que ataca\na sus enemigos haciéndose una bola,\nson partes endurecidas de su piel.", "Si lancia all'attacco formando una palla\ncon il corpo. Le formazioni coriacee sul\ndorso possono ferire il nemico.", "The spikes on its body are made\nup of its hardened hide. It rolls up\nand attacks foes with its spikes.") },
            // { PBESpecies.29, new PBELocalizedString("たたかいを　このまない　せいかく。\nどくバリから　ぶんぴつされる　どくは\nひとしずくでも　いのちとりだ。", "싸움을 좋아하지 않는 성격이다.\n독침에서 분비된 독은\n한 방울만 맞아도 생명을 빼앗긴다.", "Bien qu'il rechigne à se battre, une\ngoutte du poison sécrété par ses\npiquants peut s'avérer fatale.", "Es mag keine Kämpfe. Ein einziger\nTropfen des Gifts aus seinen\nWiderhaken hat eine fatale Wirkung.", "Aunque no le gusta luchar, una sola gota\ndel veneno de sus púas puede resultar\nfatal.", "Non ama combattere, ma anche una\nsola goccia del veleno che secerne\ndagli aculei può essere fatale.", "While it does not prefer to fight,\neven one drop of the poison it\nsecretes from barbs can be fatal.") },
            // { PBESpecies.30, new PBELocalizedString("きけんを　かんじると　ぜんしんの\nトゲを　さかだてる。ニドリーノに\nくらべて　トゲの　そだちが　おそい。", "위험을 느끼면 전신의 가시를\n곤두세운다. 니드리노에 비해서\n가시의 성장이 느리다.", "Ce Pokémon dresse ses piquants\nen cas de danger. Ils poussent\nmoins vite que ceux de Nidorino.", "Bei Gefahr fährt es die Widerhaken\nam Körper aus. Diese wachsen\nlangsamer als die von Nidorino.", "Saca las púas de su cuerpo si siente\npeligro. Sus púas crecen más despacio\nque las de Nidorino.", "Quando avverte il pericolo, rizza\ngli aculei, che fuoriescono più\nlentamente di quelli di Nidorino.", "When it senses danger, it raises\nall the barbs on its body. These\nbarbs grow slower than Nidorino's.") },
            // { PBESpecies.31, new PBELocalizedString("よろいのように　かたい　ウロコが\nぜんしんを　つつむ。すあなの\nこどもを　いのちがけで　まもる。", "갑옷처럼 단단한 비늘이\n전신을 둘러싼다. 둥지의\n새끼를 목숨 걸고 지킨다.", "Son corps est recouvert d'écailles\nsolides. Il donnera sa vie pour\nsecourir les petits de son terrier.", "Sein ganzer Körper ist mit harten\nSchuppen bedeckt. Es beschützt\nsein Junges mit seinem Leben.", "Tiene el cuerpo cubierto de duras\nescamas. Protege a su cría con\ntoda su fuerza.", "Una robusta armatura ricopre l'intero\ncorpo. Protegge i propri cuccioli a\ncosto della vita.", "Its entire body is armored with\nhard scales. It will protect the\nyoung in its burrow with its life.") },
            // { PBESpecies.32, new PBELocalizedString("くさむらの　うえに　みみだけ　だして\nまわりの　けはいを　さぐる。\nもうどくの　ツノで　みを　まもる。", "풀밭 위로 귀만 내어\n주위의 낌새를 살핀다.\n맹독의 뿔로 몸을 보호한다.", "Il jauge le terrain en laissant\nses oreilles dépasser de l'herbe.\nIl se défend avec sa corne toxique.", "Es untersucht die Umgebung, indem\nes die Ohren spitzt und lauscht. Sein\ngiftiges Horn schützt es.", "Saca las orejas por encima de la hierba\npara explorar el territorio.\nLe protege su cuerno venenoso.", "Esamina l'ambiente circostante tendendo\nle orecchie fuori dall'erba. Si protegge\ncon il corno velenoso.", "It scans its surroundings by\nraising its ears out of the grass.\nIts toxic horn is for protection.") },
            // { PBESpecies.33, new PBELocalizedString("きしょうが　あらい　ポケモン。\nあいてに　つきさした　しょうげきで\nツノから　もうどくが　にじみでる。", "기질이 거친 포켓몬이다.\n상대를 깊이 찌른 충격으로\n뿔에서 맹독이 배어 나온다.", "D'un tempérament violent, il\nempale l'ennemi sur sa corne\nqui distille un poison puissant.", "Es ist aggressiv und greift seine\nGegner mit dem Horn an, welches\nbei Berührung Gift absondert.", "Se muestra violento y ataca a\nlos enemigos con un cuerno\nque desprende veneno.", "Ha un temperamento violento e infilza\ni nemici con il corno, che, all'impatto,\nrilascia veleno.", "It has a violent disposition and\nstabs foes with its horn, which\noozes poison upon impact.") },
            // { PBESpecies.34, new PBELocalizedString("しっぽの　いちげきは　でんちゅうを\nまるで　マッチぼうのように\nまっぷたつに　へしおってしまう。", "꼬리의 일격은 전신주를\n마치 성냥개비 다루듯이\n두 동강으로 꺾어 버린다.", "Un coup de sa puissante queue\npeut briser un poteau téléphonique\ncomme une allumette.", "Ein Schlag mit seinem gewaltigen\nSchweif kann einen Telegrafenmasten\nknicken wie ein Streichholz.", "Un golpe de su poderosa cola puede\npartir un poste de teléfono como si\nfuese una cerilla.", "Con un solo colpo della potente coda\npuò abbattere un palo del telefono\ncome se fosse un fiammifero.", "One swing of its mighty tail can\nsnap a telephone pole as if it were\na matchstick.") },
            // { PBESpecies.35, new PBELocalizedString("まんげつの　よる　どこから　ともなく\nあつまり　ピッピたちは　おどりだす。\nつきのひかりを　あびて　うかぶのだ。", "보름달 밤에 어디에서 왔는지도 모르게\n모여 삐삐들은 춤춘다.\n달빛을 받으며 떠오른다.", "Les Mélofée se rassemblent les nuits de\npleine lune et dansent sous ses rayons,\njusqu'à flotter dans les airs.", "Bei Vollmond kommen die Piepi von überall\nzusammen, um zu tanzen. Das Mondlicht\nlässt sie in der Luft schweben.", "En noches de luna llena, Clefairy de\ndiversos lugares se reúnen para bailar.\nLa luz de la luna los hace flotar.", "Nelle notti di luna piena saltano fuori da\nnon si sa dove e si radunano per danzare\ninsieme, fluttuando al chiaro di luna.", "On nights with a full moon, Clefairy\ngather from all over and dance.\nBathing in moonlight makes them float.") },
            // { PBESpecies.36, new PBELocalizedString("\xFF11キロさきに　おちた　はりの　おとも\nきこえるほど　みみが　いいので\nふだんは　しずかな　ところに　いる。", "1km 앞에 떨어진 바늘 소리가\n들릴 정도로 귀가 좋아\n평소에는 조용한 곳에 있다.", "Capable d'entendre une aiguille tomber à\nplus d'un kilomètre, ce Pokémon préfère\nles endroits calmes et isolés.", "Ihr Gehör erfasst das Geräusch einer\nfallenden Nadel noch aus einem Kilometer\nEntfernung. Sie bevorzugen ruhige Orte.", "Su oído es tan fino que puede oír como\ncae una aguja a 1 km de distancia. Por\neso suele habitar en lugares tranquilos.", "Il loro udito è così acuto che sentono un\nago cadere a 1 km di distanza. Per questo\ndi solito vivono in luoghi molto silenziosi.", "Their ears are sensitive enough to hear\na pin drop from over a mile away,\nso they're usually found in quiet places.") },
            { PBESpecies.Vulpix, new PBELocalizedString("\xFF16ほんの　しっぽは　そだつごとに\nけなみが　よくなり　うつくしくなる。\nだきしめると　ほんのり　あたたかい。", "6개의 꼬리는 자라면서\n털의 결이 좋아지며 아름다워진다.\n안으면 살짝 따듯하다.", "Avec l'âge, la fourrure de ses six queues\ndevient de plus en plus belle et soyeuse.\nElle est chaude au toucher.", "Sein Fell wird geschmeidiger, wenn seine\n6 Schweife wachsen. Wenn man das Fell\nberührt, fühlt es sich leicht warm an.", "Su pelaje va adquiriendo más brillo a\nmedida que sus seis colas crecen. Al\nabrazarlo, emana una ligera calidez.", "Le sue sei code diventano sempre più\nbelle man mano che crescono. La pelliccia\ndi cui sono ricoperte è calda al tatto.", "As each tail grows, its fur becomes\nmore lustrous. When held, it feels\nslightly warm.") },
            { PBESpecies.Ninetales, new PBELocalizedString("\xFF19ほんの　ながい　しっぽ　それぞれに\nじんつうりきが　こめられており\n\xFF11\xFF10\xFF10\xFF10ねん　いきることが　できる。", "9개의 긴 꼬리에는 각각\n신통력이 깃들어 있어\n천 년을 살 수 있다.", "On raconte que ses neuf queues ont\nchacune un pouvoir mystique différent.\nIl pourrait vivre pendant mille ans.", "Sie können bis zu 1 000 Jahre alt werden.\nJeder ihrer 9 Schweife besitzt\nübernatürliche Kräfte.", "Cada una de sus nueve colas está\nrevestida de poderes místicos.\nPuede vivir mil años.", "Ognuna delle sue nove code è intrisa di\nuna forza magica. Può vivere anche per\n1000 anni.", "Each of its nine tails is imbued\nwith supernatural power, and it\ncan live for a thousand years.") },
            // { PBESpecies.39, new PBELocalizedString("つぶらな　ひとみを　みつめていると\nねむらずには　いられないほどの\nここちよい　うたを　うたいはじめる。", "동그란 눈동자를 보고 있으면\n자지 않고는 견딜 수 없을 정도의\n기분 좋은 노래를 부르기 시작한다.", "Lorsqu'il roule ses grands yeux ronds,\nil entonne un doux chant qui endort\ninvariablement son auditoire.", "Blickt man in ihre Kulleraugen, singen\nsie ein beruhigendes Lied, das alle\nZuhörer ins Reich der Träume entführt.", "Con su mirada tan tierna y esos ojos\nredondos, canturrea una nana tan dulce\ncon la que es imposible no dormirse.", "Se incroci i suoi occhioni tondi, inizia\na cantare una melodia così dolce e soave\nche restare svegli diventa impossibile.", "Looking into its cute, round eyes makes\nit start singing a song so pleasant\nlisteners can't help but fall asleep.") },
            // { PBESpecies.40, new PBELocalizedString("きめこまやかな　たいもうは\nてざわりが　よすぎて　うっかり\nさわると　はなれられなくなる。", "세밀한 털은\n감촉이 최고로 좋아 무심코\n만지면 뗄 수 없게 된다.", "Sa fourrure est d'une douceur au\ntoucher incomparable... Au point\nqu'on ne puisse plus s'en passer.", "Ihr weiches Fell fühlt sich so gut an,\ndass man davon gar nicht lassen will,\nwenn man es versehentlich berührt.", "Su suave pelaje es tan agradable al\ntacto que, si lo tocan por casualidad,\nno podrán dejar de acariciarlo.", "Il suo manto è così soffice al tatto che\nse inizi ad accarezzarlo, non riesci più\na smettere.", "Its fine fur feels so pleasant,\nthose who accidentally touch it\ncannot take their hands away.") },
            { PBESpecies.Zubat, new PBELocalizedString("ちょうおんぱを　だして　まわりの\nようすを　たしかめながら　とぶので\nりょうめが　なくても　だいじょうぶ。", "초음파를 내며 주변의\n상황을 확인하면서 날기 때문에\n두 눈이 없어도 괜찮다.", "Il se repère dans l'espace grâce\naux ultrasons émis par sa gueule.\nIl peut donc se passer d'yeux.", "Es benötigt keine Augen, da es seine\nUmgebung im Flug durch das Aussenden\nvon Schallwellen erschließt.", "No necesita ojos porque utiliza\nultrasonidos para escrutar sus\nalrededores mientras vuela.", "È privo degli occhi, ma non ha problemi\na volare qui e là. Percepisce l'ambiente\ncircostante emettendo ultrasuoni.", "It does not need eyes, because it\nemits ultrasonic waves to check\nits surroundings while it flies.") },
            { PBESpecies.Golbat, new PBELocalizedString("まよなか　かっぱつに　とびまわり\nねらいをつけた　えものに　キバを\nさし　しぬほど　ちを　すいまくる。", "한밤중 활발하게 날아다니며\n목표로 삼은 먹이에 송곳니를\n찔러서 죽을 만큼 피를 빨아버린다.", "Une fois sa proie repérée dans la nuit,\nil l'embroche de ses crocs acérés,\navant de la vider de son sang.", "Bei Nacht sucht es unermüdlich nach\nBeute, der es mit seinen scharfen\nZähnen große Blutmengen absaugt.", "Revolotea enérgicamente por la noche\ny asesta colmilladas a sus presas, a\nlas que debilita chupándoles la sangre.", "Attivo soprattutto durante la notte,\naffonda i suoi denti nella carne della\npreda, succhiandone via il sangue.", "Flitting around in the dead of night,\nit sinks its fangs into its prey and\ndrains a nearly fatal amount of blood.") },
            // { PBESpecies.43, new PBELocalizedString("ひるまは　ねっこの　あしを　じめんに\nうめて　うごかないことが　おおい。\nよる　あるきまわって　タネを　まく。", "낮에는 뿌리인 발을 땅에 박고\n움직이지 않을 때가 많다.\n밤에 돌아다니며 씨를 뿌린다.", "En journée, il plante ses pieds-racines\ndans le sol. La nuit, il se promène en\nsemant des graines.", "Tagsüber verankert es sich mit\nseinen Wurzelfüßen im Boden.\nNachts wandert es und verteilt Samen.", "Suele plantarse en el suelo durante\nel día. Por la noche se desplaza\nesparciendo semillas.", "Durante il giorno, pianta i piedi per\nterra come se fossero radici. Di notte\ncammina seminando.", "It often plants its root feet in the\nground during the day and sows\nseeds as it walks about at night.") },
            // { PBESpecies.44, new PBELocalizedString("くちから　たれている　ミツは\n\xFF12キロ　はなれていても　はなが\nまがるほど　もうれつに　くさい。", "입에서 흘러내리는 꿀은\n2km 떨어져 있어도 코가\n비뚤어질 정도의 심한 악취가 난다.", "L'odeur du nectar de sa bouche est\nsi répugnante qu'elle agresse les\nnarines à deux kilomètres.", "Der Honig, den es abgibt, riecht so\nentsetzlich, dass sich sogar Nasen\nin 2 km Entfernung rümpfen.", "La miel que emana de su boca posee\nun hedor capaz de derribar enemigos\na 2 km de distancia.", "Il fluido che fuoriesce dalla sua bocca\nè così puzzolente che si sente anche\na 2 km di distanza.", "The honey it drools from its mouth\nsmells so atrocious, it can curl\nnoses more than a mile away.") },
            // { PBESpecies.45, new PBELocalizedString("はなびらの　おおきさは　せかいいち。\nひどい　アレルギーを　ひきおこす\nどくかふんを　ばらまいて　あるく。", "세계에서 꽃잎이 제일 크다.\n심한 알레르기를 일으킬\n독 꽃가루를 흩뿌리며 걷는다.", "Ses pétales sont les plus grands\ndu monde. Il marche en répandant\nun pollen extrêmement allergène.", "Es besitzt die größten Blätter der Welt.\nEs verteilt beim Gehen Pollen, die\nschreckliche Allergien auslösen.", "Sus pétalos son los más grandes del\nmundo. Cuando anda, desprende\nun terrible polen alergénico.", "I suoi petali sono i più grandi al mondo.\nMentre cammina diffonde un polline che\ncausa allergie.", "Its petals are the largest in the\nworld. As it walks, it scatters\nextremely allergenic pollen.") },
            // { PBESpecies.46, new PBELocalizedString("とうちゅうかそうと　よばれる\nキノコを　せなかに　はやしている。\nパラスと　ともに　おおきく　そだつ。", "동충하초라고 불리는\n버섯을 등에 기르고 있다.\n파라스와 함께 크게 자란다.", "Des champignons appelés “tochukaso\"\npoussent sur son dos. Ils évoluent\navec le Paras hôte.", "Auf seinem Rücken wachsen Pilze,\ndie Tochukaso. Sie nehmen an Größe zu,\nwenn Paras wächst.", "En el lomo de Paras crecen unas setas\nparasitarias llamadas “tochukaso\".", "Ha sul dorso dei funghi chiamati\ntochukaso, che crescono insieme\nal Paras su cui si trovano.", "Mushrooms named tochukaso grow\non its back. They grow along\nwith the host Paras.") },
            // { PBESpecies.47, new PBELocalizedString("からだよりも　おおきな　キノコが\nパラセクトを　あやつっている。\nどくの　ほうしを　ばらまく。", "몸보다 큰 버섯이\n파라섹트를 조종하고 있다.\n독 포자를 여기저기 뿌린다.", "Un champignon parasite plus gros\nque Parasect contrôle son corps.\nIl répand des spores empoisonnées.", "Parasek wird von einem Pilz, der größer\nals das Pokémon ist, kontrolliert. Er\ngibt Giftsporen ab.", "Parasect está dominado por una seta\nparásita mayor que él. Dispersa\nesporas venenosas.", "Parasect è controllato da un fungo\nancora più grosso del suo corpo.\nDiffonde spore velenose.", "A mushroom grown larger than the\nhost's body controls Parasect.\nIt scatters poisonous spores.") },
            // { PBESpecies.48, new PBELocalizedString("ちいさな　めが　たくさん　あつまって\nおおきな　めに　なっている。\nよるになると　あかりに　あつまる。", "작은 눈이 많이 모여\n큰 눈을 이루고 있다.\n밤이 되면 불빛을 향해 모여든다.", "Ses grands yeux sont en fait des\namas d'yeux minuscules. La nuit,\nil est attiré par la lumière.", "Seine großen Augen bestehen aus\nvielen kleinen Augen. Nachts wird\nes von Licht angezogen.", "Sus grandes ojos son en realidad grupos\nde ojos diminutos. Por la noche se\nsiente atraído por la luz.", "I suoi grandi occhi sono in realtà\nun insieme di tanti piccoli occhi.\nDi notte, è attirato dalla luce.", "Its big eyes are actually clusters\nof tiny eyes. At night, its kind is\ndrawn by light.") },
            // { PBESpecies.49, new PBELocalizedString("はばたいて　りんぷんを　まきちらす。\nりんぷんが　からだに　つくと　どくの\nせいぶんが　ひふに　しみこんでくる。", "날개를 쳐서 날개 가루를 흩뿌린다.\n날개 가루가 몸에 붙으면\n독 성분이 피부에 스며든다.", "Il répand ses écailles poudreuses\nen battant des ailes. Elles sont\ntoxiques au toucher.", "Es schlägt mit den Flügeln, um\nstaubartige Schuppen abzusondern.\nDiese geben bei Kontakt Gift ab.", "Agita las alas para dispersar un polvillo\nde escamas que libera toxinas si toca\nla piel.", "Sbattendo le ali sparge una polvere\nvelenosa a contatto con la pelle.", "It flutters its wings to scatter\ndustlike scales. The scales leach\ntoxins if they contact skin.") },
            // { PBESpecies.50, new PBELocalizedString("ちちゅうで　くらしている　ポケモン。\nくらい　ちかに　いるため\nあかるい　たいようが　にがて。", "땅속에서 살고 있는 포켓몬이다.\n어두운 지하에 있기 때문에\n밝은 태양을 싫어한다.", "Un Pokémon qui vit sous terre.\nHabitué aux souterrains, il fuit la\nlumière du jour.", "Dieses Pokémon lebt unterirdisch.\nDa es an Dunkelheit gewöhnt ist,\nschreckt helles Licht es ab.", "Este Pokémon vive a oscuras bajo tierra,\npor lo que la luz solar le espanta.", "Un Pokémon che vive sottoterra.\nPoiché è abituato a vivere al buio,\nnon sopporta la luce solare.", "A Pokémon that lives underground.\nBecause of its dark habitat, it is\nrepelled by bright sunlight.") },
            // { PBESpecies.51, new PBELocalizedString("\xFF13つの　あたまが　たがいちがいに\nうごいて　どんなに　かたい　ちそうも\nちか\xFF11\xFF10\xFF10キロまで　ほりすすむ。", "3개의 머리가 교차하며 움직여서\n아무리 딱딱한 지층이라도\n지하 100km까지 파들어 간다.", "Ses trois têtes creusent le sol à\ntour de rôle. Il peut atteindre des\nprofondeurs de 100 kilomètres.", "Die drei Köpfe bewegen sich abwechselnd,\num sich durch harte Erde in Tiefen von\nbis zu 100 km zu graben.", "Sus tres cabezas se mueven por turnos\npara excavar la tierra a una profundidad\nde unos 100 km.", "Le sue tre teste si muovono a turno\nper scavare nel duro suolo fino ad\nuna profondità di 100 km.", "Its three heads move alternately,\ndriving it through tough soil to\ndepths of over 60 miles.") },
            // { PBESpecies.52, new PBELocalizedString("よなかに　こうどうする　しゅうせい。\nきらきら　ひかるものを　みつけると\nまけないくらい　ひとみが　かがやく。", "한밤중에 움직이는 습성이 있다.\n반짝반짝 빛나는 것을 발견하면\n그에 못지 않게 눈동자가 반짝인다.", "Son regard s'anime à la vue\nd'un objet brillant. C'est un\nPokémon nocturne.", "Ein nachtaktives Pokémon. Sieht\nes etwas Schimmerndes, fangen\nseine Augen an zu glänzen.", "Es de naturaleza nocturna.\nLe atraen los objetos brillantes.", "È un Pokémon attivo di notte. Se nota\nqualcosa di luccicante, i suoi occhi\ncominciano a brillare.", "It is nocturnal in nature. If it\nspots something shiny, its eyes\nglitter brightly.") },
            // { PBESpecies.53, new PBELocalizedString("きぐらいが　たかい　ポケモン。\nマニアの　あいだでは　ひたいの\nほうせきの　サイズが　わだいになる。", "자존심이 센 포켓몬이다.\n마니아 사이에서는 이마의\n보석 크기가 화제가 된다.", "Un Pokémon très snob. La taille du\njoyau qui orne son front alimente\nbien des débats parmi ses fans.", "Ein sehr stolzes Pokémon.\nFür Fans ist die Größe des Juwels auf\nseiner Stirn Anlass für Diskussionen.", "Es un Pokémon muy arrogante.\nEl tamaño de la joya de su frente\nda mucho que hablar.", "Un Pokémon molto altezzoso. I fan\nparlano spesso delle dimensioni del\ngioiello che ha sulla testa.", "A very haughty Pokémon. Among\nfans, the size of the jewel in its\nforehead is a topic of much talk.") },
            { PBESpecies.Psyduck, new PBELocalizedString("ずつうで　ふだん　ねむっている\nのうさいぼうが　しげき　されると\nふしぎな　ちからが　つかえる。", "두통으로 평소 자고 있다\n뇌세포가 자극받으면\n이상한 힘을 사용할 수 있다.", "Ses migraines réveillent chez lui des\nzones du cerveau qui lui donnent\ndes pouvoirs étonnants.", "Werden die Zellen seines Hirns durch\nstarke Kopfschmerzen stimuliert,\nerhält es geheimnisvolle Kräfte.", "Sus neuronas suelen estar aletargadas\ndebido a sus fuertes jaquecas. Si las\nestimula, puede usar un extraño poder.", "Per evitare le emicranie, non usa alcune\nzone del cervello. Se lo fa, però, può\nscatenare un potere misterioso.", "When headaches stimulate its brain\ncells, which are usually inactive,\nit can use a mysterious power.") },
            { PBESpecies.Golduck, new PBELocalizedString("ひたいが　あやしく　かがやくとき\nゴルダックは　もてる　ちからを\n\xFF11\xFF10\xFF10パーセント　はっき　できる。", "이마가 수상하게 빛날 때\n골덕은 가지고 있는 힘을\n100퍼센트 발휘할 수 있다.", "Il est au maximum de ses capacités\nlorsque son front s'illumine d'une\nmanière pour le moins étrange.", "Beginnt seine Stirn unheilvoll zu\nleuchten, bedeutet dies, dass es nun\nseine volle Macht entfesseln kann.", "Cuando su frente emite un brillo\nmisterioso, es capaz de utilizar\nsu poder al máximo.", "Quando la fronte emette una strana\nluce, può usare i suoi poteri al cento\nper cento.", "When its forehead shines mysteriously,\nGolduck can use the full extent\nof its power.") },
            // { PBESpecies.56, new PBELocalizedString("きのうえで　せいかつしている。\nむれの　\xFF11ぴきが　おこりはじめると\nぜんいんが　いみもなく　あばれだす。", "나무 위에서 생활하고 있다.\n무리 중 1마리가 화내기 시작하면\n모두 아무 의미도 없이 난동부린다.", "Ils vivent en colonies sylvestres.\nQuand un Férosinge s'énerve, toute\nla colonie suit son exemple.", "Es lebt mit anderen in Baumkronen. Wird\neines von ihnen wütend, werden alle\nanderen auch wütend.", "Vive en colonias en los árboles. Si uno\nse enfada, el resto de la manada ataca\nsin motivo.", "Vive in colonie sugli alberi. Se uno\nsi adira, l'intera colonia comincia a\nagire violentemente senza motivo.", "It lives in treetop colonies.\nIf one becomes enraged, the whole\ncolony rampages for no reason.") },
            // { PBESpecies.57, new PBELocalizedString("しせんが　あっただけで　おこり\nにげだしたら　また　おこり\nたたきのめしても　まだ　おこる。", "시선을 마주치기만 해도 화내고\n도망치면 또 화내고\n때려눕혀도 계속 화를 낸다.", "Il grogne quand on le toise, rugit\nquand on s'enfuit et devient fou\nde rage quand on le frappe.", "Siehst du ihm in die Augen, wird es\nwütend. Rennst du weg, wird es\nnoch wütender. Ärgerst du es...", "Se molesta si le miras a los ojos.\nSe enfada si corres.\nSe enfurece si le golpeas.", "Se lo guardi fisso negli occhi, si adira.\nSe corri, s'infuria. Se poi lo sconfiggi,\ns'arrabbia ancor di più.", "It grows angry if you see its eyes\nand gets angrier if you run. If you\nbeat it, it gets even madder.") },
            // { PBESpecies.58, new PBELocalizedString("トレーナーに　とても　ちゅうじつで\nうっかり　ちかづくと　はげしく\nほえたて　まちのそとに　おいはらう。", "트레이너에게 아주 충실하며\n무심코 다가가면 격렬하게\n짖으며 마을 밖으로 쫓아낸다.", "Un Pokémon très loyal. Il aboie dès\nque quelqu'un s'approche de trop\nprès, et chasse les intrus.", "Aus Loyalität zu seinem Trainer jagt es\njeden, der ihm zu nahe kommt, unter\nlautem Bellen aus der Stadt.", "Extremadamente leal a su Entrenador, si\nalguien se le acerca despistado, ladrará\nhasta alejar a esa persona de la ciudad.", "È molto fedele al suo Allenatore. Abbaia\ncon forza contro chi si avvicina troppo,\ninseguendolo e costringendolo alla fuga.", "Extremely loyal to its Trainer, it will\nbark at those who approach the Trainer\nunexpectedly and run them out of town.") },
            // { PBESpecies.59, new PBELocalizedString("いっちゅうやで　\xFF11\xFF10\xFF10\xFF10\xFF10キロの\nきょりを　かけぬける　すがたは\nおおくの　ひとを　みりょうしてきた。", "하루 만에 10000km의\n거리를 달리는 모습은\n많은 사람을 매료시켜왔다.", "Capable de parcourir 10 000 km en\n24 heures, ce majestueux Pokémon\nest admiré de tous.", "Viele Trainer sind von ihrer Fähigkeit,\ninnerhalb eines Tages 10 000 Kilometer\nzurückzulegen, fasziniert.", "Es capaz de correr 10 000 km al día,\nlo que deja embelesados a todos los\nque lo ven pasar.", "Sono molte le persone affascinate dalla\ncapacità di questo Pokémon di correre\nfino a 10.000 km in 24 ore.", "The sight of it running over 6,200 miles\nin a single day and night has captivated\nmany people.") },
            { PBESpecies.Poliwag, new PBELocalizedString("ないぞうが　すけて　みえるほど\nひふが　うすい。はえたばかりの\nあしは　あるくことが　にがて。", "내장이 들여다보일 정도로\n피부가 얇다. 막 자란\n다리는 걷는 것이 서투르다.", "Sa peau est si mince qu'on voit\nses organes internes. Il tient\nà peine sur ses nouveaux pieds.", "Seine Haut ist so dünn, dass man die\ninneren Organe sehen kann. Es hat\nSchwierigkeiten beim Laufen.", "Su piel es tan fina que permite ver\nsus órganos. Le cuesta andar\ncon sus nuevas patas.", "La sua pelle è così sottile che si\nintravedono gli organi. Cammina a\nfatica sulle zampe poco sviluppate.", "Its skin is so thin, its internal\norgans are visible. It has trouble\nwalking on its newly grown feet.") },
            { PBESpecies.Poliwhirl, new PBELocalizedString("おなかの　うずまきは　びみょうに\nうねっているので　みつめていると\nだんだん　ねむくなってしまう。", "배의 소용돌이는 미묘하게\n꾸불거리므로 바라보고 있으면\n점점 잠이 오게 된다.", "La spirale qui orne son ventre ondule\ndoucement. Celui qui la fixe est saisi\nd'une étrange torpeur.", "Das Spiralmuster auf seinem Bauch\ndreht sich langsam. Starrt man\ndarauf, wird einem schwindelig.", "El dibujo espiral de su pecho ondea\nlevemente. Si se mira fijamente,\nprovoca somnolencia.", "Il disegno spiraliforme sulla pancia\nondeggia leggermente. Chi lo fissa,\npiano piano si assopisce.", "The spiral pattern on its belly\nsubtly undulates. Staring at it\ngradually causes drowsiness.") },
            { PBESpecies.Poliwrath, new PBELocalizedString("きょうじんな　きんにくを　もつ。\nたいへいようを　やすむことなく\nおよぎつづけることが　できるのだ。", "강인한 근육을 가지고 있다.\n태평양을 쉬지 않고\n계속 헤엄칠 수 있다.", "Il possède de sacrés biscoteaux.\nIl peut parcourir sans relâche\nl'Océan Pacifique.", "Es hat extrem starke Muskeln und\nkann durch den Ozean schwimmen,\nohne sich ausruhen zu müssen.", "Tiene músculos muy desarrollados.\nEs capaz de nadar en el océano\nsin descanso.", "Ha dei muscoli tanto sviluppati da\nriuscire ad attraversare a nuoto\ninteri oceani senza fermarsi.", "With its extremely tough muscles,\nit can keep swimming in the Pacific\nOcean without resting.") },
            // { PBESpecies.63, new PBELocalizedString("ちょうのうりょくを　つかったあとは\nのうみそが　つかれてしまうので\n\xFF11にちに　\xFF11\xFF18じかんも　ねむるのだ。", "초능력을 쓴 뒤에는\n뇌가 지쳐버리기 때문에\n하루에 18시간이나 잔다.", "L'utilisation de ses pouvoirs\nmentaux le fatigue tellement\nqu'il dort 18 heures par jour.", "Der Einsatz seiner Psycho-Kräfte\nkostet so viel Energie, dass es\n18 Stunden am Tag schlafen muss.", "Sus poderes psíquicos causan un\ndesgaste tan grande para su mente\nque precisa dormir 18 horas al día.", "L'utilizzo dei suoi poteri psichici è così\nstancante da costringerlo a dormire\n18 ore al giorno.", "Using its psychic power is such a\nstrain on its brain that it needs\nto sleep for 18 hours a day.") },
            // { PBESpecies.64, new PBELocalizedString("ぎんのスプーンを　みつめて\nせいしんを　とういつ　していると\nはっさんする　アルファは　がふえる。", "은 숟가락을 바라보고\n정신을 통일하고 있으면\n발산하는 알파파가 증가한다.", "Il fixe sa cuillère d'argent afin de\nconcentrer son esprit et d'émettre\nun maximum d'ondes alpha.", "Es starrt auf seinen Silberlöffel,\num sich zu konzentrieren. So kann\nes mehr Alphawellen ausstoßen.", "Mira su cuchara de plata fijamente\npara concentrarse. Mientras lo hace,\nemite más ondas alfa.", "Fissa il suo cucchiaio d'argento per\nconcentrarsi. Così facendo, emette\npiù onde alfa.", "It stares at its silver spoon to\nfocus its mind. It emits more alpha\nwaves while doing so.") },
            // { PBESpecies.65, new PBELocalizedString("りょうてに　もつ　スプーンは\nフーディンの　ちょうのうりょくで\nうみだしたモノと　いわれている。", "양손에 지니고 있는 숟가락은\n후딘의 초능력으로\n만들어낸 것이라고 전해진다.", "On dit que les cuillères qu'il tient\nen permanence ont été créées\npar la puissance de son esprit.", "Man sagt, dass es die Löffel in\nseinen Händen durch Psycho-Kräfte\nselbst erzeugt habe.", "Se dice que creó las cucharas que\nlleva en las manos con sus poderes\npsíquicos.", "Si dice che abbia creato i cucchiai\nche tiene in mano grazie ai suoi\npoteri psichici.", "The spoons clutched in its hands\nare said to have been created by\nits psychic powers.") },
            // { PBESpecies.66, new PBELocalizedString("こがらな　からだだけど　ちからもち。\nイシツブテなら　なんびきも　まとめて\nかるがると　もちあげ　なげとばす。", "작은 몸집이지만 힘이 세다.\n꼬마돌쯤은 몇 마리라도 한꺼번에\n가뿐히 들어올려서 날려버린다.", "Malgré sa petite taille, sa force\nlui permet de soulever plusieurs\nRacaillou à la fois.", "Obwohl von kleiner Statur, ist es\nkräftig genug, mehrere Kleinstein\nzu hieven und dann zu werfen.", "No alcanza mucha altura, pero tiene\nfuerza suficiente para levantar y\nderribar a varios Geodude a la vez.", "Nonostante sia piccolo, riesce a\nsollevare e lanciare più Geodude\ncontemporaneamente.", "Though small in stature, it is\npowerful enough to easily heft and\nthrow a number of Geodude at once.") },
            // { PBESpecies.67, new PBELocalizedString("からだを　きたえるために　よろこんで\nおもい　にもつを　はこぶので\nひとのかわりに　ちからしごとをする。", "몸을 단련하고자 기분 좋게\n무거운 짐을 날라주기에\n사람을 대신하여 힘을 쓰는 일을 한다.", "Il soulève les plus lourdes charges\navec plaisir et facilité. Il donne un\ncoup de main tout en s'entraînant!", "Es hievt gern schwere Ladung,\num so zu trainieren. Es hilft auch\ngern anderen bei harter Arbeit.", "Levanta pesos descomunales para\nmantenerse en forma y usa su fuerza\npara ayudar a las personas.", "Sposta di buon grado carichi pesanti\nper rinforzarsi e gli piace dare\nuna mano alle persone.", "It happily carries heavy cargo to\ntoughen up. It willingly does hard\nwork for people.") },
            // { PBESpecies.68, new PBELocalizedString("\xFF14ほんの　ちからづよい　うでは\nめにも　とまらぬ　はやさで\nパンチや　チョップを　たたきこむ。", "4개의 힘센 팔은\n눈에 보이지 않을 정도로 빠르게\n펀치와 당수를 날린다.", "La puissance et la rapidité de ses\nquatre bras puissants font des\nravages sur ses adversaires.", "Es erwischt Gegner mit harten\nSchlägen seiner kräftigen Arme und\nhackt mit enormer Geschwindigkeit.", "Tiene cuatro musculosos brazos con\nlos que golpea y destroza al enemigo\na una velocidad increíble.", "Grazie alle sue quattro muscolose\nbraccia tira pugni e colpi a una\nvelocità impressionante.", "Its four muscled arms slam foes\nwith powerful punches and chops\nat blinding speed.") },
            // { PBESpecies.69, new PBELocalizedString("こうおん　たしつの　とちを　このむ。\nツルを　のばして　えものを　とらえる\nときの　うごきは　とても　すばやい。", "고온다습한 땅을 좋아한다.\n덩굴을 뻗어서 먹이를 잡을 때의\n움직임은 매우 재빠르다.", "Il préfère les climats chauds et\nhumides. Ses lianes peuvent\ncapturer une proie en un clin d'œil.", "Es bevorzugt heiße und feuchte\nUmgebungen. Seine Beute fängt es\nblitzschnell mit seinen Ranken.", "Prefiere los lugares cálidos y húmedos.\nCaptura presas con sus rápidas lianas.", "Preferisce gli habitat caldi e umidi.\nCattura velocemente le prede\ncon i suoi rampicanti.", "It prefers hot and humid\nenvironments. It is quick at\ncapturing prey with its vines.") },
            // { PBESpecies.70, new PBELocalizedString("しょくぶつに　そっくりな　ポケモン。\nゆだんして　ちかよってきた　えものに\nどくのこなを　あびせて　つかまえる。", "식물과 똑 닮은 포켓몬이다.\n방심해서 가까이 다가온 먹이에게\n독가루를 뿌려서 잡는다.", "Un Pokémon végétal. Il capture les\nproies étourdies en les endormant\nà l'aide d'une poudre toxique.", "Ein Pokémon, das wie eine Pflanze\naussieht. Es fängt Beute, indem es\ngiftigen Puder darüber verteilt.", "Este Pokémon parece una planta.\nCaptura a sus presas usando polvo\ntóxico cuando están desprevenidas.", "Questo Pokémon sembra una pianta.\nCattura le prede con una polvere\ntossica.", "A Pokémon that appears to be a\nplant. It captures unwary prey by\ndousing them with a toxic powder.") },
            // { PBESpecies.71, new PBELocalizedString("ミツのような　かおりの　えきたいを\nくちに　ためているが　それは\nなんでも　とかす　ようかいえきだ。", "꿀같은 향기의 액체를\n입에 모아두고 있지만 그것은\n무엇이든 녹이는 용해액이다.", "Sa bouche sécrète un fluide à\nl'odeur de miel, qui s'avère être\nun acide extrêmement corrosif.", "In seinem Maul sammelt sich eine\nFlüssigkeit, die nach Honig riecht,\nin Wahrheit aber ätzend ist.", "Su boca segrega un fluido de olor\nparecido a la miel: un potente ácido\nque disuelve cualquier cosa.", "Tiene in bocca un liquido dall'aroma\nsimile al miele, che in realtà è un\nacido altamente corrosivo.", "It pools in its mouth a fluid with\na honey-like scent, which is really\nan acid that dissolves anything.") },
            // { PBESpecies.72, new PBELocalizedString("からだの　ほとんどが　みずなので\nなみに　ながされ　すなはまに\nうちあげられると　ひからびてしまう。", "몸 대부분이 수분이어서\n파도에 밀려 모래 해변에\n올려지면 바싹 말라버린다.", "Presque entièrement composé d'eau,\nson corps a tendance à se dessécher\nsur la terre ferme.", "Wird es an Land geschwemmt,\nvertrocknet es schnell, da es\nfast völlig aus Wasser besteht.", "Como su cuerpo se compone casi en\nexclusiva de agua, se reseca si sale\nde ella.", "Dato che il suo corpo è quasi\ninteramente composto d'acqua,\nse si arena si avvizzisce subito.", "Because its body is almost entirely\ncomposed of water, it shrivels up if\nit is washed ashore.") },
            // { PBESpecies.73, new PBELocalizedString("\xFF18\xFF10ぽんの　しょくしゅを　のばして\nどくの　ほういもうを　つくりだす。\nつかまると　にげるのは　むずかしい。", "80개의 촉수를 길게 뻗어\n독의 포위망을 만들어 낸다.\n붙잡히면 도망치기 어렵다.", "Ses 80 tentacules lui permettent\nd'emprisonner ses adversaires\ndans un redoutable filet venimeux.", "Durch das Strecken seiner 80 Tentakel\nerzeugt es ein giftiges Netz, dem man\nkaum entrinnen kann.", "Extiende sus 80 tentáculos para\nformar una red venenosa de la\nque es muy difícil escapar.", "Estende i suoi 80 tentacoli per creare\nuna rete velenosa da cui è difficilissimo\nliberarsi.", "It extends its 80 tentacles to\nform an encircling poisonous net\nthat is difficult to escape.") },
            // { PBESpecies.74, new PBELocalizedString("じっとしていると　いしころ　にしか\nみえないので　つい　ふみつけると\nげんこつを　ふりまわして　おこる。", "움직이지 않고 있으면 돌멩이로\n착각하여 무심코 밟게 되는데\n그러면 주먹을 휘두르며 화를 낸다.", "Au repos, rien ne le distingue d'un\nvulgaire caillou. Malheur à ceux qui\nlui marchent dessus par mégarde!", "Ruhend sieht es fast wie ein Felsen aus.\nTritt man auf Kleinstein, wird es wütend\nmit den Fäusten wirbeln.", "En reposo parece una roca normal,\npero responde agitando los puños\ncon agresividad si se pisa por error.", "Quando riposa sembra un sasso. Se viene\ncalpestato, si infuria e agita i pugni.", "At rest, it looks just like a rock.\nCarelessly stepping on it will make\nit swing its fists angrily.") },
            // { PBESpecies.75, new PBELocalizedString("やまみちを　ころがって　いどう。\nいきおいが　ついてくると　どんな\nポケモンでも　とめるのは　たいへん。", "산길을 굴러서 이동한다.\n기세가 극에 오르면 어떤\n포켓몬도 이를 멈출 수 없다.", "Il dévale les montagnes pour se\ndéplacer. Une fois qu'il a pris tout\nson élan, dur dur de l'arrêter!", "Rollt auf Bergpfaden, um sich\nfortzubewegen. Hat es erst mal Schwung\ngeholt, kann man es kaum bremsen.", "Se desplaza rodando por caminos de\nmontaña. Cuando coge velocidad, es\ndifícil frenar su avance.", "Si sposta rotolando per i sentieri di\nmontagna. Quando prende velocità,\nè quasi impossibile fermarlo.", "It rolls on mountain paths to move.\nOnce it builds momentum, no Pokémon\ncan stop it without difficulty.") },
            // { PBESpecies.76, new PBELocalizedString("がんせきの　ような　かたい　からだは\nダイナマイトでも　きずつかない。\n\xFF11ねんに　\xFF11どだけ　だっぴする。", "암석 같은 단단한 몸은\n다이너마이트로도 상처를\n입힐 수 없다. 1년에 1번 탈피한다.", "Aucun explosif ne pourrait entamer\nsa carapace de pierre. Il mue une\nfois par an.", "Selbst Sprengstoff kann seinem\nharten Körper nichts anhaben.\nHäutet sich nur einmal jährlich.", "Ni siquiera la dinamita puede dañar\nsu cuerpo rocoso. Muda la piel\nuna vez al año.", "Muta il guscio solo una volta all'anno.\nNeanche la dinamite può scalfire il suo\ncorpo durissimo.", "Even dynamite can't harm its hard,\nboulder-like body. It sheds its hide\njust once a year.") },
            // { PBESpecies.77, new PBELocalizedString("うまれたばかりでは　たつのがやっと。\nだが　はしるほどに　あしこしは\nきたえられて　そくどが　ましていく。", "막 태어나서는 겨우 일어설 수 있을\n정도이지만 많이 달리면 하반신이\n단련되어 달리는 속도가 빨라진다.", "Chancelantes à la naissance, ses\npattes deviennent très vite sûres\net solides à force de galoper.", "Neugeboren kann es kaum stehen.\nDurch das Galoppieren werden seine\nBeine aber schneller und kräftiger.", "Cuando nace, apenas puede tenerse\nen pie. Pero va fortaleciendo las patas\nen cuanto empieza a galopar.", "Alla nascita non riesce quasi a reggersi\nin piedi. Galoppando si rinforza e diventa\npiù veloce.", "As a newborn, it can barely stand.\nHowever, through galloping, its\nlegs are made tougher and faster.") },
            // { PBESpecies.78, new PBELocalizedString("ぜんりょくで　かけぬけるとき\nもえる　たてがみが　きらめいて\nよりいっそう　うつくしく　みえる。", "전력으로 달릴 때는\n타오르는 갈기에서 빛이 나\n한층 더 아름답게 보인다.", "Au grand galop, sa crinière de feu\ndisperse au vent une myriade\nd'étincelles ardentes.", "In vollem Galopp funkelt seine\nleuchtende Mähne, was wiederum\nseine Schönheit unterstreicht.", "Cuando galopa, su ardiente crin\ncentellea y le da un aspecto\naún más impresionante.", "Quando galoppa, la sua criniera ardente\nbrilla, rendendo il suo aspetto ancora\npiù straordinario.", "When at an all-out gallop, its\nblazing mane sparkles, enhancing\nits beautiful appearance.") },
            // { PBESpecies.79, new PBELocalizedString("うごきは　のろいが　しっぽを　つかう\nつりが　とくい。どんかんなので\nしっぽを　かまれても　いたくない。", "움직임은 느리지만 꼬리를 사용하는\n낚시가 특기다. 둔감하므로\n꼬리를 물려도 아프지 않다.", "Bien que lent, c'est un pêcheur\nadroit qui utilise sa queue. Elle\nest insensible aux morsures.", "Es ist langsam, hat aber ein Talent,\nmit seinem Schweif zu fischen.\nBeißt etwas an, tut es ihm nicht weh.", "A pesar de su lentitud, tiene una gran\nhabilidad para pescar con la cola, que\nes insensible al dolor.", "Anche se è lento, è abile a pescare con\nla coda. Non avverte alcun dolore se\ngliela mordono.", "Although slow, it is skilled at\nfishing with its tail. It does not\nfeel pain if its tail is bitten.") },
            // { PBESpecies.80, new PBELocalizedString("ぼんやりしている　ヤドランだが\nシェルダーが　つよく　しっぽを\nかむとき　なにかが　ひらめくらしい。", "멍하게 있는 야도란이지만\n셀러가 강하게 꼬리를 물 때\n무언가가 번뜩이는 듯하다.", "Ce grand benêt connaît des éclairs\nde lucidité lorsque le Kokiyas de sa\nqueue se met à mordre.", "Ein begriffsstutziges Pokémon.\nBeißt das Muschas am Schweif zu,\nscheint es Intelligenz zu gewinnen.", "Normalmente se muestra torpe, aunque\nespabila si el Shellder de su cola le\nmuerde.", "Non è molto perspicace, ma sembra\naguzzare l'ingegno se lo Shellder\nche ha sulla coda lo morde.", "Though usually dim witted, it\nseems to become inspired if the\nShellder on its tail bites down.") },
            // { PBESpecies.81, new PBELocalizedString("さゆうにある　ユニットから　だす\nでんじはで　じゅうりょくを\nさえぎって　そらに　うかぶのだ。", "좌우에 있는 유닛에서 나오는\n전기자석파로 중력에\n반하여 하늘에 떠있다.", "Les ondes électromagnétiques émises\npar ses extrémités lui permettent de\ndéfier la gravité et de voler.", "Die seitlichen Module halten es in der\nLuft, indem sie mit elektromagnetischen\nWellen die Schwerkraft überlisten.", "Las unidades laterales crean ondas\nelectromagnéticas que contrarrestan\nla gravedad y le permiten flotar.", "Le onde elettromagnetiche generate\ndalle calamite laterali neutralizzano la\ngravità permettendogli di levarsi in aria.", "The electromagnetic waves emitted by\nthe units at the sides of its head expel\nantigravity, which allows it to float.") },
            // { PBESpecies.82, new PBELocalizedString("\xFF13びきの　コイルが　つながって\nつよくなった　でんじはは　まわりの　\nすいぶんを　かんそう　させるほど。", "3마리의 코일이 연결되어\n강해진 전기자석파는 주변의\n수분을 건조하게 할 정도다.", "L'association de trois Magnéti génère un\nmagnétisme suffisamment puissant pour\nvaporiser l'eau alentour.", "Die vereinten elektromagnetischen Wellen\nvon 3 Magnetilo bringen alles Wasser in\nder Umgebung zum Verdampfen.", "Los tres Magnemite unidos generan\nunas fuertes ondas electromagnéticas\nque secan la humedad a su alrededor.", "Le onde elettromagnetiche generate dai\ntre Magnemite congiunti sono così forti\nda seccare del tutto l'aria circostante.", "The stronger electromagnetic waves\nfrom the three linked Magnemite are\nenough to dry out surrounding moisture.") },
            { PBESpecies.Farfetchd, new PBELocalizedString("クキが　なくなると　いきていけない。\nだから　クキを　ねらう　あいてとは\nいのちがけで　たたかうのだ。", "파 줄기가 없으면 살 수 없다.\n그래서 파 줄기를 노리는 상대와는\n목숨을 걸고 싸운다.", "Il ne peut pas vivre sans son\nlégume, c'est pourquoi il le\nprotégera au péril de sa vie.", "Ohne seinen Stock kann es nicht leben.\nDaher beschützt es den Stock mit\nseinem Leben.", "No puede vivir sin el puerro que lleva.\nPor eso lo protege de sus atacantes\ncon todas sus fuerzas.", "Non può vivere senza lo stelo che tiene\ncon un'ala. Lo difende dagli attacchi a\ncosto della vita.", "It can't live without the stalk it\nholds. That's why it defends the\nstalk from attackers with its life.") },
            // { PBESpecies.84, new PBELocalizedString("\xFF12つの　あたまの　のうみそは\nテレパシーのような　ちからで\nきもちを　つうじあわせているらしい。", "두 머리에 각각 존재하는 뇌는\n텔레파시같은 힘으로\n의사를 맞춰나가는 듯하다.", "Ses deux cerveaux semblent\ncommuniquer leurs émotions\ngrâce à un lien télépathique.", "Die Gehirne der beiden Köpfe\nkommunizieren ihre Gefühle\nüber Telepathie.", "Parece que los cerebros de sus dos\ncabezas se comunican por telepatía.", "I suoi due cervelli si comunicano\nle emozioni grazie ai poteri telepatici.", "The brains in its two heads appear\nto communicate emotions to each\nother with a telepathic power.") },
            // { PBESpecies.85, new PBELocalizedString("しんかのときに　ドードーの　あたまの\nどちらかが　ぶんれつした　ちんしゅ。\nじそく\xFF16\xFF10キロいじょうで　はしる。", "진화할 때 두두의 머리 중 한쪽이\n분열되는 희귀종.\n시속 60km 이상으로 달린다.", "Quand Doduo connaît cette étrange\névolution, l'une de ses têtes se\ndédouble. Il atteint les 60 km/h.", "Entwickelt sich Dodu, teilt sich\neiner der Köpfe in zwei. Es kann\nsich mit 60 km/h fortbewegen.", "Cuando un Doduo evoluciona, una\nde sus cabezas se divide en dos.\nCorre a unos 60 km/h.", "Quando Doduo si evolve in questo strano\nessere, una delle due teste si divide a\nmetà. Corre a 60 km/h.", "When Doduo evolves into this odd\nbreed, one of its heads splits into\ntwo. It runs at nearly 40 mph.") },
            // { PBESpecies.86, new PBELocalizedString("さむくなるほど　げんきになって\nこおりの　うかぶ　つめたい　うみを\nうれしそうに　およぎまわる。", "추워질수록 기운이 나\n얼음이 떠있는 차가운 바다를\n기쁜 듯이 헤엄친다.", "Il aime flotter nonchalamment sur les\nmers glacées. D'ailleurs, plus il fait\nfroid, mieux il se sent.", "Je kälter es ist, desto wohler fühlt es\nsich. Es schwimmt vergnügt durch kühle\nMeere, auf denen Eisschollen treiben.", "Se le ve con mayor energía cuanto más\nfrío hace. Nada feliz de un lado para\notro en los mares con capas de hielo.", "Più fa freddo, più si sente a suo agio.\nSi diverte a nuotare tra i blocchi di\nghiaccio dei mari più gelidi.", "The colder it gets, the better it feels.\nIt joyfully swims around oceans so cold\nthat they are filled with floating ice.") },
            // { PBESpecies.87, new PBELocalizedString("りゅうせんけいの　からだは　みずの\nていこうも　すくなく　\xFF18ノットの\nスピードで　つめたい　うみをおよぐ。", "유선형의 몸은 물의\n저항도 적어 8노트의\n스피드로 차가운 바다를 헤엄친다.", "Il aime les mers froides. Sa forme\nhydrodynamique lui permet de filer\nà plus de 8 nœuds.", "Es trotzt mit seinem stromlinienförmigen\nKörper der Strömung und erreicht beim\nSchwimmen im kalten Meer bis zu 8 Knoten.", "Contrarresta la resistencia del agua\ncon su cuerpo hidrodinámico y nada por\nmares gélidos a 8 nudos de velocidad.", "Il suo corpo affusolato subisce meno\nattrito con l'acqua e può sfrecciare\nnel mare gelato alla velocità di 8 nodi.", "Its streamlined body has low resistance,\nand it swims around cold oceans at\na speed of eight knots.") },
            // { PBESpecies.88, new PBELocalizedString("ヘドロが　ポケモンに　なった。\nきたない　ばしょに　あつまって\nからだの　ばいきんを　ふやしていく。", "진흙이 포켓몬이 되었다.\n더러운 장소에 모여\n몸의 세균을 번식시킨다.", "Torrent de boue devenu Pokémon, il vit\ndans les lieux les plus insalubres pour\nentretenir les microbes qu'il héberge.", "Diese aus Schlamm entstandenen Pokémon\nscharen sich an dreckigen Orten, um ihre\nkörpereigenen Bakterien zu kultivieren.", "Formados a partir de lodo, los Grimer se\njuntan en lugares sucios para aumentar\nel número de gérmenes de su cuerpo.", "Un Pokémon nato dalla melma. Predilige\ni posti sporchi perché gli permettono di\naumentare la sua carica batterica.", "Born from sludge, these Pokémon now\ngather in polluted places and increase\nthe bacteria in their bodies.") },
            // { PBESpecies.89, new PBELocalizedString("とっても　くさい\xFF01　からだの\nせいぶんは　もうどくで　ベトベトンが\nとおると　どんな　くさきも　かれる。", "냄새가 지독하다! 몸의\n성분은 맹독으로 질뻐기가\n지나가면 어떤 초목이라도 시든다.", "Il dégage une odeur pestilentielle.\nSon corps est si toxique que là où\nil passe, la végétation trépasse.", "Ihr Gestank ist unerträglich. Das starke\nGift, aus dem ihr Körper besteht, macht\njeder Pflanze in ihrem Weg den Garaus.", "Es pestilente y los componentes tóxicos\nde su cuerpo harían que, a su paso,\ncualquier planta se marchitara.", "Ha un odore sgradevole e il suo corpo è\nun concentrato di veleni. Non c'è pianta\nche rimanga in vita dopo il suo passaggio.", "It's so stinky! Muk's body contains\ntoxic elements, and any plant will\nwilt when it passes by.") },
            // { PBESpecies.90, new PBELocalizedString("\xFF12まいの　カラを　あけしめすることで\nうしろむきに　およぐ。どんなときでも\nおおきな　ベロは　だしっぱなし。", "2장의 껍질을 여닫아서\n뒤쪽으로 헤엄친다. 어떤 때든\n큰 혀는 항상 내어놓는다.", "Il nage à reculons en ouvrant et en\nrefermant ses deux coquilles. Il\nlaisse traîner sa large langue.", "Es schwimmt rückwärts, indem es\nseine Schale öffnet und schließt.\nEs zeigt immer seine breite Zunge.", "Nada hacia atrás abriendo y cerrando\nsu concha. Su gran lengua siempre\nqueda colgando.", "Nuota all'indietro aprendo e chiudendo\nle due valve. La lingua è sempre fuori\na penzoloni.", "It swims backward by opening and\nclosing its two shells. Its large\ntongue is always kept hanging out.") },
            // { PBESpecies.91, new PBELocalizedString("カラを　しっかりと　とじて　みを\nまもりながら　トゲを　とばして\nてきを　げきたいする　せんぽう。", "껍질을 잘 닫아 몸을\n보호하면서 가시를 날려\n상대를 물리치는 전법을 쓴다.", "Il se défend en fermant sa coquille\net projette des piquants qui\nrepoussent ses agresseurs.", "Im Kampf schließt es seine Schale,\num sich zu schützen. Es schießt mit\nStacheln auf seine Gegner.", "En la lucha se protege cerrando\nsu concha y lanzando pinchos\na sus oponentes.", "Quando lotta si protegge tenendo\nla conchiglia chiusa e spara punte\nper respingere i nemici.", "It fights by keeping its shell\ntightly shut for protection and\nby shooting spikes to repel foes.") },
            // { PBESpecies.92, new PBELocalizedString("ガスから　うまれた　せいめいたい。\nどくをふくんだ　ガスの　からだに\nつつまれると　だれでも　きぜつする。", "가스에서 태어난 생명체다.\n독을 포함한 가스로 된 몸에\n둘러싸이면 누구든지 기절한다.", "Son corps composé de gaz toxique\npourrait asphyxier n'importe qui\nen quelques secondes.", "Eingehüllt in seinen gasförmigen,\nGift enthaltenden Körper würde\njeder in Ohnmacht fallen.", "Nació a partir de gases venenosos que\nasfixiarían a cualquiera que se viera\nenvuelto en ellos.", "Generato da sostanze gassose, fa\nperdere i sensi a chiunque respiri\ni gas tossici di cui è costituito.", "Born from gases, anyone would\nfaint if engulfed by its gaseous\nbody, which contains poison.") },
            // { PBESpecies.93, new PBELocalizedString("くらやみにまぎれ　ガスのてを　のばし\nひとのかたを　たたくのが　すき。\nさわられると　ふるえが　とまらない。", "어둠을 틈타 가스로 된 손을 뻗쳐\n사람의 어깨를 두드리기 좋아한다.\n그 손에 닿으면 떨림이 멈추지 않는다.", "Il adore se tapir dans l'ombre et\nfaire frissonner ses proies en leur\ntouchant l'épaule.", "Lauert in der Dunkelheit. Die\nBerührung seiner gasförmigen\nHand erzeugt endloses Schaudern.", "Le gusta acechar en la oscuridad y tocar\nel hombro a sus víctimas, que se quedan\ntemblando para siempre.", "Adora tendere agguati in luoghi bui.\nIl suo tocco causa brividi incontenibili.", "It likes to lurk in the dark and tap\nshoulders with a gaseous hand. Its\ntouch causes endless shuddering.") },
            // { PBESpecies.94, new PBELocalizedString("くらやみに　うかぶ　えがおの\nしょうたいは　ひとに　のろいを\nかけて　よろこぶ　ゲンガーだ。", "어둠에 떠있는 웃는 얼굴의\n정체는 사람에게 저주를 걸고\n기뻐하는 팬텀이다.", "Si vous croisez un regard\ninquiétant qui perce la nuit,\nc'est sûrement un Ectoplasma.", "Der heimtückische Blick im Dunkel\ngehört einem Gengar, das sich freut,\nFlüche auszustoßen.", "Esa mirada fija que flota en la oscuridad\nes de algún Gengar que disfruta\nmaldiciendo a la gente.", "Si aggira nel buio con lo sguardo perfido\ne si diverte a lanciare maledizioni.", "The leer that floats in darkness\nbelongs to a Gengar delighting in\ncasting curses on people.") },
            // { PBESpecies.95, new PBELocalizedString("おおきな　くちを　あけて\nたくさんの　つちを　のみこみながら\nながい　トンネルを　つくっていく。", "커다란 입을 열어\n많은 흙을 삼키면서\n긴 터널을 만들어간다.", "Il engloutit dans son immense gueule\nles pierres qu'il rencontre en creusant\nde longs tunnels dans le sol.", "Es gräbt lange Tunnel, indem es sein\nriesiges Maul öffnet und große Mengen\nan Erdreich verschluckt.", "Construye largos túneles ingiriendo\npor su inmensa boca la tierra que\nva excavando.", "Costruisce tunnel lunghissimi ingoiando\nenormi quantità di terra con la sua bocca\nenorme.", "Opening its large mouth, it ingests\nmassive amounts of soil and creates\nlong tunnels.") },
            // { PBESpecies.96, new PBELocalizedString("つきでた　はなを　ひくひくさせると\nみている　ユメが　わかるという。\nだいこうぶつは　たのしい　ユメだ。", "튀어나온 코를 실룩샐룩 거리면\n꾸고 있는 꿈을 안다고 한다.\n즐거운 꿈을 매우 좋아한다.", "Son grand nez lui permet de lire\nles rêves d'autrui. Il adore les\nsonges amusants.", "Mit seiner großen Nase kann es die\nTräume anderer erkennen.\nEs liebt lustige Träume.", "Puede oler los sueños de la gente\ncon su gran nariz. Le encantan\nlos sueños divertidos.", "Riesce ad indovinare cosa sognano\nle persone annusandole con il suo\ngrande naso. Ama i sogni divertenti.", "It can tell what people are\ndreaming by sniffing with its big\nnose. It loves fun dreams.") },
            // { PBESpecies.97, new PBELocalizedString("ふりこを　めのまえで　ゆらされると\nたったいま　めざめたばかりの　ひとも\n\xFF13びょうごには　ねむってしまう。", "눈앞에서 추를 흔들면\n방금 깨어난 사람도\n3초 후에는 잠들어 버린다.", "La vue de son pendule oscillant\nendort en trois secondes, même\nquand on vient de se réveiller.", "Ein Blick auf das Pendel versetzt\neinen in 3 Sekunden in Schlaf,\nselbst wenn man gar nicht müde ist.", "Mirar su péndulo puede inducir al sueño\nen tres segundos, incluso si acabas\nde despertarte.", "Con il suo pendolo fa addormentare\nchiunque nel giro di tre secondi,\nanche chi si è appena svegliato.", "Seeing its swinging pendulum can\ninduce sleep in three seconds,\neven in someone who just woke up.") },
            // { PBESpecies.98, new PBELocalizedString("すなはまに　あなを　ほって　くらす。\nハサミは　たたかいで　とれても\nまた　はえてきて　もとどおり。", "모래 해변에 구멍을 파서 산다.\n집게는 싸울 때 떨어져 나가도\n다시 자라나 원래대로 돌아온다.", "Il creuse son terrier sur des plages\nsablonneuses. Ses pinces repoussent\nsi on les brise.", "Es lebt in Höhlen am Strand.\nSeine Scheren wachsen nach,\nwenn es sie im Kampf verliert.", "Vive en madrigueras excavadas en playas\narenosas. Sus pinzas vuelven a crecer\nsi se rompen.", "Vive in buche scavate sulle spiagge\nsabbiose. Le sue chele ricrescono\nse si spezzano nella lotta.", "It lives in burrows dug on sandy\nbeaches. Its pincers fully grow\nback if they are broken in battle.") },
            // { PBESpecies.99, new PBELocalizedString("おおきいほうの　ハサミの　パワーは\n\xFF11まんばりき。しかし　おもすぎるため\nねらいを　つけることが　にがてだ。", "큰 집게의 파워는 1만 마력이다.\n하지만 너무 무거워서\n목표물을 잡는 것이 서투르다.", "Sa grande pince possède une puissance\nde 10 000 chevaux. Son poids la rend\ndifficile à manier.", "Die großen Scheren haben eine\nStärke von 10 000 PS. Aber sie sind\nschwer und kaum zu handhaben.", "La pinza mayor tiene 10 000 caballos\nde potencia, pero es tan grande que\nle cuesta usarla.", "La chela più grande ha una potenza\ndi 10.000 cavalli, ma è così pesante\nche non permette di mirare bene.", "The larger pincer has 10,000-\nhorsepower strength. However, it\nis so heavy, it is difficult to aim.") },
            // { PBESpecies.100, new PBELocalizedString("モンスターボールに　そっくり。\nまちがって　さわると　かんでんしたり\nときには　ばくはつするので　きけん。", "몬스터볼과 똑 닮았다.\n잘못해서 만지면 감전되거나\n때로는 폭발하므로 위험하다.", "Il ressemble à une Poké Ball. Ce\nPokémon dangereux peut exploser\nou s'électrifier au toucher.", "Sieht aus wie ein Pokéball. Es ist\ngefährlich, da es bei Berührung\nexplodieren kann.", "Parece una Poké Ball. Es muy peligroso,\nya que puede lanzar descargas o\nexplotar si se toca.", "Sembra una Poké Ball. Toccandolo si\nrischia di prendere la scossa e di\nfarlo esplodere.", "It looks just like a Poké Ball.\nIt is dangerous because it may\nelectrocute or explode on contact.") },
            // { PBESpecies.101, new PBELocalizedString("でんきエネルギーを　ためすぎて\nぱんぱんに　ふくらんだ　マルマインが\nかぜに　ながされてくることが　ある。", "전기 에너지를 너무 모아서\n팽팽히 부풀어오른 붐볼이\n바람에 날려오는 경우가 있다.", "Il se laisse porter par les vents\nlorsque son corps est gonflé\nd'électricité à en éclater.", "Es lässt sich vom Wind treiben,\nwenn es so voller Elektrizität ist,\ndass es fast explodiert.", "Se lo lleva el viento si se hincha\ncon la electricidad que almacena.", "Quando ha accumulato elettricità fino\nquasi a scoppiare, si fa trasportare\ndal vento.", "It is known to drift on winds if it\nis bloated to bursting with stored\nelectricity.") },
            // { PBESpecies.102, new PBELocalizedString("テレパシーで　かいわをしているため\nタマタマを　ひきはなそうとしても\nすぐに　あつまって　\xFF16ぴきになる。", "텔레파시로 대화를 하기 때문에\n아라리를 갈라놓으려 해도\n바로 모여들어 6마리가 된다.", "Ces six œufs communiquent par\ntélépathie. Ils peuvent se réunir\nrapidement si on les sépare.", "Die sechs Eier kommunizieren\ntelepathisch. Werden sie getrennt,\nfinden sie sich schnell wieder.", "Estos seis huevos se comunican por\ntelepatía. Si se separan, se pueden\nreunir rápidamente.", "Queste sei uova comunicano per\ntelepatia. Si riuniscono subito\nanche se vengono divise.", "Its six eggs converse using\ntelepathy. They can quickly gather\nif they become separated.") },
            // { PBESpecies.103, new PBELocalizedString("あるく　ねったいうりんと　よばれる。\nおおきくなった　あたまの　ひとつが\nじめんに　おちると　タマタマになる。", "걸어다니는 열대 우림이라고\n불린다. 크게 자란 머리 중 하나가\n땅에 떨어지면 아라리가 된다.", "On l'appelle “jungle sur pattes\".\nSi une tête devient trop grosse,\nelle tombe et produit un Noeunoeuf.", "Man nennt es den „Laufenden Dschungel“.\nWird ein Kopf zu groß, fällt er ab\nund wird zu einem Owei.", "Se le llama la Selva Andante. Si una\ncabeza crece demasiado, se cae\ny forma un Exeggcute.", "Noto come “Giungla in moto\". Se\nuna testa diventa troppo grande,\ncade e si trasforma in Exeggcute.", "It is called “The Walking Jungle.\"\nIf a head grows too big, it falls\noff and becomes an Exeggcute.") },
            { PBESpecies.Cubone, new PBELocalizedString("しにわかれた　ははおやを　おもいだし\nないてしまうとき　あたまに　かぶった\nホネが　からからと　おとを　たてる。", "사별한 어머니를 생각하며\n울 때에는 머리에 쓴\n뼈가 달각달각 소리를 낸다.", "Il pleure en pensant à sa mère\ndisparue, et ses larmes résonnent\ndans son crâne creux.", "Denkt es an seine verstorbene Mutter,\nweint es, wobei der Schädel\nauf seinem Kopf hohl klingt.", "Llora cuando se acuerda de su madre\nfallecida. Cuando lo hace, sus llantos\nresuenan en su calavera.", "Piange pensando alla madre defunta e\ndal teschio che ha in testa proviene\nun rumore sordo e continuo.", "When it thinks of its dead mother,\nit cries. Its crying makes the\nskull it wears rattle hollowly.") },
            { PBESpecies.Marowak, new PBELocalizedString("うまれたときから　いつも　もっている\nホネを　じざいに　つかいこなす。\nせいかくは　きょうぼうだ。", "태어날 때부터 항상 지니고 있는\n뼈를 자유로이 사용한다.\n성격은 난폭하다.", "Ce Pokémon sauvage possède des os\ndepuis sa naissance. Il s'en sert\npour combattre avec dextérité.", "Von Geburt an trägt dieses wilde\nPokémon Knochen. Es setzt sie\ntalentiert als Waffen ein.", "Este Pokémon salvaje maneja huesos\nconstantemente desde su nacimiento\ny los usa como armas.", "Pokémon selvatico che tiene in mano\nun osso sin dalla nascita. Lo usa\nabilmente come arma.", "From its birth, this savage Pokémon\nconstantly holds bones. It is\nskilled in using them as weapons.") },
            // { PBESpecies.106, new PBELocalizedString("あしが　\xFF12ばいの　ながさに　のびる。\nはじめて　たたかう　あいては\nその　まあいの　ひろさに　おどろく。", "발이 두 배 길이로 늘어난다.\n처음 싸운 상대는\n그 길이에 놀란다.", "Ses pattes élastiques s'allongent, ce\nqui ne manque jamais de surprendre\nau premier combat.", "Seine Beine können die doppelte\nLänge annehmen. Gegner, die das\nnicht wissen, erschrecken.", "Sus piernas se extienden hasta doblar\nsu longitud para sorprender a\nenemigos desprevenidos.", "I suoi arti inferiori si allungano del\ndoppio, il che sbalordisce i nemici\nche lo vedono per la prima volta.", "Its legs can stretch double.\nFirst-time foes are startled by\nits extensible reach.") },
            // { PBESpecies.107, new PBELocalizedString("うでを　ねじりながら　くりだす\nパンチは　コンクリートも　ふんさい。\n\xFF13ぷん　たたかうと　ひとやすみする。", "팔을 비틀며 날리는 펀치는\n콘크리트도 부스러뜨린다.\n3분 싸우면 잠시 쉰다.", "Même le béton cède sous ses\npoings dévastateurs. Au combat, il\ns'essouffle au bout de 3 minutes.", "Die Schläge, die es austeilt, können\nBeton pulverisieren. Es muss sich im\nKampf alle 3 Minuten ausruhen.", "Los potentes golpes de sus brazos\npueden pulverizar el hormigón.\nDescansa tras luchar tres minutos.", "Sferra pugni così potenti da\npolverizzare persino il cemento.\nSi riposa dopo tre minuti di lotta.", "The arm-twisting punches it throws\npulverize even concrete. It rests\nafter three minutes of fighting.") },
            // { PBESpecies.108, new PBELocalizedString("ながい　ベロは　だえきまみれで\nなめられると　ぴりぴり　しびれる。\nベロが　のびると　しっぽが　ちぢむ。", "긴 혀는 타액투성이로\n핥으면 찌릿찌릿 저리다.\n혀가 길어지면 꼬리가 줄어든다.", "Sa queue rétrécit quand sa langue très\nbaveuse, propre à vous engourdir\nà chaque léchouille, s'allonge.", "Der Speichel auf seiner langen Zunge\nerzeugt Hautirritationen. Streckt es\ndie Zunge aus, wird sein Schweif kürzer.", "Al extender la lengua, recoge la cola.\nLos lametazos de su lengua larga y llena\nde saliva provocan un cosquilleo.", "La sua lingua eccezionalmente lunga è\nricoperta di una saliva paralizzante. Se\nla lingua si estende, la coda si accorcia.", "Being licked by its long, saliva-covered\ntongue leaves a tingling sensation.\nExtending its tongue retracts its tail.") },
            // { PBESpecies.109, new PBELocalizedString("うすい　バルーンじょうの　からだに\nもうどくの　ガスが　つまっているので\nときどき　だいばくはつを　おこす。", "얇은 풍선 상태의 몸에\n맹독의 가스가 채워져 있어\n가끔 대폭발을 일으킨다.", "Son corps en fine baudruche est rempli\nde gaz toxiques qui peuvent exploser\nviolemment à la moindre occasion.", "Sein dünner, ballonartiger Körper ist\nmit schrecklichem Giftgas gefüllt, das\nriesige Explosionen verursachen kann.", "Su cuerpo, con forma de globo, encierra\ngases muy tóxicos que pueden ocasionar\nexplosiones espontáneas.", "Il suo corpo leggero come un palloncino è\nripieno di un gas altamente tossico che\nogni tanto dà luogo a delle esplosioni.", "Toxic gas is held within its thin,\nballoon-shaped body, so it can\ncause massive explosions.") },
            // { PBESpecies.110, new PBELocalizedString("ゴミからでる　どくガスを　すいこみ\nたいないで　まぜあわて　さらに\nきょうれつな　においを　まきちらす。", "쓰레기에서 발생한 독가스를 빨아들여\n체내에서 섞어 한층 더\n강렬한 냄새를 퍼뜨린다.", "Il grandit en absorbant les gaz des\ndéchets, faisant empirer la puanteur\nqui s'échappe de son corps.", "Es saugt giftige Abgase aus dem Müll auf,\ndie sich in seinem Körper zu einem noch\nübleren Gestank vermischen.", "Inhala los gases tóxicos que emanan de\nla basura y los mezcla en su interior,\nproduciendo un hedor aún más intenso.", "Aspira i gas tossici emanati dai rifiuti, li\nmiscela dentro il suo corpo e va in giro\nrilasciando un olezzo terrificante.", "Inhaling toxic fumes from trash\nand mixing them inside its body\nlets it spread an even fouler stench.") },
            // { PBESpecies.111, new PBELocalizedString("なんでも　たいあたりで　こわせる\nちからもちだが　あたまが　わるいので\nひとのしごとを　てつだうのは　むり。", "무엇이든 몸통박치기로 부숴버리는\n힘센 장사지만 머리가 나빠서\n사람의 일을 도우는 것은 무리다.", "Ses puissantes charges pourraient\ndémolir n'importe quel bâtiment.\nDommage qu'il soit stupide.", "Seine mächtigen Tackles zerstören alles.\nLeider ist es etwas schwer von Begriff.", "Puede destruir cualquier cosa con sus\npotentes placajes. Le falta inteligencia\npara ser de utilidad.", "Con i suoi potenti attacchi distrugge\nqualsiasi cosa. Non è abbastanza\nsagace da aiutare le persone.", "Its powerful tackles can destroy\nanything. However, it is too\nslow witted to help people work.") },
            // { PBESpecies.112, new PBELocalizedString("うしろあしだけで　たつようになり\nまえあしが　じゆうになって　ちのうが\nはったつしたが　ものわすればかりだ。", "뒷발만으로 서게 되어\n앞발이 자유로워졌기에 지능이\n발달했지만 건망증이 심하다.", "La station debout a libéré ses\npattes avant et l'a rendu plus\nintelligent, mais il est distrait.", "Das Stehen auf den Hinterbeinen\nhat es klüger gemacht. Leider ist\nes aber auch sehr vergesslich.", "Al ponerse en pie, liberó dos patas\ny eso desarrolló su inteligencia.\nPero se le olvidan las cosas.", "Alzandosi sulle zampe posteriori, è\ndiventato più sagace. Tuttavia, è\nmolto smemorato.", "Standing on its hind legs freed its\nforelegs and made it smarter. It is\nvery forgetful, however.") },
            { PBESpecies.Chansey, new PBELocalizedString("きずついた　ポケモンや　ひとがいると\nえいようまんてんの　タマゴをうみ\nわけあたえる　やさしい　ポケモン。", "상처입은 포켓몬이나 사람이 있으면\n영양 만점의 알을 낳아\n나눠주는 상냥한 포켓몬이다.", "Ce Pokémon très serviable distribue\nses œufs hautement nutritifs aux\nhumains et Pokémon blessés.", "Ein freundliches Pokémon, das seine\nnahrhaften Eier mit verletzten Pokémon\nund Menschen teilt.", "Un generoso Pokémon que pone huevos\nmuy nutritivos y se los da a personas o\nPokémon heridos.", "Un Pokémon altruista che depone uova\nmolto nutrienti. Le condivide con\npersone o Pokémon feriti.", "A kindly Pokémon that lays highly\nnutritious eggs and shares them\nwith injured Pokémon or people.") },
            // { PBESpecies.114, new PBELocalizedString("たくさんの　うごめく　ツルに\nおおわれて　しょうたいふめい。\nあおいツルは　いっしょう　のびる。", "수많은 움직이는 덩굴에\n둘러싸여 정체불명이다.\n파란 덩굴은 평생 자란다.", "Ses lianes bleues s'allongent au fil du\ntemps. Elles recouvrent tout son corps,\ndont on ignore la véritable forme.", "Aufgrund der Ranken, die seinen Körper\nbedecken, kennt keiner seine wahre Form.\nDie blauen Ranken wachsen immer weiter.", "Se camufla con la multitud de lianas que\nenvuelven su cuerpo y que no dejan de\ncrecer a lo largo de toda su vida.", "Una moltitudine di liane brulicanti,\nin crescita perenne, ne ricopre il corpo\ncelandone la vera forma.", "Many writhing vines cover it,\nso its true identity remains unknown.\nThe blue vines grow its whole life long.") },
            // { PBESpecies.115, new PBELocalizedString("おなかの　ふくろで　こそだてをする。\nあんぜんな　ときだけ　こどもを\nふくろから　だして　あそばせる。", "배의 주머니에서 새끼를 키운다.\n안전할 때만 새끼를\n주머니에서 꺼내어 놀게 한다.", "Il élève ses petits dans sa poche\nventrale. Il attend d'être en lieu\nsûr pour les laisser jouer dehors.", "Sein Nachwuchs wächst in seinem\nBeutel heran. Nur wenn es sicher ist,\ndarf das Junge aus dem Beutel.", "Lleva a su cría en la bolsa de su panza.\nSolo deja que su cría salga a jugar\ncuando no siente peligro.", "Tiene il cucciolo nel marsupio che ha\nsulla pancia e lo lascia uscire solo\nquando non ci sono pericoli.", "It raises its offspring in its belly\npouch. It lets the baby out to\nplay only when it feels safe.") },
            // { PBESpecies.116, new PBELocalizedString("サンゴの　かげに　すみかを　つくる。\nきけんを　かんじると　くちから\nまっくろい　スミを　はいて　にげる。", "산호의 그늘에 거처를 만든다.\n위험을 느끼면 입에서\n새까만 먹물을 내뿜고 도망간다.", "Il niche à l'ombre du corail. Quand\nil se sent menacé, il disparaît\ndans un nuage d'encre opaque.", "Im Schatten von Korallen legt es\nsein Nest an. Bei Gefahr versprüht\nes Tinte und flieht.", "Hace su nido entre los corales. Si se\nsiente en peligro, escupe tinta y huye.", "Crea la sua tana all'ombra dei coralli.\nSe avverte un pericolo, spruzza\ninchiostro nero e fugge.", "It makes its nest in the shade of\ncorals. If it senses danger, it\nspits murky ink and flees.") },
            // { PBESpecies.117, new PBELocalizedString("トゲが　てきから　みを　まもる。\nひれや　ホネが　かんぽうやくの\nざいりょうとして　ちょうほうされる。", "가시가 상대로부터 몸을 지킨다.\n지느러미와 뼈가 한약의\n재료로써 귀하게 쓰인다.", "Son épine dorsale le protège.\nSes os et ses nageoires sont très\nprisés en médecine traditionnelle.", "Seine Stacheln schützen es.\nSeine Flossen und Knochen werden bei\nder Herstellung von Medizin verwendet.", "Se protege con sus púas. Sus aletas\ny huesos son muy valorados por\nla medicina tradicional.", "Si difende con gli aculei. Pinne\ne ossa sono comunemente usati\nnella medicina tradizionale.", "Its spines provide protection.\nIts fins and bones are prized as\ntraditional-medicine ingredients.") },
            // { PBESpecies.118, new PBELocalizedString("きれいな　ひれを　たなびかせ\nおよぐ　すがたは　とても　かれいだが\nツノの　ひとつきは　きょうりょく。", "아름다운 지느러미를 살랑거리며\n헤엄치는 모습은 매우 화려하지만\n뿔의 공격은 강력하다.", "Malgré son élégance quand il\nnage, ses coups de corne sont\nredoutables.", "Mit ausgebreiteten Flossen wirkt es\nsehr elegant. Kann allerdings auch\nheftig mit seinem Horn zustoßen.", "Resulta muy elegante cuando nada con\nlas aletas desplegadas, pero causa\nestragos con su cuerno.", "Anche se è molto elegante quando nuota\na pinne spiegate, può infliggere colpi\npotenti con il suo corno.", "Though it appears very elegant\nwhen swimming with fins unfurled, it\ncan jab powerfully with its horn.") },
            // { PBESpecies.119, new PBELocalizedString("あきになると　プロポーズのため\nからだに　あぶらが　のってきて\nとても　きれいないろに　へんかする。", "가을이 되면 짝짓기를 위해\n몸에 윤기가 돌게 되며\n매우 아름다운 색으로 변화한다.", "En automne, à la saison des amours,\nil fait des réserves de graisse et\narbore des couleurs chatoyantes.", "Im Herbst legt es an Gewicht zu und\nerscheint in prächtigen Farben,\num so einen Partner anzulocken.", "En otoño gana algo de peso para atraer\na posibles parejas y se cubre de\nllamativos colores.", "In autunno, il suo corpo si ingrossa\nin previsione della stagione degli\namori e assume colori sgargianti.", "In autumn, its body becomes more\nfatty in preparing to propose to a\nmate. It takes on beautiful colors.") },
            // { PBESpecies.120, new PBELocalizedString("あかい　コアが　あるかぎり\nからだは　ちぎれても　いっしゅんで\nもとどおりに　じこさいせい　できる。", "빨간 핵이 있는 한\n몸은 조각나도 한순간에\n원래대로 회복할 수 있다.", "Même taillé en pièces, son corps peut\nse régénérer en un instant tant que\nson noyau rouge est intact.", "Sofern der rote Kern intakt ist, kann es\nsich augenblicklich selbst regenerieren,\nwenn sein Körper verletzt wird.", "Si mantiene intacto su núcleo rojo, puede\nregenerar el resto de las partes de su\ncuerpo aunque hayan sido destruidas.", "Se fatto a pezzi, ha la capacità di\nrigenerarsi in un istante, a condizione\nperò che il suo nucleo rosso sia intatto.", "As long as its red core remains,\nit can regenerate its body instantly,\neven if it's torn apart.") },
            // { PBESpecies.121, new PBELocalizedString("なないろに　かがやく　コアから\nうちゅうに　むけて　でんぱを　だし\nなにかしらの　こうしんを　している。", "일곱 색으로 빛나는 핵에서\n우주를 향해 전파를 보내\n뭔가를 교신 하고 있다", "Son cœur iridescent envoie des ondes\nmystérieuses en direction de l'espace.\nEnverrait-il des messages?", "Richtet es seinen regenbogenfarben\nleuchtenden Kern auf das All aus,\nscheint es mit etwas zu kommunizieren.", "Si apunta hacia el cielo con su brillante\nnúcleo multicolor, emite ondas con las\nque parece comunicarse.", "Il suo nucleo brilla dei colori dell'iride\ned emette delle onde radio con le quali\nStarmie comunica con l'universo.", "Its core shines in many colors\nand sends radio signals into space\nto communicate with something.") },
            // { PBESpecies.122, new PBELocalizedString("ゆびさきを　こまかく　ふるわせて\nくうきちゅうの　ぶんしの　うごきを\nとめて　みえないかべを　つくるのだ。", "손가락을 잘게 흔들어서\n공기 중의 분자 운동을\n멈추게 하고 보이지 않는 벽을 만든다.", "En modifiant les molécules de l'air\ndu bout de ses doigts, il parvient\nà créer un mur invisible devant lui.", "Formt eine unsichtbare Wand mitten\nin der Luft, indem es minutiös\nmit den Fingerspitzen vibriert.", "Crea paredes invisibles deteniendo\nmoléculas con las imperceptibles\nvibraciones de sus dedos.", "Crea un muro invisibile a mezz'aria\nfacendo vibrare la punta delle dita\nper bloccare le molecole.", "It shapes an invisible wall in midair\nby minutely vibrating its fingertips\nto stop molecules in the air.") },
            // { PBESpecies.123, new PBELocalizedString("りょうての　するどい　カマは\nかたいものを　きればきるほど\nさらに　きれあじを　ましていく。", "양손의 날카로운 낫은\n단단한 것을 자르면 자를수록\n더욱더 날카로워진다.", "À force de trancher des objets\nsolides, les faux de ses bras\nsont très aiguisées.", "Die scharfen Sensen an den Unterarmen\nwerden durch das Schneiden\nharter Objekte noch schärfer.", "Las cortantes guadañas de sus\nantebrazos se vuelven más afiladas\ncada vez que cortan objetos duros.", "Le falci sulle sue zampe anteriori\ndiventano sempre più affilate man\nmano che tranciano oggetti duri.", "The sharp scythes on its forearms\nbecome increasingly sharp by\ncutting through hard objects.") },
            // { PBESpecies.124, new PBELocalizedString("なきごえは　まるで　にんげんの\nことばのように　きこえるが\nいみは　まったく　りかいできない。", "울음소리는 마치 인간의\n말처럼 들리지만\n의미는 전혀 이해할 수 없다.", "Son cri ressemble à des paroles\nhumaines. Mais nul n'est jamais\nparvenu à les comprendre.", "Sein Ruf klingt wie menschliche Sprache.\nTrotzdem ist nicht zu verstehen,\nwas es sagt.", "Sus gritos se parecen al lenguaje\nhumano, pero es imposible\nentender lo que dice.", "Le sue grida ricordano il linguaggio\numano, ma è impossibile capire\nil significato delle sue parole.", "Its cries sound like human speech.\nHowever, it is impossible to tell\nwhat it is trying to say.") },
            // { PBESpecies.125, new PBELocalizedString("エレブーに　カミナリを　ためこませ\nいつでも　つかえるように　する\nけんきゅうが　すすめられている。", "에레브에게 번개를 비축시켜\n언제라도 쓸 수 있도록 하는\n연구가 진행되고 있다.", "Stocker l'énergie de la foudre dans les\nÉlektek pour qu'elle soit disponible à\ntout moment est un projet à l'étude.", "Experimente, Elektek als flexiblen\nSpeicher für frei einsetzbare Blitze\nzu verwenden, zeigen erste Erfolge.", "Se están llevando a cabo estudios para\nintentar almacenar rayos en Electabuzz\ny utilizarlos en cualquier momento.", "Secondo alcuni studi sarebbe possibile\nimmagazzinare l'energia dei fulmini negli\nElectabuzz per poi usarla quando serve.", "Research is progressing on storing\nlightning in Electabuzz so this\nenergy can be used at any time.") },
            // { PBESpecies.126, new PBELocalizedString("しゃくねつの　ほのおを　ふきだすと\nからだの　まわりに　かげろうが　でき\nブーバーの　すがたが　ぼやける。", "작열하는 불꽃을 내뿜으면\n몸 주위에 아지랑이가 생겨\n마그마의 모습이 희미해진다.", "Quand il éructe des flammes ardentes,\nles vagues de chaleur émanant de son\ncorps le rendent difficile à voir.", "Es stößt glühend heiße Flammen aus, die\nLuftspiegelungen erzeugen, in denen die\nKonturen seines Körpers verschwimmen.", "Las candentes llamaradas que expulsa\nenvuelven su cuerpo en olas de calor\nque hacen que sea difícil verlo.", "Emette fiamme così incandescenti che\nl'aria circostante si scalda e i contorni\ndella sua figura si sfumano.", "The scorching fire exhaled by Magmar\nforms heat waves around its body, making\nit hard to see the Pokémon clearly.") },
            // { PBESpecies.127, new PBELocalizedString("パワフルな　ツノを　ふりまわす。\n\xFF12ほんの　ツノで　はさんだ　えものは\nちぎれるまで　ぜったい　はなさない。", "파워풀한 뿔을 휘두른다.\n2개의 뿔로 끼운 먹이는\n조각날 때까지 절대 놓지 않는다.", "Il serre ses proies dans ses puissantes\npinces jusqu'à les trancher en deux.", "Beute erfasst es mit seinen mächtigen\nScheren und zerrt daran, bis sie\nin zwei Stücke reißt.", "Gira enérgicamente sus potentes pinzas,\ncon las que atrapa presas y las atenaza\nhasta partirlas en dos.", "Quando afferra una preda con le sue\npotenti pinze, non la molla finché non\nl'ha tranciata.", "It grips prey with its powerful\npincers and will not let go\nuntil the prey is torn in half.") },
            // { PBESpecies.128, new PBELocalizedString("えものに　ねらいを　さだめると\nいっちょくせんに　とっしんする。\nあらっぽい　せいかくで　ゆうめい。", "노리는 먹이를 포착하면\n일직선으로 돌진한다.\n난폭한 성격으로 유명하다.", "Après avoir choisi sa cible, il fonce\ndessus tête baissée. Il est réputé\npour sa nature violente.", "Sobald es einen Gegner ins Visier\ngenommen hat, rennt es mit dem\nKopf voran auf ihn zu.", "Cuando elige una presa, ataca sin\npensárselo. Este Pokémon es\nfamoso por su carácter violento.", "Dopo aver puntato il nemico, lo\ncarica a testa bassa.\nÈ noto per la sua indole violenta.", "Once it takes aim at its foe, it\nmakes a headlong charge. It is\nfamous for its violent nature.") },
            { PBESpecies.Magikarp, new PBELocalizedString("ながねん　いきた　コイキングは\nはねるだけで　やまをも　こえるが\nわざのいりょくは　よわいまま。", "오래 산 잉어킹은 튀어오르기로\n산도 넘을 수 있지만 기술의\n위력은 여전히 약하다.", "Un vénérable Magicarpe peut\nfranchir une montagne en utilisant\nTrempette. Mais c'est tout...", "Ein älteres Karpador kann mit\nPlatscher Berge überspringen. Die\nAttacke ist trotzdem eher nutzlos.", "Si vive mucho, puede llegar a saltar\nmontañas con Salpicadura, pero el\nmovimiento no sirve para nada más.", "Un Magikarp di una certa età può\nsaltare una montagna con Splash,\nche però è una mossa inutile.", "A Magikarp living for many years\ncan leap a mountain using Splash.\nThe move remains useless, though.") },
            { PBESpecies.Gyarados, new PBELocalizedString("いちど　あばれだした　ギャラドスは\nあらしが　ふきすさんでいようとも\nどんなものでも　やきつくしてしまう。", "한 번 난동부리기 시작한 갸라도스는\n태풍이 사납게 휘몰아쳐도\n어떤 것이든 다 태워버린다.", "Quand il se laisse emporter par la\nrage, il ne se calme qu'après avoir\ndétruit tout ce qui l'entoure.", "Wütet ein Garados, wird es alles\nniederbrennen. Dies geschieht\nselbst während eines Sturms.", "Cuando empieza a agitarse, puede\nquemarlo todo, incluso en medio\nde la más violenta tormenta.", "Quando va su tutte le furie,\nGyarados brucia ogni cosa, anche\nnel mezzo di un violento temporale.", "Once it begins to rampage, a\nGyarados will burn everything\ndown, even in a harsh storm.") },
            // { PBESpecies.131, new PBELocalizedString("ひとの　ことばを　りかいする　たかい\nちのうをもち　せなかに　ひとをのせて\nうみをおよぐのが　すきな　ポケモン。", "인간의 말을 이해하는 높은\n지능을 가졌으며 등에 사람을 태우고\n바다를 헤엄치는 것을 좋아하는 포켓몬.", "Ce Pokémon très intelligent comprend\nle langage humain. Il adore parcourir\nles mers avec des gens sur son dos.", "Ein schlaues Pokémon, das die Sprache\nder Menschen versteht und ihnen liebend\ngern seine Fährdienste anbietet.", "Dotado de una gran inteligencia y capaz\nde comprender el lenguaje humano. Surca\nlos mares llevando a gente en su lomo.", "La sua grande intelligenza gli permette\ndi capire anche il linguaggio umano. Ama\nnuotare in mare trasportando persone.", "Able to understand human speech\nand very intelligent, it loves to swim\nin the sea with people on its back.") },
            { PBESpecies.Ditto, new PBELocalizedString("ぜんしんの　さいぼうを　くみかえて\nみたもの　そっくりに　へんしんするが\nちからが　ぬけると　もとにもどる。", "전신의 세포를 재구성해서\n본 것과 똑 닮게 변신하지만\n힘이 빠지면 원래로 돌아간다.", "Il modifie sa structure cellulaire pour\ncopier l'apparence de ce qu'il voit, mais\nau repos, il reprend sa forme normale.", "Ruht es sich nicht aus, kann es seine\nZellstruktur so verändern, dass es sich\nin alles verwandeln kann, was es sieht.", "Redistribuye las células de su cuerpo\npara cobrar la apariencia de lo que ve,\npero vuelve a la normalidad al relajarse.", "Può modificare la sua struttura cellulare\nassumendo le sembianze di ciò che vede.\nRitorna se stesso quando è stanco.", "It can reconstitute its entire cellular\nstructure to change into what it sees,\nbut it returns to normal when it relaxes.") },
            { PBESpecies.Eevee, new PBELocalizedString("ふあんていな　いでんしの　おかげで\nさまざまな　しんかの　かのうせいを\nひめている　とくしゅな　ポケモン。", "불안정한 유전자 덕분에\n여러 가지 진화 가능성을\n간직하고 있는 특수한 포켓몬.", "L'ADN de ce Pokémon très particulier\nrecèle de nombreuses possibilités\nd'évolution.", "Aufgrund einer genetischen Anomalie\nkann seine Entwicklung viele\nverschiedene Formen annehmen.", "Su irregular estructura genética\nencierra el secreto de su capacidad para\nadoptar evoluciones de lo más diversas.", "È un Pokémon molto particolare. Dotato\ndi un corredo genetico instabile, serba\nin sé le più varie possibilità evolutive.", "Thanks to its unstable genetic makeup,\nthis special Pokémon conceals many\ndifferent possible evolutions.") },
            { PBESpecies.Vaporeon, new PBELocalizedString("からだの　さいぼうの　つくりが\nみずの　ぶんしに　にているため\nみずに　とけると　みえなくなる。", "몸의 세포 구조가\n물 분자와 닮았기 때문에\n물에 녹으면 보이지 않는다.", "Sa composition moléculaire est proche\nde celle de l'eau, ce qui lui permet de\ns'y fondre complètement.", "Seine Zellstruktur ist der von\nWassermolekülen ähnlich. Daher\nkann es mit Wasser eins werden.", "Su composición celular se asemeja a la\nde las moléculas del agua. Por eso, al\nfundirse en el agua, se mimetiza.", "La sua composizione cellulare è simile\na quella delle molecole d'acqua e quando\nsi immerge in essa diventa invisibile.", "Its cell composition is similar to water\nmolecules. As a result, it can't be seen\nwhen it melts away into water.") },
            { PBESpecies.Jolteon, new PBELocalizedString("たいないに　でんきを　ためることで\nさかだてた　ぜんしんの　たいもうを\nミサイルのように　つぎつぎ　とばす。", "체내에 전기를 모으는 것으로\n곤두세운 전신의 털을\n미사일처럼 연속해서 날린다.", "Il fait appel à l'électricité de son\ncorps pour dresser ses poils et\nles lancer comme des missiles.", "Lädt sich sein Körper mit Elektrizität,\nrichten sich alle seine Haare auf und\ndienen ihm als Geschosse.", "Acumula electricidad en su interior y\npuede liberarla lanzando su pelaje\nencrespado a modo de salva de misiles.", "Quando concentra l'elettricità dentro di\nsé, i peli del suo manto si rizzano e\nsfrecciano in aria come piccoli missili.", "By storing electricity in its body,\nit can shoot its bristlelike fur\nlike a barrage of missiles.") },
            { PBESpecies.Flareon, new PBELocalizedString("すいこんだ　くうきを　たいないの\nほのおぶくろに　おくりこみ\n\xFF11\xFF17\xFF10\xFF10どの　ほのおにして　ふく。", "들이마신 공기를 체내의\n불꽃 주머니에 보내\n1700도의 불꽃으로 내뿜는다.", "L'air qu'il inspire est chauffé par\nla glande enflammée de son corps,\natteignant les 1 700 °C.", "Speichert Atemluft in einer Feuerlunge.\nDort erhitzt es sie auf 1 700 Grad,\num sie als Flammen auszuspucken.", "Calienta el aire que inhala en su saca\nde fuego y lo expulsa a 1700° de\ntemperatura.", "L'aria che respira si infiamma passando\nnella sacca ardente dentro il suo corpo,\nraggiungendo i 1700°C.", "Inhaled air is carried to its flame sac,\nheated, and exhaled as fire\nthat reaches over 3,000 degrees F.") },
            // { PBESpecies.137, new PBELocalizedString("さいこうの　かがくりょくで\nうみだされた　じんこうの　ポケモン。\nでんしくうかんを　いどうできる。", "최고의 과학력으로\n만들어진 인공 포켓몬이다.\n전자 공간을 이동할 수 있다.", "Ce Pokémon créé par des\nscientifiques peut arpenter\nlibrement le cyberespace.", "Ein von Menschen erschaffenes Pokémon,\ndas sich frei im künstlichen Raum\nbewegen kann.", "Un Pokémon creado por el hombre\ncon avanzados medios tecnológicos.\nPuede viajar por el ciberespacio.", "Un Pokémon creato dall'uomo con\nmetodi scientifici avanzatissimi. Si\nmuove liberamente nel ciberspazio.", "A man-made Pokémon created using\nadvanced scientific means. It can\nmove freely in cyberspace.") },
            // { PBESpecies.138, new PBELocalizedString("げんだいの　すぐれた　かがくりょくで\nかせきから　ふっかつした　ポケモン。\nこだいの　うみを　およいでいた。", "현대의 우수한 과학력으로\n화석에서 부활한 포켓몬이다.\n고대의 바다를 헤엄치고 있었다.", "Un Pokémon ramené à la vie par\nla science à partir d'un fossile. Il\npeuplait autrefois les mers.", "Dieses Pokémon wurde von der modernen\nWissenschaft aus einem Fossil ge-\nschaffen. Es lebte im urzeitlichen Meer.", "Fue recuperado a partir de un fósil\ngracias a la ciencia moderna.\nSolía nadar en antiguos mares.", "Pokémon rigenerato da un fossile\ngrazie alla scienza moderna.\nNuotava nei mari ancestrali.", "A Pokémon that was resurrected\nfrom a fossil using modern science.\nIt swam in ancient seas.") },
            // { PBESpecies.139, new PBELocalizedString("らせんじょうの　カラが　おおきく\nなりすぎたことが　げんいんで\nぜつめつしたと　かんがえられている。", "나선형의 껍질이 너무\n커져 버린 것이 원인으로\n멸종했다고 여겨지고 있다.", "On pense que ce Pokémon a disparu\nparce que sa coquille en spirale\nétait devenue trop grosse.", "Man geht davon aus, dass das Pokémon\nausgestorben ist, weil seine\nspiralförmige Schale zu groß wurde.", "Se cree que este Pokémon se extinguió\nporque su concha espiral creció\ndemasiado.", "Si pensa che questo Pokémon si\nsia estinto perché la sua conchiglia\na spirale è cresciuta troppo.", "It is thought that this Pokémon\nbecame extinct because its spiral\nshell grew too large.") },
            // { PBESpecies.140, new PBELocalizedString("\xFF13おくねんまえの　すなはまで\nくらしていたと　かんがえられている。\nかたい　カラが　みを　まもる。", "3억 년 전에 모래 해변에서\n살고 있었던 것으로 추측된다.\n단단한 껍질이 몸을 보호한다.", "On pense qu'il peuplait les plages\nil y a 300 millions d'années. Il est\nprotégé par une coquille robuste.", "Man geht davon aus, dass dieses\nPokémon vor 300 Millionen Jahren\ndie Strände bevölkerte.", "Se cree que habitó las playas hace\n300 millones de años. Se protege\ncon una dura concha.", "Si ritiene che vivesse sulle spiagge\n300 milioni di anni fa. È protetto da\nuna conchiglia robusta.", "It is thought to have inhabited\nbeaches 300 million years ago.\nIt is protected by a stiff shell.") },
            // { PBESpecies.141, new PBELocalizedString("えものが　りくじょうせいかつを\nはじめたため　カブトプスも　りくに\nあがったと　かんがえられている。", "투구푸스의 먹이가 육상 생활을\n시작했기 때문에 투구푸스 역시\n육지에 올라온 것으로 추측된다.", "On pense que ce Pokémon est\nvenu sur la terre ferme pour\nsuivre l'évolution de ses proies.", "Man geht davon aus, dass dieses\nPokémon an Land kam, weil seine Beute\nebenfalls irgendwann an Land lebte.", "Se cree que este Pokémon cambió de\nhábitat y pasó del mar a la tierra\nbuscando nuevas presas.", "Pokémon probabilmente giunto sulla\nterraferma perché le sue prede si\nerano adattate a vivere lì.", "It is thought that this Pokémon\ncame onto land because its\nprey adapted to life on land.") },
            // { PBESpecies.142, new PBELocalizedString("きょうりゅうじだいの　おおぞらを\nとびまわっていた　ポケモン。\nのこぎりのような　キバを　もつ。", "공룡 시대의 넓은 하늘을\n날아다녔던 포켓몬이다.\n톱 같은 이빨을 가지고 있다.", "Un Pokémon qui arpentait le ciel\nau temps des dinosaures. Ses\ncrocs sont pareils à des scies.", "Dieses Pokémon flog zu Zeiten der\nDinosaurier am Himmel. Seine Zähne\nsind wie Sägeblätter.", "Este Pokémon surcó los cielos\nen la época de los dinosaurios.\nSus colmillos son muy afilados.", "Un Pokémon che vagava nei cieli\nnell'era dei dinosauri. Le sue zanne\nsono affilate come lame.", "A Pokémon that roamed the skies\nin the dinosaur era. Its teeth are\nlike saw blades.") },
            // { PBESpecies.143, new PBELocalizedString("まんぷくになると　ゆびすら\nうごかすのが　めんどうに　なるので\nおなかに　のっても　だいじょうぶ。", "배가 부르면 손가락 하나를\n움직이는 것조차 귀찮아하므로\n배에 올라타도 괜찮다.", "Une fois le ventre plein, il est trop\namorphe pour lever le petit doigt.\nSautez sur son ventre!", "Ist sein Magen voll, wird es sehr\nlethargisch. Nun kann man problemlos\nauf seinem Bauch umherspringen.", "Cuando tiene la tripa llena, no puede\nni mover un dedo. En ese momento\nde letargo, puedes saltar en su tripa.", "Quando ha la pancia piena diventa\ntroppo pigro per muoversi e si può\nsaltargli sopra senza pericolo.", "When its belly is full, it becomes\ntoo lethargic to even lift a finger,\nso it is safe to bounce on its belly.") },
            // { PBESpecies.144, new PBELocalizedString("でんせつの　とりポケモン。\nくうきちゅうの　すいぶんを　こおらせ\nふぶきを　つくりだすことが　できる。", "전설의 새 포켓몬이다.\n공기 중의 수분을 얼려\n눈보라를 만들어 낼 수 있다.", "Un Pokémon Oiseau légendaire.\nIl peut provoquer des blizzards\nen gelant l'humidité de l'air.", "Ein Legendäres Vogel-Pokémon.\nEs kann Blizzards verursachen,\nindem es Feuchtigkeit gefriert.", "Legendario Pokémon pájaro capaz\nde generar ventiscas congelando\nla humedad del aire.", "Un Pokémon uccello leggendario.\nRiesce a creare bufere di neve\ncongelando l'umidità dell'aria.", "A legendary bird Pokémon.\nIt can create blizzards by\nfreezing moisture in the air.") },
            // { PBESpecies.145, new PBELocalizedString("かみなりぐもの　なかに　いると\nいわれる　でんせつの　ポケモン。\nカミナリを　じざいに　あやつる。", "번개 구름 안에 있다고\n전해지는 전설의 포켓몬이다.\n번개를 자유로이 조종한다.", "Un Pokémon Oiseau légendaire dont\non dit qu'il vit dans les nuages\nd'orage. Il contrôle la foudre.", "Ein Legendäres Vogel-Pokémon,\ndas in Gewitterwolken leben soll.\nEs kontrolliert Blitze.", "Legendario Pokémon pájaro del que\nse dice que vive en los nubarrones.\nControla los rayos eléctricos.", "Un Pokémon uccello leggendario.\nSi dice che viva tra le nubi\ntemporalesche. Controlla i fulmini.", "A legendary Pokémon that is said\nto live in thunderclouds. It freely\ncontrols lightning bolts.") },
            // { PBESpecies.146, new PBELocalizedString("でんせつの　とりポケモンの　\xFF11ぴき。\nファイヤーが　すがたを　みせると\nはるが　おとずれると　いわれている。", "전설의 새 포켓몬 중의 1마리다.\n파이어가 모습을 보이면\n봄이 찾아온다고 전해진다.", "L'un des Pokémon Oiseaux légendaires.\nOn dit que sa venue annonce l'arrivée\ndu printemps.", "Eines der Legendären Vogel-Pokémon.\nEs wird als Bote des Frühlings\nangesehen.", "Uno de los legendarios Pokémon pájaro.\nDicen que su presencia anuncia\nla llegada de la primavera.", "Un Pokémon uccello leggendario.\nSi dice che la sua apparizione preannunci\nl'arrivo della primavera.", "One of the legendary bird Pokémon.\nIt is said that its appearance\nindicates the coming of spring.") },
            // { PBESpecies.147, new PBELocalizedString("もくげきしゃが　すくないために\nまぼろしのポケモンと　よばれていた。\nだっぴした　かわが　みつかっている。", "목격자가 적기 때문에\n환상의 포켓몬이라고 불리고 있다.\n탈피한 껍질이 발견되고 있다.", "On l'appelle “Pokémon mirage\"\nen raison de sa rareté. On a\ndécouvert sa mue.", "Man nennt es „Illusion-Pokémon“,\ndenn nur wenige haben es gesehen.\nNur seine Haut wurde oft gefunden.", "Se le llama el Pokémon Espejismo\nporque son muy pocos los que lo\nhan visto. Se encontró su muda.", "Detto “Pokémon miraggio\" perché\nè stato avvistato da pochi. È facile\ntrovare la sua pelle della muta.", "It is called the “Mirage Pokémon\"\nbecause so few have seen it.\nIts shed skin has been found.") },
            // { PBESpecies.148, new PBELocalizedString("ぜんしんが　オーラに　つつまれるとき\nまわりの　てんきが　いっぺんする。\nうみや　みずうみに　すむという。", "전신이 오라에 둘러싸일 때는\n주위 날씨가 완전히 바뀐다.\n바다나 호수에서 산다고 한다.", "La météo change brusquement quand\nil est entouré d'une aura. On dit\nqu'il peuple les mers et les lacs.", "Erscheint um seinen Körper eine Aura,\ngibt es einen Wetterwechsel.\nEs soll in Seen und Meeren leben.", "Si su cuerpo está rodeado de un aura,\nel tiempo cambia de repente.\nSe dice que vive en mares y lagos.", "Se il suo corpo emana un'aura, il tempo\ncambia all'istante. Si dice che viva nei\nmari e nei laghi.", "If its body takes on an aura, the\nweather changes instantly. It is\nsaid to live in seas and lakes.") },
            // { PBESpecies.149, new PBELocalizedString("ひろい　うみの　どこかに　すみかが\nあると　いわれている。なんぱした\nふねを　りくまで　みちびいてくれる。", "넓은 바다의 어딘가에 거처가\n있다고 전해진다. 난파한\n배를 육지까지 이끌어 준다.", "On raconte qu'il vit quelque part\nen mer. Il guide les équipages\nnaufragés jusqu'à la terre ferme.", "Man sagt, es lebe in den Meeren.\nEs bringt Schiffbrüchige sicher an Land.", "Se dice que vive en algún lugar del mar.\nGuía a las tripulaciones de los barcos\nhundidos a la costa.", "Si dice che faccia la sua tana da qualche\nparte nel mare. Porta a riva le vittime di\nnaufragi.", "It is said to make its home\nsomewhere in the sea. It guides\ncrews of shipwrecks to shore.") },
            // { PBESpecies.150, new PBELocalizedString("ミュウの　いでんしを　くみかえて\nうみだされた。ポケモンで　いちばん\nきょうぼうな　こころを　もつという。", "뮤의 유전자를 재구성해서\n만들어졌다. 포켓몬 중에서 가장\n난폭한 마음을 가지고 있다고 한다.", "Un Pokémon conçu en réorganisant\nles gènes de Mew. On raconte qu'il\ns'agit du Pokémon le plus féroce.", "Die Gene von Mew wurden neu\nangeordnet, wodurch dieses Pokémon\nentstand. Es hat ein wildes Herz.", "Pokémon creado por recombinación\ngenética de Mew. Se dice que es\nel más salvaje de los Pokémon.", "Un Pokémon creato usando i geni di Mew.\nSi dice che fra i Pokémon sia quello con\nl'animo più crudele.", "A Pokémon created by recombining\nMew's genes. It's said to have the\nmost savage heart among Pokémon.") },
            // { PBESpecies.151, new PBELocalizedString("あらゆる　わざを　つかうため\nポケモンの　せんぞと　かんがえる\nがくしゃが　たくさん　いる。", "모든 기술을 사용하기 때문에\n포켓몬의 조상이라고 생각하는\n학자가 많다.", "Nombre de scientifiques voient en\nlui l'ancêtre des Pokémon car il\nmaîtrise toutes leurs capacités.", "Es beherrscht alle möglichen\nAttacken, daher sieht man in ihm\nden Vorfahren aller Pokémon.", "Varios científicos lo consideran\nel antecesor de los Pokémon\nporque usa todo tipo de movimientos.", "Poiché sa usare qualsiasi mossa, molti\nscienziati ritengono che Mew sia\nl'antenato di tutti i Pokémon.", "Because it can use all kinds of\nmoves, many scientists believe Mew\nto be the ancestor of Pokémon.") },
            // { PBESpecies.152, new PBELocalizedString("あたまの　はっぱで　まわりの\nおんどや　しつどを　さぐる。\nひざしを　あびることが　だいすき。", "머리의 잎사귀로 주위의\n온도나 습도를 살핀다.\n햇볕을 쬐는 것을 매우 좋아한다.", "Il jauge la température et l'humidité\ngrâce à la feuille sur sa tête. Il\nraffole des bains de soleil.", "Mit dem Blatt auf seinem Kopf bestimmt\nes die Temperatur und Feuchtigkeit.\nEs liebt Sonnenbäder.", "Con la hoja de su cabeza puede medir\nla temperatura y la humedad.\nLe encanta tomar el sol.", "Usa la foglia sulla sua testa per\nmisurare la temperatura e l'umidità.\nAma crogiolarsi al sole.", "It uses the leaf on its head to\ndetermine the temperature and\nhumidity. It loves to sunbathe.") },
            // { PBESpecies.153, new PBELocalizedString("くびまわりの　つぼみから　におう\nスパイシーな　かおりは\nかいだ　ひとを　げんきに　させる。", "목 주위의 봉오리로부터 풍기는\n향긋한 향기는 향기를\n맡은 사람을 힘이 나게 한다.", "Le collier de bourgeons à son cou\nrépand un arôme épicé qui vous\ndonne du tonus.", "Die Knospen an seinem Hals\ngeben ein würziges Aroma ab,\ndas andere aufheitert.", "Su cuello desprende un dulce aroma\nque anima a quien lo huele.", "Le foglie attorno al suo collo emanano\nun aroma speziato dall'effetto\nenergizzante.", "The buds that ring its neck give\noff a spicy aroma that perks\npeople up.") },
            // { PBESpecies.154, new PBELocalizedString("メガニウムが　はきだす　いきには\nかれた　くさばなを　よみがえらせる\nふしぎな　ちからが　ひめられている。", "메가니움이 뿜어내는 호흡에는\n시든 화초를 되살리는\n이상한 힘이 숨어 있다.", "Son souffle a l'incroyable capacité\nde ranimer les plantes et les fleurs\nflétries.", "Mit seinem Atem kann es tote\nPflanzen und Blumen zu neuem\nLeben erwecken.", "Su aliento tiene la maravillosa capacidad\nde revivir plantas y flores muertas.", "Il suo respiro ha lo straordinario\npotere di far tornare rigogliosi piante\nsecche e fiori avvizziti.", "Its breath has the fantastic\nability to revive dead plants and\nflowers.") },
            // { PBESpecies.155, new PBELocalizedString("おくびょうな　せいかく。\nおどろくと　せなかの　ほのおが\nいちだんと　つよく　もえあがる。", "겁쟁이 같은 성격이다.\n놀라면 등의 불꽃이\n한층 더 강하게 타오른다.", "Ce Pokémon est un grand timide.\nLes flammes sur son dos s'intensifient\nlorsqu'il prend peur.", "Erschrickt sich dieses scheue\nPokémon, lodern die Flammen\nauf seinem Rücken kräftiger.", "Es un Pokémon muy tímido. Si se asusta,\nlas llamas de su lomo arden con más\nfuerza.", "È riservato per natura. Se viene\nspaventato, le fiamme sul suo dorso\nbruciano ardentemente.", "It has a timid nature. If it is\nstartled, the flames on its back\nburn more vigorously.") },
            // { PBESpecies.156, new PBELocalizedString("ほのおの　ねつで　あいてを　いかく。\nたたかう　たいせいになると\nほのおの　いきおいが　ます。", "불꽃의 열로 상대를 위협한다.\n싸울 태세가 되면\n불꽃의 기세가 강해진다.", "La chaleur de ses flammes intimide\nl'ennemi. Elles s'intensifient\nlorsqu'il se prépare à combattre.", "Es bedroht seine Gegner mit der\nHitze seiner Flammen. Ist es\nkampfbereit, lodern sie stärker.", "Intimida a sus enemigos con el calor de\nsus llamas. Arde con mayor fuerza\ncuando va a luchar.", "Intimorisce i nemici con il calore delle\nsue fiamme. Se è pronto a lottare,\nle vampate sono più ardenti.", "It intimidates foes with the heat\nof its flames. The fire burns more\nstrongly when it readies to fight.") },
            // { PBESpecies.157, new PBELocalizedString("ほのおの　ばくふうで　こうげき。\nしゃくねつの　ほのおで　かげろうを\nつくりだし　すがたを　かくす。", "불꽃 폭풍으로 공격한다.\n작열하는 불꽃으로 아지랑이를\n만들어 내어 모습을 감춘다.", "Il attaque en projetant des flammes.\nIl se dissimule derrière les vagues\nde chaleur qu'il produit.", "Es greift seine Gegner mit Feuer an.\nDabei entsteht ein Hitzeflimmern, in\ndem es sich versteckt.", "Ataca con llamaradas. Con ellas crea\nreflejos de calor para ocultarse.", "Attacca usando fiamme esplosive. Si cela\nin una scintillante nube di calore creata\ndalle fiamme roventi.", "It attacks using blasts of fire.\nIt creates heat shimmers with\nintense fire to hide itself.") },
            // { PBESpecies.158, new PBELocalizedString("はったつした　あごを　もち\nなんにでも　かみつく　しゅうせい。\nトレーナーも　ちゅういが　ひつよう。", "발달된 턱을 갖고 있어 무엇이든\n물어버리는 습성이 있다.\n트레이너도 주의가 필요하다.", "Il broie tout ce qu'il trouve avec\nses mâchoires puissantes. Même\nson Dresseur doit s'en méfier.", "Es hat die Angewohnheit, nach allem\nzu schnappen, was es sieht. Selbst\nseine Trainer müssen aufpassen.", "Tiene costumbre de morderlo todo\ncon sus poderosas fauces, incluso\nEntrenadores.", "Ha l'abitudine di mordere ogni cosa con\nle potenti mandibole. Neppure il suo\nAllenatore è al sicuro!", "It has the habit of biting anything\nwith its developed jaws. Even its\nTrainer needs to be careful.") },
            // { PBESpecies.159, new PBELocalizedString("いちど　かみつくと　キバが\nぬけるまで　ぜったいに　はなさない。\nぬけた　キバは　すぐに　はえてくる。", "한번 물면 이빨이\n빠질 때까지 절대 놓지 않는다.\n빠진 이빨은 바로 자라난다.", "Quand il mord, il ne lâche pas prise\navant que ses crocs se brisent.\nIls repoussent par la suite.", "Hat es einmal zugebissen, lässt\nes erst los, wenn es seine Zähne\nverliert, die schnell nachwachsen.", "Cuando muerde algo, no lo suelta hasta\nque pierde sus colmillos. Estos se\nregeneran rápidamente.", "Quando azzanna il nemico, non molla\nla presa finché non gli cadono le zanne,\nche però ricrescono subito.", "Once it bites down, it won't let go\nuntil it loses its fangs. New fangs\nquickly grow into place.") },
            // { PBESpecies.160, new PBELocalizedString("ふだんは　ゆっくりとした　うごきだが\nえものに　かみつくときは\nめにも　とまらない　スピードだ。", "평소에는 느긋하게 움직이지만\n먹이를 물 때에는 눈에 보이지\n않는 엄청난 스피드를 낸다.", "Ce Pokémon à l'air pataud est\ncapable d'attaquer à la vitesse\nde l'éclair pour mordre sa proie.", "Eigentlich bewegt es sich\nlangsam, doch seine Beute\ngreift es blitzschnell an.", "Se suele mover lento, pero alcanza\nvelocidades de vértigo al atacar y\nmorder a sus enemigos.", "Di solito si muove lentamente, ma quando\nattacca e morde la preda si muove ad una\nvelocità incredibile.", "It usually moves slowly, but it\ngoes at blinding speed when it\nattacks and bites prey.") },
            // { PBESpecies.161, new PBELocalizedString("とても　しんけいしつな　せいかく。\nとおくまで　みわたせるように\nしっぽを　つかって　せのびをする。", "매우 신경질적인 성격이다.\n멀리까지 볼 수 있도록\n꼬리를 써서 발돋움한다.", "Ce Pokémon très nerveux\nprend appui sur sa queue pour\nobserver ses alentours.", "Ein sehr nervöses Pokémon.\nEs steht auf seinem Schweif und\nbetrachtet seine Umgebung ganz genau.", "Es de naturaleza nerviosa. Se alza sobre\nsu cola para otear grandes extensiones.", "Ha un'indole alquanto nervosa. Sta ritto\nsulla punta della coda per riuscire a\nsorvegliare ampie aree.", "It has a very nervous nature.\nIt stands up high on its tail so it\ncan scan wide areas.") },
            // { PBESpecies.162, new PBELocalizedString("ははおやは　ほそながい　からだで\nこどもを　つつみこみ　ねむらせる。\nはやい　うごきで　てきを　おいこむ。", "엄마 포켓몬이 가늘고 긴 몸으로\n새끼를 감싸 안아 재운다. 빠른\n움직임으로 상대를 몰아붙인다.", "La femelle s'enroule autour des\npetits pour les bercer. Il accule\nl'ennemi grâce à sa vitesse.", "Es rollt sich um seine Jungen,\nwenn diese schlafen sollen.\nGegnern begegnet es mit Schnelligkeit.", "Acurruca a sus crías para que duerman.\nAcorrala a los enemigos con su enorme\nvelocidad.", "Si addormenta avvolto nell'esile corpo\ndella madre. Mette all'angolo i nemici\ncon movimenti rapidi.", "The mother puts its offspring to\nsleep by curling up around them.\nIt corners foes with speed.") },
            // { PBESpecies.163, new PBELocalizedString("せいかくに　ときを　つげることから\nせかいの　ことわりを　わきまえた\nちえのかみさま　とする　くにもある。", "정확하게 시간을 알리는 것에서\n세상의 이치를 깨우친\n지혜의 신으로 섬기는 나라도 있다.", "Il hulule chaque jour à la même\nheure. Dans certaines cultures,\nil incarne la sagesse.", "Es sagt präzise die Uhrzeit an.\nIn manchen Regionen verehrt man\nes zudem als weisen Freund.", "Da la hora con gran exactitud.\nEn algunos países se le considera\ntoda una autoridad por su sabiduría.", "Segna il tempo con precisione. In alcuni\npaesi è considerato un amico saggio ed\nesperto del mondo.", "It marks time precisely. Some\ncountries consider it to be a wise\nfriend, versed in the world's ways.") },
            // { PBESpecies.164, new PBELocalizedString("とくしゅな　つくりの　りょうめは\nわずかな　ひかりさえ　あれば\nくらやみでも　ひるのように　みえる。", "특수한 구조의 두 눈은\n약간의 빛만 있으면\n어둠 속에서도 낮처럼 볼 수 있다.", "Ses yeux sont capables de voir\ndistinctement même quand il fait\ntrès sombre.", "Seine Augen sind so gut entwickelt,\ndass es selbst in tiefster Dunkelheit\nnoch klar sehen kann.", "Tiene los ojos muy desarrollados y\npuede ver con increíble claridad\nen la oscuridad más densa.", "Ha una vista acutissima, che gli permette\ndi vedere anche nel buio più profondo e\ncon la luce più fioca.", "Its eyes are specially developed\nto enable it to see clearly even in\nmurky darkness and minimal light.") },
            // { PBESpecies.165, new PBELocalizedString("むれを　つくらないと　ふあんで\nうごけなくなるほど　おくびょう。\nにおいで　きもちを　つたえあう。", "무리를 짓지 않으면 불안해서\n움직일 수 없을 정도로 겁쟁이다.\n냄새로 서로의 마음을 전한다.", "Il est si timide qu'il ne se déplace\nqu'au milieu d'un essaim. Il exprime\nses émotions par l'odeur.", "Es ist so scheu, dass es sich\nnur dann bewegt, wenn es sich\nin einem Schwarm befindet.", "Es tan temeroso que no se mueve si no\nes en grupo. Comunica sus sentimientos\ncon olores.", "È tanto timido da non muoversi se non è\nin gruppo. Trasmette le sue emozioni\nemanando una fragranza.", "It is so timid, it can't move if it\nisn't with a swarm of others. It\nconveys its feelings with scent.") },
            // { PBESpecies.166, new PBELocalizedString("ほしあかりを　エネルギーにする。\nよぞらの　ほしの　かずが　ふえると\nせなかの　もようが　おおきくなる。", "별빛을 에너지로 쓴다.\n밤하늘의 별의 수가 늘어나면\n등의 무늬가 커진다.", "Il tire sa force de la lumière des\nétoiles. Plus il y en a et plus ses\nmotifs dorsaux sont grands.", "Es zieht Energie aus dem Licht der\nSterne. Je mehr Sterne zu sehen sind,\ndesto größer ist sein Muster.", "Se nutre de la luz de las estrellas.\nCuanto más estrellada es la noche,\nmás crecen los dibujos de su lomo.", "La luce delle stelle è la sua fonte\nd'energia. Un cielo più stellato fa\ningrandire i disegni sul suo dorso.", "It uses starlight as energy. When\nmore stars appear at night, the\npatterns on its back grow larger.") },
            // { PBESpecies.167, new PBELocalizedString("ほそくて　じょうぶな　いとを\nはりめぐらして　わなを　しかける。\nえものが　かかるまで　じっと　まつ。", "가늘고 튼튼한 실을\n둘러쳐서 덫을 설치한다. 먹이가\n걸릴 때까지 가만히 기다린다.", "Il tisse une toile fine mais solide\npour poser des pièges et se poste\ndans l'attente d'une proie.", "Es baut eine Falle, indem es ein\nNetz mit dünner, starker Seide\nspinnt. Es wartet still auf Beute.", "Pone trampas tejiendo una red\nde seda fina y resistente y luego\nespera inmóvil a su presa.", "Tesse una trappola con un filo di seta,\nsottile ma robusto. Attende la preda\nsenza muoversi.", "It sets a trap by spinning a web\nwith thin but strong silk. It waits\nmotionlessly for prey to arrive.") },
            // { PBESpecies.168, new PBELocalizedString("えものの　からだに　いとを　つけて\nわざと　にがす。いとを　たどれば\nなかまごと　つかまえられるからだ。", "먹이의 몸에 실을 붙여\n일부러 풀어준다. 실을 더듬어 가면\n동료까지 잡을 수 있기 때문이다.", "Il attache un fil à sa proie avant\nde la libérer. Il s'en servira pour\nla retrouver, elle et ses amis.", "Es befestigt Seide an der Beute und\nlässt sie frei. Es folgt dem Seidenfaden\nzur Beute und ihren Freunden.", "Pega hilos de seda a sus presas y\nlas libera para seguirlas más tarde\ny localizar también a sus amigos.", "Aggancia la preda con un filo di seta\ne la lascia andare. Poi segue il filo e\nla trova quando è in gruppo.", "It attaches silk to its prey and\nsets it free. Later, it tracks the\nsilk to the prey and its friends.") },
            { PBESpecies.Crobat, new PBELocalizedString("\xFF14まいに　ふえた　はねを　つかい\nさらに　はやく　しずかに　とんで\nえものに　きづかれず　しのびよる。", "4장으로 늘어난 날개를 사용하여\n더욱 빠르고 조용하게 날아\n먹이가 눈치채지 않게 살며시 다가간다.", "Ses quatre ailes lui permettent de\nvoler furtivement pour approcher\nses proies sans les effrayer.", "Dank seiner 4 Flügel kann es sich seiner\nBeute noch schneller und leiser nähern,\nohne dabei bemerkt zu werden.", "Al contar con cuatro alas, puede\nacechar de manera más rápida y sigilosa\na sus presas sin que estas lo perciban.", "Con il secondo paio d'ali ottenuto\ndall'evoluzione, vola verso le prede\nin modo ancora più veloce e silenzioso.", "Having four wings allows it to fly more\nquickly and quietly so it can sneak up\non prey without its noticing.") },
            // { PBESpecies.170, new PBELocalizedString("プラスと　マイナスの　でんきを\nしょくしゅの　さきから　ながす。\nてきを　かんでんさせてしまうのだ。", "플러스와 마이너스의 전기를\n촉수의 끝에서 흘려보낸다.\n적을 감전시켜 버린다.", "Il envoie des décharges électriques\npositives et négatives du bout des\nantennes pour paralyser sa proie.", "Über seine Antennen entlädt es\nElektrizität, mit der es seinen\nGegnern einen Schlag versetzt.", "Libera cargas eléctricas positivas y\nnegativas con sus antenas para\naturdir a sus enemigos.", "Dalle antenne emette scariche elettriche\npositive e negative con le quali colpisce\ni nemici.", "It discharges positive and\nnegative electricity from its\nantenna tips to shock its foes.") },
            // { PBESpecies.171, new PBELocalizedString("しんかいを　およぐ　ランターンの\nあかりは　すいめんまで　とどく。\nしんかいのほし　と　よばれている。", "심해를 헤엄치는 랜턴의\n불빛은 수면까지 다다른다.\n심해의 별이라고 불리고 있다.", "La lumière de Lanturn surgit des\nprofondeurs. On le surnomme\n“étoile des profondeurs\".", "Lanturns Licht kann aus großen\nTiefen heraufscheinen. Man nennt\nes auch „Tiefseestern“.", "La luz de Lanturn se puede ver\ndesde lo más profundo.\nSe le llama la Estrella de Alta Mar.", "La sua luce è visibile anche quando si\ntrova in profondità. È soprannominato\n“Stella degli abissi\".", "Lanturn's light can shine up from\ngreat depths. It is nicknamed\n“The Deep-Sea Star.\"") },
            { PBESpecies.Pichu, new PBELocalizedString("ほほの　でんきぶくろは　ちいさく\nちょっとでも　でんきが　あふれると\nじぶんじしんが　しびれてしまう。", "볼의 전기 주머니가 작아서\n조금이라도 전기가 넘치게 되면\n자기 자신이 감전되어 버린다.", "Les poches électriques de ses\njoues sont encore petites, mais\nrisquent de l'électrocuter.", "Tritt auch nur eine geringe Menge\nElektrizität aus seinen Backen aus,\nbekommt es einen Schlag.", "Las bolsas de electricidad de sus\nmejillas son muy pequeñas. La mínima\nfuga le provoca una descarga.", "Le sacche elettriche sulle sue guance\nsono piccole. Se fuoriesce elettricità,\nresta fulminato.", "The electric sacs in its cheeks are\nsmall. If even a little electricity\nleaks, it becomes shocked.") },
            // { PBESpecies.173, new PBELocalizedString("ピィを　よく　みかける　ばしょは\nながれぼしが　おちた　ばしょと\nじもとでは　うわさ　されている。", "삐가 자주 보이는 장소는\n별똥별이 떨어진 장소라고\n그 고장에서 소문이 돈다.", "On dit qu'il apparaît souvent là\noù s'écrasent les météorites.\nViendrait-il du ciel?", "In seiner Heimat heißt es, dass dort, wo\neinmal Meteore einschlugen, ein erhöhtes\nVorkommen an Pii anzutreffen sei.", "Los lugareños rumorean que suele\nencontrarse en lugares donde\nhan caído estrellas fugaces.", "Si dice che sia facile incontrarlo dove\nsono cadute delle stelle cadenti.", "According to local rumors, Cleffa\nare often seen in places where\nshooting stars have fallen.") },
            // { PBESpecies.174, new PBELocalizedString("ほんのり　あまい　かおりが　して\nよく　はずむ　やわらかい　からだは\nいちど　はずみだすと　とまらない。", "은은하게 달콤한 향기가 나며\n잘 튕기는 부드러운 몸은\n한번 튀기 시작하면 멈추지 않는다.", "Son corps dégage un parfum sucré.\nQuand il commence à rebondir, on\nne peut plus l'arrêter.", "Es duftet süßlich. Fängt sein weicher,\nelastischer Körper einmal an zu hüpfen,\nist es nicht mehr zu stoppen.", "Su cuerpo suave y elástico desprende\nun aroma ligeramente dulce. Cuando\nempieza a botar, no puede parar.", "Il suo corpo è morbido, elastico ed\nemette un profumo dolce e delicato. Se\ninizia a rimbalzare è impossibile fermarlo.", "Its body has a faintly sweet scent\nand is bouncy and soft. If it bounces\neven once, it cannot stop.") },
            // { PBESpecies.175, new PBELocalizedString("みんなの　かんじた　やさしさや\nうれしさを　しあわせに　かえている。\nカラのなかは　しあわせ　ばかりだ。", "모두가 느낀 상냥함과\n기쁨을 행복으로 바꾼다.\n껍질 안에는 행복이 가득.", "Il transforme les émotions\npositives des autres en bonheur\nqu'il stocke dans sa coquille.", "Wandelt die Güte und Freude anderer\nin Glücksgefühle um, die es in seinem\nPanzer speichert.", "Transforma la bondad y la alegría\nde los demás en felicidad y\nla almacena en su cascarón.", "Trasforma la gentilezza e la gioia degli\naltri in felicità, che immagazzina nel\nsuo guscio.", "It transforms the kindness and joy\nof others into happiness, which it\nstores in its shell.") },
            // { PBESpecies.176, new PBELocalizedString("しあわせを　わけあたえるため\nこころやさしい　ひとを　さがしもとめ\nせかいじゅうを　とびまわっている。", "행복을 나눠주기 위해\n마음 착한 사람을 찾아서\n이 세상을 날아다니고 있다.", "Il parcourt le monde pour\ndistribuer de la joie aux\nêtres bons.", "Um sein Glück mit anderen zu teilen,\nfliegt es um die Welt auf der Suche\nnach gutherzigen Menschen.", "Para compartir su felicidad, vuela\npor el mundo en busca de gente\nde buen corazón.", "Vola intorno al mondo in cerca di persone\nbuone e premurose con le quali\ncondividere la sua felicità.", "To share its happiness, it flies\naround the world seeking kind-\nhearted people.") },
            // { PBESpecies.177, new PBELocalizedString("サボテンの　つぼみや　トゲを\nきように　よけながら　ついばむ。\nとびはねるようにして　いどうする。", "선인장의 봉오리나 가시를\n재주 있게 피하며 쪼아댄다.\n마치 뛰어오르는 것처럼 이동한다.", "Il mange des cactus en prenant\nsoin d'éviter les bourgeons et les\népines. Il ne tient pas en place.", "Es pickt seine Nahrung aus\nKakteen, wobei es Knospen\nund Dornen verschont.", "Recoge alimento de los cactos evitando\nlos pinchos. Se mueve dando saltos.", "Raccoglie cibo dai cactus, evitando\nagilmente germogli e spine. Si muove\nsaltellando.", "It picks food from cactus plants,\ndeftly avoiding buds and spines.\nIt seems to skip about to move.") },
            // { PBESpecies.178, new PBELocalizedString("かこと　みらいを　みとおせる。\nまいにち　たいようの　うごきを\nみつづけている　ふしぎな　ポケモン。", "과거와 미래를 내다볼 수 있다.\n매일 태양의 움직임을\n바라보고 있는 이상한 포켓몬이다.", "Cet étrange Pokémon peut voir\nl'avenir et le passé. Il guette\nsans cesse la course du soleil.", "Dieses Pokémon kann die Vergangenheit\nund die Zukunft sehen. Es beobachtet\nständig die Sonne.", "Este extraño Pokémon puede ver\nel pasado y el futuro. Se pasa\nel día mirando al sol.", "Pokémon enigmatico che vede il passato\ne prevede il futuro osservando il sole\ntutto il giorno.", "This odd Pokémon can see both\nthe past and the future. It eyes\nthe sun's movement all day.") },
            // { PBESpecies.179, new PBELocalizedString("さむくなり　せいでんきが　たまると\nたいもうが　\xFF12ばいに　ふくれあがり\nしっぽの　さきが　ほんのり　ひかる。", "추워져 정전기가 쌓이면\n털이 2배로 부풀어\n꼬리 끝이 희미하게 빛난다.", "Sa laine fournie enfle et sa queue se\nmet à briller lorsqu'il fait froid et qu'il\naccumule de l'électricité statique.", "Kältebedingte Elektrostatik verdoppelt\ndie Dichte seines Fells und bewirkt, dass\ndas Ende seines Schweifs leicht leuchtet.", "Almacena electricidad estática con el\nfrío, lo que duplica el volumen de su\npelaje y hace brillar la punta de su cola.", "Quando fa freddo il suo manto si carica di\nenergia elettrostatica duplicando il suo\nvolume, e la sua coda inizia a brillare.", "When cold weather increases static\nelectricity, its wool doubles in size\nand the tip of its tail glows slightly.") },
            // { PBESpecies.180, new PBELocalizedString("うぶげすら　はえなくなった　ぶぶんの\nひふは　ゴムのように　でんきを　\nさえぎるので　じぶんは　しびれない。", "솜털조차 나지 않는 부분의\n피부는 고무처럼 전기를\n막기 때문에 자신은 감전되지 않는다.", "Sa peau ressemble à une sorte de\ncaoutchouc qui le protège de ses\npropres décharges.", "Die gummiartigen, unbehaarten Teile\nseiner Haut leiten keinen Strom und\nschützen es so vor Stromschlägen.", "Los parches de su piel donde no crece ni\npelusilla actúan como un aislante y lo\nprotegen de su propia electricidad.", "La pelle delle parti glabre del suo corpo\nisola dall'elettricità come la gomma.\nPer questo non prende mai la scossa.", "Not even downy wool will grow on\nits rubbery, nonconductive patches\nof skin that prevent electrical shock.") },
            // { PBESpecies.181, new PBELocalizedString("しっぽの　さきは　まぶしく　ひかり\nとおく　はなれた　がいこくまで\nとどき　うみのみちしるべ　となる。", "꼬리 끝이 눈부시게 빛나\n멀리 떨어진 외국까지\n닿아 바다의 길잡이가 된다.", "Le bout de sa queue brille intensément.\nOn l'utilise comme fanal pour guider les\nbateaux jusque dans les pays lointains.", "Das grelle Licht seiner Schweifspitze\nreicht bis in weit entfernte Länder und\nwird auf See als Leuchtfeuer eingesetzt.", "El brillo de la punta de su cola es tan\nintenso que se ve desde países lejanos.\nSe usa para guiar a los navegantes.", "La punta della sua coda è così luminosa\nche raggiunge regioni lontanissime e viene\nusata come segnale da chi naviga in mare.", "The tip of its tail shines so brightly it\ncan be used to send sea-navigation\nbeacons to distant foreign shores.") },
            // { PBESpecies.182, new PBELocalizedString("おおあめの　きせつが　おわると\nあたたかい　ひざしに　さそわれた\nキレイハナが　おどりはじめる。", "장마의 계절이 끝나면\n따뜻한 햇살에 이끌려나온\n아르코가 춤추기 시작한다.", "À la fin de la saison des pluies,\nil sort danser en plein air,\nattiré par la chaleur du soleil.", "Sobald die Regenzeit vorbei ist, wird es\nvon der warmen Sonne nach draußen\ngezogen, wo es tanzt.", "Cuando acaba la estación de las lluvias,\nsale al sol e inicia una peculiar danza.", "Quando finisce la stagione delle piogge,\nlo si vede danzare sotto i caldi raggi del\nsole.", "When the heavy rainfall season\nends, it is drawn out by warm\nsunlight to dance in the open.") },
            { PBESpecies.Marill, new PBELocalizedString("あぶらが　つまっている　しっぽが\nうきぶくろの　かわりと　なるので\nながれの　はやい　かわも　へいき。", "기름이 가득 차 있는 꼬리가\n부낭을 대신하기 때문에\n물살이 빠른 강에서도 문제없다.", "Sa queue à l'extrémité remplie d'huile\nfait office de flotteur, lui permettant\nde rester indifférent aux rapides.", "Sein ölgefüllter Schweif dient ihm als\nRettungsboje, die es vor der Strömung\nreißender Flüsse schützt.", "Su cola, llena de aceite, hace las veces\nde boya, con la que se desenvuelve con\nsoltura hasta en ríos de aguas bravas.", "La sua coda contiene dell'olio e funge\nda galleggiante. Così può nuotare sicuro\nnei fiumi con le correnti più insidiose.", "The oil-filled tail functions\nas a buoy, so it's fine even\nin rivers with strong currents.") },
            { PBESpecies.Azumarill, new PBELocalizedString("ながい　みみは　すぐれた　センサー。\nみずのなかの　おとを　ききわけて\nなにが　うごいているのか　わかる。", "긴 귀는 뛰어난 센서.\n물속의 소리를 구별하여\n무엇이 움직이는지 알 수 있다.", "Ses longues oreilles lui permettent\nd'entendre tout ce qui se passe sous\nl'eau de manière très distincte.", "Seine langen Ohren sind hervorragende\nSensoren. Mit ihnen kann es die Quellen\naller Geräusche des Flusses ausmachen.", "Sus largas orejas son unos sensores\nexcepcionales que le permiten diferenciar\ny clasificar lo que oye dentro del agua.", "Le sue lunghe orecchie sono ricettori\nsensibilissimi. Riesce a distinguere ogni\nminimo rumore perfino sott'acqua.", "Its long ears are superb sensors.\nIt can distinguish the movements of\nthings in water and tell what they are.") },
            // { PBESpecies.185, new PBELocalizedString("こうげき　されないように　ひたすら\nきのまねをしているが　みずはにがてで\nあめになると　どこかに　にげだす。", "공격받지 않기 위해 필사적으로\n나무 흉내를 내며, 물을 싫어하여\n비가 올 때는 어딘가로 사라진다.", "Il prend l'apparence d'un arbre\npour éviter les attaques, mais il\ndéteste l'eau et fuit la pluie.", "Um einen Angriff zu vermeiden, ahmt\nes einen Baum nach. Es hasst zudem\nWasser und flieht vor Regen.", "Para evitar que le ataquen, se limita\na imitar un árbol. Odia el agua y\nhuye de la lluvia.", "Evita gli attacchi nemici rimanendo\nimmobile e camuffandosi da albero.\nOdia l'acqua e rifugge la pioggia.", "To avoid being attacked, it does\nnothing but mimic a tree. It hates\nwater and flees from rain.") },
            { PBESpecies.Politoed, new PBELocalizedString("ニョロトノを　リーダーに　グループが\nつくられる。ニョロトノの　なきごえが\nニョロモたちを　したがわせる。", "왕구리를 리더로 해서 그룹이\n만들어진다. 왕구리의 울음소리가\n발챙이들을 따르게 한다.", "Il rassemble ses pairs pour les\ncommander. Il utilise son cri\npour diriger Ptitard.", "Es versammelt andere Pokémon\num sich herum und führt sie an.\nQuapsel gehorchen seinem Ruf.", "Agrupa a otros Pokémon para liderarlos.\nLos Poliwag obedecen su voz.", "Ama radunare gruppi e atteggiarsi\na capogruppo. I suoi versi richiamano\nPoliwag.", "It gathers groups of others as\ntheir leader. Its cries make\nPoliwag obey.") },
            // { PBESpecies.187, new PBELocalizedString("かぜに　ながされて　ただよう。\nのやまに　ハネッコが　あつまりだすと\nはるが　おとずれると　いわれている。", "바람에 날려 떠다닌다.\n산과 들에 통통코가 모여들면\n봄이 찾아온다고 전해진다.", "Il dérive avec le vent. Sa présence\nen nombre dans les champs et les\nmontagnes annonce le printemps.", "Es reitet auf dem Wind. Man sagt,\nwenn sich Hoppspross versammeln,\nkommt der Frühling bald.", "Flotan en el aire. Se dice que, cuando\nlos Hoppip se reúnen, es que\nla primavera está al caer.", "Giunge sospinto dai venti. Si dice che\nquando Hoppip appare su campi e monti,\nla primavera sia in arrivo.", "It drifts on winds. It is said that\nwhen Hoppip gather in fields and\nmountains, spring is on the way.") },
            // { PBESpecies.188, new PBELocalizedString("きおんが　たかくなると　はなひらく。\nそらに　うかんで　ひざしを\nいっぱい　あびようとする。", "기온이 높아지면 꽃이 핀다.\n하늘에 떠서 햇살을\n가득 쬐려고 한다.", "Il fleurit lorsque les températures\nremontent. Il flotte dans le ciel\npour absorber les rayons du soleil.", "Sobald es wärmer wird, blüht es auf.\nEs schwebt am Himmel und nimmt so\nviel Sonnenlicht auf wie möglich.", "Florece en épocas cálidas. Flota en el\naire para absorber toda la luz solar\nque puede.", "Il suo fiore sboccia appena l'aria\nsi riscalda. Fluttua nel cielo per\nassorbire l'energia solare.", "It blooms when the weather warms.\nIt floats in the sky to soak up as\nmuch sunlight as possible.") },
            // { PBESpecies.189, new PBELocalizedString("きせつふうに　ながされて\nせかいを　いっしゅうしてしまう。\nとちゅうで　わたほうしを　ばらまく。", "계절풍에 날려서\n세계 일주를 해 버린다.\n도중에 솜 포자를 흩뿌린다.", "Poussé par les vents saisonniers,\nil fait le tour du globe en semant\ndes spores de coton.", "Es lässt sich von den Winden um den\nGlobus tragen und verteilt auf\nseinem Flug Baumwollsamen.", "Los vientos estacionales lo llevan por\ntodo el mundo, donde va soltando\nsus esporas.", "Sospinto dai venti stagionali, gira\nintorno al globo sparpagliando i\nsuoi semi simili al cotone.", "Blown by seasonal winds, it\ncircles the globe, scattering\ncotton spores as it goes.") },
            // { PBESpecies.190, new PBELocalizedString("てよりも　じゆうじざいに　うごく\nしっぽを　たくみに　あやつりながら\nたかい　きのうえで　くらしている。", "꼬리를 능숙하게 사용하여\n손보다 자유자재로 움직이며\n높은 나무 위에서 지낸다.", "Sa queue est aussi agile que ses\nmains. Il vit en haut des grands\narbres.", "Lebt in den Baumwipfeln. Kann seinen\nSchweif genauso gut wie seine Hände\nverwenden.", "Vive en las copas de los árboles.\nPuede usar su cola como si fuera\nuna mano más.", "Vive sulla cima degli alberi. Con la coda\npuò fare di tutto, come se fosse una\nmano.", "It lives high among the treetops.\nIt can use its tail as freely and\ncleverly as its hands.") },
            // { PBESpecies.191, new PBELocalizedString("ある　あさ　とつぜん　ふってくる。\nよわいのを　しっており　しんかまで\nひたすら　えいようを　ためこむ。", "어느 날 아침 갑자기 떨어진다.\n약한 것을 알고 있어 진화까지\n한결같이 영양을 모은다.", "Ce Pokémon tombe du ciel certains matins.\nAssez faible, il stocke un maximum de\nnourriture jusqu'à son évolution.", "Es fällt morgens plötzlich vom Himmel. Da\nes weiß, wie schwach es ist, sammelt es\nbis zu seiner Entwicklung nur Nährstoffe.", "Cae de repente del cielo por las mañanas.\nComo sabe que es débil, solo se dedica a\nnutrirse hasta que evoluciona.", "Cade improvvisamente giù dal cielo\nal mattino. Sa di essere debole e cerca di\nnutrirsi al meglio in attesa di evolversi.", "It suddenly falls out of the sky in\nthe morning. Knowing it's weak, it\nsimply feeds until it evolves.") },
            // { PBESpecies.192, new PBELocalizedString("あびた　ひざしを　エネルギーに\nへんかん　するため　ひるまは　ずっと\nたいようの　ほうを　むいている。", "쬔 햇볕을 에너지로\n변환하기 위해 낮에는 계속\n태양 쪽을 바라본다.", "Les rayons du soleil lui donnant de\nl'énergie, il s'oriente toujours dans\nla direction de l'astre du jour.", "Tagsüber richtet es sich stets auf die\nSonne aus, um ihr Licht aufzufangen\nund in Energie umzuwandeln.", "Durante el día está constantemente\norientado hacia el sol para convertir\nsus rayos en energía.", "Guarda sempre in direzione del sole per\nraccogliere i suoi raggi e trasformarli in\nenergia.", "Since it converts sunlight\ninto energy, it is always looking\nin the direction of the sun.") },
            // { PBESpecies.193, new PBELocalizedString("こうそくで　はばたくことで\nくうちゅうを　じゆうじざいに　とぶ。\nきゅうていし　だって　へっちゃら。", "고속으로 날개 쳐서\n공중을 자유자재로 난다.\n급정지도 전혀 문제없다.", "La vitesse de ses ailes lui permet de\nvoler sur place sans trop d'efforts.", "Es kann sich durch seinen schnellen\nFlügelschlag frei durch die Luft bewegen\nund fliegend auf der Stelle halten.", "Vuela a su antojo aleteando muy rápido.\nNi siquiera detenerse bruscamente\nle supone un problema.", "Grazie alle velocissime ali si libra in volo\ncon grazia e agilità. Neanche fermarsi\na mezz'aria costituisce un problema.", "By flapping its wings at high speed,\nit can fly freely through the air.\nEven sudden stops are no problem.") },
            // { PBESpecies.194, new PBELocalizedString("ちじょうを　あるくときは　ひふが\nかんそう　しないように　どくの\nねんまくで　からだを　おおっている。", "지상에서 걸을 때는 피부가\n건조해지지 않도록 독성분의\n점막으로 몸을 감싸고 있다.", "Sur la terre ferme, il couvre son\ncorps d'un fluide toxique qui le\nprotège de la déshydratation.", "An Land bedeckt es die Haut mit\neiner giftigen Schicht, die es vor\ndem Austrocknen bewahrt.", "Cuando anda por la tierra, cubre su\ncuerpo con una capa venenosa para\nmantener hidratada su piel.", "Quando si avventura sulla terraferma,\nricopre il suo corpo di una sostanza\nvelenosa che lo idrata.", "When walking on land, it covers its\nbody with a poisonous film that\nkeeps its skin from dehydrating.") },
            // { PBESpecies.195, new PBELocalizedString("ふなぞこや　かわのいわに　あたまを\nぶつけまくっても　きにせず　きままに\nおよいでいる　のんきな　ポケモン。", "배의 밑바닥이나 물가의 바위에\n머리를 부딪쳐도 신경 쓰지 않고\n헤엄치는 무사태평한 포켓몬이다.", "De nature placide, il a tendance à\nse cogner la tête contre les récifs\net autres bateaux de passage.", "Es ist sehr unbekümmert und stört\nsich nicht daran, wenn es während\ndes Schwimmens an etwas stößt.", "Es de naturaleza sencilla. Cuando\nnada, se choca de cabeza contra\nbarcos o rocas y no le importa.", "È molto tranquillo per natura. Non\nsi scompone se nuotando sbatte\nla testa contro barche e scogli.", "It has an easygoing nature. It\ndoesn't care if it bumps its head on\nboats and boulders while swimming.") },
            { PBESpecies.Espeon, new PBELocalizedString("ぜんしんの　こまやかな　たいもうで\nくうきの　ながれを　かんじて　てきの\nかんがえや　てんこうを　よそくする。", "전신의 세밀한 털로\n공기의 흐름을 알아차려 상대의\n생각이나 날씨를 예측한다.", "Sa fourrure ultrasensible détecte les\nvibrations de l'air. Il peut ainsi prédire\nle temps ou lire les pensées adverses.", "Die Haare seines Fells sind so feinfühlig,\ndass es am Wind ablesen kann, was seine\nGegner denken und wie das Wetter wird.", "Su pelaje es tan sensible que percibe\nlos cambios en el aire y predice así los\nataques de sus enemigos y el tiempo.", "Grazie al pelo sensibile, percepisce pure\ngli spostamenti d'aria. Sa leggere nel\npensiero e prevedere il tempo.", "Its fur is so sensitive, it can feel\nminute shifts in the air and predict the\nweather...and its foes' thoughts.") },
            { PBESpecies.Umbreon, new PBELocalizedString("つきの　はどうを　あびると\nぜんしんの　わっかもようが　ひかり\nふしぎな　ちからに　あふれるのだ。", "달의 파동을 쬐면\n전신의 고리 모양이 빛나며\n이상한 힘이 넘친다.", "Quand il s'expose à la lumière de\nla lune, ses anneaux brillent et il\ndéveloppe de mystérieux pouvoirs.", "Wird es der Aura des Mondes ausgesetzt,\nglühen seine Ringe und es wird von einer\nmysteriösen Kraft durchströmt.", "Cuando lo baña la luz de la luna, los\ncírculos de su pelaje brillan levemente y\nse ve revestido de un poder misterioso.", "Quando è esposto alla luce lunare\ni cerchi sul suo corpo brillano e si\ncarica di uno strano potere.", "When exposed to the moon's aura,\nthe rings on its body glow faintly\nand it's filled with a mysterious power.") },
            // { PBESpecies.198, new PBELocalizedString("ヤミカラスを　みかけて　ふよういに\nあとを　つけていくと　まよわされ\nやまみちに　おいてけぼりに　される。", "니로우를 발견했을 때\n조심성 없이 따라가면\n길을 잃고 산중에 혼자 남게 된다.", "Quand il est en danger, il tente de\nsemer ses poursuivants dans les\nchemins montagneux.", "Wird es entdeckt, lockt es seinen\nVerfolger auf eine Jagd in die\nBerge, wo es ihn dann abschüttelt.", "Si algún incauto logra detectarlo,\nse verá abocado a perseguirlo\nhasta perderse en las montañas.", "Se individuato, cerca di farsi\ninseguire, per poi far perdere le\nsue tracce su sentieri di montagna.", "If spotted, it will lure an unwary\nperson into chasing it then lose\nthe pursuer on mountain trails.") },
            // { PBESpecies.199, new PBELocalizedString("シェルダーに　かまれたことによって\nノーベルしょうを　じゅしょうした\nかがくしゃなみの　ちのうを　えた。", "셀러에 물린 것을 계기로\n노벨상을 수상한\n과학자 수준의 지능을 얻었다.", "La morsure de Kokiyas a fait de lui\nun génie dont l'intelligence rivalise\navec celle d'un prix Nobel.", "Wird es von Muschas gebissen, wird\nes so intelligent, dass es sich mit\nNobelpreisträgern messen kann.", "Al ser mordido por un Shellder,\ndesarrolló una inteligencia propia\nde un ganador del premio Nobel.", "Il morso di Shellder gli ha infuso\nun'intelligenza pari a quella di\nrinomati scienziati.", "Being bitten by Shellder gave it\nintelligence comparable to that of\naward-winning scientists.") },
            { PBESpecies.Misdreavus, new PBELocalizedString("まよなか　ひとを　おどろかせては\nこわがるこころを　あつめて　じぶんの\nエネルギーに　している　ポケモン。", "한밤중에 사람을 놀라게 하고\n무서워하는 마음을 모아 자신의\n에너지로 만드는 포켓몬이다.", "Il fait peur aux aventuriers en\npleine nuit et se nourrit de leur\nfrayeur.", "Ein Pokémon, das Menschen mitten in\nder Nacht erschreckt. Es sammelt die\nAngst als seine Energie.", "Sorprende a la gente en mitad\nde la noche y acumula su miedo\ncomo energía.", "Un Pokémon che terrorizza la gente nel\ncuore della notte. Assorbe la paura per\nusarla come energia.", "A Pokémon that startles people in\nthe middle of the night. It gathers\nfear as its energy.") },
            { PBESpecies.Unown_A, new PBELocalizedString("\xFF11ぴきで　いても　なにも　おきないが\n\xFF12ひき　いじょうで　ならぶと\nなにかの　ちからが　めばえるという。", "혼자 있으면 아무 일도 일어나지\n않지만 두 마리 이상 있게 되면\n어떤 힘이 생긴다고 한다.", "Quand il est seul, il ne se passe\nrien... Mais en groupe, il semble\nhabité par un mystérieux pouvoir.", "Sind sie zu zweit oder mehr, entsteht\neine eigentümliche Kraft. So sagt man\nzumindest.", "Si están en solitario, no pasa nada;\npero, si se juntan dos o más, se\ndice que surge un extraño poder.", "Un solo esemplare non produce alcun\neffetto, ma se ce ne sono due o più,\nemerge uno strano potere.", "When alone, nothing happens.\nHowever, if there are two or more,\nan odd power is said to emerge.") },
            // { PBESpecies.202, new PBELocalizedString("くろい　しっぽを　ひっしになって\nかくすのは　しっぽに　ひみつがある\nしょうこだと　かんぐられている。", "까만 꼬리를 필사적으로\n숨기는 것은 꼬리에 비밀이 있다는\n증거라고 의심받고 있다.", "Il cherche désespérément à cacher\nsa queue noire. Certains pensent\nqu'elle renferme un secret.", "Verzweifelt versucht es, seinen\nschwarzen Schweif zu verstecken.\nEr soll ein Geheimnis enthalten.", "Siempre intenta ocultar su cola,\npor lo que muchos creen que\ncontiene un secreto.", "Cerca di tenere nascosta la sua coda\nnera ad ogni costo. Pare che essa celi\nun segreto.", "It desperately tries to keep its\nblack tail hidden. It is said to be\nproof the tail hides a secret.") },
            // { PBESpecies.203, new PBELocalizedString("しっぽの　あたまにも　ちいさな\nのうがあり　うしろを　むいたままでも\nほんのうで　たたかうことが　できる。", "꼬리의 머리에도 작은\n뇌가 있어서 뒤를 향한 채로도\n본능적으로 싸울 수 있다.", "La tête qu'il a sur la queue dispose\nde son propre cerveau et lui\npermet de couvrir ses arrières.", "Es kann sich in beide Richtungen\nverteidigen, da der Kopf auf seinem\nSchweif ein kleines Gehirn besitzt.", "La cabeza de su cola también tiene\nun pequeño cerebro, así que puede\ncombatir por delante o por detrás.", "Sulla coda ha una testa con un piccolo\ncervello. Riesce a lottare anche se\nil nemico è alle sue spalle.", "The head on its tail contains a\nsmall brain. It can instinctively\nfight even while facing backward.") },
            // { PBESpecies.204, new PBELocalizedString("きのみに　そっくり。まちがわれて\nとりポケモンに　つつかれてしまうが\nかたい　カラで　まもられている。", "나무열매와 똑 닮았다. 실수로\n새 포켓몬에게 쪼이기도 하지만\n단단한 껍질이 몸을 보호하고 있다.", "Il ressemble à une pomme de pin.\nSa carapace le protège des Pokémon\nOiseaux qui le picorent par erreur.", "Es sieht aus wie ein Tannenzapfen.\nSeine Schale schützt es vor Vogel-\nPokémon, die an ihm picken wollen.", "Es como una piña piñonera. Su\ncoraza lo protege de los pájaros\nque lo picotean por error.", "Ha l'aspetto di una pigna. Il suo guscio\nlo protegge dai Pokémon uccello che lo\nbeccano per errore.", "It looks just like a pinecone.\nIts shell protects it from bird\nPokémon that peck it by mistake.") },
            // { PBESpecies.205, new PBELocalizedString("こうてつの　カラで　まもられている。\nすきまから　めだまが　のぞいているが\nなかみの　しょうたいは　なぞのまま。", "강철 껍질이 몸을 보호하고 있다.\n틈새에서 엿보고 있는 눈이 있지만\n내용물의 정체는 수수께끼다.", "Il est prisonnier d'une coquille\nd'acier. Ses yeux vigilants sont la\nseule partie visible de son corps.", "Dieses Pokémon ist von einer Stahlhülle\numgeben. Seine stechenden Augen sind\nalles, was man von ihm sieht.", "Se protege con su concha de acero\nde tal manera que solo se pueden\nver sus ojos.", "È incassato in una conchiglia d'acciaio.\nA parte gli occhi scrutatori, nessuno\nsa cosa ci sia all'interno.", "It is encased in a steel shell. Its\npeering eyes are all that can be\nseen of its mysterious innards.") },
            // { PBESpecies.206, new PBELocalizedString("くらいばしょに　めいろを　つくる。\nだれかに　みられると　しっぽで\nじめんを　ほって　にげようとする。", "어두운 장소에 미로를 만든다.\n누군가에게 발견되면 꼬리로\n땅을 파서 도망가려 한다.", "Il construit des labyrinthes dans les\nendroits sombres. Il fuit en creusant à\nl'aide de sa queue quand on l'approche.", "Es baut an dunklen Orten Labyrinthe.\nWird es von jemandem entdeckt, gräbt es\nein Loch und versucht zu entkommen.", "Construye laberintos en lugares\noscuros. Si alguien lo mira, huye\ncavando un agujero con su cola.", "Costruisce labirinti in luoghi bui.\nSe qualcuno lo vede, si dà alla fuga\nscavando il terreno con la coda.", "It creates mazes in dark locations.\nWhen spotted, it flees into the\nground by digging with its tail.") },
            // { PBESpecies.207, new PBELocalizedString("ねらった　えものに　はりついて\nおどろきとまどっている　あいだに\nしっぽの　トゲを　さしこんでくる。", "노린 먹이에 달라붙어\n놀라 당황하고 있는 사이에\n꼬리의 바늘을 찌른다.", "Il s'agrippe à ses proies et profite\nde ce moment de confusion pour les\nfrapper avec son dard.", "Es klammert sich an seiner Beute fest\nund nutzt den Überraschungseffekt,\num seinen Giftstachel in sie zu bohren.", "Se agarra a su presa con firmeza y,\naprovechando su estupor, le clava\nel aguijón de su cola.", "D'un tratto salta addosso alla preda e,\napprofittando del suo smarrimento,\nla infilza con l'aculeo che ha sulla coda.", "It clamps on to its chosen prey then\njabs the stinger on its tail into the\nprey while it's stunned with surprise.") },
            // { PBESpecies.208, new PBELocalizedString("つちと　いっしょに　のみこんだ\nはがねが　からだを　へんかさせて\nダイヤモンドより　かたくなった。", "흙과 함께 삼킨\n강철이 몸을 변화시켜\n다이아몬드보다 단단해졌다.", "Son corps est composé du fer contenu\ndans la terre qu'il mange. Avec le temps,\nil est devenu plus dur que le diamant.", "Durch all die eisenhaltige Erde,\ndie es verschluckt hat, wurde sein\nKörper härter als ein Diamant.", "El acero que ingirió junto con la tierra\ntransformó su cuerpo y le confirió una\ndureza mayor que la del diamante.", "Il ferro contenuto nella terra di cui si\nnutre ha trasformato il suo corpo\nrendendolo più duro del diamante.", "The iron it ingested with the soil it\nswallowed transformed its body and\nmade it harder than diamonds.") },
            // { PBESpecies.209, new PBELocalizedString("ちいさな　ポケモンが　にげだすほどの\nこわいかおが　ぎゃくに　かわいいと\nじょせいに　にんきの　ポケモン。", "작은 포켓몬이 도망칠 정도의\n무서운 얼굴이 반대로 귀엽다며\n여성에게 인기가 있는 포켓몬이다.", "Son visage horrible fait fuir les\npetits Pokémon. Par contre, les\nfemmes le trouvent mignon.", "Kleine Pokémon fliehen beim Anblick\nseines Gesichts. Frauen aber finden\nes niedlich.", "Los Pokémon pequeños huyen al\nver su cara agresiva. No obstante,\npara muchas féminas es mono.", "I Pokémon più piccoli fuggono alla\nvista della sua faccia terrificante.\nMa le donne lo trovano carino.", "Small Pokémon flee from its scary\nface. It is, however, considered\nby women to be cute.") },
            // { PBESpecies.210, new PBELocalizedString("かおに　にあわず　おくびょう。\nしかし　ひとたび　おこりはじめると\nおおきな　キバで　はんげきする。", "얼굴에 어울리지 않게 겁이 많다.\n그러나 한번 화내기 시작하면\n큰 이빨로 반격한다.", "En dépit des apparences, c'est un\ngrand timide. Quand il s'énerve, il\nmord de ses énormes crocs.", "Es ist trotz seines Äußeren schüchtern.\nWird es wütend, schnappt es mit seinen\nFängen zu.", "A pesar de su aspecto, es muy\ntímido. Sin embargo, cuando se\nenfada, ataca con sus colmillos.", "Malgrado il suo aspetto, è molto timido.\nSe si arrabbia, tuttavia, colpisce con\nle sue enormi zanne.", "It is timid in spite of its looks.\nIf it becomes enraged, however,\nit will strike with its huge fangs.") },
            // { PBESpecies.211, new PBELocalizedString("ぜんしんの　どくバリを\nしほうはっぽうに　うちだす。\nまるい　からだは　およぎが　にがて。", "전신의 독침을\n사방팔방으로 쏘아댄다.\n둥근 몸은 헤엄치는데 서투르다.", "Il envoie ses piquants empoisonnés\nà la ronde. Sa forme sphérique en\nfait un piètre nageur.", "Es verschießt die giftigen Stacheln\nseines Körpers in alle Richtungen.\nEs ist kein guter Schwimmer.", "Lanza púas venenosas en todas\ndirecciones. Debido a su forma\nredonda, es muy mal nadador.", "Spara i suoi aculei velenosi in tutte\nle direzioni. Essendo un po' tondetto,\nnon è un gran nuotatore.", "It shoots the poison spines on its\nbody in all directions. Its round\nform makes it a poor swimmer.") },
            // { PBESpecies.212, new PBELocalizedString("めだまもようの　ついた　はさみを\nふりあげて　いかくする　だけでなく\nそのまま　ふりおろすので　きけんだ。", "눈알 무늬가 붙은 집게를\n치켜들어 위협하는 것뿐만 아니라\n그대로 내려치므로 위험하다.", "Les yeux sur ses pinces servent à\nintimider l'ennemi avant de passer\nà l'attaque.", "Setzt seine mit Markierungen\nversehenen Scheren ein,\num Gegner einzuschüchtern.", "Intimida a los enemigos con los\ndibujos de ojos de sus pinzas,\nque agita amenazadoramente.", "Solleva le chele su cui sono disegnati\ndegli occhi. Poi le abbassa brandendole\npericolosamente.", "It raises its pincers with eyelike\nmarkings for intimidation. It also\nswings them down dangerously.") },
            // { PBESpecies.213, new PBELocalizedString("ツボのような　こうらの　なかに\nためこんだ　きのみは　いつのまにか\nドロドロの　ジュースに　かわる。", "항아리 같은 등껍질 속에\n모은 나무열매는 어느샌가\n걸쭉한 주스로 변한다.", "Les Baies qu'il stocke dans sa carapace\nen forme d'urne fermentent et\nproduisent de délicieux jus.", "In seinem topfförmigen Panzer\ngelagerte Beeren verwandeln sich\nim Nu zu einem dickflüssigen Saft.", "Las bayas que almacena en su caparazón\ncon forma de tarro se convierten al final\nen un espeso zumo.", "Usa il guscio a mo' di vaso per stipare\nle bacche, che dopo un po' fermentano\ne si trasformano in un succo delizioso.", "The berries stored in its\nvaselike shell eventually\nbecome a thick, pulpy juice.") },
            // { PBESpecies.214, new PBELocalizedString("どんなに　おもい　あいてでも\nじまんの　ツノを　つかい　じめんごと\nとおくまで　ほうりなげてしまう。", "아무리 무거운 상대라도\n자랑스러운 뿔을 사용해 땅째로\n멀리까지 내던져버린다.", "Il peut envoyer valser n'importe\nquel adversaire avec ses cornes,\npeu importe son poids.", "Mit seinem prämierten Horn schleudert\nes jeden noch so schweren Gegner bis\nin weite Ferne.", "Con su preciado cuerno, es capaz de\nlanzar por los aires a cualquier enemigo\npor fuerte que este sea.", "Vanta un corno possente con il quale\nscaglia l'avversario a grande distanza,\nqualunque sia il suo peso.", "No matter how heavy its opponents,\nit flings them far away\nwith its prized horn.") },
            // { PBESpecies.215, new PBELocalizedString("ずるがしこい　ポケモンで　ゆびに\nかくした　ながい　ツメを　いきなり\nのばして　あいてを　ひるませる。", "약삭빠른 포켓몬으로 손가락에\n숨긴 긴 손톱을 갑자기\n늘려 상대를 풀죽게 한다.", "Ce Pokémon rusé effraie ses proies en\ndéployant soudainement les longues\ngriffes rétractiles de ses doigts.", "Dieses durchtriebene Pokémon lässt seine\nGegner zurückschrecken, indem es auf\neinmal seine langen Krallen ausfährt.", "Este astuto Pokémon hace retroceder a\nsus enemigos con las largas garras que\nnormalmente lleva ocultas.", "Un Pokémon scaltro e imprevedibile.\nFa tentennare l'avversario sguainando\ni suoi lunghi artigli all'improvviso.", "A smart and sneaky Pokémon,\nit makes its opponents flinch by suddenly\nshowing the claws hidden in its paws.") },
            // { PBESpecies.216, new PBELocalizedString("あまい　ミツを　てのひらに\nしみこませて　いつも　なめている。\nヒメグマによって　あじが　ちがう。", "달콤한 꿀을 손바닥에\n배어들게 해서 항상 핥고 있다.\n깜지곰에 따라 맛이 다르다.", "Il baigne ses griffes dans le miel\npour les lécher. Chaque paire\nde pattes a un goût unique.", "Es lässt Honig in seine Pranken\neindringen, so dass es immer\nwelchen dabeihat.", "Deja que la miel se le pegue a las\ngarras para lamerla más tarde.\nCada una de ellas sabe diferente.", "Immerge in continuazione gli arti\nsuperiori nel miele per poterli leccare.\nOgni assaggio ha un sapore unico.", "It lets honey soak into its paws\nso it can lick them all the time.\nEvery set of paws tastes unique.") },
            // { PBESpecies.217, new PBELocalizedString("なわばりにある　おいしい　きのみや\nくだものの　なる　き　には\nツメで　きずあとを　つける。", "영역 내에 있는 맛있는 나무열매나\n과일이 열리는 나무에는\n발톱으로 흔적을 남긴다.", "Il marque de ses griffes les arbres\nde son territoire qui portent des\nBaies ou des fruits.", "Es durchstreift sein Revier und\nmarkiert Bäume, die Früchte\noder Beeren tragen, mit Kratzern.", "Marca con arañazos los árboles de\nsu territorio que dan bayas y frutas.", "Nel suo territorio, lascia graffi sugli\nalberi che hanno bacche o frutti\ndeliziosi.", "In its territory, it leaves\nscratches on trees that bear\ndelicious berries or fruits.") },
            // { PBESpecies.218, new PBELocalizedString("ようがんで　できた　からだを　もつ。\nたえず　うごいていないと　からだが\nひえて　かたまってしまうのだ。", "용암으로 된 몸을 가지고 있다.\n끊임없이 움직이지 않으면 몸이\n식어 굳어져 버린다.", "Son corps est fait de magma.\nS'il cesse de bouger, il refroidit\net durcit.", "Sein Körper besteht aus Magma. Bleibt\nes nicht ständig in Bewegung, kühlt es\naus und verhärtet sich.", "Su cuerpo se compone de magma.\nSi deja de moverse, se enfría y\nse endurece.", "Nel suo corpo scorre magma. Se non si\nmuove continuamente, il suo corpo si\nraffredda e s'indurisce.", "Its body is made of magma.\nIf it doesn't keep moving, its\nbody will cool and harden.") },
            // { PBESpecies.219, new PBELocalizedString("たいおんは　やく\xFF11まんど。\nマグマが　かたまって　できた　カラの\nすきまから　ほのおを　ふきだす。", "체온은 약 10000도다.\n마그마가 굳어 생긴 껍질의\n틈새로부터 불꽃을 뿜어낸다.", "Sa température corporelle avoisine\nles 10 000 °C. Des flammes fusent\ndes fissures de sa coquille.", "Seine Körpertemperatur beträgt\netwa 10 000 Grad. Aus seiner Schale\ntreten immer wieder Flammen aus.", "Su cuerpo está a una temperatura\nde 10 000°. De las fisuras de su\ncuerpo escapan llamas.", "Ha una temperatura corporea di circa\n10.000°C. Dai fori del guscio fuoriescono\nintense fiammate.", "Its body temperature is roughly\n18,000 degrees F. Flames spout\nfrom gaps in its hardened shell.") },
            // { PBESpecies.220, new PBELocalizedString("はなさきを　こすりあわせ　じめんを\nほりながら　エサを　さがしている。\nたまに　おんせんを　ほりあてる。", "코끝을 비벼 땅을\n파면서 먹이를 찾는다.\n가끔 온천도 파낸다.", "Il fouille le sol de sa truffe à la\nrecherche de nourriture, et découvre\nparfois des sources chaudes.", "Spürt mit seiner Nase im Erdreich Futter\nauf und gräbt danach. Manchmal stößt es\ndabei auf heiße Quellen.", "Busca comida escarbando el suelo con la\npunta de su hocico. En ocasiones llega a\nencontrar manantiales cavando.", "Annusa il terreno e scava alla ricerca\ndi cibo. A volte scopre persino delle\nsorgenti termali.", "Rooting the tip of its snout\ninto the ground, it searches for food.\nSometimes it even digs up a hot spring.") },
            // { PBESpecies.221, new PBELocalizedString("きゅうかくに　すぐれ　こおっている\nじめんの　したに　うもれた\nキノコだって　さがしだすのだ。", "후각이 뛰어나\n언 땅 아래 파묻힌\n버섯도 찾아낸다.", "Son odorat très développé lui permet\nde trouver les champignons cachés\nsous la terre gelée.", "Sein Geruchssinn ist stark genug\nausgeprägt, um damit Pilze unter\nvereisten Erdmassen aufzuspüren.", "Su tremendamente desarrollado sentido\ndel olfato le permite desenterrar setas\nocultas bajo suelos congelados.", "Con l'olfatto sopraffino riesce persino\na scovare i funghi che sono sepolti sotto\nla terra ghiacciata.", "With its excellent sense of smell,\nit's even able to find mushrooms that\nare buried under frozen ground.") },
            // { PBESpecies.222, new PBELocalizedString("みなみの　きれいな　うみをこのむ。\nよごれた　うみだと　サンゴの　えだは\nいろがくすみ　ボロボロになるのだ。", "남쪽의 깨끗한 바다를 좋아한다.\n더러운 바다면 산호 가지는\n색이 거무스레해지고 엉망이 된다.", "On le trouve souvent dans les mers\nclaires du sud. L'eau polluée décolore\nson corail et le fait dépérir.", "Hält sich lieber in den sauberen Seen im\nSüden auf. Seine Korallenarme verlieren\nin verschmutztem Wasser Farbe und Form.", "Adoran las aguas cristalinas de los mares\ndel sur, pues su coral pierde color y se\ndeteriora en aguas sucias.", "Preferisce i limpidi mari del sud.\nIn quelli inquinati, invece, i suoi coralli\nsi logorano e perdono il loro colore.", "They prefer unpolluted southern seas.\nTheir coral branches lose their color\nand deteriorate in dirty water.") },
            // { PBESpecies.223, new PBELocalizedString("くちから　ふきだす　すいりゅうは\n\xFF11\xFF10\xFF10メートルさきで　うごく\nえものに　だって　めいちゅうする。", "입에서 뿜어내는 수류는\n100m 앞에서 움직이는\n먹이조차 명중시킨다.", "Son puissant jet d'eau ne manque\njamais sa cible, même à plus de\n100 m de distance.", "Selbst aus 100 Metern Entfernung\ntreffen die Wassersalven, die es mit\nseinem Maul abfeuert, ihr Ziel.", "Los chorros de agua que escupe pueden\nalcanzar a presas en movimiento a una\ndistancia de hasta 100 metros.", "I getti d'acqua che spara dalla bocca\nriescono a colpire una preda in movimento\nanche a 100 metri di distanza.", "The water they shoot from their mouths\ncan hit moving prey from more than\n300 feet away.") },
            // { PBESpecies.224, new PBELocalizedString("あなに　はいりたがる　せいしつで\nいわあなや　ツボを　このみ　そこから\nスミを　ふきだして　こうげきする。", "구멍에 들어가고 싶어 하는 성질로\n바위굴이나 항아리를 좋아해 거기서\n먹물을 뿜어내 공격한다.", "Il adore se cacher dans les fissures\net les épaves, d'où il attaque en\ncrachant de l'encre.", "Es verkriecht sich gerne in Löchern, von\nwo aus es Gegner mit Tinte beschießt.\nEs bevorzugt Felsspalten und Vasen.", "Tiene querencia por los agujeros.\nAtaca escupiendo tinta metido en las\ngrietas de rocas o en recipientes.", "Ama rintanarsi nei vasi o nelle fessure\ndella roccia, da dove attacca sparando\ngetti d'inchiostro.", "It has a tendency to want to be in holes.\nIt prefers rock crags or pots and\nsprays ink from them before attacking.") },
            // { PBESpecies.225, new PBELocalizedString("\xFF11にちじゅう　エサを　はこぶ。\nやまで　そうなんした　ひとがいると\nエサを　わけあたえ　たすけている。", "온종일 먹이를 나른다.\n산에서 조난당한 사람이 있으면\n먹이를 나눠 도와주고 있다.", "Il passe ses journées à transporter\nde la nourriture. Il l'offre souvent\naux gens égarés en montagne.", "Es trägt den ganzen Tag Essen mit sich\nherum, das es mit Menschen teilt, die in\nden Bergen feststecken.", "Lleva siempre comida consigo.\nSi se encuentra con montañeros\nque vagan perdidos, la comparte.", "Porta sempre del cibo con sé e lo\ncondivide volentieri con gli sfortunati\nche si sono persi in montagna.", "It carries food all day long.\nWhen someone is lost in the\nmountains, it shares that food.") },
            // { PBESpecies.226, new PBELocalizedString("およいで　スピードが　のってくると\nなみのうえに　とびだし　そのまま\n\xFF11\xFF10\xFF10メートルも　かっくう　する。", "헤엄쳐서 스피드가 빨라지면\n파도 위에 뛰어올라 그대로\n100m나 활공한다.", "Il peut planer au-dessus des vagues\nsur plus de 100 m en prenant son\nélan dans la mer.", "Schwimmt es schnell genug, kann es über\ndie Wellen springen und bis zu 100 Meter\ndurch die Lüfte gleiten.", "Acumula velocidad nadando y puede saltar\nfuera del agua, alcanzando 100 metros de\naltura, para descender luego planeando.", "Prende velocità nuotando e, quando è\npronto, usa le onde come trampolini per\nsaltare a volte anche fino a 100 metri.", "If it builds up enough speed swimming, it\ncan fly over 300 feet out of the water\nfrom the surface of the ocean.") },
            // { PBESpecies.227, new PBELocalizedString("がんじょうで　おもそうな　てつの\nからだだが　うすくて　かるいので\nじそく\xFF13\xFF10\xFF10キロで　とべる。", "튼튼하고 무거워 보이는 철의\n몸이지만 얇고 가벼워\n시속 300km로 날 수 있다.", "Son corps est fait d'un acier résistant\nmais très fin et léger. Il peut voler à\nplus de 300 km/h.", "Sein stählerner Körper ist dünner und\nleichter, als er wirkt und erlaubt eine\nFluggeschwindigkeit von bis zu 300 km/h.", "Aunque da la impresión de ser muy pesado\ncon ese cuerpo tan robusto, es muy\nligero y puede volar a 300 km/h.", "Il suo corpo metallico dà l'impressione di\nessere pesante, ma in realtà è leggero e\ngli consente di volare a 300 km/h.", "Its heavy-looking iron body is\nactually thin and light, so it can\nfly at speeds over 180 mph.") },
            // { PBESpecies.228, new PBELocalizedString("さまざまな　なきごえを　つかいわけ\nなかまと　コミュニケーションしながら\nかりを　おこなう　かしこさをもつ。", "수많은 울음소리를 가려 써서\n동료들과 의사소통을 하며\n사냥을 하는 지능을 가지고 있다.", "Il est assez évolué pour chasser\nen meute et communiquer par\ndes séries de cris modulés.", "Es jagt in Rudeln und kommuniziert\nüber eine ganze Reihe von Rufen mit\nanderen Hunduster.", "Tiene suficiente inteligencia para\ncazar en manada. Se comunica\ncon los demás a través de gritos.", "Va a caccia in branchi e comunica con\ngli altri emettendo una varietà di versi.", "It is smart enough to hunt in\npacks. It uses a variety of cries\nfor communicating with others.") },
            // { PBESpecies.229, new PBELocalizedString("おこったときに　くちから　ふきだす\nほのおには　どくそも　まじっていて\nやけどになると　いつまでも　うずく。", "화가 났을 때 입에서 뿜어내는\n불꽃에는 독소도 섞여 있기에\n화상을 입으면 계속 욱신거린다.", "En colère, il crache des flammes\ncontenant une toxine qui peut\ncauser des dégâts irréversibles.", "Ist es wütend, spuckt es giftige\nFlammen. Die Schmerzen der\nVerbrennungen dauern ewig an.", "Las llamas que respira cuando se\nenfada contienen toxinas. Si causan\nuna quemadura, dolerá toda la vida.", "Se s'infuria, sputa fiamme contenenti\nuna tossina. Se ci si brucia, il dolore\npermane a lungo.", "The flames it breathes when angry\ncontain toxins. If they cause a\nburn, it will hurt forever.") },
            // { PBESpecies.230, new PBELocalizedString("かいていどうくつに　すんでいる。\nキングドラが　みうごきすると\nきょだいな　うずしおが　うまれる。", "해저동굴에 살고 있다.\n킹드라가 움직이면\n거대한 소용돌이가 생겨난다.", "Chacun de ses déplacements provoque\ndes tourbillons. Il vit dans les grottes\nsous-marines.", "Es lebt in Höhlen auf dem Meeresgrund.\nJedes Mal, wenn es sich bewegt,\nentsteht ein Strudel.", "Vive en cavernas del fondo marino\ny crea grandes remolinos cuando\nse mueve.", "Vive in caverne sui fondali marini e crea\nvortici giganteschi ogni volta che si\nmuove.", "It lives in caves on the seafloor\nand creates giant whirlpools\nevery time it moves.") },
            // { PBESpecies.231, new PBELocalizedString("からだは　ちいさいが　ちからもち。\nおとなの　ひとを　かるがると\nせなかに　のせて　あるいてしまう。", "몸은 작지만 힘이 장사다.\n어른인 사람을 가볍게\n등에 태우고 걸어다닌다.", "Il est fort malgré son aspect ramassé.\nIl n'a aucun mal à porter un humain\nadulte sur son dos.", "Trotz seiner geringen Größe ist es\nstark. Es kann einen Erwachsenen\nmühelos auf dem Rücken tragen.", "A pesar de su tamaño reducido,\nes tan fuerte que puede llevar a un\nhumano a su espalda con facilidad.", "Non è molto grande, ma è forte. Può\nsollevare un adulto e trasportarlo\nsul dorso senza fatica.", "It is strong despite its compact\nsize. It can easily pick up and\ncarry an adult human on its back.") },
            // { PBESpecies.232, new PBELocalizedString("からだを　まるめて　かいてんしながら\nとっしんする　こうげき。いちげきで\nみんかを　ばらばらに　ふきとばす。", "몸을 웅크려 회전하면서\n돌진하며 공격한다. 민가를\n일격에 조각조각 날려버린다.", "Il attaque en se roulant en boule\npour percuter l'ennemi. Il peut\nabattre une maison d'un seul coup.", "Wenn es angreift, rollt es sich\nzusammen und auf den Gegner zu.\nEs kann Häuser zum Einsturz bringen.", "Se enrolla sobre sí mismo y se\nlanza rodando contra el enemigo.\nPuede derribar casas de un golpe.", "Si arrotola a palla e attacca il nemico.\nRiesce ad abbattere una casa con\nun solo colpo.", "It attacks by curling up then\nrolling into its foe. It can blow\napart a house in one hit.") },
            // { PBESpecies.233, new PBELocalizedString("わくせい　かいはつが　できるように\nバージョンアップ　されたのだが\nまだまだ　むずかしかった　ようだ。", "행성개발을 할 수 있도록\n버전 업되었지만\n아직은 힘든 듯하다.", "Il a subi une mise à jour censée lui\npermettre d'explorer d'autres\nplanètes... C'est un échec.", "Wurde zur Erforschung anderer\nPlaneten weiterentwickelt. Diesem\nAnspruch wurde es nicht gerecht.", "Fue mejorado para posibilitar\nla exploración de otros planetas.\nPero no estuvo a la altura.", "È stato potenziato per consentire\nl'esplorazione di altri pianeti.\nTuttavia, non ha avuto successo.", "It was upgraded to enable the\nexploration of other planets.\nHowever, it failed to measure up.") },
            // { PBESpecies.234, new PBELocalizedString("ツノを　みつめていると　わっかの\nちゅうしんに　すいこまれそうな\nふしぎな　きぶんに　なってしまう。", "뿔을 응시하고 있으면 원의\n중심에 빨려 들어가는 것 같은\n이상한 기분이 든다.", "Quiconque observe ses antennes\nressent une sensation étrange,\ncomme si leur centre l'attirait.", "Starrt man auf sein Geweih,\nbekommt man das seltsame Gefühl,\nin dessen Mitte gezogen zu werden.", "Mirar a su cornamenta provoca\nuna extraña sensación de\npérdida de equilibrio.", "Chi fissa le sue corna riceve una strana\nsensazione, quasi come se venisse\nrisucchiato.", "Staring at its antlers creates\nan odd sensation as if one were\nbeing drawn into their centers.") },
            { PBESpecies.Smeargle, new PBELocalizedString("しっぽを　ふでのように　つかって\nなわばりに　マークを　えがく。\nその　しゅるいは　\xFF15\xFF10\xFF10\xFF10いじょう。", "꼬리를 붓처럼 써서\n영역에 마크를 그린다.\n그 종류는 5000개 이상이다.", "Il marque son territoire en maniant\nsa queue comme un pinceau. On\ndénombre plus de 5 000 marques.", "Sein Revier markiert es mit seinem\npinselartigen Schweif. Es kennt mehr\nals 5 000 Markierungen.", "Marca su territorio usando su cola\na modo de pincel. Ha hecho más\nde 5000 marcas diferentes.", "Delimita il suo territorio usando la coda\ncome se fosse un pennello. Ha lasciato\noltre 5000 segni diversi.", "It marks its territory by using its\ntail like a paintbrush. There are\nmore than 5,000 different marks.") },
            // { PBESpecies.236, new PBELocalizedString("けんかっぱやいことで　ゆうめい。\nじぶんよりも　おおきな　あいてに\nいどみかかるので　きずが　たえない。", "툭하면 싸우려 드는 것으로\n유명하다. 자신보다 큰 상대에게\n도전하므로 상처가 끊이지 않는다.", "Il est réputé pour sa combativité.\nIl se blesse toujours en défiant\ndes ennemis plus grands.", "Es ist bekannt für seine\nKampfbegierde. Es erholt sich\nständig von Verletzungen.", "Famoso por su disposición a la\nlucha. Siempre tiene heridas por\nluchar con enemigos más grandes.", "È famoso per la sua brama di lotta.\nQuando sfida nemici più forti di lui,\nsubisce sempre ferite.", "It is famous for its eagerness to\nfight and always nurses injuries\nfrom challenging larger foes.") },
            // { PBESpecies.237, new PBELocalizedString("コマのように　かいてんしながら\nたたかう。えんしんりょくの　パワーで\nはかいりょくは　\xFF11\xFF10ばいだ。", "팽이처럼 회전하면서\n싸운다. 원심력의 파워로\n파괴력은 10배다.", "Il combat en tournoyant comme une\ntoupie. La force centrifuge décuple\nsa puissance destructrice.", "Es kämpft, während es sich wie ein\nKreisel dreht. Die Zentrifugalkraft\nerhöht die Kampfkraft um 10.", "Gira a gran velocidad al luchar.\nLa fuerza centrífuga multiplica\nsu poder de destrucción por diez.", "Combatte mentre gira come una trottola.\nLa forza centrifuga decuplica il suo\npotere distruttivo.", "It fights while spinning like a top.\nThe centrifugal force boosts its\ndestructive power by 10.") },
            // { PBESpecies.238, new PBELocalizedString("なんでも　くちびるで　ふれてみて\nたしかめる。すきな　ものも　きらいな\nものも　くちびるが　おぼえている。", "무엇이든 입술로 건드려보고\n확인한다. 좋아하는 것도 싫어하는\n것도 입술이 기억하고 있다.", "Il goûte à tout du bout des lèvres.\nElles gardent en mémoire ses\ngoûts et ses dégoûts.", "Dieses Pokémon berührt alles mit den\nLippen. Diese merken sich, was es mag\nund nicht mag.", "Analiza todo tocándolo con los\nlabios. Así puede recordar las\ncosas que le gustan y disgustan.", "Analizza tutto con le labbra e con esse\nriesce a memorizzare ciò che gli piace e\nciò che non gli piace.", "It tests everything by touching\nwith its lips, which remember\nwhat it likes and dislikes.") },
            // { PBESpecies.239, new PBELocalizedString("りょううでを　ぐるぐる　まわして\nでんきを　はっせい　させると\nツノのあいだが　あおじろく　ひかる。", "양팔을 빙글빙글 돌려\n전기를 발생시키면\n뿔 사이가 푸르스름하게 빛난다.", "Ses cornes s'illuminent lorsqu'il fait\ntourner ses bras pour générer de\nl'électricité.", "Wenn es seine Arme kreisen lässt, um\nStrom zu erzeugen, entstehen zwischen\nseinen Hörnern hellblaue Funken.", "Al girar ambos brazos para generar\nelectricidad, sus cuernos se iluminan\ncon una luz blanquecina.", "Quando rotea le braccia per produrre\nelettricità, le sue corna si illuminano.", "Spinning its arms around\nto generate electricity makes the area\nbetween its horns shine light blue.") },
            // { PBESpecies.240, new PBELocalizedString("こがらだが　たいおんは　\xFF16\xFF10\xFF10ど。\nいきを　すったり　はいたりするたび　\nくちと　はなから　ひのこが　もれる。", "작은 몸이지만 체온은 600도다.\n숨을 들이쉬고 내쉴 때마다\n입과 코에서 불꽃이 샌다.", "La température de son corps peut\natteindre 600 °C. Son nez et sa bouche\nlaissent échapper des flammèches.", "Seine Körpertemperatur misst 600 Grad.\nBeim Ein- und Ausatmen springen glühende\nKohlenstücke aus seinem Mund.", "Es pequeño, pero su cuerpo puede llegar\na alcanzar 600°. Cuando inspira y espira,\nexpulsa llamas por la nariz y por la boca.", "È di piccole dimensioni, ma la temperatura\ndel suo corpo è di 600°C. Quando respira\nemette scintille da naso e bocca.", "It's small, but its body temperature\nis over 1,100 degrees F. Embers escape\nits mouth and nose when it breathes.") },
            // { PBESpecies.241, new PBELocalizedString("ミルタンクの　ミルクを　のんで\nそだった　こどもは　けんこうで\nたくましい　おとなに　なるという。", "밀탱크의 우유를 마시고\n자란 아이는 건강하고\n강인한 어른이 된다고 한다.", "On raconte que les enfants élevés\nau lait d'Écrémeuh deviennent des\nadultes braves et robustes.", "Man sagt, dass Kinder, die Miltanks\nMilch trinken, zu gesunden\nErwachsenen heranwachsen.", "Se dice que, si un niño bebe leche\nde Miltank, crecerá y se convertirá\nen un adulto sano y campechano.", "Si dice che se un bambino beve il latte\ndi Miltank crescerà bene e da adulto\nsarà sano e buono.", "It is said that kids who drink\nMiltank's milk grow up to become\nhearty, healthy adults.") },
            { PBESpecies.Blissey, new PBELocalizedString("ハピナスの　うむ　タマゴには\nしあわせが　つまっていて　ひとくち\nたべると　だれでも　えがおになれる。", "해피너스가 낳은 알에는\n행복이 담겨 있어서 한입 먹으면\n누구든지 웃음 띤 얼굴이 된다.", "Les œufs que pond Leuphorie sont\nun concentré de bonheur dont une\nbouchée suffit à apporter la joie.", "Eier, die es legt, stecken voller\nFröhlichkeit. Schon ein Bissen\nerzeugt ein breites Lächeln.", "Los huevos que pone están llenos\nde felicidad. Solo con probar un\npoquito de uno, cualquiera sonríe.", "Le uova che depone sono piene di\nfelicità. Un assaggio rende chiunque\nallegro.", "The eggs it lays are filled with\nhappiness. Eating even one bite\nwill bring a smile to anyone.") },
            // { PBESpecies.243, new PBELocalizedString("カミナリと　ともに　おちてきたと\nいわれている。せなかの　あまぐもから\nカミナリを　うちだすことが　できる。", "번개와 함께 떨어졌다고\n전해진다. 등의 비구름에서\n번개를 뿜어낼 수 있다.", "On prétend qu'il est tombé avec la\nfoudre. Il peut lancer des éclairs\ngrâce aux nuages sur son dos.", "Dieses Pokémon ist der personifizierte\nBlitz. Es kann aus den Wolken über\nseinem Rücken Blitze schleudern.", "Dicen que apareció con un relámpago.\nPuede lanzar rayos desde las nubes\nde su lomo.", "Pare che sia caduto con un fulmine.\nPuò scagliare saette dalle nuvole\ndi pioggia che ha sul dorso.", "It is said to have fallen with\nlightning. It can fire thunderbolts\nfrom the rain clouds on its back.") },
            // { PBESpecies.244, new PBELocalizedString("エンテイが　ほえると\nせかいの　どこかの　かざんが\nふんかすると　いわれている。", "앤테이가 울부짖으면\n세계 어딘가의 화산이\n분화한다고 전해진다.", "On raconte qu'à chaque fois qu'il\nrugit, un volcan entre en éruption\nquelque part.", "Man sagt, wenn es brüllt, bricht\nirgendwo in der Welt ein Vulkan aus.", "Se dice que, cuando ruge, un volcán\nentra en erupción en algún punto\ndel globo.", "Si dice che quando emette il suo verso,\nda qualche parte nel mondo un vulcano\nstia eruttando.", "It is said that when it roars, a\nvolcano erupts somewhere around\nthe globe.") },
            // { PBESpecies.245, new PBELocalizedString("せかいじゅうを　かけめぐり\nよごれた　みずを　きよめている。\nきたかぜと　ともに　はしりさる。", "세계 곳곳을 뛰어다니며\n오염된 물을 정화시킨다.\n북풍과 함께 달려나간다.", "Il parcourt le vaste monde pour\npurifier les eaux polluées. Il\naccompagne le vent du nord.", "Es wandert beständig in der Welt herum,\num verunreinigtes Wasser zu reinigen.\nEs zieht mit dem Nordwind.", "Recorre el mundo para purificar agua\ncontaminada. Corre veloz con el viento\ndel norte.", "Corre per tutto il mondo per purificare\nl'acqua contaminata.\nSi allontana con i venti del nord.", "It races around the world to\npurify fouled water. It dashes\naway with the north wind.") },
            // { PBESpecies.246, new PBELocalizedString("ちてい　おくふかくで　うまれる。\nまわりの　つちを　たいらげると\nちじょうに　あらわれ　サナギになる。", "땅속 깊은 곳에서 태어난다.\n주변의 흙을 다 먹으면\n지상으로 올라와 번데기가 된다.", "Il vit très profond sous terre.\nIl n'en sort pour évoluer qu'après\navoir dévoré tout ce qui l'entourait.", "Sie schlüpfen tief unter der Erde und\nfressen sich durch das Erdreich bis zur\nOberfläche durch, wo sie sich verpuppen.", "Nace muy profundo en el suelo y sube a\nla superficie, donde se convierte en una\nlarva, comiéndose la tierra que lo rodea.", "Nasce nelle profondità del sottosuolo.\nDopo aver divorato la terra circostante\nemerge in superficie e diventa crisalide.", "Born deep underground, it comes\naboveground and becomes a pupa once it\nhas finished eating the surrounding soil.") },
            // { PBESpecies.247, new PBELocalizedString("たいないで　あっしゅく　させた\nガスを　いきおいよく　ふんしゅつさせ\nとんで　あばれまわる　サナギだ。", "체내에서 압축한\n가스를 기세 좋게 분출시켜\n날며 난동 피우는 번데기다.", "Cette violente larve file comme une fusée\nen expulsant les gaz sous pression\nrenfermés dans son corps.", "Es katapultiert sich in die Luft, indem es\nGas ausstößt, das sich in seinem Körper\nangestaut hat, und sorgt so für Unruhe.", "La larva vuela propulsándose con los\ngases sometidos a altas presiones que\nencierra en el interior de su cuerpo.", "È una crisalide che vola spruzzando qui e\nlì il gas compresso nel suo corpo.", "This pupa flies around wildly\nby venting with great force the\ngas pressurized inside its body.") },
            // { PBESpecies.248, new PBELocalizedString("じひびきを　ならしながら　あるくと\nおおきな　やまでさえ　くずれ\nまわりの　ちけいは　かわってしまう。", "지축을 울리면서 걸으면\n큰 산조차 무너지며\n주변의 지형은 변해버린다.", "Son pas est si lourd qu'il en abat même\nles plus grandes montagnes, altérant\nainsi la topographie.", "Seine Schritte erzeugen Erdbeben, die\nselbst große Berge plätten und die Form\nganzer Landstriche verändern.", "Sus estrepitosos pasos derrumban\nmontañas y hacen que el terreno a\nsu alrededor cambie drásticamente.", "Può camminare a passi così pesanti da\nabbattere le montagne, trasformando\ncosì il paesaggio circostante.", "The quakes caused when it walks\nmake even great mountains crumble\nand change the surrounding terrain.") },
            // { PBESpecies.249, new PBELocalizedString("ふかい　かいこうの　そこで　ねむる。\nルギアが　はばたくと　\xFF14\xFF10にち\nあらしが　つづくと　いわれている。", "깊은 해구의 밑바닥에서 잠잔다.\n루기아가 날개를 치면 40일 동안\n폭풍우가 계속된다고 전해진다.", "Il dort dans une faille des grands\nfonds. Ses battements d'ailes\ngénèrent une tempête de 40 jours.", "Es schläft in einem Tiefseegraben.\nSchwingt es seine Flügel, entsteht\nein Sturm, der 40 Tage dauert.", "Duerme en una dorsal marina.\nSi bate sus alas, puede causar\ntormentas de 40 días.", "Dorme in una fossa negli abissi marini.\nCon un battito d'ali provoca una\ntempesta di 40 giorni.", "It sleeps in a deep-sea trench.\nIf it flaps its wings, it is said to\ncause a 40-day storm.") },
            // { PBESpecies.250, new PBELocalizedString("なないろの　つばさを　もつ。\nホウオウを　みた　ものは　えいえんの\nしあわせが　やくそくされるという。", "무지개색 날개를 가지고 있다.\n칠색조를 본 사람은 영원한\n행복이 약속된다고 한다.", "Ses plumes possèdent sept couleurs.\nOn prétend que sa vue apporte la\njoie éternelle.", "Seine Federn besitzen 7 Farben.\nMan sagt, dass demjenigen, der es\nsieht, ewiges Glück beschieden ist.", "Su plumaje tiene siete colores.\nSe dice que verlo proporciona\nfelicidad eterna.", "Le sue piume sono di sette colori.\nSi dice che chiunque lo veda sarà\nper sempre felice.", "Its feathers are in seven colors.\nIt is said that anyone seeing it is\npromised eternal happiness.") },
            // { PBESpecies.251, new PBELocalizedString("じかんを　こえる　ちからを　つかう。\nへいわな　じだいにだけ\nすがたを　みせると　いわれている。", "시간을 초월하는 힘을 사용한다.\n평화스러운 시대에만\n모습을 보인다고 한다.", "Il a le pouvoir de voyager dans le\ntemps. Cependant, on dit qu'il\nn'apparaît qu'en temps de paix.", "Es kann durch die Zeit reisen,\naber es erscheint nur zu\nfriedlichen Zeiten.", "Puede viajar en el tiempo, pero se dice\nque solo aparece en tiempos de paz.", "Ha il potere di viaggiare attraverso\nil tempo, ma si dice che appaia solo\nin periodi di pace.", "It has the power to travel across\ntime, but it is said to appear only\nin peaceful times.") },
            // { PBESpecies.252, new PBELocalizedString("あしの　うらには　ちいさな　トゲが\nたくさん　ついているので　かべや\nてんじょうを　あるくことが　できる。", "발바닥에는 작은 가시가\n많이 달렸기 때문에 벽이나\n천장을 걸을 수 있다.", "Ses plantes de pieds sont couvertes\nd'épines lui permettant de marcher\nau mur et au plafond.", "Seine Fußsohlen sind mit kleinen\nStacheln bedeckt, so dass es\nan Wänden und Decken Halt findet.", "Las plantas de sus pies tienen\npúas diminutas que le permiten\nandar por paredes y techos.", "Le piante dei suoi piedi sono piene di\nuncini che gli permettono di camminare\nsu muri e soffitti.", "The soles of its feet are covered\nby countless tiny spikes, enabling\nit to walk on walls and ceilings.") },
            // { PBESpecies.253, new PBELocalizedString("みつりんに　せいそくする。\nえだから　えだへ　とびうつりながら\nいどうして　えものに　せっきんする。", "밀림에 서식한다.\n가지에서 가지로 뛰어 옮겨가며\n이동해서 먹이에 접근한다.", "Il vit dans les jungles denses.\nIl saute de branche en branche\npour approcher de sa proie.", "Es lebt im dichten Dschungel.\nEs springt von Ast zu Ast,\nwenn es sich einer Beute nähert.", "Vive en selvas frondosas. Salta de\nrama en rama para acercarse a\nsus presas.", "Vive in giungle fitte. Si avvicina alle\nprede saltando di ramo in ramo.", "It lives in dense jungles. While\nclosing in on its prey, it leaps\nfrom branch to branch.") },
            // { PBESpecies.254, new PBELocalizedString("うでに　はえた　はっぱは　たいぼくも\nすっぱり　きりたおす　きれあじ。\nみつりんの　たたかいでは　むてき。", "팔에 자란 잎사귀는 큰 나무도\n싹둑 베어 넘어뜨리는 정도다.\n밀림의 싸움에서는 무적이다.", "Les feuilles sur ses bras peuvent\ntrancher des troncs épais. C'est\nle meilleur combattant des jungles.", "Die Blätter an seinen Armen können dicke\nBäume fällen. Im Dschungelkampf gibt es\nkein stärkeres Pokémon.", "Las hojas de sus brazos pueden\ncortar gruesos árboles. Invencible\nen los combates en la jungla.", "Le foglie che crescono sulle sue braccia\ntagliano anche grandi alberi.\nNel suo habitat, è imbattibile.", "The leaves that grow on its arms\ncan slice down thick trees. It is\nwithout peer in jungle combat.") },
            { PBESpecies.Torchic, new PBELocalizedString("たいないで　ほのおが　もえているので\nだきしめると　とても　あたたかい。\n\xFF11\xFF10\xFF10\xFF10どの　ひのたまを　とばす。", "체내에 불꽃이 타오르고 있어\n껴안으면 무척 따뜻하다.\n1000도의 불구슬을 날린다.", "Ses câlins réchauffent car il renferme\nune fournaise. Il envoie des boules de\nfeu à 1 000 °C.", "In seinem Inneren lodert\nein Feuer. Es schleudert\n1 000 Grad heiße Feuerbälle.", "En su interior arde una llama que\nmantiene su cuerpo caliente.\nTira bolas de fuego a 1000°.", "Nel suo corpo brucia una fiamma e\nabbracciandolo si avverte calore.\nLancia palle di fuoco a 1000°C.", "A fire burns inside, so it feels\nvery warm to hug. It launches\nfireballs of 1,800 degrees F.") },
            { PBESpecies.Combusken, new PBELocalizedString("\xFF11びょうかんに　キックを　\xFF11\xFF10ぱつ\nくりだす　あしわざの　もちぬし。\nするどい　なきごえで　いかくする。", "1초에 킥을 10번 날릴 정도로\n발을 사용하는 기술에 능하다.\n날카로운 울음소리로 위협한다.", "Ce maître du coup de pied peut donner\n10 coups par seconde. Ses cris aigus\nintimident l'ennemi.", "Es kann 10 Tritte pro Sekunde austeilen.\nEs gibt schrille Schreie von sich,\num Gegner einzuschüchtern.", "Su habilidad le permite dar diez patadas\npor segundo. Lanza potentes gritos\npara intimidar.", "Possiede l'abilità di sferrare anche\n10 calci al secondo. Emette urla\nstrazianti per intimorire i nemici.", "Its kicking mastery lets it loose\n10 kicks per second. It emits\nsharp cries to intimidate foes.") },
            { PBESpecies.Blaziken, new PBELocalizedString("てくびから　ふきだした　ほのおで\nこぶしを　つつみこんだ　パンチは\nあいてを　くろこげに　してしまう。", "손목에서 뿜어낸 불꽃으로\n주먹을 둘러싼 펀치는\n상대를 까맣게 태워 버린다.", "Des flammes fusent de ses\npoignets et ses coups brûlent\nl'ennemi.", "Aus seinen Handgelenken kommt\nFeuer, das seine Knöchel umhüllt.\nSchläge verbrennen den Gegner.", "Sus puños están envueltos en llamas.\nCon sus golpes puede quemar a sus\nrivales.", "Le fiamme che fuoriescono dai suoi polsi\ngli avvolgono i pugni. Quando colpisce\nil nemico, lo scotta.", "Flames spout from its wrists,\nenveloping its knuckles. Its\npunches scorch its foes.") },
            // { PBESpecies.258, new PBELocalizedString("あたまの　ひれで　みずの　ながれを\nかんじて　まわりの　ようすを　しる。\nいわを　もちあげる　ちからもち。", "머리의 지느러미로 물의 흐름을\n느껴 주위의 상황을 파악한다.\n바위를 들어올릴 정도로 힘이 세다.", "Il analyse le courant grâce à la\nnageoire sur sa tête. Il est assez\nfort pour soulever des rochers.", "Die Flosse auf seinem Kopf prüft\ndie Strömung des Wassers. Dieses\nPokémon kann Felsen heben.", "La aleta de su cabeza detecta las\ncorrientes de agua y los peligros.\nTiene fuerza para levantar rocas.", "Con la pinna sulla testa percepisce\ni movimenti dell'acqua e sta in guardia.\nRiesce a sollevare rocce.", "To alert it, the fin on its head\nsenses the flow of water. It has\nthe strength to heft boulders.") },
            // { PBESpecies.259, new PBELocalizedString("ぬかるんだ　あしばでも　しっかり\nあるける　じょうぶな　あしこし。\nどろに　からだを　うめて　ねむる。", "발밑이 질퍽거려도 잘 걸을 수\n있는 튼튼한 다리를 가졌다.\n진흙에 몸을 묻고 잠잔다.", "Ses jambes robustes lui donnent\nun bon appui, même dans la boue.\nIl dort enfoui dans la saleté.", "Seine kräftigen Beine geben ihm\nsicheren Halt. Es gräbt sich in\nDreck ein, wenn es schlafen will.", "Sus piernas robustas impiden que\npierda el equilibrio y caiga, incluso\nen el barro. Duerme bajo la arena.", "Grazie alle zampe vigorose, si muove\ncon disinvoltura anche nel fango.\nDorme immerso nella melma.", "Its sturdy legs give it sure\nfooting, even in mud. It\nburrows into dirt to sleep.") },
            // { PBESpecies.260, new PBELocalizedString("おおがたせんを　ひっぱって　およぐ\nパワーの　もちぬし。ふとい　うでの\nひとふりで　あいてを　たたきのめす。", "큰 배를 끌며 헤엄치는\n파워의 소유자이다. 굵은 팔을\n한 번 휘둘러 상대를 때려눕힌다.", "Il peut traîner un grand bateau en\nnageant. Il assomme l'ennemi d'un\ngrand coup de ses bras épais.", "Es kann im Schwimmen ein großes\nSchiff ziehen. Seine Gegner schlägt\nes mit Schlägen seiner Arme zurück.", "Puede nadar y arrastrar un barco\ngrande. Golpea a sus enemigos\ncon sus gruesos brazos.", "Nuotando riesce a trainare una grande\nnave. Con le braccia vigorose abbatte\ni nemici in un sol colpo.", "It can swim while towing a large\nship. It bashes down foes with a\nswing of its thick arms.") },
            // { PBESpecies.261, new PBELocalizedString("しつこい　せいかくの　ポケモン。\nめをつけた　えものが　ヘトヘトに\nつかれるまで　おいかけまわす。", "집요한 성격의 포켓몬이다.\n점찍은 먹이가 기진맥진\n지칠 때까지 뒤쫓아간다.", "Un Pokémon très obstiné qui\npoursuit sa proie jusqu'à ce\nqu'elle soit épuisée.", "Ein beharrliches Pokémon, das seine\nBeute jagt, bis diese erschöpft ist.", "Es muy persistente. Si se fija en\nuna presa, no la dejará hasta que\ncaiga agotada.", "Pokémon di natura ostinata. Insegue\nla preda prescelta finché questa non\nè esausta.", "A Pokémon with a persistent\nnature, it chases its chosen prey\nuntil the prey becomes exhausted.") },
            // { PBESpecies.262, new PBELocalizedString("むれで　えものを　おいつめる。\nすぐれた　トレーナーの　めいれいには\nぜったいに　さからわない。", "무리를 이루어 먹이를 바싹\n몰아넣는다. 우수한 트레이너의\n명령에는 절대로 거역하지 않는다.", "Il traque ses proies en groupe.\nIl ne désobéira jamais aux\nordres d'un bon Dresseur.", "Es jagt seine Beute im Rudel.\nDen Befehlen eines erfahrenen\nTrainers wird es stets folgen.", "Ataca a sus presas en manada.\nNunca desobedece las órdenes\nde un Entrenador avezado.", "Caccia le prede in branco. Non\ndisobbedisce mai agli ordini di\nun Allenatore abile.", "It chases down prey in a pack.\nIt will never disobey the commands\nof a skilled Trainer.") },
            // { PBESpecies.263, new PBELocalizedString("ジグザグに　あるいて　くさかげや\nじめんに　うまっている　たからものを\nみつけるのが　とくいな　ポケモン。", "지그재그로 걸어서 풀숲이나\n땅에 묻혀 있는 보물을\n찾아내는 것이 특기인 포켓몬이다.", "Il marche en zigzaguant et n'a\npas son pareil pour trouver des\nobjets dans l'herbe ou sous terre.", "Es läuft im Zickzack. Es hat das\nTalent, Items im Gras, aber auch\nim Boden, zu finden.", "Se mueve en zigzag. Se le da bien\nencontrar objetos ocultos en la hierba\ne incluso enterrados.", "Avanza a zigzag. È bravo a trovare\nstrumenti nell'erba e sul terreno.", "It walks in zigzag fashion. It is\ngood at finding items in the\ngrass and even in the ground.") },
            // { PBESpecies.264, new PBELocalizedString("じそく\xFF11\xFF10\xFF10キロで　えものに\nおそいかかるが　まっすぐにしか\nはしれないので　しっぱいも　おおい。", "시속 100km로 먹이를\n덮치지만 똑바로밖에 달릴 수\n없어서 실패할 때도 많다.", "Il fonce sur sa proie à plus de 100 km/h.\nMais il ne peut pas dévier sa course\net loupe souvent sa cible.", "Es stürzt sich mit 100 km/h auf Beute.\nAber es kann nur geradeaus laufen\nund die Jagd misslingt oft.", "Carga contra sus enemigos a más\nde 100 km/h. Como solo va en línea\nrecta, falla a menudo.", "Carica la preda ad una velocità di\n100 km/h. Ma dal momento che va\nsolo dritto, sbaglia spesso.", "It charges prey at speeds over\n60 mph. However, because it can\nonly run straight, it often fails.") },
            // { PBESpecies.265, new PBELocalizedString("とりポケモンに　よく　ねらわれるが\nおしりの　トゲから　どくをだし\nひっしになって　ていこうする。", "새 포켓몬에게 자주 표적이 되지만\n엉덩이의 가시에서 독을 내서\n필사적으로 저항한다.", "Cible favorite des Pokémon Oiseaux,\nil tente de se protéger avec ses\népines venimeuses.", "Es wird oft von Vogel-Pokémon\nangegriffen, wehrt sich aber mit\nGift aus seinen Schweifspitzen.", "Es el blanco favorito de muchos\nPokémon pájaro. Se defiende con\nel veneno de las púas de su cola.", "Viene spesso attaccato dai Pokémon\nuccello. Si difende emettendo veleno\ndagli aculei che ha sulla coda.", "Often targeted by bird Pokémon,\nit desperately resists by releasing\npoison from its tail spikes.") },
            // { PBESpecies.266, new PBELocalizedString("いとを　きのえだに　まきつけている。\nいとについた　あまみずを　のみながら\nしんかの　ときを　まっている。", "실을 나뭇가지에 휘감고 있다.\n실에 붙은 빗물을 마시며\n진화할 때를 기다리고 있다.", "Il attend d'évoluer dans son cocon\nde soie accroché aux branches et\nse nourrit d'eau de pluie.", "Es bindet sich mit Seide an Äste\nund trinkt Regenwasser, während es\nstarr auf seine Entwicklung wartet.", "Se agarra con su seda a las ramas\nde un árbol y espera su evolución\nbebiendo agua de lluvia.", "Si appende ai rami con fili di seta.\nAspetta l'evoluzione bevendo l'acqua\npiovana che si posa sulla seta.", "It wraps silk around the branches\nof a tree. It drinks rainwater on\nits silk while awaiting evolution.") },
            // { PBESpecies.267, new PBELocalizedString("みために　よらず　こうげきてきで\nかふんあつめの　じゃまを　すると\nほそながい　くちを　つきさしてくる。", "보기와는 다르게 공격적이며\n꽃가루 모으기를 방해하면\n가늘고 긴 입으로 찌른다.", "Malgré les apparences, il est très\nagressif et attaque avec sa trompe\nquand on le dérange.", "Stört man es, während es Pollen sucht,\nstößt es mit seinem langen, dünnen\nMund zu.", "Aunque no lo parece, es un Pokémon\nagresivo. Si se le molesta cuando\nrecoge polen, atacará.", "Malgrado l'aspetto, è feroce. Se\ndisturbato in cerca di polline, attacca\ncon la bocca lunga e sottile.", "Despite its looks, it is aggressive.\nIt jabs with its long, thin mouth if\ndisturbed while collecting pollen.") },
            // { PBESpecies.268, new PBELocalizedString("マユに　こもっている　あいだに\nうけた　こうげきは　しんかしても\nわすれずに　かならず　しかえしする。", "고치에 들어가 있는 사이에\n받은 공격은 진화해도\n잊지 않고 반드시 앙갚음한다.", "Rancunier, il n'oublie aucune des\nattaques subies dans le cocon et\nse venge une fois qu'il a évolué.", "Es vergisst keinen Angriff, den es\nim Kokon erdulden musste. Nach\nder Entwicklung sinnt es auf Rache.", "Jamás olvida a quienes lo atacaron\nmientras estaba en su capullo.\nCuando evoluciona, busca venganza.", "Non dimentica mai gli attacchi subiti\ndentro il bozzolo. Dopo l'evoluzione\ncerca di vendicarsi.", "It never forgets any attack it\nendured while in the cocoon.\nAfter evolution, it seeks payback.") },
            // { PBESpecies.269, new PBELocalizedString("はばたくたびに　どくのこなが　まう。\nよるの　あいだに　がいろじゅの\nはっぱを　くいちらかすことも　ある。", "날개를 칠 때마다 독가루가 흩날린다.\n밤중에 가로수 잎을 어지르며 먹어대는\n일도 있다.", "Il disperse un nuage de poudre\ntoxique à chaque coup d'aile. Il\naime les feuilles d'arbres urbains.", "Es streut mit jedem Flügelschlag\ngiftiges Pulver. Nachts entfernt es\ndie Blätter von Bäumen an Alleen.", "Bate las alas para esparcir polvo\ntóxico. De noche se come las hojas\nde los árboles de las avenidas.", "Rilascia una polvere tossica dalle ali.\nDi notte divora le foglie degli alberi\nlungo i viali.", "Toxic powder is scattered with each\nflap. At night, it is known to strip\nleaves off trees lining boulevards.") },
            // { PBESpecies.270, new PBELocalizedString("みずくさに　そっくりな　ポケモン。\nおよげない　ポケモンを　はっぱに\nのせて　むこうぎしまで　はこぶ。", "수초를 똑 닮은 포켓몬이다.\n헤엄을 못 치는 포켓몬을 잎사귀에\n태워 건너편 물가까지 운반한다.", "Il ressemble à une plante aquatique\net fait la navette pour les Pokémon\nqui ne savent pas nager.", "Es sieht aus wie eine Wasserpflanze.\nEs dient den Pokémon, die nicht\nschwimmen können, als Fähre.", "Parece una planta acuática. Hace\nde ferry para los Pokémon que no\nsaben nadar.", "Sembra una pianta acquatica e viene\nusato come traghetto dai Pokémon\nche non sanno nuotare.", "It looks like an aquatic plant and\nserves as a ferry to Pokémon\nthat can't swim.") },
            // { PBESpecies.271, new PBELocalizedString("つりびとを　みつけると\nすいちゅうから　つりいとを　ひっぱり\nジャマして　よろこぶ　いたずらもの。", "낚시꾼을 발견하면\n물속에서 낚싯줄을 잡아당겨\n방해하며 좋아하는 장난꾸러기다.", "C'est un mauvais plaisantin. Quand\nil repère un pêcheur, il tire sur sa\nligne pour le déranger.", "Es hat ein spitzbübisches Wesen.\nSieht es einen Angler, zieht es an\nder Angelschnur, um ihn zu ärgern.", "Tiene carácter travieso. Si ve\nun pescador, tira del anzuelo\npara confundirlo.", "È un po' dispettoso. Se vede un\npescatore, gli tira la lenza solo\nper dargli fastidio.", "It has a mischievous spirit. If it\nspots an angler, it will tug on the\nfishing line to interfere.") },
            // { PBESpecies.272, new PBELocalizedString("ようきな　おんがくを　きくと\nからだじゅうに　ちからが　みなぎり\nおどらずには　いられなくなるのだ。", "경쾌한 음악을 들으면\n몸속의 힘이 넘쳐흘러\n춤추지 않고는 견딜 수 없게 된다.", "Ses muscles se tonifient au son\nd'une musique entraînante. Il ne\npeut pas s'empêcher de danser.", "Hört es fröhliche Musik, füllen\nsich seine Muskeln mit Energie.\nEs muss dann einfach tanzen.", "Cuando oye música alegre, sus\nmúsculos se llenan de energía, y\nno puede evitar ponerse a bailar.", "Se ascolta musica allegra, tutto il suo\ncorpo si rivitalizza e non riesce ad\nevitare di ballare.", "If it hears festive music, all its\nmuscles fill with energy. It can't\nhelp breaking out into a dance.") },
            // { PBESpecies.273, new PBELocalizedString("えだに　ぶらさがっていると\nきのみに　そっくり。ついばもうとした\nポケモンを　おどろかせて　よろこぶ。", "가지에 매달려 있으면 나무열매와\n똑 닮았다. 쪼아먹으려 한\n포켓몬을 놀래주며 좋아한다.", "Il ressemble à un gland pendu à\nune branche. Il adore effrayer\nles autres Pokémon.", "Es sieht aus wie eine Eichel, die am\nBaum hängt. Es liebt es, andere\nPokémon zu erschrecken.", "Cuando cuelga de las ramas,\nparece una bellota. Le encanta\nasustar a otros Pokémon.", "Quando si attacca a un ramo, sembra\nuna vera ghianda. Si diverte a\nspaventare gli altri Pokémon.", "When it dangles from a tree\nbranch, it looks just like an acorn.\nIt enjoys scaring other Pokémon.") },
            // { PBESpecies.274, new PBELocalizedString("コノハナが　かなでる　くさぶえの\nねいろは　ひとを　ふあんにさせる。\nもりの　おくに　すんでいる。", "잎새코가 연주하는 풀피리의\n음색은 사람을 불안하게 만든다.\n숲 속에서 살고 있다.", "Le son de sa flûte d'herbe\ndéstabilise l'auditeur. Il vit au\nplus profond des forêts.", "Der Ton seiner Grasflöte beunruhigt die,\ndie ihn hören. Es lebt tief in den\nWäldern.", "Cuando usa la hoja de su cabeza\ncomo flauta, asusta a la gente. Vive\nen lo más profundo de los bosques.", "Il fischio del suo flauto di foglia mette\na disagio chi lo sente.\nVive nelle foreste più fitte.", "The sound of its grass flute makes\nits listeners uneasy. It lives deep\nin forests.") },
            // { PBESpecies.275, new PBELocalizedString("はっぱの　うちわを　あおぐと\nふうそく\xFF13\xFF10メートルの　とっぷうが\nまきおこり　みんかを　ふきとばす。", "잎사귀 부채를 부치면\n풍속 30m의 돌풍이 일어나\n민가를 날려버린다.", "D'un coup de sa feuille éventail, il\ngénère des bourrasques de 30 m/s\ncapables de souffler une maison.", "Seine großen Fächer erzeugen\nBöen, die eine Geschwindigkeit\nvon 30 m/sek erreichen können.", "Con sus abanicos puede provocar\nvientos de 30 m/s capaces de\nlevantar casas.", "Con le sue foglie provoca raffiche di\nvento della velocità di 30 m/s che\nspazzano via interi edifici.", "By flapping its leafy fan, it can\nwhip up gusts of 100 ft/second\nthat can level houses.") },
            // { PBESpecies.276, new PBELocalizedString("つよい　あいてにも　ゆうかんに\nたちむかう　こんじょうの　もちぬし。\nあたたかい　とちを　めざして　とぶ。", "강한 상대에게도 용감히\n맞서는 근성의 소유자다.\n따뜻한 토지를 찾아서 난다.", "Ce Pokémon téméraire n'a pas peur\nd'affronter des ennemis puissants.\nIl vole en quête de climats chauds.", "Es ist sehr mutig und stellt sich\nauch starken Gegnern. Es sucht\nständig nach warmen Regionen.", "Es un Pokémon valiente que no\nteme a los rivales fuertes. Vuela\nen busca de climas templados.", "È molto coraggioso e affronta spavaldo i\nnemici più forti. Migra verso i paesi caldi.", "It has a gutsy spirit that makes\nit bravely take on tough foes. It\nflies in search of warm climates.") },
            // { PBESpecies.277, new PBELocalizedString("じょうくうを　せんかいしながら\nえものを　さがし　まっさかさまに\nきゅうこうかして　つかまえる。", "상공을 선회하면서\n먹이를 찾으면 거꾸로\n급강하하여 잡는다.", "Il vole en cercle en quête d'une\nproie. Dès qu'il l'a repérée, il fond\nsur elle en un éclair.", "Es fliegt auf der Suche nach Beute\nständig umher. Findet es Beute,\nstürzt es sich im Sturzflug auf sie.", "Vuela en círculos en busca de presas.\nCuando ve una, se lanza sin dudarlo.", "Vola in tondo alla ricerca di prede.\nQuando ne avvista una, si lancia\nin picchiata per catturarla.", "It circles the sky in search of\nprey. When it spots one, it dives\nsteeply to catch the prey.") },
            // { PBESpecies.278, new PBELocalizedString("きりたった　がけに　すを　つくり\nうみかぜを　りようして　ひろいそらを\nじょうしょうし　かっくう　するのだ。", "안개가 낀 절벽에 둥지를 만들어\n바닷바람을 이용하여 넓은 하늘을\n상승하여 활공한다.", "Il utilise les courants ascendants\npour planer en altitude. Il construit\nson nid le long des falaises.", "Es baut sein Nest an Steilhängen und\nnutzt die Seebrise, um beim Gleiten am\nweiten Himmel an Höhe zu gewinnen.", "Hace sus nidos en acantilados\nescarpados. Aprovecha la brisa marina\npara volar a lo más alto del cielo.", "Costruisce il nido a ridosso dei precipizi.\nSfrutta la brezza marina per levarsi alto\nin cielo.", "It makes its nest on sheer cliffs.\nRiding the sea breeze, it glides\nup into the expansive skies.") },
            // { PBESpecies.279, new PBELocalizedString("かいめん　すれすれを　とんで\nおおきな　くちばしで　かいすいごと\nエサを　すくいとって　はこぶのだ。", "해면 아주 가까이 날아\n큰 부리로 해수와 함께\n먹이를 건져 나른다.", "Il vole au ras de la mer pour gober\nen même temps proies et eau, qu'il\ntransporte dans son gros bec.", "Es schnappt sich seine Beute, indem es\nbeim Fliegen mit seinem großen Schnabel\ndas Wasser streift.", "Vuela a ras de la superficie marina y\nllena su inmenso pico de agua y comida\nque se lleva volando.", "Si libra a pelo dell'acqua del mare\npescando il suo cibo e trasportandolo\nvia con il suo grande becco.", "Skimming the water's surface, it dips\nits large bill in the sea, scoops up food\nand water, and carries it.") },
            // { PBESpecies.280, new PBELocalizedString("あかいツノで　ひとや　ポケモンの\nあたたかな　きもちを　キャッチすると\nぜんしんが　ほのかに　あつくなる。", "빨간 뿔로 사람이나 포켓몬의\n따뜻한 마음을 캐치하면\n전신이 미약하게 뜨거워진다.", "Quand ses cornes captent les ondes\npositives d'un Pokémon ou d'un\nhumain, son corps se réchauffe.", "Es erfasst warme Gefühle von\nMenschen und Pokémon mit seinen\nHörnern und wärmt sich daran auf.", "Si sus cuernos perciben emociones\npositivas de personas o Pokémon,\nsu cuerpo se calienta un poco.", "Se con le corna avverte emozioni positive\ndi persone o Pokémon, il suo corpo\nsi scalda leggermente.", "If its horns capture the warm\nfeelings of people or Pokémon,\nits body warms up slightly.") },
            // { PBESpecies.281, new PBELocalizedString("トレーナーが　よろこぶと\nキルリアに　エネルギーが　みちあふれ\nたのしそうに　くるくると　おどる。", "트레이너가 기뻐하면\n킬리아에게 에너지가 넘쳐나서\n기쁜 듯이 빙글빙글 춤춘다.", "Quand il sent la joie de son\nDresseur, il se met à danser,\ndébordant d'énergie.", "Ist sein Trainer glücklich,\ntanzt es in einem Schwall\nvon Energie fröhlich umher.", "Si su Entrenador está contento,\nse llena de energía y baila de\nforma alegre dando giros.", "Quando il suo Allenatore si sente felice,\ntrabocca di energia e inizia a ballare\ngirando su se stesso.", "If its Trainer becomes happy, it\noverflows with energy, dancing\njoyously while spinning about.") },
            // { PBESpecies.282, new PBELocalizedString("トレーナーを　まもるためなら\nサイコパワーを　つかいきり　ちいさな\nブラックホールを　つくりだす。", "트레이너를 지키기 위해서라면\n사이코 파워를 모두 써서 작은\n블랙홀을 만들어 낸다.", "Prêt à tout pour protéger son\nDresseur, il peut créer un mini trou\nnoir par sa seule force mentale.", "Erzeugt ein kleines schwarzes Loch\nmithilfe all seiner Psycho-Kräfte,\num seinen Trainer zu schützen.", "Para proteger a su Entrenador,\nemplea todo su poder psíquico en\ncrear un pequeño agujero negro.", "Quando il suo Allenatore è in pericolo\nusa tutto il suo potere psichico per\ncreare un piccolo buco nero.", "To protect its Trainer, it will\nexpend all its psychic power\nto create a small black hole.") },
            // { PBESpecies.283, new PBELocalizedString("すいめんを　すべるように　あるく。\nあたまの　さきから　あまい　においを\nだして　えものを　さそう。", "수면을 미끄러지듯이 걷는다.\n머리끝에서 달콤한 냄새를\n내어 먹이를 끌어들인다.", "Il semble patiner sur l'eau. Le parfum\ndiffusé par le sommet de sa tête sert\nà attirer ses proies.", "Scheinbar reitet es auf dem\nWasser. Es lockt seine Beute\nmit einem süßen Duft an.", "Parece que patina sobre el agua.\nAtrae a las presas con el suave\naroma de su cabeza.", "Cammina a pelo d'acqua. Dall'aculeo sulla\ntesta emana un dolce aroma con cui\nattira le prede.", "It appears as if it is skating on\nwater. It draws prey with a sweet\nscent from the tip of its head.") },
            // { PBESpecies.284, new PBELocalizedString("めだまもようの　しょっかくを　もつ。\n\xFF14まいの　はねで　うかびあがり\nぜんごさゆうに　うごくことができる。", "눈알 모양의 더듬이를 가지고 있다.\n4장의 날개로 떠올라\n전후좌우로 움직일 수 있다.", "Des motifs en forme d'yeux ornent\nses antennes. Ses 4 ailes l'aident\nà voler dans toutes les directions.", "Seine Antenne besitzt ein Augenmuster.\nSeine vier Flügel erlauben es,\nin alle Richtungen zu fliegen.", "Sus antenas tienen dibujos de ojos,\nmientras que sus alas le permiten\nvolar en cualquier dirección.", "Le sue antenne presentano un motivo ad\nocchi. Con le quattro ali riesce a volare\nin ogni direzione.", "Its antennae have eye patterns\non them. Its four wings enable it\nto hover and fly in any direction.") },
            // { PBESpecies.285, new PBELocalizedString("あたまの　てっぺんから　どくほうしを\nふきだす。ほうしを　すいこむと\nからだの　ふしぶしが　いたくなる。", "머리의 정수리에서 독 포자를\n뿜어낸다. 포자를 들이마시면\n몸의 마디마디가 아파진다.", "Le sommet de sa tête libère des\nspores empoisonnées. Il est\ndangereux de les inhaler.", "Es setzt an seinem Kopf Giftsporen frei.\nWerden diese eingeatmet, verursachen\nsie Schmerzen.", "Lanza esporas venenosas desde\nla parte superior de la cabeza.\nInhalarlas es muy doloroso.", "Sparge spore tossiche dalla sommità\ndel capo. Se inalate, queste spore\nprovocano dolore in tutto il corpo.", "It spouts poison spores from the\ntop of its head. These spores\ncause pain all over if inhaled.") },
            // { PBESpecies.286, new PBELocalizedString("みじかい　うでは　パンチを　だすとき\nぐーんと　のびる。プロボクサー\nかおまけの　テクニックを　もつ。", "짧은 팔은 펀치를 날릴 때\n쑤-욱 늘어난다. 프로 복서를\n압도하는 기술을 가지고 있다.", "Ses petits bras s'étendent quand il\ndonne un coup de poing. Son talent\négale celui d'un boxeur pro.", "Seine kurzen Arme dehnen sich aus,\nwenn es zuschlägt. Seine Technik\nähnelt der von Profi-Boxern.", "Sus cortos brazos se expanden\ncuando da puñetazos. Tiene una\ntécnica pugilística muy depurada.", "Tirando pugni, i suoi cortissimi arti\nsi allungano. Usa una tecnica simile\na quella dei pugili professionisti.", "Its short arms stretch when it\nthrows punches. Its technique is\nequal to that of pro boxers.") },
            // { PBESpecies.287, new PBELocalizedString("\xFF11にちに　はっぱを　\xFF13まいも\nたべれば　まんぞくで　それいがいは\n\xFF12\xFF10じかんも　ねむっている。", "하루에 잎을 3장만\n먹으면 만족하고 그 외에는\n20시간이나 자고 있다.", "Il dort 20 heures par jour et ne fait\nrien d'autre, si ce n'est manger trois\nou quatre feuilles dans la journée.", "Solange es täglich drei Blätter zu essen\nbekommt, ist es zufrieden. Abgesehen\ndavon schläft es 20 Stunden am Tag.", "Si se come tres hojas al día, ya se queda\nsatisfecho. Aparte de eso, se pasa\ndurmiendo 20 horas al día.", "Tre foglie al giorno bastano a saziarlo e\ndorme fino a 20 ore.", "If it eats just three leaves in a day,\nit is satisfied. Other than that,\nit sleeps for 20 hours a day.") },
            // { PBESpecies.288, new PBELocalizedString("しんぞうの　こどうが　はやく\nぜんしんの　ちが　たぎっているため\n\xFF11びょうも　じっと　していられない。", "심장 박동이 빨라 전신의\n피가 끓어오르고 있기 때문에\n1초도 가만히 있지 못한다.", "Son cœur bat tellement vite que son\nsang bout dans ses veines, l'empêchant\nde rester immobile même une seconde.", "Sein Puls ist konstant so hoch, dass sein\nBlut immer in Wallung ist und es keine\nSekunde stillhalten kann.", "Su corazón palpita a un ritmo frenético,\nhaciendo que su sangre bulla, así que no\npuede estarse quieto ni un segundo.", "I battiti del suo cuore sono rapidissimi e\nil suo sangue scorre con tale impeto che\nnon riesce a stare fermo un istante.", "Its heartbeat is fast and\nits blood so agitated that\nit can't sit still for one second.") },
            // { PBESpecies.289, new PBELocalizedString("ねころがったまま　せいかつ　する。\nまわりに　たべる　くさが　なくなると\nようやく　ねがえりをして　うごく。", "뒹굴면서 생활한다.\n주변에 먹을 풀이 없어지면\n그제야 뒤척여서 움직인다.", "Il passe sa vie affalé. Il ne se déplace\nque lorsqu'il n'y a plus rien à manger\nà proximité et qu'il n'a plus le choix.", "Es fristet seine Tage im Liegen und rafft\nsich erst auf, wenn es alle Grasvorräte\nin seinem Umfeld aufgegessen hat.", "Vive tumbado todo el día, girándose\nexclusivamente de un lado a otro si\nno le queda más hierba para comer.", "Sta tutto il tempo disteso a terra.\nSi sposta rotolando solo quando ha\nmangiato tutta l'erba circostante.", "This Pokémon lives lying on its side.\nIt only rolls over and moves when\nthere is no more grass to eat.") },
            { PBESpecies.Nincada, new PBELocalizedString("じめんの　したで　せいちょうする。\nほとんど　みえない　めの　かわりに\nしょっかくで　ようすを　さぐる。", "땅밑에서 성장한다.\n거의 보이지 않는 눈 대신\n더듬이로 상황을 살핀다.", "Il grandit sous terre et se repère\ngrâce à ses antennes car ses\nyeux sont quasiment aveugles.", "Es wächst unterirdisch heran und nimmt\nseine Umgebung mit Antennen wahr, da\nes nahezu blind ist.", "Crece bajo tierra y explora el entorno\ncon sus antenas porque casi no ve\ncon sus ojos.", "Cresce sottoterra e, poiché è quasi\ncieco, usa le antenne per sondare\nciò che lo circonda.", "It grows underground, sensing\nits surroundings using antennae\ninstead of its virtually blind eyes.") },
            { PBESpecies.Ninjask, new PBELocalizedString("あまりに　こうそくで　うごくため\nすがたが　みえなくなる　ことがある。\nじゅえきに　あつまってくる。", "매우 고속으로 움직이므로\n모습이 보이지 않게 될 때가 있다.\n수액에 모여든다.", "Il bouge si vite que l'œil a parfois du\nmal à le suivre. Ils se regroupent près\nde la sève des arbres.", "Es bewegt sich so schnell, dass es\nmanchmal unsichtbar zu sein scheint.\nEs liebt Baumsaft.", "Se mueve tan rápido que a veces\nresulta invisible. Le atrae la savia\nde los árboles.", "Si muove così in fretta da risultare quasi\ninvisibile. Lo si vede in gruppo attorno\nagli alberi ricchi di linfa.", "Because it moves so quickly, it\nsometimes becomes unseeable. It\ncongregates around tree sap.") },
            { PBESpecies.Shedinja, new PBELocalizedString("ぬけがらが　たましいを　やどした。\nせなかの　すきまから　のぞきこむと\nたましいを　すわれてしまうらしい。", "허물 속으로 영혼이 들어갔다.\n등에 난 틈새로 들여다보면\n영혼을 빼앗겨버린다고 한다.", "Une carapace d'insecte laissée à\nl'abandon. On dit qu'il vole l'âme\nde celui qui regarde à l'intérieur.", "Ein weggeworfener Käferpanzer,\nder zum Leben erwachte. Schaut man\nhinein, stiehlt es einem die Seele.", "Es el caparazón de un bicho que\ncobró vida. Si alguien lo mira por\nla espalda, le robará el alma.", "È nato dal guscio vuoto di un insetto.\nPare che chi spia nella fessura sul suo\ndorso perda l'anima.", "A discarded bug shell that came to\nlife. Peering into the crack on its\nback is said to steal one's spirit.") },
            // { PBESpecies.293, new PBELocalizedString("ふだんは　ささやくような　なきごえ。\nふあんになると　ジェットきと　おなじ\nおんりょうで　なきつづける。", "평소에는 속삭이는 듯한\n울음소리를 낸다. 불안해지면\n제트기와 같은 음량으로 울어댄다.", "En temps normal, son cri est pareil\nà un murmure. Effrayé, il atteint le\nvolume d'un avion à réaction.", "Normalerweise klingen seine Rufe\nwie Gemurmel. Hat es aber Angst,\nist es so laut wie ein Flugzeug.", "Suele murmurar a un volumen casi\ninaudible, pero cuando se asusta\ngrita con el volumen de un reactor.", "Di solito ha una voce molto tenue, ma se\nsi spaventa, emette un suono assordante\nquanto un jet.", "Usually, its cries are like quiet\nmurmurs. If frightened, it shrieks\nat the same volume as a jet plane.") },
            // { PBESpecies.294, new PBELocalizedString("おおごえの　しょうげきはで\nトラックを　ひっくりかえしてしまう。\nあしを　ふみならして　パワーアップ。", "큰 소리의 충격파로\n트럭을 뒤집어 버린다.\n발을 쿵쾅거리며 파워를 올린다.", "L'onde de choc provoquée par son\ncri peut renverser un camion. Il\ntrépigne pour augmenter sa force.", "Die Schockwellen, die durch sein\nRufen entstehen, können einen\nLKW umkippen.", "Las ondas de sus gritos pueden\nvoltear un camión. Patea el suelo\npara ganar potencia.", "Le onde d'urto dei suoi versi ribaltano\nanche i camion. Pesta i piedi per\naccumulare energia.", "The shock waves from its cries can\ntip over trucks. It stamps its\nfeet to power up.") },
            // { PBESpecies.295, new PBELocalizedString("バクオングの　とおぼえは　\xFF11\xFF10キロ\nさきまで　とどく。からだじゅうの\nあなから　さまざまな　おとを　だす。", "폭음룡이 멀리 짖으면 10km\n전방까지 닿는다. 몸 곳곳의\n구멍에서 갖가지 소리를 낸다.", "Son hurlement s'entend à 10 km à la\nronde. Ses orifices émettent toutes\nsortes de bruits.", "Sein Heulen hört man in 10 km\nEntfernung. Es gibt alle Arten\nvon Geräuschen von sich.", "Su aullido se puede oír a 10 km.\nEmite todo tipo de sonidos desde\nlos tubos de su cuerpo.", "Le sue urla si sentono a 10 km di\ndistanza. Emette diversi suoni dalle\nnumerose aperture del suo corpo.", "Its howls can be heard over six\nmiles away. It emits all sorts of\nnoises from the ports on its body.") },
            // { PBESpecies.296, new PBELocalizedString("ふとい　きのみきに　ぶつかって\nからだを　きたえる。すみかの　そばは\nへしおられた　きが　たくさんある。", "굵은 나무줄기에 부딪혀\n몸을 단련한다. 거처 주변에는\n꺾여버린 나무가 많이 있다.", "Il fortifie son corps en fonçant\nsur des arbres épais. Son nid est\nentouré d'arbres abattus.", "Es stärkt seinen Körper, indem es\ngegen Bäume rennt. In seiner Nähe\nfinden sich viele umgekippte Bäume.", "Endurece su cuerpo golpeando grandes\nárboles. Cerca de su hogar suele haber\nárboles golpeados.", "Si rinforza sbattendo contro enormi\nalberi. Vicino alla sua tana si trovano\nparecchi alberi abbattuti.", "It toughens its body by slamming\ninto thick trees. Many snapped\ntrees can be found near its nest.") },
            // { PBESpecies.297, new PBELocalizedString("からだの　おおきな　ポケモンたちと\nちからくらべをすることが　だいすき。\nはりてで　トラックを　ふっとばす。", "몸집이 큰 포켓몬들과 힘겨루는\n것을 매우 좋아한다. 손바닥치기로\n트럭을 멀리 날려 버린다.", "Il aime mesurer sa force à celle des\nplus grands Pokémon. Ses coups de\npaume peuvent projeter un camion.", "Es liebt das Kräftemessen mit großen\nPokémon. Mit seinem Armwurf kann\nes LKW durch die Luft werfen.", "Le encanta enfrentarse a Pokémon\ngrandes y probar su fuerza. Sus\nbrazos pueden derribar un camión.", "Ama confrontarsi con Pokémon grossi.\nCon uno dei suo schiaffi, può far\nprendere il volo a un camion.", "It loves to match power with\nbig-bodied Pokémon. It can knock a\ntruck flying with its arm thrusts.") },
            { PBESpecies.Azurill, new PBELocalizedString("えいようが　つまった　おおきな\nしっぽを　ふりまわして　じぶんより\nてごわい　あいてにも　たちむかう。", "영양이 채워진 큰\n꼬리를 휘두르며 자신보다\n벅찬 상대에게도 맞선다.", "Il fait tournoyer sa queue, connue pour\nses qualités nutritives, pour l'abattre\ncomme une puissante massue sur l'ennemi.", "Es legt sich mit starken Gegnern an,\nindem es seinen großen, mit Nährstoffen\ngefüllten Schweif umherschwingt.", "Para hacer frente a oponentes más\ngrandes que él, agita su gran cola,\nllena de nutrientes, de un lado a otro.", "Si scaglia contro avversari più forti di\nlui agitando la grande coda in cui\nconserva le sostanze di cui si nutre.", "It swings its large, nutrient-filled\ntail around to fight opponents\nbigger than itself.") },
            // { PBESpecies.299, new PBELocalizedString("いつも　きたを　むいている\nじしゃくの　はなで　まわりの　てつを\nひきよせて　まもりを　かためるのだ。", "항상 북쪽을 향한다.\n자석의 코로 주변의 철을\n끌어당겨 방어를 굳힌다.", "Son nez polarisé lui permet de se\ndéfendre en augmentant son magnétisme\net en attirant tout objet métallique.", "Es schützt sich mit Objekten aus Eisen,\ndie es mithilfe seiner immer nach Norden\nzeigenden magnetischen Nase anzieht.", "Siempre apunta al norte con su nariz\nimantada. Con ella reviste su cuerpo\nde objetos metálicos para protegerse.", "Rafforza le sue difese attirando su di sé\ngli oggetti di ferro circostanti con il suo\nnaso magnetico che indica sempre il nord.", "Its magnetic nose always faces north\nand draws iron objects to its body\nto protect itself better.") },
            { PBESpecies.Skitty, new PBELocalizedString("じぶんの　しっぽを　おいかけて\nあそんでいると　めを　まわすといった\nかわいらしい　いちめんを　みせる。", "자신의 꼬리를 쫓아서\n놀고 있으면 눈이 핑 돌고 마는\n귀여운 일면을 보인다.", "Un Pokémon très mignon qui aime\nparfois courir en cercle en\nchassant sa propre queue.", "Es zeigt gerne seine niedliche Seite,\nindem es seinen eigenen Schweif jagt,\nbis ihm schwindlig wird.", "Le gusta jugar persiguiéndose la cola\nhasta que se marea, mostrando así\nsu lado más mono.", "È davvero carino quando barcolla per\ni giramenti di testa, dopo aver cercato\ndi mordersi la coda.", "It shows its cute side\nby chasing its own tail\nuntil it gets dizzy.") },
            { PBESpecies.Delcatty, new PBELocalizedString("きまった　すみかを　もたないのは\nいごこちが　よく　きれいな　ばしょを\nさがして　ねどこに　しているから。", "일정한 거처를 가지지 않는 것은\n지내기 좋고 깨끗한 장소를\n찾아 잠자리로 하고 있기 때문이다.", "Il ne possède pas de territoire fixe. Il\nest donc toujours à la recherche d'un\nendroit propre et agréable pour dormir.", "Es hat kein festes Revier, weil es sich\neinfach immer ein gemütliches, sauberes\nFleckchen zum Schlafen sucht.", "No está asentado en ningún sitio en\nconcreto porque busca constantemente\nlugares limpios y cómodos donde dormir.", "Non ha una tana fissa perché è sempre\nalla ricerca di un posto bello e\naccogliente in cui dormire.", "The reason it does not have a nest\nis that it simply searches for a clean,\ncomfortable place then sleeps there.") },
            // { PBESpecies.302, new PBELocalizedString("どうくつの　くらやみに　ひそむ。\nほうせきを　たべているうちに\nめが　ほうせきに　なってしまった。", "동굴의 어둠에 숨는다.\n보석을 먹는 사이에\n눈이 보석이 되어 버렸다.", "À force de manger des gemmes, les\nyeux de ce Pokémon des grottes\nobscures sont devenus des joyaux.", "Es versteckt sich im Dunkeln von\nHöhlen. Seine Augen sind Edelsteine.", "Se oculta en cavernas oscuras.\nDe tanto comer gemas, sus ojos\nson piedras preciosas.", "Si cela nell'oscurità delle caverne.\nSi nutre di gemme e per questo i suoi\nocchi sono pietre preziose.", "It hides in the darkness of caves.\nIts diet of gems has transformed\nits eyes into gemstones.") },
            // { PBESpecies.303, new PBELocalizedString("ツノが　へんけいして　できた\nおおあごが　あたまに　ついている。\nてっこつを　かみきってしまう。", "뿔이 변형되어 생긴\n큰 턱이 머리에 달려 있다.\n철골을 물어서 끊어 버린다.", "Ses cornes forment une grande\nmâchoire attachée à sa tête. Elle\npeut broyer des barres de fer.", "Auf seinem Kopf befindet sich ein\nriesiger Kiefer, der aus Hörnern\nbesteht. Er kann Eisen zermalmen.", "Las grandes fauces de su cabeza\nestán formadas por cuernos.\nPuede romper el hierro con ellas.", "Le sue due enormi mandibole sono corna\ntrasformate. Con esse può masticare\npersino travi di ferro.", "Attached to its head is a huge\nset of jaws formed by horns.\nIt can chew through iron beams.") },
            // { PBESpecies.304, new PBELocalizedString("はがねの　からだを　つくるために\nてっこうせきを　たべている。ときどき\nレールも　たべてしまう　こまりもの。", "강철의 몸을 만들기 위해\n철광석을 먹는다. 가끔\n레일도 먹어버리는 말썽꾼.", "Il dévore le minerai pour constituer son\ncorps. C'est une nuisance qui s'attaque\nmême aux rails de chemin de fer.", "Es baut sich einen Körper aus Stahl auf,\nindem es Eisenerz verzehrt. Gelegentlich\nfrisst es auch Schienenteile auf.", "Se alimenta de hierro para construir\nsu cuerpo de acero. Aron es un incordio\nporque a menudo se come vías de tren.", "Si nutre di rocce ricche di ferro per\nalimentare il suo corpo d'acciaio. A volte\nmangia rotaie, creando seri problemi.", "In order to build up its steel body,\nit eats iron ore. This pesky Pokémon\nis known to eat railroad tracks.") },
            // { PBESpecies.305, new PBELocalizedString("なわばり　あらそいのため　コドラが\nはがねのからだを　ぶつけあうと\nもじどおり　ひばなが　とびちるのだ。", "영역싸움 때문에 갱도라가\n강철의 몸을 서로 부딪치면\n말 그대로 불꽃이 튄다.", "Un combat de Galegon fait littéralement\ndes étincelles quand leurs corps d'acier\ns'entrechoquent.", "Prallen bei Revierkämpfen die stählernen\nKörper von zwei Stollrak aufeinander,\nsprühen buchstäblich die Funken.", "Los Lairon disputan luchas territoriales.\nCuando sus cuerpos de acero chocan,\nsaltan chispas por todas partes.", "Quando due Lairon si scontrano per\ndifendere il territorio, i loro corpi di\nmetallo fanno letteralmente scintille.", "Lairon fight over territory,\nand when their steel bodies\ncollide, sparks fly.") },
            // { PBESpecies.306, new PBELocalizedString("やまを　まるごと　なわばりに　する。\nキズが　おおい　ボスゴドラほど\nたたかっているので　あなどれない。", "산을 통째로 영역으로 한다.\n상처가 많은 보스로라일수록\n많이 싸웠다는 것이므로 얕볼 수 없다.", "Il établit son territoire sur toute une\nmontagne. Ses cicatrices indiquent son\nexpérience: plus il en a, plus il est fort!", "Ihre Reviere erstrecken sich über ganze\nGebirge. Stolloss, die mit Narben übersät\nsind, sollte man besser meiden.", "Hacen de toda una montaña su territorio.\nCuantas más cicatrices tienen, más\ncurtidos en disputas. ¡Mucha atención!", "Sceglie come territorio intere montagne.\nSe ha tante cicatrici sul suo corpo,\nè meglio non scherzare con lui.", "It claims an entire mountain as its own.\nThe more wounds it has, the more it has\nbattled, so don't take it lightly.") },
            // { PBESpecies.307, new PBELocalizedString("いつもは　やまおくで　しゅぎょう。\nめいそうをして　せいしんりょくを\nたかめると　からだが　うかびあがる。", "평상시는 깊은 산속에서 수행한다.\n명상을 하고 정신력을\n높이면 몸이 떠오른다.", "Son entraînement d'ermite lui\npermet de léviter par le seul\npouvoir de la méditation.", "Trainiert tief in den Bergen. Erhöht\nes seine spirituelle Kraft durch\nMeditation, kann es schweben.", "Se entrena en la profundidad de las\nmontañas. Cuando aumenta su poder\nespiritual con meditación, levita.", "Si allena in montagna per elevare il suo\npotere spirituale. Con la meditazione\nriesce a levitare.", "It always trains deep in mountains.\nIt levitates when it heightens its\nspiritual power through meditation.") },
            // { PBESpecies.308, new PBELocalizedString("なにも　たべずに　ただひたすらに\nせいしんを　とぎすませると\nあいてのオーラが　みえるようになる。", "아무것도 먹지 않고 한결같이\n정신을 맑게 닦으면\n상대의 오라가 보이게 된다.", "Le jeûne lui permet de concentrer\nson esprit au point de déceler\nl'aura de ses adversaires.", "Es kann die Aura seines Gegners\nerkennen, indem es durch Hungern\nseinen Geist schärft.", "Cuando ayuna, adquiere la habilidad\nde ver el aura de sus adversarios.", "Riesce a percepire l'aura dei nemici\nallenando la sua mente tramite il digiuno.", "It gains the ability to see the aura\nof its opponents by honing its mind\nthrough starvation.") },
            // { PBESpecies.309, new PBELocalizedString("たいもうに　ためた　でんきを　つかい\nきんにくを　しげきすることで\nしゅんぱつりょくを　たかめる。", "털에 모은 전기를 써서\n근육을 자극함으로써\n순발력을 높인다.", "Il améliore ses réflexes en\nstimulant ses muscles grâce à\nl'électricité dans sa fourrure.", "Die Elektrizität, die es im Fell\nspeichert, nutzt es, um seine\nMuskeln zu stimulieren.", "Estimula sus músculos y aumenta\nsus reflejos con la electricidad\nque almacena su pelaje.", "L'elettricità immagazzinata nella\npelliccia gli stimola i muscoli e aumenta\nla sua velocità di reazione.", "Using electricity stored in its fur,\nit stimulates its muscles to\nheighten its reaction speed.") },
            // { PBESpecies.310, new PBELocalizedString("たてがみから　ほうでんしている。\nずじょうに　かみなりぐもを　つくり\nいなずまを　おとして　こうげきする。", "갈기에서 방전을 하고 있다.\n머리 위에 번개 구름을 만들고\n천둥번개를 떨어뜨려 공격한다.", "Il libère l'électricité par sa crinière.\nIl crée un nuage d'orage pour appeler\nla foudre.", "Aus seiner Mähne entlädt es Elekt-\nrizität. Es generiert eine Gewitter-\nwolke, aus der es Blitze entlädt.", "Descarga electricidad desde su\nmelena. Crea nubarrones desde\nlos que lanza rayos.", "Scarica elettricità dalla criniera. Crea\nnubi temporalesche in cielo che fanno\ncadere saette.", "It discharges electricity from its\nmane. It creates a thundercloud\noverhead to drop lightning bolts.") },
            { PBESpecies.Plusle, new PBELocalizedString("ひばなの　ボンボンを　つくって\nなかまを　おうえんする。\nでんちゅうから　でんきを　すいとる。", "스파크를 톡톡 만들어\n동료를 응원한다.\n전신주에서 전기를 흡수한다.", "Il absorbe l'énergie des poteaux\nélectriques et encourage ses amis\navec des pompons d'étincelles.", "Es feuert Freunde mit Pompons an,\ndie aus Funken bestehen. Es holt\nsich Energie aus Telegrafenmasten.", "Anima a sus compañeros con\npompones de chispas. Roba\nenergía de los postes telefónicos.", "Incoraggia gli amici con un vivace\nscoppiettio di scintille. Assorbe\nelettricità dai pali telefonici.", "It cheers on friends with pom-poms\nmade of sparks. It drains power\nfrom telephone poles.") },
            { PBESpecies.Minun, new PBELocalizedString("なかまを　おうえんする　しゅうせい。\nまけそうになると　からだから　だす\nひばなの　かずが　どんどん　ふえる。", "동료를 응원하는 습성이 있다.\n질 것 같아지면 몸에서 내는\n스파크의 수가 점점 늘어난다.", "Il encourage ses amis. Son corps\nproduit plus d'étincelles quand il\nest en mauvaise posture.", "Es feuert Freunde an. Sind diese im\nBegriff zu verlieren, gibt sein Körper\nimmer mehr Funken ab.", "Le gusta animar a sus amigos.\nSi pierden, su cuerpo suelta\ncada vez más chispas.", "Incoraggia gli amici e, se questi perdono,\nil suo corpo emette una maggiore\nquantità di scintille.", "It cheers on friends. If its\nfriends are losing, its body lets\noff more and more sparks.") },
            // { PBESpecies.313, new PBELocalizedString("よるになると　おしりを　ひからせ\nなかまと　かいわする。イルミーゼの\nだす　あまい　かおりが　だいすき。", "밤이 되면 엉덩이를 빛나게 해\n동료와 대화한다. 네오비트가\n내는 달콤한 향기를 매우 좋아한다.", "Il communique avec ses pairs en\nallumant son postérieur la nuit. Il\nadore le doux parfum de Lumivole.", "Es kommuniziert mit anderen, indem\nes sein Hinterteil zum Leuchten bringt.\nEs liebt Illumises Duft.", "Se comunica con otros iluminando\nsu cola por la noche. Le encanta\nel suave aroma de Illumise.", "Di notte comunica con gli altri illuminando\nla sua coda. Ama il dolce aroma di\nIllumise.", "It communicates with others by\nlighting up its rear at night. It\nloves Illumise's sweet aroma.") },
            // { PBESpecies.314, new PBELocalizedString("あまい　かおりで　バルビートを\nゆうどうして　よぞらに\nひかりの　サインを　えがく。", "달콤한 향기로 볼비트를\n유도해서 밤하늘에\n빛의 사인을 그린다.", "Il utilise son doux parfum pour aider\nMuciole à décrire des arabesques\ndans le ciel nocturne.", "Sein süßer Duft leitet Volbeat an,\nZeichen aus Licht an den\nNachthimmel zu malen.", "Su suave aroma guía a Volbeat\npara que haga señales luminosas\nen el cielo nocturno.", "Con il suo dolce aroma dirige il volo\ndi Volbeat, che disegna figure luminose\nnel cielo stellato.", "With its sweet aroma, it guides\nVolbeat to draw signs with light in\nthe night sky.") },
            // { PBESpecies.315, new PBELocalizedString("みぎてと　ひだりてで　\xFF12しゅるいの\nどくを　つかいわけて　こうげきする。\nかおりが　つよいほど　げんきだ。", "오른손과 왼손으로 2종류의\n독을 구별하여 공격한다.\n향기가 강할수록 기운이 넘친다.", "Chacune de ses mains sécrète un poison\ndifférent. Plus un Rosélia est en bonne\nsanté, plus ses parfums sont puissants.", "Aus seinen Händen verströmt es jeweils\nein anderes Gift. Je stärker es duftet,\ndesto gesünder ist es.", "Ataca con sus manos, en las que tiene\nun tipo de veneno diferente en cada una.\nCuanto más aroma, mejor salud tiene.", "Attacca usando abilmente i due tipi di\nveleno delle estremità dei suoi arti. Più è\nforte la sua fragranza, più è in salute.", "It uses the different poisons in each\nhand separately when it attacks. The\nstronger its aroma, the healthier it is.") },
            // { PBESpecies.316, new PBELocalizedString("からだの　ほとんどが　いぶくろ。\nきょうりょくな　いえきで　のみこんだ\nものを　たちまち　しょうかする。", "몸 대부분이 위다.\n강력한 위액으로 삼킨\n것을 순식간에 소화한다.", "Il est principalement composé d'un\nestomac dont les sucs digestifs\ndissolvent tout ce qu'il avale.", "Sein Körper besteht fast nur aus Magen.\nSeine starken Verdauungssäfte\nzersetzen alles sehr schnell.", "Casi todo su cuerpo es estómago.\nSus potentes jugos gástricos\ndisuelven rápido cualquier cosa.", "La maggior parte del suo corpo è\nstomaco. I suoi succhi gastrici\ndissolvono subito ciò che ingerisce.", "Almost all its body is its stomach.\nIts harsh digestive juices quickly\ndissolve anything it swallows.") },
            // { PBESpecies.317, new PBELocalizedString("なんでも　まるのみしてしまう。\nけあなから　もうどくの　たいえきを\nぶんぴつして　てきに　あびせかける。", "무엇이든 통째로 삼켜 버린다.\n모공에서 맹독의 체액을\n분비하여 상대에게 끼얹는다.", "Il avale tout en une bouchée. Ses\nfollicules sécrètent des fluides\ntoxiques qui endorment l'ennemi.", "Es verschluckt alles in einem Stück\nund sondert giftige Stoffe ab, mit\ndenen es Gegner besprüht.", "Se traga cualquier cosa de una\npieza. Sus poros segregan fluidos\ntóxicos que dañan a sus enemigos.", "Inghiotte intera qualsiasi cosa. Dai pori\ntraspira un liquido tossico con cui bagna\ni nemici.", "It swallows anything whole.\nIt sweats toxic fluids from its\nfollicles to douse foes.") },
            // { PBESpecies.318, new PBELocalizedString("なわばりに　はいってきた　あいてを\nしゅうだんで　こうげき。するどい\nキバは　ボートの　そこも　かみきる。", "영역에 침입한 상대를 집단으로\n공격한다. 날카로운 이빨은\n보트의 밑바닥도 물어뜯는다.", "Il attaque en banc quand on menace\nson territoire. Ses dents aiguisées\npeuvent couler un navire.", "Sie begegnen jedem Gegner, der in\nihr Revier eindringt, im Schwarm. Ihre\nZähne durchdringen alles.", "Rodean a los enemigos que osan\ninvadir su territorio. Sus afilados\ncolmillos dañan los barcos.", "Attacca in branco chi invade il suo\nterritorio. Le zanne aguzze lacerano\nanche gli scafi delle navi.", "They swarm any foe that invades\ntheir territory. Their sharp fangs\ncan tear out boat hulls.") },
            // { PBESpecies.319, new PBELocalizedString("てっぱんも　かみちぎる　キバを　もち\nおよぐ　そくどは　じそく\xFF11\xFF12\xFF10キロ。\nべつめいは　うみのギャング。", "철판도 물어 찢는 이빨을 가지며\n헤엄치는 속도는 시속 120km다.\n별명은 바다의 건달이다.", "Ses crocs lacèrent des feuilles\nd'acier. Il nage à 120 km/h. On\nl'appelle “tyran des mers\".", "Seine Zähne durchdringen sogar Eisen.\nEs schwimmt mit 120 km/h und wird\n„Tyrann des Meeres“ genannt.", "Con sus colmillos puede atravesar\nel acero. Nada a 120 km/h.\nLe llaman el Terror de los Mares.", "Con le sue zanne può spezzare il ferro.\nNuota a 120 km/h. È noto come\nil “Tiranno del mare\".", "Its fangs rip through sheet iron.\nIt swims at 75 mph and is known as\n“The Bully of the Sea.\"") },
            // { PBESpecies.320, new PBELocalizedString("まいにち　\xFF11トンの　エサをたべる。\nはなから　ためこんだ　かいすいを\nいきおいよく　ふきだして　あそぶ。", "매일 1톤의 먹이를 먹는다.\n코에서 모은 해수를\n기세 좋게 내뿜으며 논다.", "Il mange près d'une tonne de nourriture\npar jour. Jouer avec son jet d'eau est\nson passe-temps favori.", "Es nimmt täglich eine Tonne an Nahrung\nauf und lässt verspielt Wasserfontänen\naus seinem Atemloch aufschießen.", "Engulle una tonelada de comida al día.\nLe gusta jugar expulsando con energía\nel agua marina por sus espiráculos.", "Mangia una tonnellata di cibo al giorno.\nSi diverte a spruzzare con forza l'acqua\nmarina attraverso il suo sfiatatoio.", "It eats one ton of food every day.\nIt plays by shooting stored seawater\nout its blowholes with great force.") },
            // { PBESpecies.321, new PBELocalizedString("おおきな　からだを　なみのうえで\nジャンプさせ　しょうげきを　うみだし\nあいてを　きぜつ　させることがある。", "커다란 몸을 파도 위에서\n점프시켜 충격을 만들어\n상대를 기절시킬 때가 있다.", "L'énorme fracas résultant de ses sauts\npar-dessus les vagues peut faire perdre\nconnaissance à ses adversaires.", "Springt es mit seinem gewaltigen Körper\nvon einer Welle ab, kann es Gegner allein\nmit der Wucht des Aufpralls besiegen.", "Puede dejar fuera de combate a sus\noponentes con el impacto de su enorme\ncuerpo al caer en el agua tras un salto.", "L'impatto creato dai suoi salti fuori e\ndentro l'acqua può arrivare a mandare\nKO un avversario.", "It can sometimes knock out opponents\nwith the shock created by breaching and\ncrashing its big body onto the water.") },
            // { PBESpecies.322, new PBELocalizedString("\xFF11\xFF12\xFF10\xFF10どの　マグマを　たいないに\nためこんでいる。ほのおの　わざを\nつかうと　コブは　ちいさく　しぼむ。", "1200도의 마그마를 체내에\n모아두고 있다. 불꽃 기술을\n사용하면 혹은 작게 쪼그라든다.", "Son corps renferme une lave à plus de\n1 200 °C. Sa bosse se contracte lorsqu'il\nutilise des capacités de type Feu.", "In seinem Körper fließt 1 200 Grad heißes\nMagma. Nach Einsatz einer Feuer-Attacke\nschrumpft sein Höcker.", "Almacena en su cuerpo magma a 1200°.\nSu joroba mengua cuando utiliza\nmovimientos de tipo Fuego.", "Nel suo corpo accumula magma che ribolle\na 1200°C. Dopo aver usato una mossa di\ntipo Fuoco, la sua gobba si restringe.", "The magma in its body reaches\n2,200 degrees F. Its hump gets smaller\nwhen it uses Fire-type moves.") },
            // { PBESpecies.323, new PBELocalizedString("せなかの　コブの　かざんは\n\xFF11\xFF10ねんごとに　だいふんか　するが\nはげしく　おこっても　ふんかする。", "등의 혹 모양 화산은\n10년마다 대분화하나\n심하게 화가 나도 분화한다.", "Les volcans sur son dos entrent en\néruption tous les dix ans ou chaque\nfois qu'il se met en colère.", "Seine Vulkanhöcker brechen nur alle\n10 Jahre aus, oder wenn es richtig\nwütend ist.", "Los volcanes de su joroba entran\nen erupción cada 10 años o cuando\nCamerupt se enfada mucho.", "I vulcani sul suo dorso eruttano ogni\ndieci anni, o quando è veramente\narrabbiato.", "The volcanoes on its back have a\nmajor eruption every 10 years--or\nwhenever it becomes really angry.") },
            // { PBESpecies.324, new PBELocalizedString("こうらの　なかで　せきたんを　もやし\nエネルギーに　している。ピンチの\nときは　くろい　ススを　ふきだす。", "등껍질 속에 석탄을 태워서\n에너지로 사용한다. 위급할\n때는 까만 그을음을 뿜어낸다.", "Il tire son énergie du charbon qu'il\nbrûle dans sa carapace et crache\nde la suie noire en cas de danger.", "In seinem Panzer verbrennt es\nKohle und gewinnt daraus Energie.\nBei Gefahr sondert es Ruß ab.", "Quema carbón en su caparazón\npara obtener energía. Si le atacan,\necha un denso humo negro.", "Genera energia bruciando carbone\nall'interno della corazza. Se è in\npericolo, emette fuliggine scura.", "It burns coal inside its shell for\nenergy. It blows out black soot if\nit is endangered.") },
            // { PBESpecies.325, new PBELocalizedString("しっぽを　バネがわりに　して\nとびはねることで　しんぞうを\nうごかしているので　とまると　しぬ。", "꼬리를 용수철 대용으로 해서\n뛰어오르는 것으로 심장을\n움직이고 있어 멈추면 죽는다.", "Sa queue lui permet de bondir à des\nhauteurs incroyables et de faire battre\nson cœur. S'il s'arrête, il meurt.", "Es nutzt seinen Schweif als Sprungfeder,\num sein Herz am Pumpen zu halten.\nHört es auf zu springen, stirbt es.", "Utiliza su cola a modo de muelle y bota\nsin cesar para hacer que su corazón\nlata. Si se detiene, su corazón, también.", "Usa la coda come molla per rimbalzare in\nmodo da mantenere vivo il battito del suo\ncuore, che altrimenti si fermerebbe.", "Using its tail like a spring, it keeps\nits heart beating by bouncing\nconstantly. If it stops, it dies.") },
            // { PBESpecies.326, new PBELocalizedString("くろしんじゅで　サイコパワーを\nつよめ　きみょうな　ステップで\nあいての　こころを　あやつるぞ。", "흑진주로 사이코 파워를\n강하게 하여 기묘한 스텝으로\n상대의 마음을 조종한다.", "Les perles noires amplifient ses pouvoirs\npsychiques, lui permettant de contrôler\nses ennemis avec sa danse étrange.", "Mit schwarzen Perlen verstärkt es\nseine Psycho-Kräfte. Mit einem\nTanz kontrolliert es seine Gegner.", "Las perlas negras aumentan sus poderes\npsíquicos. Controla las mentes de sus\nrivales con un extraño baile.", "Amplifica i suoi poteri psichici con le sue\nperle nere. Si esibisce anche in danze\nbizzarre per controllare i suoi nemici.", "It uses black pearls to amplify its\npsychic power. It does a strange\ndance to control foes' minds.") },
            // { PBESpecies.327, new PBELocalizedString("おなじ　ブチもようの　パッチールは\nいない。フラフラした　あしどりで\nあいての　ねらいを　はずす。", "똑같은 얼룩무늬의 얼루기는\n없다. 휘청휘청거리는 걸음걸이로\n상대의 노림수를 피한다.", "Les motifs sur leur fourrure sont\npropres à chaque Spinda. Son pas\nchancelant le rend difficile à viser.", "Das Muster eines Pandir ist wie ein\nFingerabdruck. Sein Taumeln senkt\ndie gegnerische Zielsicherheit.", "No hay dos Spinda que tengan\nidénticos pelajes. Su tambaleo\nal bailar confunde a los rivales.", "Non ci sono due Spinda con lo stesso\nmotivo maculato. Il suo passo\nbarcollante confonde i nemici.", "No two Spinda have the same\npattern of spots. Its tottering\nstep fouls the aim of foes.") },
            // { PBESpecies.328, new PBELocalizedString("ぜったいに　だっしゅつ　ふかのうな\nすりばちじょうの　すあなを　つくって\nえものが　おちてくるのを　まつ。", "절대 탈출 불가능한\n원뿔형의 둥지를 만들어\n먹이가 떨어지는 것을 기다린다.", "Il creuse puis attend ses proies dans\nson antre, un trou conique dont il est\nimpossible de s'échapper.", "Es baut sich ein trichterförmiges Loch,\naus dem es kein Entrinnen gibt, und\nwartet, bis Beute hineinfällt.", "Excava fosas cóncavas de las cuales\nresulta imposible escapar y espera\na que una presa caiga en su interior.", "Costruisce un nido a forma di imbuto dal\nquale non si può scappare, aspettando\npoi che le prede cadano in trappola.", "It makes an inescapable conical pit\nand lies in wait at the bottom\nfor prey to come tumbling down.") },
            // { PBESpecies.329, new PBELocalizedString("\xFF12まいの　ハネを　こうそくで\nしんどうさせて　だす　ちょうおんぱは\nはげしい　ずつうを　ひきおこす。", "2장의 날개를 고속으로\n진동시켜서 내는 초음파는\n격렬한 두통을 불러일으킨다.", "Ses violents battements d'ailes\ngénèrent des vagues d'ultrasons\nqui donnent d'intenses migraines.", "Die Schallwellen, die es durch eine\nhohe Flügelschlagfrequenz erzeugt,\nverursachen heftige Kopfschmerzen.", "Al agitar a gran velocidad ambas alas,\nemite ondas ultrasónicas que provocan\nfuertes dolores de cabeza.", "Fa vibrare velocemente le ali generando\nonde ultrasoniche che provocano dei\nforti mal di testa.", "The ultrasonic waves it generates\nby rubbing its two wings together\ncause severe headaches.") },
            // { PBESpecies.330, new PBELocalizedString("さばくのせいれい　と　よばれる。\nはばたくことで　まきおこした\nすなあらしの　なかに　かくれている。", "사막의 정령이라고 불린다.\n날개를 쳐서 일으킨\n모래바람 속에 숨어 있다.", "On l'appelle “esprit du désert\".\nSon puissant battement d'ailes provoque\ndes tempêtes de sable qui le dissimulent.", "Auch bekannt als „Geist der Wüste“.\nEs versteckt sich in Sandstürmen, die\nes durch seinen Flügelschlag erzeugt.", "Se le conoce como el Alma del Desierto.\nLevanta tormentas de arena al batir\nsus alas y se refugia en su interior.", "Viene chiamato “Spirito primordiale del\ndeserto\". Si nasconde nelle tempeste di\nsabbia che genera battendo le ali.", "Known as “The Desert Spirit,\"\nthis Pokémon hides in the sandstorms\nit causes by beating its wings.") },
            // { PBESpecies.331, new PBELocalizedString("さばくに　せいそく。たいないに\nすいぶんを　ためることで　みずを\nのまずに　\xFF13\xFF10にちかん　いきられる。", "사막에 서식한다. 체내에\n수분을 모아 물을 마시지\n않고도 30일간 살 수 있다.", "En stockant l'eau dans son corps,\ncet habitant du désert peut\nsurvivre 30 jours sans boire.", "Dieser Wüstenbewohner speichert\nWasser in seinem Körper. So kann\ner 30 Tage ohne Wasser überleben.", "Habita en el desierto. Aguanta 30 días\nsin agua gracias a la que almacena\nen su cuerpo.", "Immagazzina acqua nel corpo e riesce\na sopravvivere nel deserto senz'acqua\nanche per 30 giorni.", "By storing water in its body, this\ndesert dweller can survive for 30\ndays without water.") },
            // { PBESpecies.332, new PBELocalizedString("よるになると　かつどうを　はじめる。\nさばくの　あつさに　つかれはてた\nえものを　みつけだし　とらえるのだ。", "밤이 되면 활동을 시작한다.\n사막의 뜨거움에 몹시 지친\n먹이를 찾아내어 붙잡는다.", "Il sort la nuit pour chasser. Il\ntraque les proies épuisées après\nune journée dans le désert.", "Ein nachtaktives Pokémon, das Beute\nsucht, die durch die Tageshitze der\nWüste bereits erschöpft ist.", "Es un Pokémon nocturno. Busca\npresas agotadas por el calor\ndiurno del desierto.", "Diventa attivo di notte, quando va a\ncaccia di prede stremate dalla calura\ndel deserto.", "It becomes active at night,\nseeking prey that is exhausted\nfrom the day's desert heat.") },
            // { PBESpecies.333, new PBELocalizedString("ひとの　あたまの　うえに\nちょこんと　のって　ぼうしのように\nふるまうのが　なぜか　だいすき。", "사람의 머리 위에\n살짝 앉아 모자처럼\n구는 것을 왠지 좋아한다.", "Son jeu préféré: se poser sur la tête\ndes gens et se faire passer pour un\njoli chapeau.", "Aus irgendeinem Grund setzt es sich\ngerne auf den Kopf von Menschen\nund tut so, als sei es ein Hut.", "Se desconoce el porqué, pero le encanta\nposarse sobre la cabeza de los humanos\ny fingir que es un gorro.", "Per qualche motivo adora salire sulla\ntesta delle persone e far finta di essere\nun cappello.", "For some reason, it likes\nto land on people's heads\nsoftly and act like it's a hat.") },
            // { PBESpecies.334, new PBELocalizedString("はれたひ　わたぐもに　まぎれながら\nおおぞらを　じゆうに　とびまわり\nうつくしい　ソプラノで　うたう。", "맑은 날 뭉게구름에 뒤섞이면서\n넓은 하늘을 자유롭게 날아다니며\n아름다운 소프라노로 노래한다.", "Il vole librement en se cachant dans les\nnuages. Son chant est digne de celui de\nla plus douée des sopranos.", "Bei gutem Wetter mischt es sich unter\ndie Wolken und genießt die Freiheit.\nEs hat eine entzückende Sopranstimme.", "En días soleados, le gusta mezclarse con\nlas nubes y disfrutar de la libertad del\ncielo mientras trina con voz de soprano.", "Nelle belle giornate, ama confondersi\ncon le poche nuvole in cielo e cantare\ncon una bellissima voce di soprano.", "On sunny days, it flies freely through\nthe sky and blends into the clouds.\nIt sings in a beautiful soprano.") },
            // { PBESpecies.335, new PBELocalizedString("ハブネークとは　いんねんの　あいだ。\nであうと　すかさず　まえあしの\nツメを　ひろげて　いかくするのだ。", "세비퍼와는 사연이 깊은 사이.\n만나면 곧바로 앞발의\n발톱을 펼쳐 위협한다.", "L'ennemi juré de Séviper. Il est\nparticulièrement menaçant quand\nil utilise ses griffes aiguisées.", "Der Erzfeind von Vipitis. Es bedroht\njeden, dem es begegnet, indem es die\nKlauen an seinen Vorderbeinen ausfährt.", "Le une una relación de enemistad con\nSeviper. Al toparse con alguien, alarga\nsus afiladas zarpas para intimidarlo.", "Acerrimo nemico di Seviper. Se l'incontra,\nlo minaccia immancabilmente sfoderando\ngli artigli.", "It's Seviper's archrival. To threaten\nthose it encounters, it fans out\nthe claws on its front paws.") },
            // { PBESpecies.336, new PBELocalizedString("しっぽの　かたなは　いつも　いわで\nといでいるので　きれあじ　ばつぐん。\nザングースとは　いんねんの　あいだ。", "꼬리의 칼은 항상 바위로\n갈고 있어 날카로움이 뛰어나다.\n쟝고와는 사연이 깊은 사이다.", "Il affûte la lame de sa queue sur des\nrochers pour la rendre bien tranchante.\nLe rival de longue date de Mangriff.", "Es hält die Klinge an seinem Schweif\nscharf, indem es sie ständig an Steinen\nwetzt. Es ist der Erzfeind von Sengo.", "Le une una relación de enemistad con\nZangoose. Se lima con las rocas su cola\nen forma de espada para tenerla afilada.", "Affila di continuo la lama della sua coda\nsulle rocce per renderla taglientissima.\nÈ un acerrimo nemico di Zangoose.", "Constant polishing makes the edge\nof the blade on its tail extremely sharp.\nIt's Zangoose's archrival.") },
            // { PBESpecies.337, new PBELocalizedString("つきの　みちかけと　パワーの\nぞうげんが　かんけい　しているらしく\nまんげつの　よる　かっぱつになる。", "달의 차고 기욺과 힘의\n증감이 관계하고 있는 듯\n보름달 밤에 활발해진다.", "Sa force est liée au cycle lunaire.\nIl est actif surtout les soirs de\npleine lune.", "Anscheinend steht die Zunahme seiner\nKraft mit den Mondphasen in Verbindung,\nda es bei Vollmond aktiv wird.", "Se piensa que las fases lunares tienen\nrelación con la fluctuación de su poder.\nEstá activo las noches de luna llena.", "La sua forza sembra aumentare o\ndiminuire a seconda delle fasi lunari.\nÈ più attivo nelle notti di luna piena.", "The phase of the moon apparently\nhas some effect on its power.\nIt's active on the night of a full moon.") },
            // { PBESpecies.338, new PBELocalizedString("たいようエネルギーが　パワーの\nみなもと　なので　ひるまは　つよい。\nかいてんすると　からだが　ひかる。", "태양 에너지가 파워의\n근원이라서 낮에는 강하다.\n회전하면 몸이 빛난다.", "Il tire sa force de l'énergie solaire.\nIl est donc particulièrement à l'aise en\njournée. Il s'illumine quand il tourne.", "Da es seine Energie aus Sonnenlicht\ngewinnt, ist es tagsüber am stärksten.\nWenn es sich dreht, leuchtet es.", "Su fuente de energía es el sol, por lo\nque es más fuerte durante el día.\nEmite luz al girar.", "L'energia solare è la fonte della sua\npotenza, per cui è più forte di giorno.\nEmana luce quando ruota su se stesso.", "Solar energy is the source of its power,\nso it is strong during the daytime.\nWhen it spins, its body shines.") },
            // { PBESpecies.339, new PBELocalizedString("ぬるぬるの　からだは　つかみにくい。\nある　ちほうでは　どろが　かたまって\nドジョッチが　うまれたと　いわれる。", "미끈미끈한 몸은 잡기 어렵다.\n어떤 지방에서는 진흙이 굳어져서\n미꾸리가 생겨났다고 전해진다.", "Son corps glissant est difficile à\nattraper. On dit qu'il a été créé\ndans de la boue solidifiée.", "Sein schlanker Körper ist schwer zu\ngreifen. Man vermutet, es sei aus\ngehärtetem Schlamm entstanden.", "Su escurridizo cuerpo es difícil de\nagarrar. En cierta región se dice\nque ha nacido de barro endurecido.", "Il suo viscido corpo è difficile da\nafferrare. In una regione si dice\nche sia nato da fango indurito.", "Its slimy body is hard to grasp. In\none region, it is said to have been\nborn from hardened mud.") },
            // { PBESpecies.340, new PBELocalizedString("なわばりいしきが　とても　つよく\nがいてきが　ちかづくと　はげしく\nじめんを　ゆらして　おそいかかる。", "영역 의식이 매우 강하여\n외부의 적이 다가오면 격렬하게\n지면을 울리며 덤벼든다.", "Il défend férocement son territoire\nen déclenchant des secousses\nterribles.", "Es bewacht sein Territorium.\nNähert sich ein Gegner, greift es\nmit heftigen Erschütterungen an.", "Protege su territorio por encima\nde todo. Si se acerca un enemigo,\nataca con violentas sacudidas.", "Ha un senso del territorio molto\nsviluppato. Se un nemico si avvicina,\nscatena forti terremoti.", "It is extremely protective of its\nterritory. If any foe approaches,\nit attacks using vicious tremors.") },
            // { PBESpecies.341, new PBELocalizedString("どんなに　みずが　よごれた\nかわでも　てきおうして　ふえていく\nタフな　せいめいりょくの　もちぬし。", "아무리 물이 더러운\n강이라도 적응해서 번식하는\n터프한 생명력의 소유자.", "Sa nature robuste lui permet de\nprospérer dans n'importe quelles\neaux, aussi polluées soient-elles.", "Egal, wie schmutzig der Fluss ist, in dem\nsie leben, sie passen sich daran an und\nvermehren sich. Sie sind hart im Nehmen.", "Por sucio o contaminado que esté el río,\nse adaptan rápido y se multiplican.\nPoseen una gran fuerza vital.", "La sua grande vitalità gli permette\ndi adattarsi e proliferare anche nelle\nacque dei fiumi più inquinati.", "No matter how dirty the water\nin the river, it will adapt and thrive.\nIt has a strong will to survive.") },
            // { PBESpecies.342, new PBELocalizedString("こうせんてきな　ポケモンで　じぶんの\nなわばりから　あらゆる　ポケモンを\nハサミで　つまんで　なげとばすぞ\xFF01", "호전적인 포켓몬으로 자신의\n영역에서 모든 포켓몬을\n집게로 집어서 내던진다!", "C'est un voyou qui utilise ses\npinces pour chasser les autres\nPokémon hors de son territoire.", "Dieses rauflustige Pokémon nimmt\nEindringlinge mit seinen Scheren in die\nZange und wirft sie aus seinem Revier.", "De naturaleza violenta. Si un Pokémon se\naventura en su territorio, lo agarra con\nsus tenazas y lo arroja por los aires.", "È un Pokémon molto bellicoso che afferra\ncon le chele chiunque osi entrare nel suo\nterritorio per scaraventarlo fuori.", "Loving to battle, this Pokémon pinches\nall Pokémon that enter its territory\nwith its pincers and throws them out.") },
            // { PBESpecies.343, new PBELocalizedString("こだいの　いせきから　はっけん。\nかいてん　しながら　いどうして\nなかまを　みつけ　むれを　なす。", "고대 유적에서 발견.\n회전하면서 이동해\n동료를 발견하고 무리를 이룬다.", "Découvert dans d'anciennes ruines.\nIl se déplace en tournoyant et est\ntoujours à la recherche de semblables.", "Es wurde in antiken Ruinen entdeckt und\nbewegt sich drehend fort. Trifft es auf\nArtgenossen, bildet es eine Herde.", "Fue descubierto en unas antiguas ruinas.\nSe mueve girando sobre su eje y forma un\ngrupo si se encuentra con otros como él.", "È stato scoperto in antiche rovine. Si\nsposta ruotando su se stesso. Cerca\ni suoi simili per formare dei branchi.", "Discovered in ancient ruins, it moves\nby spinning around and forms a group\nwhen it finds others.") },
            // { PBESpecies.344, new PBELocalizedString("\xFF12まんねんまえの　こだいじんが\nつくった　ドロにんぎょうから\nうまれたらしい　ナゾの　ポケモン。", "2만 년 전 고대인이\n만든 진흙인형에서\n태어난 듯한 의문의 포켓몬.", "Un Pokémon mystérieux né d'une\nfigurine d'argile vieille de près\nde 20 000 ans.", "Dieses rätselhafte Pokémon ist aus\neiner Lehmpuppe entstanden, die vor\n20 000 Jahren angefertigt wurde.", "Pokémon misterioso que nació a partir de\nuna figurilla de barro creada por una\ncivilización de hace 20 000 años.", "È un Pokémon enigmatico nato da\nun'antica statuetta d'argilla costruita\ndagli antichi 20.000 anni or sono.", "This mysterious Pokémon started life\nas an ancient clay figurine made over\n20,000 years ago.") },
            { PBESpecies.Lileep, new PBELocalizedString("およそ　\xFF11おくねんまえの　かいていで\nくらしていた　こだいの　ポケモン。\nかがくの　ちからで　ふっかつした。", "약 1억 년 전의 해저에서\n살고 있던 고대의 포켓몬이다.\n과학의 힘으로 부활했다.", "Il vivait au fond de la mer il y a\n100 millions d'années. La science\na permis de le ressusciter.", "Vor 100 Millionen Jahren lebte dieses\nPokémon auf dem Meeresgrund.\nDie Wissenschaft belebte es neu.", "Vivió en los fondos marinos hace\nunos 100 millones de años y fue\nrecreado científicamente.", "Viveva sul fondo marino 100 milioni di anni\nfa ed è stato rigenerato in laboratorio.", "It lived on the seafloor 100\nmillion years ago and was\nreanimated scientifically.") },
            { PBESpecies.Cradily, new PBELocalizedString("あたたかい　うみの　あさせに　いる。\nしおが　ひくと　すなはまに　もぐった\nえものを　ほりだして　たべる。", "따뜻한 바다의 얕은 곳에 있다.\n바닷물이 빠지면 모래 해변에\n숨어 있는 먹이를 파내어 먹는다.", "Vit dans les hauts-fonds des mers\nchaudes. Il déterre sa proie du\nsable quand la marée se retire.", "Es lebt in seichten Stellen warmer Meere.\nBei Ebbe sucht es im Sand nach Beute.", "Vive en el fondo de los mares de aguas\ntempladas. Emerge para cazar cuando\nbaja la marea.", "Vive in acque poco profonde nei mari\ncaldi. Con la bassa marea, scava sulla\nriva in cerca di prede.", "It lives in the shallows of warm\nseas. When the tide goes out, it\ndigs up prey from beaches.") },
            // { PBESpecies.347, new PBELocalizedString("かせきから　ふっかつした　ポケモンの\nせんぞの　いっしゅ。うみで　くらし\nツメで　えものを　つかまえる。", "화석에서 부활한 포켓몬의\n조상 중 하나. 바다에서 살고\n발톱으로 먹이를 잡는다.", "Un ancêtre Pokémon réanimé à partir\nd'un fossile. Il vivait en mer et\nchassait avec ses pinces.", "Ein Vorfahre der Pokémon, der aus einem\nFossil neu belebt wurde. Es lebte im Meer\nund jagte mit Klauen.", "Este Pokémon fue recreado a partir\nde restos fósiles. Vivía en el mar y\ncazaba con sus pinzas.", "Un antico Pokémon rigenerato da\nun fossile. Viveva nel mare e catturava\nle prede con gli artigli.", "A Pokémon ancestor that was\nreanimated from a fossil. It lived\nin the sea and hunted with claws.") },
            // { PBESpecies.348, new PBELocalizedString("しんかして　ちじょうで　くらすように\nなった。ぜんしんが　がんじょうな\nよろいに　おおわれている。", "진화하여 지상에서 살게\n되었다. 전신이 튼튼한\n갑옷으로 덮여 있다.", "Il a gagné la côte après son\névolution. Une armure robuste\nrecouvre son corps.", "Nach seiner Entwicklung ging es an Land.\nSein Körper ist von einer robusten\nRüstung umgeben.", "Tras evolucionar, este Pokémon fue\na tierra firme. Una dura coraza\nprotege todo su cuerpo.", "Dopo essersi evoluto, è andato a vivere\na riva. Tutto il suo corpo è rivestito da\nun'armatura robusta.", "It went ashore after evolving.\nIts entire body is clad in a sturdy\narmor.") },
            // { PBESpecies.349, new PBELocalizedString("みすぼらしく　みにくい　ポケモンだが\nしぶとい　せいめいりょくを　もち\nわずかな　みずだけでも　いきのびる。", "볼품없고 못생긴 포켓몬이지만\n강인한 생명력을 가져\n약간의 물만 있어도 살아남는다.", "Ce Pokémon a peut-être un physique\ndisgracieux, mais il est robuste et\npeut survivre dans très peu d'eau.", "Ein schäbiges, ja sogar hässliches\nPokémon. Dafür ist es abgehärtet\nund überlebt mit wenig Wasser.", "Su apariencia deja bastante que\ndesear, pero es muy resistente y\npuede sobrevivir con poca agua.", "È un Pokémon brutto e sciatto. Tuttavia,\nè molto resistente e sopravvive in\npochissima acqua.", "It is a shabby and ugly Pokémon.\nHowever, it is very hardy and\ncan survive on little water.") },
            // { PBESpecies.350, new PBELocalizedString("にじいろと　いわれる　きれいな\nウロコは　みるほうこうを　かえると\nさまざまな　いろに　へんかする。", "무지개색이라고 전해지는 아름다운\n비늘은 보는 방향을 바꾸면\n여러 가지 색으로 변화한다.", "Ses splendides écailles aux couleurs\nde l'arc-en-ciel changent de teinte\nselon l'angle de vue.", "Seine Schuppen sind regenbogenfarben.\nDie jeweiligen Farben verändern sich\nje nach Blickwinkel.", "Sus preciosas escamas tienen todos\nlos colores del arcoíris y cambian\nde color según el ángulo de visión.", "Le sue bellissime scaglie, che hanno i\nriflessi dell'arcobaleno, cambiano colore\na seconda dell'angolazione.", "Its lovely scales are described as\nrainbow colored. They change color\ndepending on the viewing angle.") },
            // { PBESpecies.351, new PBELocalizedString("きおんや　しつどが　さいぼうに\nえいきょう　するため　てんきによって\nすがたが　かわってしまう　ポケモン。", "기온이나 습도가 세포에\n영향을 주기 때문에 날씨에 따라\n모습이 바뀌는 포켓몬.", "La température et l'humidité influent sur\nses cellules, conduisant ce Pokémon à\nchanger d'aspect selon la météo.", "Dieses Pokémon ändert je nach Wetter\ndie Gestalt, da seine Zellstruktur auf\nTemperatur und Feuchtigkeit reagiert.", "La temperatura y la humedad afectan a\nsu estructura celular, por lo que su\naspecto cambia según la meteorología.", "Le sue cellule reagiscono all'umidità e\nalla temperatura, facendogli assumere un\naspetto diverso a seconda del clima.", "Temperature and weather affect its\ncellular structure, so this Pokémon\nchanges form according to the weather.") },
            // { PBESpecies.352, new PBELocalizedString("からだの　いろを　じゆうに　かえる\nのうりょくを　もつ。おなかにある\nギザギザもよう　だけは　かわらない。", "몸의 색을 자유롭게 바꾸는\n능력을 가지고 있다. 배에 있는\n톱날 무늬만은 바뀌지 않는다.", "Il change de couleur à volonté,\nmais le motif en zigzag qui orne\nson ventre reste le même.", "Es kann nach Belieben seine Farbe\nändern. Nur das gezackte Muster\nauf seinem Bauch bleibt gleich.", "Puede mudar el color de su cuerpo\na voluntad, pero el dibujo en zigzag\nde su panza nunca desaparece.", "Può mutare il colore del corpo a\npiacimento. Tuttavia, il motivo a\nzigzag sul ventre non cambia.", "It can freely change its body's\ncolor. The zigzag pattern on its\nbelly doesn't change, however.") },
            // { PBESpecies.353, new PBELocalizedString("だれかが　だれかを　うらむ\nくらく　かなしい　きもちを\nすいとって　じわじわ　つよくなる。", "누군가가 누군가를 원망하는\n어둡고 슬픈 마음을\n흡수해 서서히 강해진다.", "Il développe sa force en absorbant la\nrancune, la tristesse et les autres\nsentiments négatifs des humains.", "Es gewinnt an Stärke, indem es sich an\nden traurigen und hasserfüllten Gefühlen\nunter den Menschen labt.", "Absorbe los sentimientos de celos y\ntristeza que albergan los humanos, y\nse hace más fuerte paulatinamente.", "Si rinvigorisce assorbendo i tristi e cupi\nsentimenti di vendetta degli esseri umani.", "It feeds on the dark emotions of\nsadness and hatred, which make it\ngrow steadily stronger.") },
            // { PBESpecies.354, new PBELocalizedString("すてられた　ヌイグルミに　うらみが\nたまって　ポケモンに　なった。\nじぶんをすてた　こどもを　さがすぞ。", "버려진 인형에 원망이\n쌓여 포켓몬이 되었다.\n자신을 버린 아이를 찾는다.", "Une poupée devenue Pokémon après avoir\naccumulé une forte soif de vengeance.\nIl cherche l'enfant qui l'a rejeté.", "Ein Pokémon, das die Rachsucht einer\nweggeworfenen Puppe verkörpert und nun\nnach seinem einstmaligen Besitzer sucht.", "Peluche que tiraron a la basura y, tras\nacumular odio, se convirtió en Pokémon.\nBusca al niño que lo abandonó.", "Un peluche divenuto Pokémon per il\nrancore di essere stato buttato via da\nun bimbo, di cui è alla ricerca.", "A doll that became a Pokémon over\nits grudge of being thrown away. It\nseeks the child who disowned it.") },
            // { PBESpecies.355, new PBELocalizedString("こどもの　なきごえが　だいすきで\nぶあつい　かべも　とおりぬけて\nわるいこを　おどろかせ　なかせる。", "어린 아이의 울음소리를 매우 좋아하여\n두꺼운 벽도 뚫고 지나가서\n나쁜 아이를 놀래켜 울린다.", "Les cris des enfants l'amusent.\nIl effraie les moins sages d'entre\neux en traversant les murs.", "Es mag das Weinen von Kindern.\nErschreckt gemeine Kinder,\nindem es durch Wände geht.", "Le encanta atravesar paredes\npara asustar a los niños malos\ny hacerles llorar.", "Adora il pianto dei bambini. Spaventa\ni bimbi cattivi passando attraverso\nle pareti.", "It loves the crying of children. It\nstartles bad kids by passing\nthrough walls and making them cry.") },
            // { PBESpecies.356, new PBELocalizedString("さまよっている　ひとだまを　みつけ\nからっぽの　たいないに　すいこむ。\nすいこまれて　どうなるかは　なぞ。", "떠돌고 있는 도깨비불을 발견하여\n텅 빈 체내로 빨아들인다.\n빨려 들어가서 어떻게 되는가는 비밀.", "Il cherche des feux follets pour\nles avaler. Ce qui se passe alors\ndans son corps est un mystère.", "Sucht dahintreibende Irrlichter und\nsaugt sie in seinen leeren Körper.\nAlles andere ist ein Rätsel.", "Busca fuegos fatuos y los absorbe\ncon su cuerpo hueco. Lo que pasa\ndentro luego es un misterio.", "Va in cerca di fuochi fatui e li risucchia\nnel suo corpo vuoto. Cosa succeda\nall'interno è un mistero.", "It seeks drifting will-o'-the-wisps\nand sucks them into its empty body.\nWhat happens inside is a mystery.") },
            { PBESpecies.Tropius, new PBELocalizedString("おおきな　はっぱで　そらをとんで\nこどもたちに　だいにんきの　くびに\nできる　あまい　くだものを　くばる。", "커다란 잎으로 하늘을 날며\n아이들에게 인기가 많은 목에\n생기는 달콤한 과일을 나눠준다.", "Ses grandes feuilles lui servent à voler.\nIl distribue les fruits qui pendent à son\ncou aux enfants, qui s'en régalent.", "Es nutzt seine großen Blätter als Flügel\nund verteilt die süßen Früchte, die an\nseinem Hals wachsen, an Kinder.", "Puede volar al agitar sus grandes hojas.\nReparte entre los niños la codiciada\nfruta dulce que crece de su cuello.", "Vola sbattendo delle grandi ali a forma di\nfoglia e distribuisce ai bambini i deliziosi\nfrutti che gli crescono sul collo.", "It flies by flapping its broad leaves\nand gives the sweet, delicious\nfruit around its neck to children.") },
            // { PBESpecies.358, new PBELocalizedString("なきごえは　からだの　くうどうで\nひびきあって　きれいな　ねいろになり\nてきをおどろかせ　おいはらっていた。", "울음소리는 몸의 공동에서\n메아리쳐 아름다운 음색이 되어\n상대를 놀래켜 쫓아 버린다.", "Ses cris se répercutent dans son\ncorps creux avant d'exploser en\nnotes mélodieuses et saisissantes.", "Es ruft ein Echo in seinen Körper,\ndas in Form wunderschöner Noten\nempordringt und Gegner erschreckt.", "Sus gritos resuenan en su cuerpo\nhueco y emergen como hermosas\nnotas que aturden a los enemigos.", "I suoi versi riecheggiano dentro il corpo\nvuoto e fuoriescono per sorprendere e\nrespingere i nemici.", "Its cries echo inside its hollow\nbody to emerge as beautiful notes\nfor startling and repelling foes.") },
            { PBESpecies.Absol, new PBELocalizedString("ツノで　さっちした　わざわいを\nひとに　しらせようとして\nやまおくから　すがたを　あらわす。", "뿔이 감지한 불행을\n사람에게 알리려고\n산속에서 모습을 드러낸다.", "Reclus en montagne, il ne sort que pour\nprévenir les humains des catastrophes\nà venir, qu'il sent grâce à sa corne.", "Es steigt von den Bergen herab, um die\nMenschen vor Unheil zu warnen, das es\nmit seinem Horn vorhergesehen hat.", "Abandona su refugio en las montañas\npara prevenir a los humanos de los\ndesastres que predice con su cuerno.", "Lascia le montagne in cui vive e si mostra\nagli uomini per avvisarli dei disastri che\nha presagito grazie al suo corno.", "It appears from deep in the mountains\nto warn people about upcoming disasters\nit has sensed with its horn.") },
            // { PBESpecies.360, new PBELocalizedString("なかまたちと　おしくらまんじゅうを\nやることで　がまんづよく　そだつ。\nあまい　くだものが　だいこうぶつ。", "동료들과 밀어내기 놀이를 하면서\n인내심이 강한 성격으로 자란다.\n달콤한 과일을 매우 좋아한다.", "Il se muscle en bousculant ses\nsemblables lors de mêlées. Il\nraffole des fruits sucrés.", "Es wird stärker, indem es andere\nständig anrempelt. Es liebt Süßigkeiten.", "Se fortalecen empujándose unos\na otros en grupos. Les encantan\nlos dulces.", "Questi Pokémon si allenano in gruppo\ncaricandosi l'un l'altro per rafforzarsi.\nAmano i frutti dolci.", "It grows strong by pushing up\nagainst others en masse.\nIt loves eating sweet fruit.") },
            // { PBESpecies.361, new PBELocalizedString("おおきな　はっぱの　したに\nすうひきの　ユキワラシが　あつまり\nなかよく　くらしているという。", "커다란 잎사귀 아래서\n여러 마리의 눈꼬마가 모여\n사이좋게 살고 있다고 한다.", "On dit que des groupes entiers de\nStalgamin vivent en harmonie\nsous des feuilles gigantesques.", "Gerüchten zufolge sammeln sich\nSchneppke unter riesigen Blättern\nund leben dort friedlich zusammen.", "Se dice que se reúnen en grupos\nbajo hojas gigantescas y viven\nallí en total armonía.", "Si dice che gli Snorunt vivano in armonia\nriuniti sotto gigantesche foglie.", "It is said that several Snorunt\ngather under giant leaves and\nlive together in harmony.") },
            // { PBESpecies.362, new PBELocalizedString("くうきちゅうの　すいぶんを\nいっしゅんで　こおらせることで\nえものが　にげられないように　する。", "공기 중의 수분을\n일순간에 얼려버리는 것으로\n먹이가 도망치지 못하게 한다.", "Il empêche ses proies de prendre\nla fuite en gelant instantanément\nl'humidité de l'air.", "Es verhindert, dass Beute flieht,\nindem es die Feuchtigkeit in der\nLuft augenblicklich einfriert.", "Impide que sus presas se escapen\ncongelando la humedad del aire en\nun instante.", "Impedisce alla preda di scappare\ncongelando all'istante l'umidità\nnell'aria.", "It prevents prey from escaping by\ninstantaneously freezing moisture\nin the air.") },
            // { PBESpecies.363, new PBELocalizedString("まだ　じょうずに　およげず\nころがったほうが　はやく　うごける。\nうれしいと　みんなで　てをたたく。", "아직 능숙하게 헤엄치지 못하고\n구르는 쪽이 빨리 움직일 수 있다.\n기쁘면 다 같이 손뼉을 친다.", "Il se déplace en roulant, car il n'est\npas doué pour la nage. Quand il est\nheureux, il applaudit avec ses nageoires.", "Es ist noch kein guter Schwimmer und\nbewegt sich rollend schneller fort. Ist\nes froh, klatscht es mit seinen Flossen.", "Como no saben nadar muy bien, se mueven\nrápidamente rodando. Cuando están\nalegres, dan palmadas con las aletas.", "Non sa ancora nuotare molto bene e si\nmuove più velocemente rotolando. Quando\nè felice batte le pinne.", "They can't swim well yet,\nand they move much faster by rolling.\nWhen they're happy, they clap fins.") },
            // { PBESpecies.364, new PBELocalizedString("まるければ　モンスターボールでも\nタマザラシでも　はなのうえに　のせて\nじゆうじざいに　くるくる　まわすぞ。", "둥글면 몬스터볼이든\n대굴레오든 코 위에 올려\n자유자재로 빙글빙글 돌린다.", "Pour s'amuser, il fait tourner tout ce\nqui est rond sur son museau, qu'il\ns'agisse de Poké Balls ou d'Obalie.", "Pokébälle, Seemops und alles, was sonst\nnoch rund ist, balanciert es mit großem\nGeschick auf seiner Nasenspitze.", "Hace girar con pericia sobre la punta de\nsu nariz cualquier objeto redondeado,\nya sea una Poké Ball o un Spheal.", "Fa roteare sul naso qualsiasi cosa abbia\nforma sferica, Poké Ball e Spheal inclusi.", "Be it Spheal or Poké Ball, it will spin\nany round object on its nose\nwith the greatest of ease.") },
            // { PBESpecies.365, new PBELocalizedString("ぶあつい　しぼうは　さむさ　いがいに\nてきの　こうげきも　よせつけない。\nじまんのキバで　こおりを　くだくぞ。", "두꺼운 지방은 추위 외에\n상대의 공격도 얼씬 못하게 한다.\n자랑스러운 이빨로 얼음을 깨부순다.", "Sa graisse le protège du froid comme des\nattaques ennemies. Ses fières défenses\npulvérisent la glace.", "Seine dicke Speckschicht schützt es vor\nKälte und Angriffen. Eis durchbricht es\nmit seinen atemberaubenden Stoßzähnen.", "Su gran capa de grasa lo protege del\nfrío y de los ataques enemigos. Parte\nel hielo con sus preciados colmillos.", "Lo spesso strato di grasso lo protegge\ndal freddo e dagli attacchi nemici.\nFrantuma il ghiaccio con le zanne.", "Not only does its thick blubber keep it\nwarm, it also protects it from attacks.\nIt shatters ice with its prized tusks.") },
            { PBESpecies.Clamperl, new PBELocalizedString("いっしょうに　\xFF11こだけ　つくる\nしんじゅは　サイコパワーを\nぞうふくする　さようが　あるという。", "평생동안 하나만 만들게 되는\n진주는 사이코 파워를\n증폭시키는 작용을 한다고 한다.", "Il ne produit qu'une perle durant\nson existence. On raconte qu'elle\namplifie les pouvoirs psychiques.", "In seinem Leben erschafft es\neine einzige Perle. Diese soll\nPsycho-Kräfte verstärken.", "Durante toda su vida, crea una\nsola perla que, según se dice,\naumenta los poderes psíquicos.", "Crea una sola perla in tutta la sua vita.\nSi dice che questa perla amplifichi\ni poteri psichici.", "It makes a single pearl during\nits lifetime. The pearl is said\nto amplify psychic power.") },
            { PBESpecies.Huntail, new PBELocalizedString("しんかいに　せいそくする　ポケモン。\nこざかなの　かたちをした　しっぽで\nえものを　おびきよせ　つかまえる。", "심해에 서식하는 포켓몬이다.\n작은 물고기 형태를 한 꼬리로\n먹이를 끌어들여 붙잡는다.", "Il vit loin sous la mer. Il appâte\nles proies crédules avec sa queue\nqui rappelle un petit poisson.", "Es lebt tief im Meer. Sein Schweif\nist wie ein kleiner Fisch geformt.\nMit ihm lockt es Beute an.", "Vive en los fondos marinos.\nAtrae a sus confiadas presas con\nla cola, que tiene forma de pez.", "Vive nei mari profondi. Con la coda\na forma di pesciolino attrae prede\nignare del pericolo.", "It lives deep in the sea. With a\ntail shaped like a small fish, it\nattracts unsuspecting prey.") },
            { PBESpecies.Gorebyss, new PBELocalizedString("うみの　そこで　くらしているが\nはるになると　からだの　ピンクいろが\nなぜか　あざやかに　いろづく。", "바다의 밑바닥에 살고 있지만\n봄이 되면 몸의 분홍색이\n웬일인지 선명하게 물든다.", "Au printemps, son corps rose se\nfait plus vif sans que l'on sache\npourquoi. Il vit au fond de la mer.", "Es lebt auf dem Grund des Meeres.\nIm Frühling wirkt die Farbe seines\nKörpers viel kräftiger.", "Vive en el fondo del mar. En\nprimavera, su cuerpo rosado\nadquiere colores más vivos.", "Vive sui fondali marini. In primavera\nil suo corpo rosato diventa più vivido\nper chissà quale motivo.", "It lives at the bottom of the sea.\nIn the springtime, its pink body\nturns more vivid for some reason.") },
            // { PBESpecies.369, new PBELocalizedString("しんかいちょうさで　はっけんされた\nめずらしい　ポケモン。\xFF11おくねんの\nあいだ　すがたが　かわっていない。", "심해조사에서 발견된\n희귀한 포켓몬이다. 1억 년\n동안 모습이 바뀌지 않았다.", "Un Pokémon rare aperçu lors d'une\nexploration sous-marine. Il n'a pas\névolué depuis 100 millions d'années.", "Tiefseeforscher fanden dieses seltene\nPokémon, das sich in 100 Mio. Jahren\nnicht verändert hat.", "Un Pokémon raro descubierto en una\nexploración marina. No ha cambiado\nen más de 100 millones de años.", "Un Pokémon raro scoperto durante\nun'esplorazione del mare profondo.\nÈ immutato da 100 milioni di anni.", "A rare Pokémon discovered during\na deep-sea exploration. It has not\nchanged in over 100 million years.") },
            // { PBESpecies.370, new PBELocalizedString("あたたかい　うみに　せいそくする。\nラブカスを　みつけた　カップルは\nえいえんの　あいが　つづくという。", "따뜻한 바다에서 서식한다.\n사랑동이를 발견한 커플은\n영원한 사랑이 지속된다고 한다.", "Un habitant des mers chaudes. On\ndit que le couple qui tombe sur ce\nPokémon connaîtra l'amour éternel.", "Es lebt in warmen Meeren. Man sagt,\ndass Verliebte, die es sehen, mit\newiger Liebe gesegnet sind.", "Vive en mares cálidos. Se dice\nque, si una pareja lo encuentra,\nserá bendecida con amor eterno.", "Vive nei mari caldi. Si dice che le coppie\nche trovano questo Pokémon riceveranno\nin dono l'eterno amore.", "It lives in warm seas. It is said\nthat a couple finding this Pokémon\nwill be blessed with eternal love.") },
            // { PBESpecies.371, new PBELocalizedString("おおぞらを　とぶことを　ゆめみて\nまいにち　とぶ　れんしゅうのために\nがけから　とびおりている。", "넓은 하늘을 나는 것을 꿈꾸며\n매일 나는 연습을 하려고\n절벽에서 뛰어내린다.", "Il rêve de pouvoir voler un jour.\nPour l'heure, il s'entraîne en\nsautant du haut des falaises.", "Es träumt davon, eines Tages\nfliegen zu können und springt daher\njeden Tag von hohen Klippen.", "Sueña con volar algún día, por lo que\nsiempre practica saltando desde\nacantilados.", "Sogna di poter volare un giorno e,\npertanto, si allena regolarmente\ngettandosi da alture.", "Dreaming of one day flying, it\npractices by leaping off cliffs\nevery day.") },
            // { PBESpecies.372, new PBELocalizedString("かたい　カラの　なかでは　さいぼうが\nへんかを　はじめている。しんかする\nしゅんかんに　カラが　はがれおちる。", "단단한 껍질 안은 세포가\n변화를 시작하고 있다. 진화하는\n순간에 껍질이 벗겨져 떨어진다.", "Ses cellules ont commencé à changer\ndans sa robuste coquille. Il la perd\nen évoluant.", "Die Zellen seines Panzers fingen an,\nsich zu verändern. Er fällt ab,\nsobald sich das Pokémon entwickelt.", "Las células han empezado a cambiar\ndentro de su dura concha, que se\nsepara cuando evoluciona.", "Nella sua dura corazza le cellule hanno\ncominciato a cambiare.\nQuando si evolve, la corazza cade.", "Within its rugged shell, its cells\nhave begun changing. The shell\npeels off the instant it evolves.") },
            // { PBESpecies.373, new PBELocalizedString("そらを　とぶことを　ねがいつづけた\nけっか　からだの　さいぼうが\nへんかして　つばさが　はえてきた。", "하늘을 나는 것을 계속\n바라왔던 결과 몸의 세포가\n변화해서 날개가 자라났다.", "À force de rêver de pouvoir voler,\nsa structure cellulaire a évolué\net il s'est vu pousser des ailes.", "Seine Zellstruktur änderte sich,\nes wuchsen ihm Flügel, da es immer\ndavon träumte, fliegen zu können.", "Siempre soñó con volar, por lo que\nsu estructura celular cambió y le\ncrecieron alas.", "Il suo forte desiderio di volare ha\nprovocato una mutazione cellulare\ne gli sono spuntate le ali.", "As a result of its long-held dream\nof flying, its cellular structure\nchanged, and wings grew out.") },
            { PBESpecies.Beldum, new PBELocalizedString("さいぼう　すべてが　じしゃくで\nからだから　じりょくを　はっしんし\nなかまと　かいわ　している。", "모든 세포가 자석으로\n몸에서 자력을 발신하여\n동료와 대화한다.", "Ses cellules sont toutes polarisées.\nIl dialogue avec les siens grâce à\ndes impulsions magnétiques.", "Ihre Zellen sind magnetisch geladen. Sie\nsondern über ihre Körper Magnetkräfte\nab, um miteinander zu kommunizieren.", "Todas sus células cuentan con carga\nmagnética, y se comunica con los suyos\na través de pulsos electromagnéticos.", "Le cellule del suo corpo sono calamite.\nIl suo corpo emette onde magnetiche,\ntramite le quali comunica con i suoi simili.", "Its cells are all magnetic,\nand it communicates with others\nby using magnetic pulses.") },
            { PBESpecies.Metang, new PBELocalizedString("\xFF12ひきの　ダンバルが　がったいした。\n\xFF12つの　のうみそが　れんけつしたので\nサイコパワーは　より　つよくなった。", "2마리의 메탕이 합체했다.\n2개의 뇌가 연결되었기 때문에\n사이코 파워는 보다 강해졌다.", "Il est formé de deux Terhal soudés.\nLeurs deux cerveaux étant liés, ses\npouvoirs psychiques sont très puissants.", "Es besteht aus zwei Tanhel. Dank der\nVereinigung ihrer beiden Hirne verfügen\nsie über gesteigerte Psycho-Kräfte.", "Está formado por dos Beldum unidos.\nTiene dos cerebros, así que cuenta\ncon poderes psíquicos amplificados.", "È nato dalla fusione di due Beldum.\nL'unione di due cervelli rende ancora\npiù forti i suoi poteri psichici.", "It is formed by two Beldum joining\ntogether. Its two brains are linked,\namplifying its psychic power.") },
            { PBESpecies.Metagross, new PBELocalizedString("\xFF14つの　のうみそが　つらなり\nスーパーコンピューターより　すごい\nけいさんで　あいてを　ぶんせきする。", "4개의 뇌가 연결되어\n슈퍼컴퓨터보다 대단한\n계산으로 상대를 분석한다.", "Il est né de la fusion de plusieurs\nTerhal. Ses quatre cerveaux en\nfont l'égal d'un superordinateur.", "Dank seiner vier vernetzten Hirne kann\nes Gegner besser als ein Supercomputer\nmit komplizierten Formeln analysieren.", "Gracias a sus cuatro cerebros, es más\ninteligente que un superordenador y\nanaliza con precisión al enemigo.", "Con l'incredibile velocità di calcolo dei\nsuoi quattro cervelli analizza il nemico\npiù rapidamente di un supercomputer.", "With four linked brains, it's more\nintelligent than a supercomputer, and\nit uses calculations to analyze foes.") },
            { PBESpecies.Regirock, new PBELocalizedString("ぜんしんが　いわで　できている。\nたたかいで　からだが　かけても\nいわを　くっつけて　なおしてしまう。", "전신이 바위로 되어 있다.\n싸움으로 몸이 깨어져도\n바위를 붙여서 치료해 버린다.", "Tout son corps est fait de roche.\nS'il s'ébrèche au combat, il utilise\ndes pierres pour le réparer.", "Sein Körper besteht aus Stein. Bricht\nim Kampf etwas heraus, wird es durch\nStein wieder ersetzt.", "Su cuerpo está hecho de roca.\nSi se astilla durante el combate,\nemplea piedras para repararlo.", "È formato interamente da rocce.\nSe si staccano nella lotta, ne cerca\naltre per sostituirle.", "Its entire body is made of rock.\nIf any part chips off in battle, it\nattaches rocks to repair itself.") },
            // { PBESpecies.378, new PBELocalizedString("ひょうがきに　できた　こおりで\nからだが　つくられている。マイナス\n\xFF12\xFF10\xFF10どの　れいきを　あやつる。", "빙하기에 생겨난 얼음으로\n몸이 만들어져 있다. 마이너스\n200도의 냉기를 다룬다.", "Son corps est fait de glace datant\nde l'ère glaciaire. Il contrôle un\nair gelé de -200 °C.", "Sein Körper besteht aus Eis aus der\nEiszeit. Es kontrolliert gefrorene Luft,\ndie minus 200 Grad kalt ist.", "Su cuerpo está hecho con hielo\nde la glaciación. Controla aire\ngélido a 200° bajo cero.", "Il suo corpo è costituito da ghiaccio\ndell'era glaciale. Mantiene l'aria\na una temperatura di -200°C.", "Its body is made of ice from the\nice age. It controls frigid air of\n-328 degrees Fahrenheit.") },
            // { PBESpecies.379, new PBELocalizedString("なんまんねんも　ちかの　あつりょくで\nきたえられた　きんぞくの　ボディは\nきずひとつ　つかない。", "몇 만년 동안 지하의 압력에 의해서\n단련된 금속의 몸은\n상처 하나 입지 않는다.", "Son corps invulnérable fut forgé\npar la pression souterraine durant\ndes dizaines de milliers d'années.", "Im Laufe der Jahrtausende, die es\nunterirdisch lebte, wurde sein\nKörper durch Druck und Wärme hart.", "Su cuerpo ha estado sometido a la\npresión subterránea durante miles\nde años y no puede arañarse.", "La pressione subita sottoterra per\ndecine di migliaia di anni ha reso il suo\ncorpo resistentissimo.", "Tempered by pressure underground\nover tens of thousands of years,\nits body cannot be scratched.") },
            { PBESpecies.Latias, new PBELocalizedString("ひかりを　くっせつさせる　うもうで\nぜんしんを　つつみこみ　すがたを\nみえなくする　のうりょくを　もつ。", "빛을 굴절시키는 깃털로\n전신을 둘러싸 모습을 보이지\n않게 하는 능력을 가지고 있다.", "Son corps est recouvert d'un\nduvet qui reflète la lumière\net le rend invisible.", "Sein Körper ist mit Daunen bedeckt,\ndie das Licht so brechen, dass das\nPokémon unsichtbar wird.", "Su cuerpo está cubierto de un plumón\nque refleja la luz de forma que se\nvuelve invisible.", "Questo Pokémon ha il corpo ricoperto di\npiume che riflettono la luce e lo rendono\ninvisibile.", "Its body is covered with a down\nthat can refract light in such a\nway that it becomes invisible.") },
            { PBESpecies.Latios, new PBELocalizedString("たかい　ちのうを　もつ　ポケモン。\nうでを　おりたたんで　とべば\nジェットきを　おいこす　スピードだ。", "높은 지능을 가진 포켓몬이다.\n팔을 접어 날면 제트기를\n추월할 만큼 빠르다.", "Un Pokémon très intelligent. Il\npeut voler plus vite qu'un avion à\nréaction en repliant ses ailes.", "Ein hochintelligentes Pokémon. Wenn\nes im Flug seine Flügel nach hinten\nlegt, ist es schneller als ein Jet.", "Es un Pokémon muy inteligente. Puede\nadelantar a aviones a reacción plegando\nlas alas.", "Pokémon molto intelligente. Ripiegando\nindietro le ali, riesce a volare più veloce\ndi un jet.", "A highly intelligent Pokémon.\nBy folding back its wings in flight,\nit can overtake jet planes.") },
            // { PBESpecies.382, new PBELocalizedString("おおあめを　ふらせる　のうりょくで\nうみを　ひろげたと　いわれている。\nかいこうの　そこで　ねむっていた。", "많은 비를 내리게 하는 능력으로\n바다를 넓혔다고 전해진다.\n해구의 밑바닥에서 잠들어 있었다.", "On dit qu'il a fait monter les eaux\nen causant des pluies diluviennes.\nIl somnolait dans une fosse marine.", "Man sagt, es habe die Meere\nvergrößert, indem es es regnen ließ.\nEs schlief in einem Meeresgraben.", "Se dice que aumentó el nivel del mar\na base de aguaceros. Ha estado\ndurmiendo en una fosa marina.", "Si dice che abbia ampliato i mari\nprovocando piogge torrenziali. Si è\nassopito in una fossa marina.", "It is said to have widened the\nseas by causing downpours. It had\nbeen asleep in a marine trench.") },
            // { PBESpecies.383, new PBELocalizedString("おおむかし　カイオーガとの　しとうの\nすえに　ちかマグマの　なかで\nねむっていた　ポケモン。", "먼 옛날 가이오가와 사투를\n벌인 후 지하 마그마 속에서\n잠들어 있던 포켓몬이다.", "Il dormait dans le magma souterrain\ndepuis sa lutte féroce contre\nKyogre, il y a longtemps de cela.", "Es hat seit dem Kampf gegen Kyogre\nin Magma unter dem Erdboden geschlafen.", "Ha estado durmiendo en magma\nsubterráneo desde que luchó\ncontra Kyogre en tiempos remotos.", "Dopo una lotta colossale contro Kyogre,\nsi è addormentato sotto terra in mezzo\nal magma.", "It had been asleep in underground\nmagma ever since it fiercely\nfought Kyogre long ago.") },
            // { PBESpecies.384, new PBELocalizedString("くもより　はるかうえの　オゾンそうに\nせいそくしているため　ちじょうから\nすがたを　みることは　できない。", "구름보다 아득히 먼 위의 오존층에\n서식하고 있기 때문에 지상에서\n모습을 볼 수 없다.", "Il vit dans la couche d'ozone,\nau-dessus des nuages. Il est\ninvisible depuis le sol.", "Es lebt in der Ozonschicht hoch\nüber den Wolken und kann vom\nBoden aus nicht gesehen werden.", "Vive en la capa de ozono sobre las nubes\ny no puede ser visto desde el suelo.", "Vive nello strato di ozono oltre le\nnuvole e non può essere avvistato\nda terra.", "It lives in the ozone layer far\nabove the clouds and cannot be\nseen from the ground.") },
            { PBESpecies.Jirachi, new PBELocalizedString("\xFF11\xFF10\xFF10\xFF10ねんかんで　\xFF17にちだけ\nめを　さまし　どんな　ねがいごとでも\nかなえる　ちからを　つかうという。", "1000년 중 7일 동안만 깨어나\n모든 소원을 이루어주는\n능력을 발휘한다고 한다.", "On raconte qu'une fois tous les\nmille ans, il a la capacité d'exaucer\ntous les vœux durant une semaine.", "Man sagt, es kann alle tausend Jahre\nfür eine Woche jeden Wunsch erfüllen.", "Se dice que puede otorgar cualquier\ndeseo durante una semana cada\n1000 años.", "Ha l'abilità di realizzare ogni desiderio,\nma soltanto per una settimana ogni 1000\nanni.", "It is said to have the ability to\ngrant any wish for just one week\nevery thousand years.") },
            // { PBESpecies.386, new PBELocalizedString("いんせきに　ふちゃくしていた\nうちゅうウイルスの　\xFF24\xFF2E\xFF21が\nへんいして　うまれた　ポケモン。", "운석에 붙어 있던\n우주 바이러스의 DNA가\n변이하여 생겨난 포켓몬이다.", "Il vient d'un virus extraterrestre\narrivé avec une météorite et ayant\nsubi une mutation génétique.", "Ein außerirdischer Virus kam mit einem\nMeteor auf die Erde. Seine DNA mutierte.\nSo entstand Deoxys.", "Surgió a raíz de la mutación de\nADN de un virus alienígena que\ncayó a la Tierra en un meteorito.", "È il risultato della mutazione genetica\ndi un virus alieno, giunto sulla terra\ncon un meteorite.", "An alien virus that fell to earth\non a meteor underwent a DNA\nmutation to become this Pokémon.") },
            { PBESpecies.Turtwig, new PBELocalizedString("つちで　できた　せなかの　こうらを\nさわって　ほどよく　しめっていたなら\nその　ナエトルは　とても　げんきだ。", "흙으로 만들어진 등껍질을\n만져보아 적당히 젖어 있다면\n그 모부기는 매우 건강한 것이다.", "La coquille sur son dos est faite de\nterre. Plus il est en bonne santé,\nplus elle est humide.", "Der Panzer auf seinem Rücken besteht\naus Erdreich. Bei gesunden Chelast ist\nder Panzer feucht.", "La concha de su espalda es de\ntierra. Si está sano, la concha de\nTurtwig debería estar húmeda.", "Il guscio sulla sua schiena è fatto di\nterra. Se un Turtwig è in forma, il suo\nguscio è umido.", "The shell on its back is made of\nsoil. On a very healthy Turtwig,\nthe shell should feel moist.") },
            { PBESpecies.Grotle, new PBELocalizedString("きれいな　みずが　わきでる　ばしょを\nしっていて　なかまの　ポケモンを\nせなかに　のせて　そこまで　はこぶ。", "깨끗한 물이 솟아나는 장소를\n알고 있어서 동료 포켓몬을\n등에 태우고 그곳까지 데려다준다.", "Il sait d'instinct où trouver une\nsource d'eau pure. Il y transporte\nd'autres Pokémon sur son dos.", "Es weiß, wo es reinstes Quellwasser\nfinden kann. Trägt andere Pokémon\nauf seinem Rücken dorthin.", "Sabe dónde encontrar manantiales\nde agua pura y lleva a los Pokémon\namigos hasta allí en su lomo.", "Sa come trovare sorgenti incontaminate,\ndove porta i Pokémon amici tenendoli\nsulla schiena.", "It knows where pure water wells\nup. It carries fellow Pokémon there\non its back.") },
            { PBESpecies.Torterra, new PBELocalizedString("ドダイトスの　せなかで　うまれて\nドダイトスの　せなかで　いっしょうを\nまっとうする　ポケモンも　いる。", "토대부기 등에서 태어나\n토대부기 등에서 일생을\n다하는 포켓몬도 있다.", "Certains petits Pokémon peuvent\nnaître sur son dos et y passer\ntoute leur vie.", "Manche Pokémon werden auf dem Rücken\neines Chelterrar geboren und\nverbringen ihr ganzes Leben dort.", "Algunos Pokémon nacen en la espalda\nde un Torterra y pasan allí toda su vida.", "Sul dorso di Torterra nascono Pokémon\nche vi trascorrono tutta la vita.", "Some Pokémon are born on a\nTorterra's back and spend their\nentire life there.") },
            { PBESpecies.Chimchar, new PBELocalizedString("とても　みがるな　ポケモン。\nまわりが　もえないように　おしりの\nほのおを　けしてから　ねむる。", "매우 몸놀림이 가벼운 포켓몬이다.\n주변이 불에 타지 않도록 꼬리의\n불꽃을 끈 다음에 잠든다.", "Il est très agile. Il fait toujours\nattention d'éteindre la flamme de\nsa queue avant de se coucher.", "Dieses flinke Pokémon löscht vor dem\nSchlafengehen die Flamme auf seinem\nSchweif, um Feuer zu verhindern.", "Es muy ágil. Antes de dormir apaga\nla llama de su cola para no\nprovocar un incendio.", "È molto agile. Prima di addormentarsi\nspegne la fiamma sulla coda per\nscongiurare il rischio di incendi.", "It is very agile. Before going to\nsleep, it extinguishes the flame\non its tail to prevent fires.") },
            { PBESpecies.Monferno, new PBELocalizedString("しっぽの　ほのおの　いきおいを\nうまく　コントロールして　じぶんの\nとくいな　まあいで　たたかうのだ。", "꼬리 불꽃의 세기를\n잘 컨트롤하여 자신에게\n맞는 거리를 두고 싸운다.", "Il contrôle habilement l'intensité\nde la flamme de sa queue pour tenir\nses adversaires à distance.", "Es kontrolliert die Stärke des Feuers\nauf seinem Schweif geschickt,\num Gegner auf Distanz zu halten.", "Controla hábilmente la intensidad\ndel fuego de su cola para mantener\nal enemigo a una distancia ideal.", "Controlla abilmente l'intensità delle\nfiamme sulla sua coda per tenere\ni nemici alla distanza ideale.", "It skillfully controls the intensity\nof the fire on its tail to keep its\nfoes at an ideal distance.") },
            { PBESpecies.Infernape, new PBELocalizedString("てあしに　ほのおを　まとった\nどくとくの　かくとうわざを　つかい\nどんな　あいてにも　たちむかう。", "손발에 불꽃을 두르는\n독특한 격투 기술을 써서\n어떤 상대라도 맞서 싸운다.", "Ses techniques de combat inédites\nà base de pieds et poings enflammés\nsont redoutables.", "Es verwendet einzigartige Attacken\nmit dem Feuer an seinen Händen und\nFüßen. Stellt sich jedem Gegner.", "Utiliza movimientos de combate\núnicos con fuego en manos y pies.\nSe enfrenta a cualquier enemigo.", "Con mani e piedi infuocati, usa mosse di\nlotta speciali. Affronta qualsiasi nemico.", "It uses unique fighting moves with\nfire on its hands and feet. It will\ntake on any opponent.") },
            { PBESpecies.Piplup, new PBELocalizedString("あるくのは　にがてで　こけたりするが\nポッチャマの　プライドは　たかく\nきにせず　どうどうと　むねを　はる。", "걷는 것이 서툴러서 넘어질 때도\n있지만 프라이드가 높은 팽도리는\n신경 쓰지 않고 당당하게 가슴을 편다.", "Malgré sa démarche maladroite et\nses pertes d'équilibre, il bombe\ntoujours fièrement le torse.", "Es fällt leider oft hin. Allerdings\nist es sehr stolz und so rappelt es\nsich immer wieder ohne Sorge auf.", "No se le da bien lo de andar, se cae\nmucho. Pero su orgullo le hace\nsacar pecho como si nada.", "Quando cammina risulta goffo e cade\nspesso. Poiché è molto orgoglioso,\ncontinua come se nulla fosse.", "A poor walker, it often falls down.\nHowever, its strong pride makes it\npuff up its chest without a care.") },
            { PBESpecies.Prinplup, new PBELocalizedString("どの　ポッタイシも　じぶんが\nいちばん　えらいと　かんがえるため\nむれを　つくることは　ふかのうだ。", "팽태자들은 모두 자신이 제일\n훌륭하다고 생각하기 때문에\n무리를 만드는 것은 불가능하다.", "La fierté du Prinplouf est si\ngrande qu'il lui est impossible\nde vivre en groupe.", "Jedes Pliprin geht davon aus, dass es\ndas wichtigste ist. Daher können sie\nkeine Gruppen bilden.", "Como cada uno se considera\nel más importante, jamás\npodrán formar un grupo.", "Poiché ogni esemplare si considera il più\nimportante, i Prinplup non riescono mai\na creare un gruppo.", "Because every Prinplup considers\nitself to be the most important,\nthey can never form a group.") },
            { PBESpecies.Empoleon, new PBELocalizedString("プライドを　きずつける　ものは\nりゅうひょうをも　せつだんする\nつばさで　まっぷたつに　する。", "프라이드를 건드리는 자는\n유빙까지도 절단하는\n날개로 두 동강을 낸다.", "S'il voit son honneur bafoué, il\nest capable de faire des ravages\navec ses ailes tranchantes.", "Würde jemand seine Ehre verletzen,\nso würde es mit Flügeln angreifen,\ndie Eis zerschneiden können.", "Si alguien hiere su orgullo, le desgarra\ncon unas alas que podrían cortar\nun témpano de hielo.", "Chi osa ferirlo nell'orgoglio, viene\ncolpito dalle sue ali tanto possenti\nda fendere un banco di ghiaccio.", "If anyone were to hurt its pride,\nit would slash them with wings that\ncan cleave through an ice floe.") },
            // { PBESpecies.396, new PBELocalizedString("むれを　つくることで　\xFF11ぴきでの\nよわさを　カバーしあっているが\nむれが　おおきくなると　もめだす。", "무리를 만드는 것으로 한 마리로는\n약하다는 단점을 커버하고 있지만\n무리가 커지면 다투기 시작한다.", "La faiblesse des Étourmi les force\nà vivre en groupe, mais ils se\nchamaillent souvent.", "Einzeln sind sie schwach. Daher bilden\nsie Gruppen. Werden diese jedoch zu\ngroß, zanken sie sich.", "Son débiles individualmente, por eso\nforman grupos. Pero, si el grupo\ncrece demasiado, se pelean.", "Da soli sono deboli, quindi si muovono\nin gruppo. Tuttavia, se sono troppi\nfiniscono per litigare.", "Because they are weak individually,\nthey form groups. However, they\nbicker if the group grows too big.") },
            // { PBESpecies.397, new PBELocalizedString("じぶんの　よわさを　わきまえており\nいつも　むれで　くらしている。\nいっぴきになると　やかましく　なく。", "자신의 약함을 잘 알고 있기에\n항상 무리를 지어 살고 있다.\n혼자가 되면 요란하게 운다.", "Conscient de sa propre faiblesse,\nil vit toujours en groupe, piaillant\nbruyamment quand il est seul.", "Staravia verbergen ihre Schwäche\nin Gruppen. Sind sie allein, kann man\nsie an ihren lauten Rufen erkennen.", "Son conscientes de su debilidad, así\nque siempre viven en grupo. Si se\nencuentran solos, lloran a gritos.", "Conscio della propria debolezza, vive\nin gruppo. Quando è da solo, Staravia\nemette forti versi.", "Recognizing their own weakness,\nthey always live in a group. When\nalone, a Staravia cries noisily.") },
            // { PBESpecies.398, new PBELocalizedString("じぶんの　からだが　きずつこうとも\nこうげきを　やめなくなった。\nとさかの　かたちを　きにしている。", "자신의 몸이 상처를 입더라도\n공격을 그만두지 않게 되었다.\n볏의 모양을 신경 쓴다.", "Il combattra sans relâche, même\nblessé. Il prend grand soin de sa\nmèche.", "Selbst mit einer Verletzung greift\nes immer weiter an. Ziert sich etwas\naufgrund der Form seines Kamms.", "Jamás deja de atacar, aunque le\nhayan herido. Le preocupa mucho\nla forma de su cresta.", "Non smette di attaccare neanche quando\nè ferito. Si preoccupa che la sua cresta\nsia sempre in ordine.", "It never stops attacking even\nif it is injured. It fusses over the\nshape of its comb.") },
            // { PBESpecies.399, new PBELocalizedString("ビッパと　コラッタの　まえば\nどちらが　のびるのが　はやいのか\nくらべたところ　ひきわけ　だった。", "비버니와 꼬렛의 앞니 어느 쪽이\n빨리 길게 자라는가\n비교한 결과 무승부였다.", "Une étude a montré que les dents\ndu Keunotor poussaient aussi\nvite que celles du Rattata.", "Ein Vergleich zeigte, dass die\nVorderzähne von Bidiza und\nRattfratz gleich schnell wachsen.", "Un estudio comparativo reveló que\nlos incisivos de Bidoof crecen a la\nmisma velocidad que los de Rattata.", "Uno studio ha rivelato che gli incisivi di\nBidoof crescono allo stesso ritmo di\nquelli di Rattata.", "A comparison revealed that\nBidoof's front teeth grow at\nthe same rate as Rattata's.") },
            // { PBESpecies.400, new PBELocalizedString("ビーダルが　ダムを　つくった\nかわは　はんらん　することがないので\nちかくの　ひとから　かんしゃされる。", "비버통이 댐을 만든 강은\n범람하는 일이 없기에\n근처의 사람들로부터 감사를 받는다.", "Les digues insubmersibles qu'il\nconstruit font le bonheur des\nhabitants proches.", "Ein von Bidifas eingedämmter Fluss\ntritt niemals über seine Ufer.\nDafür sind die Anrainer dankbar.", "Un río en el que un Bibarel cree\nuna presa jamás se desbordará.\nPor esa razón la gente los aprecia.", "Un fiume in cui Bibarel ha costruito\nuna diga non straripa mai, cosa molto\napprezzata da chi ci vive vicino.", "A river dammed by Bibarel will\nnever overflow its banks, which\nis appreciated by people nearby.") },
            // { PBESpecies.401, new PBELocalizedString("あしが　みじかく　こけそうになるたび\nかたい　しょっかくが　こすれあって\nもっきんのような　おとが　ひびく。", "다리가 짧아 넘어지려고 할 때마다\n단단한 더듬이가 서로 비벼져서\n실로폰 소리 같은 것이 울린다.", "Quand il tombe du haut de ses\npetites pattes, ses antennes\nfont un bruit de xylophone.", "Seine Beine sind kurz. Stolpert es,\nklappern seine starren Antennen\nund klingen wie ein Xylophon.", "Tiene las patas cortas. Cada vez\nque se tropieza, sus antenas\nchocan y suenan como un xilófono.", "Ha le zampe corte. Quando inciampa\nle sue antenne si urtano, producendo\nun suono simile allo xilofono.", "Its legs are short. Whenever it\nstumbles, its stiff antennae clack\nwith a xylophone-like sound.") },
            // { PBESpecies.402, new PBELocalizedString("へんげんじざいの　なきごえを\nきそいあわせる　なきくらべ　という\nあそびを　たのしむ　むらがある。", "변화무쌍한 울음소리를 겨루는\n울음소리 비교 놀이를\n즐기는 마을이 있다.", "Ses cris sont tellement variés qu'il\nexiste un village où on organise\ndes concours en leur honneur.", "Es gibt ein Dorf, das basierend auf\nden imposanten Rufen dieses Pokémon\neinen Wettbewerb veranstaltet.", "Hay un pueblo en el que celebran\nun concurso basado en la increíble\nvariedad de sus gritos.", "C'è un villaggio che organizza una gara\nbasata sulle melodie incredibilmente\nvarie di questo Pokémon.", "There is a village that hosts a\ncontest based on the amazingly\nvariable cries of this Pokémon.") },
            { PBESpecies.Shinx, new PBELocalizedString("からだを　うごかすたびに　きんにくが\nのびちぢみして　でんきが　うまれる。\nピンチになると　からだが　かがやく。", "몸을 움직일 때마다 근육이 늘어났다\n줄어들었다 하여 전기가 발생한다.\n궁지에 몰리면 몸이 빛난다.", "Ses muscles génèrent un courant\nélectrique lorsqu'ils travaillent.\nIl s'illumine en cas de danger.", "Es erzeugt Elektrizität durch das\nStrecken und Zusammenziehen seiner\nMuskeln. Bei Bedrohung glüht es.", "La extensión y contracción de sus\nmúsculos genera electricidad.\nBrilla cuando está en peligro.", "Produce elettricità contraendo e\nrilassando i muscoli. Quando si sente\nminacciato si illumina.", "The extension and contraction of\nits muscles generates electricity.\nIt glows when in trouble.") },
            { PBESpecies.Luxio, new PBELocalizedString("するどい　ツメの　さきには　つよい\nでんきが　ながれており　ほんのすこし\nかするだけで　あいてをきぜつさせる。", "날카로운 발톱의 끝에는 강한\n전기가 흐르고 있어서 살짝 스치는\n것만으로 상대를 기절시킨다.", "Le courant qui circule à la pointe\nde ses griffes est capable de faire\nperdre connaissance à ses proies.", "Durch die Spitzen seiner scharfen\nKrallen strömt Elektrizität. Selbst\nkleine Kratzer verursachen Ohnmacht.", "Por las puntas de sus garras pasa\nuna fuerte corriente eléctrica.\nEl mínimo roce debilita al enemigo.", "I suoi artigli rilasciano una forte\ncorrente elettrica e con un solo graffio\nmanda KO i nemici.", "Strong electricity courses through\nthe tips of its sharp claws. A light\nscratch causes fainting in foes.") },
            { PBESpecies.Luxray, new PBELocalizedString("かべのむこうも　みえる　ちからで\nにげた　えものを　おいつめるほかにも\nまいごの　こどもを　さがしたりする。", "벽 저편이라도 볼 수 있는 힘으로\n도망친 먹이를 쫓는 것 이외에도\n미아가 된 아이를 찾기도 한다.", "Il est capable de voir à travers\nles murs pour chasser des proies\nou retrouver ses petits égarés.", "Es kann durch Wände sehen und\nspürt auf diese Weise Beute und\nverlorengegangene Junge auf.", "Puede ver claramente a través de las\nparedes para buscar a sus presas\no a sus crías.", "Vede attraverso le pareti per\nindividuare le prede e i suoi cuccioli\nsmarriti.", "It can see clearly through walls\nto track down its prey and seek\nits lost young.") },
            // { PBESpecies.406, new PBELocalizedString("まわりの　おんどへんかに　びんかん。\nあたたかくなると　つぼみが　ひらき\nどくをふくんだ　かふんを　ばらまく。", "주위 온도 변화에 민감하다.\n따뜻해지면 꽃봉오리가 피어\n독을 머금은 꽃가루를 흩뿌린다.", "Il est sensible aux variations de\ntempérature. Il fleurit grâce à la\nchaleur et répand du pollen toxique.", "Spürt Wetterveränderungen jeder Art.\nBei warmem Wetter erblüht seine\nKnospe und versprüht giftigen Pollen.", "Es muy sensible a los cambios de\ntemperatura. Si hace calor, su capullo\nflorece y esparce polen venenoso.", "È sensibile agli sbalzi di temperatura.\nQuando fa caldo la sua gemma si schiude\nliberando nell'aria un polline velenoso.", "Sensitive to changing temperatures,\nthe bud blooms when it's warm,\nreleasing toxic pollen.") },
            // { PBESpecies.407, new PBELocalizedString("あまい　かおりで　えものを　さそい\nりょううでの　どくのムチを　つかって\nさしたり　しめたりして　しとめる。", "달콤한 향기로 먹이를 유인해\n양팔의 독 채찍을 사용하여\n찌르거나 조여서 꼼짝 못하게 한다.", "Il attire ses proies grâce à son parfum,\npuis les empoisonne ou les étouffe à\nl'aide de ses bras vénéneux.", "Es lockt seine Beute mit süßem Duft an,\num sie danach mit seinen dornigen Ranken\nzu peitschen oder zu würgen.", "Atrae a sus presas con una dulce\nfragancia y usa sus cepas venenosas\npara atenazarlas y acabar con ellas.", "Attira la preda con il suo profumo soave\nper poi afferrarla e abbatterla con gli\narti velenosi.", "Luring prey with a sweet scent, it\nuses poison whips on its arms\nto poison, bind, and finish off the prey.") },
            // { PBESpecies.408, new PBELocalizedString("およそ　\xFF11おくねんまえの　ポケモン。\nジャングルで　うまれそだち　じゃまな\nじゅもくは　ずつきで　へしおった。", "대략 1억 년 전의 포켓몬이다.\n정글에서 태어나 자라 방해되는\n수목은 박치기로 꺾었다.", "Il vivait dans la jungle il y a\n100 millions d'années. Il abat\nun arbre d'un coup de tête.", "Es lebt seit Urzeiten im Dschungel.\nKann im Weg befindliche Bäume mit\nKopfstößen aus dem Weg räumen.", "Vivía en la jungla hace 100 millones de\naños. Apartaba los árboles del camino\na cabezazos.", "Abitava nella giungla già 100 milioni\ndi anni fa. Abbatte gli alberi che lo\nostacolano con delle testate.", "A lifelong jungle dweller from 100\nmillion years ago, it would snap\nobstructing trees with head butts.") },
            // { PBESpecies.409, new PBELocalizedString("あたまを　はげしく　ぶつけあっても\nずがいこつは　あつさ　\xFF13\xFF10センチも\nあるので　きぜつ　したりしない。", "머리로 격렬하게 치고받아도\n두개골은 두께가 30cm나 되기에\n기절하거나 하지 않는다.", "Quand deux Charkos se rentrent\ndedans, leur crâne extrêmement\népais les empêche de s'assommer.", "Schlagen zwei von ihnen mit den\nKöpfen zusammen, verhindern ihre\ndicken Schädel eine Ohnmacht.", "Su cráneo es de 30 cm de grosor.\nSi dos de ellos se dan un cabezazo,\nno les ocurrirá nada.", "Anche se si prendono a testate, due\nRampardos non vanno KO perché il loro\ncranio è molto spesso.", "If two were to smash their heads\ntogether, their foot-thick skulls\nwould keep them from fainting.") },
            // { PBESpecies.410, new PBELocalizedString("ばつぐんの　ぼうぎょりょくを　もつ。\nそのため　とくに　あらそうこともなく\nくさや　きのみを　たべて　すごす。", "뛰어난 방어력을 지녔다.\n그 덕분에 특별히 다투는 일도 없이\n풀이나 나무열매를 먹으며 지낸다.", "Il est si bien protégé qu'il peut\ndéguster Baies et herbe fraîche\nsans craindre de prédateurs.", "Es ist sehr gut gepanzert und muss\ndaher während des Essens von Gras\nund Beeren keinen Kampf fürchten.", "Gracias a su imponente protección\nfacial, puede comer hierba y bayas\ndonde quiera sin que le molesten.", "Ha una corazza molto spessa. Di\nconseguenza può procurarsi erba\ne bacche senza dover combattere.", "It is outstandingly armored. As a\nresult, it can eat grass and\nberries without having to fight.") },
            // { PBESpecies.411, new PBELocalizedString("よこいちれつに　ならぶと　どんな\nポケモンでも　とっぱ　できない。\nそうやって　こどもを　まもっていた。", "옆에 한 줄로 세우면 어떤\n포켓몬이라도 돌파하지 못한다.\n그렇게 하여 아기를 지켜냈다.", "En groupe, ils protègent leurs\npetits en formant autour d'eux\nune impénétrable muraille.", "Stellen sie sich Seite an Seite,\nkann kein Gegner hindurchbrechen.\nSo schützen sie auch ihre Jungen.", "Se alineaban y creaban una barrera\nque ningún enemigo podía cruzar.\nAsí protegían a sus crías.", "Se si mettono uno di fianco all'altro\nnessun nemico riesce a passare.\nProteggono così i loro cuccioli.", "When they lined up side by side, no\nfoe could break through. They\nshielded their young in that way.") },
            // { PBESpecies.412, new PBELocalizedString("からだをつつむ　ざいりょうが　ない\nばしょで　うまれても　ミノムッチは\nいつのまにか　ミノを　まとっている。", "몸을 둘러쌀 재료가 없는\n장소에서 태어나도 도롱충이는\n어느새 도롱이를 걸치고 있다.", "Nul ne sait comment il y parvient,\nmais il arrive toujours à se former\nune cape, où qu'il soit.", "Es erschafft sich immer irgendwie\neinen schützenden Umhang, selbst\nwenn es kaum Materialien findet.", "Aunque nazca en un lugar en el que\nno haya muchos materiales, siempre\nconsigue crearse un caparazón.", "Anche se dove nasce non ci sono\nmateriali per fare bozzoli, si ritrova\nsempre coperto da un manto.", "Even if it is born where there are\nno cocooning materials, it somehow\nalways ends up with a cloak.") },
            // { PBESpecies.413, new PBELocalizedString("しんかするとき　まわりにある\nざいりょうを　からだに　とりこむため\nおおくの　バリエーションが　ある。", "진화할 때 주변에 있는\n재료를 몸에 둘러싸기 위해\n많은 바리에이션이 있다.", "À l'évolution, son corps absorbe\nles matériaux à proximité et peut\nainsi présenter divers aspects.", "Es nimmt während der Entwicklung\nDinge aus der Umgebung auf, daher\ngibt es viele Variationen von ihm.", "Cuando evoluciona, incorpora a su\ncuerpo los materiales del entorno.\nPor eso hay muchas variantes.", "Quando si evolve assorbe i materiali che\nha intorno. Per questo motivo ne\nesistono molte varianti.", "When evolving, its body takes in\nsurrounding materials. As a result,\nthere are many body variations.") },
            // { PBESpecies.414, new PBELocalizedString("はなのミツが　だいすきだが\nじぶんでは　あつめず　ミツハニーから\nよこどり　ばかりを　かんがえている。", "꽃의 꿀을 제일 좋아하지만\n자신은 모으지 않고 세꿀버리로부터\n가로챌 생각만 한다.", "Il adore le nectar des fleurs mais\nn'en récolte pas lui-même.\nIl préfère en voler à un Apitrini.", "Es liebt Honig, sammelt ihn aber\nnicht, sondern stiehlt den Honig,\nder von Wadribie gesammelt wurde.", "Le gusta la miel de flores, pero no\nle gusta recogerla. Se dedica a\nrobársela a Combee.", "Anche se ama il nettare dei fiori, non lo\nraccoglie. Preferisce rubarlo ai Combee.", "While it loves floral honey, it won't\ngather any itself. Instead, it\nplots to steal some from Combee.") },
            // { PBESpecies.415, new PBELocalizedString("\xFF13びきセットの　ポケモン。\nねむるとき　ミツハニーが　\xFF11\xFF10\xFF10ひき\nあつまり　おおきな　すをつくる。", "3마리 세트인 포켓몬.\n잠들 때 세꿀버리가 100마리\n모여서 큰 둥지를 만든다.", "Un trio inséparable. Cent d'entre eux\nse regroupent pour dormir et forment\nainsi un gigantesque essaim.", "Ein Pokémon-Trio. Zur Schlafenszeit\nscharen sie sich zu Hunderten und\nbilden einen riesigen Bienenstock.", "Pokémon formado por tres Pokémon.\nA la hora de dormir, se juntan unos 100\ny crean una gran colmena.", "Si tratta di tre Pokémon in uno. Quando è\nora di dormire, 100 Combee si riuniscono\nper formare un alveare enorme.", "This Pokémon is a set of three.\nWhen they sleep, they gather up\nand form a giant hive of 100 Combee.") },
            // { PBESpecies.416, new PBELocalizedString("どうたいは　こどもたちの　すあな。\nいろんな　フェロモンを　だして\nこどもたちを　じゆうに　あやつる。", "몸통은 아기들의 둥지다.\n여러 페로몬을 내어\n새끼들을 자유롭게 조종한다.", "Son abdomen abrite ses petits. Ce\nPokémon utilise des phéromones\npour leur donner des ordres.", "Es beherbergt Jung-Pokémon in seinem\nRumpf, die es mithilfe von verschiedenen\nPheromonen frei herumkommandieren kann.", "Cría larvas en los panales de su cuerpo.\nSegrega diversas feromonas de su cuerpo\ncon las cuales controla a sus crías.", "Nell'addome ospita la sua progenie, sulla\nquale esercita un controllo assoluto\ntramite i feromoni che rilascia.", "It houses its colony in cells in its body\nand releases various pheromones to\nmake those grubs do its bidding.") },
            { PBESpecies.Pachirisu, new PBELocalizedString("たまった　でんきを　わけあたえようと\nほほぶくろを　こすりあわせる\nパチリスを　みかけることも　ある。", "모인 전기를 나눠주려고\n뺨의 주머니를 서로 비비는\n파치리스를 발견하기도 한다.", "Il arrive que deux Pachirisu se\nfrottent les joues pour partager\nl'électricité qu'ils ont accumulée.", "Um gespeicherte Elektrizität zu\nteilen, reiben zwei von ihnen ihre\nBackentaschen aneinander.", "A veces se ve a dos frotándose\nlas bolsas de las mejillas para\ncompartir electricidad almacenada.", "Talvolta due esemplari si sfregano\nle guance per condividere l'elettricità\nimmagazzinata.", "A pair may be seen rubbing their\ncheek pouches together in an\neffort to share stored electricity.") },
            // { PBESpecies.418, new PBELocalizedString("くびの　うきぶくろを　ふくらませ\nすいめんから　かおを　だして\nあたりの　ようすを　うかがっている。", "목의 부낭을 부풀려\n수면에서 얼굴을 내밀어\n주변의 상황을 살피고 있다.", "Il utilise la bouée autour de son cou\npour passer sa tête hors de l'eau et\nobserver les alentours.", "Es füllt den Schwimmreifen um seinen Hals\nmit Luft, um den Kopf über dem Wasser zu\nhalten und die Umgebung zu überblicken.", "Hincha el flotador de su cuello para\nflotar y saca la cabeza de la superficie\ndel agua para explorar sus alrededores.", "Gonfia il salvagente che ha attorno\nal collo per mantenere la testa fuori\ndall'acqua mentre controlla i paraggi.", "It inflates the flotation sac around\nits neck and pokes its head out of\nthe water to see what is going on.") },
            // { PBESpecies.419, new PBELocalizedString("りょうしまちに　おおく　くらし\nおぼれた　ひとを　たすけたり\nとった　えものを　はこんでいる。", "어촌에서 많이 살고 있으며\n물에 빠진 사람을 구하거나\n잡은 먹이를 운반한다.", "Il vit souvent près des ports de pêche,\noù on le voit transporter ses proies ou\nbien sauver les gens tombés à la mer.", "Man findet es oft in der Nähe von Häfen,\nwo es Menschen vor dem Ertrinken rettet\nund seine Beute lagert.", "Habita en los puertos pesqueros,\nayudando a rescatar a personas o\ntrasladando presas.", "Vive spesso vicino ai porti dove si pesca.\nPorta in salvo le persone e trascina via\nle prede.", "It is a common sight around\nfishing ports. It is known to\nrescue people and carry off prey.") },
            // { PBESpecies.420, new PBELocalizedString("ちいさな　たまには　えいようが\nつまっているだけでなく　おいしいので\nムックルに　ついばまれたりする。", "작은 구슬에는 영양이\n가득할 뿐 아니라 맛도 있어서\n찌르꼬에게 쪼이거나 한다.", "Sa petite boule rose est nutritive\net délicieuse. Les Étourmi en\nraffolent.", "Der kleine Ball ist nicht nur voller\nNährstoffe, sondern auch schmackhaft.\nStaralili pickt oft danach.", "Su pequeña esfera está llena de\nnutrientes y está tan rica que los\nStarly siempre intentan comérsela.", "La pallina, oltre a contenere sostanze\nnutritive, è molto gustosa. Starly\ncerca spesso di beccarla.", "The small ball is not only filled with\nnutrients, it is also tasty. Starly\ntry to peck it off.") },
            // { PBESpecies.421, new PBELocalizedString("つよい　ひざしを　かんじとると\nとざしていた　はなびらを　ひろげ\nぜんしんで　にっこうを　あびる。", "강한 햇살을 느끼면\n움츠려 있던 꽃잎을 펼쳐\n전신으로 햇빛을 받는다.", "Sous un grand soleil, il ouvre\nses pétales pour en absorber\nles rayons.", "Spürt es Sonnenlicht, öffnet es\nseine Blütenblätter und nimmt die\nEnergie der Sonnenstrahlen auf.", "Cuando detecta luz solar fuerte,\ndespliega los pétalos y absorbe\ntodos los rayos posibles.", "Quando splende il sole, ama aprire\ni suoi petali per assorbire i raggi\nsolari con tutto il corpo.", "If it senses strong sunlight, it\nopens its folded petals to absorb\nthe sun's rays with its whole body.") },
            // { PBESpecies.422, new PBELocalizedString("やわらかい　からだを　つよくおすと\nむらさきいろの　なぞの　えきたいが\nにじみでるので　ようちゅうい。", "부드러운 몸을 강하게 누르면\n보랏빛이 나는 정체불명의 액체가\n배어 나오므로 주의가 필요하다.", "Un étrange liquide mauve s'échappe\nde son corps, ne lui appuyez pas\ndessus.", "Nicht seinen Körper zusammendrücken,\nsonst sickert eine seltsame lilafarbene\nFlüssigkeit aus!", "No hay que apretarle muy fuerte,\nya que, si lo haces, secreta un\nmisterioso fluido morado.", "Se si esercita una forte pressione\nsul suo corpo, ne fuoriesce un\nmisterioso liquido viola.", "Beware of pushing strongly on\nits squishy body, as it makes a\nmysterious purple fluid ooze out.") },
            // { PBESpecies.423, new PBELocalizedString("むかしは　じょうぶな　カラで\nせなか　ぜんたいを　おおっていた。\nさいぼうに　その　なごりが　ある。", "옛날에는 튼튼한 껍질로\n등 전체를 두르고 있었다.\n세포에 그 흔적이 있다.", "Ses gènes ont démontré qu'il avait\njadis une carapace couvrant la\ntotalité de son dos.", "Vor langer Zeit hatte es einen\nfesten Panzer. Mittlerweile sind\nnur noch Spuren davon vorhanden.", "Hace mucho tiempo tenía todo el\nlomo cubierto con una concha. Aún\nhay trazas de ella en sus células.", "In passato portava sulla schiena\nun robusto carapace. Ne rimangono\ntracce nelle sue cellule.", "Long ago, its entire back was\nshielded with a sturdy shell. There\nare traces of it left in its cells.") },
            // { PBESpecies.424, new PBELocalizedString("\xFF12ほんに　わかれた　しっぽは\nいろんなことが　きように　できるので\nほとんど　てを　つかわなくなった。", "2개로 나뉜 꼬리를\n능숙하게 사용할 수 있어서\n거의 손을 쓰지 않게 됐다.", "Ses queues jumelles sont si agiles\net efficaces qu'il ne se sert que\ntrès rarement de ses bras.", "Es ist mit seinen beiden Schweifen\nso geschickt, dass es seine Hände\nnur noch selten gebraucht.", "Tiene dos colas muy útiles y hábiles\npara manejar cosas, así que rara\nvez utiliza las manos.", "È talmente abile nel maneggiare gli\noggetti con le sue due code che\nsolo raramente usa le mani.", "Split into two, the tails are so\nadept at handling and doing things,\nAmbipom rarely uses its hands.") },
            // { PBESpecies.425, new PBELocalizedString("たましいの　みちしるべと　いわれる。\nフワンテを　もっていた　こどもは\nとつぜん　きえて　いなくなる。", "영혼의 이정표라고 전해진다.\n흔들풍손을 가지고 있는 아이는\n갑자기 사라져버린다.", "Les enfants qui attrapent des Baudrive\ndisparaissent parfois. On lui donne le\nsurnom de “bouée des esprits égarés\".", "Auch bekannt als „Wegweiser für\numherstreifende Geister“. Kinder, die\nsie halten, verschwinden manchmal.", "Se dice que es como un hito que guía\na las almas. Los niños que sostienen\nun Drifloon a veces desaparecen sin más.", "Anche detto “Guida degli spiriti vaganti\".\nA volte i bambini che ne hanno uno\nsvaniscono improvvisamente nel nulla.", "These Pokémon are called the\n“Signpost for Wandering Spirits.\"\nChildren holding them sometimes vanish.") },
            // { PBESpecies.426, new PBELocalizedString("ひとや　ポケモンを　はこぶ。\nただし　かぜに　ながされてしまうので\nいきさきを　きめられない。", "사람이나 포켓몬을 운반한다.\n단 바람에 날려버리기 때문에\n목적지를 정할 수 없다.", "Il aime servir de moyen de transport.\nSeul inconvénient: il ne va que dans\nla direction du vent.", "Es transportiert Menschen und Pokémon.\nWohin sie fliegen, bestimmt jedoch ganz\nalleine die Windrichtung.", "Pueden transportar a gente y Pokémon.\nSin embargo, por culpa de las corrientes\nde aire, no pueden fijar un destino.", "Trasporta Pokémon e persone, ma poiché\nsi fa trascinare dal vento, non si sa mai\ndove va a finire.", "They carry people and Pokémon,\nbut the wind can catch them, so\nthere can't be a fixed destination.") },
            // { PBESpecies.427, new PBELocalizedString("まるめている　みみを　いきおいよく\nのばして　じめんを　たたくと\nじぶんでも　おどろくほど　はねるぞ。", "말고 있는 귀를 힘차게\n뻗어서 땅을 치면\n자신도 놀랄 만큼 뛰어오른다.", "Quand ses oreilles étendues frappent\nle sol violemment, il peut bondir si\nhaut qu'il se surprend lui-même.", "Es kann selbst kaum glauben, wie hoch es\nfliegt, wenn es seine aufgerollten Ohren\nmit großer Wucht zu Boden schnellt.", "Cuando golpea con fuerza sus orejas\nenrolladas contra el suelo, puede saltar\nalcanzando una altura sorprendente.", "Quando distende le orecchie arrotolate\ne colpisce il suolo, riesce a saltare così\nin alto da sorprendersi da solo.", "By extending its rolled-up ears\nand striking the ground, it can\nbound so high it surprises itself.") },
            // { PBESpecies.428, new PBELocalizedString("けいかいしんが　とても　つよい。\nきけんを　かんじると　かろやかに\nとびはねて　はしりさってしまう。", "경계심이 아주 강하다.\n위험을 감지하면 가뿐하게\n뛰어올라 달아난다.", "Il détecte le moindre danger.\nIl file discrètement par petits bonds\nrapides quand il se sent menacé.", "Es ist extrem vorsichtig. Wenn es\nGefahr wittert, macht es sich mit\nflinken Sprüngen aus dem Staub.", "Este Pokémon resulta muy precavido.\nSi siente peligro, escapa corriendo a\ngrandes saltos.", "È un Pokémon estremamente cauto.\nSe avverte un pericolo, si dà subito\nalla fuga saltellando.", "Extremely cautious,\nit quickly bounds off\nwhen it senses danger.") },
            { PBESpecies.Mismagius, new PBELocalizedString("じゅもんのような　なきごえだが\nまれに　あいてを　しあわせにする\nこうかも　ひめているという。", "주문 같은 울음소리지만\n가끔 상대를 행복하게 만드는\n효과도 감춰져 있다고 한다.", "Pareil à une incantation magique,\nson cri n'est que très rarement\nsource de joie.", "Sein Ruf ähnelt einer Beschwörung.\nMan sagt, dass er manchmal über die\nKraft verfüge, glücklich zu machen.", "Sus gritos parecen cánticos. Se dice\nque, en alguna rara ocasión, han\nimbuido felicidad a quien los oía.", "I suoi versi sembrano incantesimi. Pare\nche a volte contengano un potere che\nporta felicità.", "Its cry sounds like an incantation.\nIt is said the cry may rarely be\nimbued with happiness-giving power.") },
            // { PBESpecies.430, new PBELocalizedString("ドンカラスが　ひくいこえで　なくと\nすぐさま　ヤミカラスが　あつまるため\nよるをまねくもの　とも　いわれる。", "돈크로우가 낮은 목소리로 울면\n즉시 니로우가 모여들기에\n밤을 부르는 자라고도 전해진다.", "Son cri profond peut invoquer une\nmeute de Cornèbre. On l'appelle\n“le crieur de mauvais augure\".", "Sein tiefer Ruf lockt andere\nKramurx herbei. Man nennt es\ndaher „Beschwörer der Nacht“.", "Si uno lanza un grito profundo, los\ndemás acuden. Por eso se le llama\ntambién Invocador de la Noche.", "Se emette un verso profondo, molti\nMurkrow accorrono all'istante.\nÈ detto “Evocatore della notte\".", "If one utters a deep cry, many\nMurkrow gather quickly. For this,\nit is called “Summoner of Night.\"") },
            // { PBESpecies.431, new PBELocalizedString("トレーナーが　エサを　くれないと\nはなのあなに　ツメをひっかける\nひどい　いちめんを　ひめている。", "트레이너가 먹이를 주지 않으면\n콧구멍에 발톱을 쑤셔넣는\n잔인한 면을 감추고 있다.", "Il a tendance à planter ses griffes\ndans le nez de son Dresseur s'il\nn'a pas été nourri à temps.", "Es verbirgt, dass es bei schlechter\nFütterung gern seine Krallen in\ndie Nase des Trainers gräbt.", "Oculta una tendencia rencorosa que\nle hace arañar la nariz de su\nEntrenador si no le da de comer.", "Se l'Allenatore non gli dà da mangiare,\ngli graffia il naso. È un'abitudine che\ncerca di nascondere.", "It hides its spiteful tendency of\nhooking its claws into the nose of\nits Trainer if it isn't fed.") },
            // { PBESpecies.432, new PBELocalizedString("どうたいを　しっぽで　しばりつけて\nじぶんを　おおきく　みせている。\nめがあうと　いつまでも　にらみあう。", "몸통을 꼬리로 동여매어\n자신이 크게 보이도록 한다.\n눈이 마주치면 끝까지 째려본다.", "Il plaque ses queues contre son\ndos pour paraître plus grand.\nIl soutient un regard des heures.", "Umschlingt seinen Körper mit seinen\nSchweifen, um größer zu wirken. Bei\ndirektem Augenkontakt blendet es.", "Rodea su cuerpo con las colas para\nparecer más grande. Si fija la mirada,\nno se perderá un detalle.", "Si fascia la vita con le code per apparire\npiù grande. Fissa con insistenza chi\nincrocia il suo sguardo.", "It binds its body with its tails to\nmake itself look bigger. If it locks\neyes, it will glare ceaselessly.") },
            // { PBESpecies.433, new PBELocalizedString("とびはねると　くちのなかにある\nたまが　あちこちに　はんしゃして\nすずのような　ねいろと　なる。", "뛰어오르면 입 안에 있는\n구슬이 사방에 반사되어\n방울 같은 음색을 만들어 낸다.", "Quand il sautille, l'orbe qu'il a\ndans la bouche s'agite et tinte\ncomme une cloche.", "In seinem Maul befindet sich\neine Kugel, die beim Hopsen ein\nklingelndes Geräusch erzeugt.", "Tiene una esfera en la boca.\nCuando salta, la esfera rebota\ny emite un zumbido.", "Ha una sfera nella gola. Quando saltella,\nla sfera si muove emettendo dei trilli.", "There is an orb inside its mouth.\nWhen it hops, the orb bounces all\nover and makes a ringing sound.") },
            // { PBESpecies.434, new PBELocalizedString("おしりからとばす　くさい　しるの\nにおいは　はんけい\xFF12キロに　ひろがり\nまわりの　ポケモンは　いなくなる。", "엉덩이에서 뿜어지는 역한 분비액의\n냄새는 범위 2km까지 멀리 퍼져\n주변의 포켓몬이 자리를 뜨게 한다.", "Son derrière propulse un fluide\nnauséabond qui peut faire fuir les\nPokémon dans un rayon de 2 km.", "Versprüht eine Substanz aus seinem\nHinterleib, die in einem großen\nRadius andere Pokémon fernhält.", "Expulsa un fluido maloliente por sus\ncuartos traseros. El hedor repele\nPokémon en un radio de 2 km.", "Emette un fluido puzzolente dal\nposteriore. Il tanfo si sparge per 2 km\ne tiene lontani i Pokémon.", "It sprays a foul fluid from its\nrear. Its stench spreads over a\nmile radius, driving Pokémon away.") },
            // { PBESpecies.435, new PBELocalizedString("しっぽの　さきから　ひどい　においの\nえきたいを　とばして　こうげきするが\nうえから　ねらわれると　とまどう。", "꼬리 끝에서 심한 냄새의 액체를\n날려 공격하지만 위에서\n공격을 받게 되면 당황한다.", "Il attaque en projetant un liquide\nfétide du bout de sa queue. Mieux\nvaut l'attaquer par les airs.", "Greift mit einer Substanz aus der\nSpitze seines Schweifs an.\nAngriffe von oben verblüffen es.", "Ataca emitiendo un fluido maloliente\npor la punta de su cola.\nLos ataques aéreos le confunden.", "Attacca spruzzando un fluido puzzolente\ndalla punta della coda. Gli attacchi\ndall'alto lo confondono.", "It attacks by spraying a horribly\nsmelly fluid from the tip of its tail.\nAttacks from above confound it.") },
            // { PBESpecies.436, new PBELocalizedString("ふるい　おはかから　みつかる。\nせなかの　もようには　しんぴてきな\nちからが　やどっていると　いわれる。", "오래된 묘에서 발견된다.\n등의 무늬는 신비한\n힘이 깃들어 있다고 전해진다.", "On les trouve dans de vieilles tombes.\nLes motifs mystiques sur leur dos\nrenfermeraient un pouvoir magique.", "Man findet sie in alten Grabstätten.\nEs heißt, die Muster auf ihrem\nRücken bergen mystische Kräfte.", "Puede encontrarse en tumbas antiguas.\nSe dice que los símbolos inscritos en su\nespalda le confieren poderes extraños.", "Si trova in vecchie tombe. Si dice che\nnel disegno sulla sua schiena risieda una\nforza misteriosa.", "They are found in ancient tombs.\nThe patterns on their backs are\nsaid to be imbued with mysterious power.") },
            // { PBESpecies.437, new PBELocalizedString("あまぐもを　よべる　ポケモンとして\nおおむかしから　まつられていた。\nときどき　じめんに　うめられている。", "비구름을 부르는 포켓몬으로\n아주 옛날부터 떠받들어졌다.\n가끔 땅에 묻혀 있다.", "Il a longtemps été célébré pour avoir\napporté la pluie. On le trouve parfois\nenterré dans le sol.", "Man verehrt sie schon seit Urzeiten als\nRegenmacher. Manchmal findet man\neines von ihnen im Boden vergraben.", "Desde antaño se adora a este Pokémon\npara que propicie lluvias abundantes.\nA veces se esconde bajo tierra.", "È stato venerato per secoli come\nPokémon che porta la pioggia. A volte\nlo si trova sepolto nel terreno.", "In ages past, this Pokémon\nwas revered as a bringer of rain.\nIt was found buried in the ground.") },
            // { PBESpecies.438, new PBELocalizedString("かんそうした　くうきを　このむ。\nすいぶんを　ちょうせつ　するときに\nだす　みずが　なみだに　みえる。", "건조한 공기를 좋아한다.\n수분을 조절할 때에 내는 물이\n눈물처럼 보인다.", "Adepte des climats secs, il régule\nson humidité en laissant couler ce\nqui ressemble à des larmes.", "Mag es trocken. Gleicht es seinen\nWasserhaushalt aus, entweicht ihm\nWasser, das wie Tränen geformt ist.", "Prefiere entornos áridos. Sus ojos\nexpulsan agua para ajustar sus\nniveles de hidratación corporal.", "Ama i luoghi aridi. Quando regola\nl'umidità del corpo sembra che pianga.", "It prefers an arid atmosphere. It\nleaks water that looks like tears\nwhen adjusting its moisture level.") },
            // { PBESpecies.439, new PBELocalizedString("めにみえる　あいての　かおや\nうごきの　モノマネを　することで\nどんな　きもちか　わかろうとする。", "눈에 보이는 상대의 얼굴이나\n움직임의 흉내를 내는 것으로\n어떤 기분인지 알려고 한다.", "Il imite les mouvements et les\nexpressions des autres pour\ncomprendre leurs sentiments.", "Ahmt die Bewegungen und\nGesichtsausdrücke anderer nach,\num ihre Gefühle besser zu verstehen.", "Cuando tiene a alguien delante, imita\nsu expresión y movimientos para\nentender sus sentimientos.", "Imita i movimenti e le espressioni\ndi coloro che vede per capire\ni sentimenti degli altri.", "It mimics the expressions and\nmotions of those it sees to\nunderstand the feelings of others.") },
            { PBESpecies.Happiny, new PBELocalizedString("ちいさないしを　かかえるのが　すき。\nあいての　あしもとを　あるきまわって\nついつい　ころばすことも　ある。", "작은 돌 껴안기를 좋아한다.\n상대의 발치를 빙빙 돌다 그만\n넘어지게 만드는 일도 있다.", "Ce Pokémon ne se sépare jamais de\nson petit caillou et a tendance à\ntraîner dans les pieds des gens.", "Hat immer einen kleinen Felsen bei sich.\nWandelt zwischen den Füßen anderer,\nwas diese stolpern lässt.", "Se pasea por ahí con una roquita.\nA veces se cuela entre los pies de\nlos demás y hace que tropiecen.", "Gli piace trasportare una piccola roccia.\nA volte cammina tra i piedi degli altri,\nfacendoli inciampare.", "It likes to carry around a small\nrock. It may wander around others'\nfeet and cause them to stumble.") },
            // { PBESpecies.441, new PBELocalizedString("ベロは　にんげんのものに　そっくり。\nそのため　にんげんの　はなすことばを\nじょうずに　まねることが　できる。", "혀는 인간의 것을 똑 닮았다.\n그 때문에 인간이 하는 말을\n능숙하게 흉내 낼 수 있다.", "Sa langue comparable à celle\nde l'homme lui permet d'imiter\nhabilement le langage humain.", "Seine Zunge ähnelt der eines Menschen.\nDaher kann es die menschliche Sprache\ngut nachahmen.", "Su lengua es como la de cualquier\npersona, así que puede imitar muy\nbien el habla humana.", "La sua lingua è uguale a quella degli\nuomini. Gli riesce quindi facile imitare\nla voce umana.", "Its tongue is just like a human's.\nAs a result, it can cleverly mimic\nhuman speech.") },
            // { PBESpecies.442, new PBELocalizedString("いつも　わるさばかり　していたら\nふしぎな　じゅつで　ほんたいを\nかなめいしに　しばりつけられた。", "항상 나쁜 짓만 하고 있었기에\n이상한 술수로 본모습을\n쐐기돌에 속박당했다.", "Son mauvais comportement lui a valu\nd'être enchaîné à une Clé de Voûte\npar un mystérieux sortilège.", "Aufgrund seiner ständigen Untaten\nist es an einen Spiritkern gebunden.", "Por sus constantes fechorías se le\nacabó uniendo a una Piedra Espíritu\ncon un misterioso hechizo.", "A causa del suo comportamento molesto\nè stato imprigionato in una Roccianima\ncon un incantesimo.", "Its constant mischief and misdeeds\nresulted in it being bound to an Odd\nKeystone by a mysterious spell.") },
            { PBESpecies.Gible, new PBELocalizedString("おおぐちを　つかった　こうげきは\nいりょく　じゅうぶんだが　まだ\nうまくたたかえず　じぶんもきずつく。", "큰 입으로 하는 공격은 위력이\n충분하지만 아직은 잘 싸우지\n못해서 자신도 상처를 입는다.", "Malgré sa maladresse, son énorme\ngueule lui permet de lancer des\nattaques puissantes.", "Greift mit seinem riesigen Maul an.\nObwohl seine Angriffe mächtig sind,\nverletzt es sich dabei auch selbst.", "Ataca usando su enorme boca y, con\nlo torpe que es, también se suele\ndañar con sus potentes ataques.", "Attacca con la sua enorme bocca. È\nforte, ma molto maldestro e spesso\nsi danneggia da solo.", "It attacks using its huge mouth.\nWhile its attacks are powerful, it\nhurts itself out of clumsiness, too.") },
            { PBESpecies.Gabite, new PBELocalizedString("ひかりかがやく　ものが　だいすきで\nどうくつの　なかで　みつけた\nたからを　じぶんのすに　ためこむ。", "반짝반짝 빛나는 것을\n아주 좋아하기에 동굴 안에서 발견한\n보물을 자신의 둥지에 모아둔다.", "Toujours à la recherche d'objets\nbrillants, il arpente les grottes\npour constituer son butin.", "Es liebt funkelnde Dinge und sucht\nnach Schätzen in Höhlen, die es\ndann in seinem Nest hortet.", "Le gustan las cosas brillantes.\nBusca tesoros en cuevas y se\nlleva el botín a su nido.", "Adora gli oggetti luccicanti. Va a caccia\ndi tesori nelle grotte e li trasporta\nnel suo nido.", "It loves sparkly things. It seeks\ntreasures in caves and hoards the\nloot in its nest.") },
            { PBESpecies.Garchomp, new PBELocalizedString("こうそくで　かけぬけると　つばさは\nくうきの　やいばを　うみだし\nまわりのきは　せつだん　されている。", "고속으로 달려나가면 날개는\n공기의 칼날을 만들어내어\n주변의 나무는 절단 나게 된다.", "On dit que lancé à pleine vitesse,\nil crée des lames de vent avec ses\nailes pouvant trancher un arbre.", "Die schnelle Bewegung seiner Flügel\nerzeugt regelrechte Klingen des\nWindes, die Bäume fällen können.", "Se dice que, cuando va a velocidad\nmáxima, sus alas crean cuchillas de\nviento que talan cualquier árbol.", "Si dice che quando vola, le sue ali creino\nraffiche di vento in grado di abbattere\ngli alberi vicini.", "It is said that when one runs at\nhigh speed, its wings create blades\nof wind that can fell nearby trees.") },
            // { PBESpecies.446, new PBELocalizedString("ひっしに　エサを　たべているうちに\nからだの　けのしたに　かくしていた\nエサのことを　わすれてしまうのだ。", "먹이를 먹는 데 열중한 나머지\n몸의 털 밑에 숨겨놓은 먹이에\n대한 것은 잊어버리고 만다.", "Obnubilé par sa quête incessante\nde nourriture, il oublie parfois\nqu'il en a caché dans sa fourrure.", "Es ist so damit beschäftigt, Futter\nhinunterzuschlingen, dass es das\nFutter unter seinem Fell vergisst.", "En su desesperación por engullir\ncomida, se suele olvidar de la que\nesconde debajo de su pelaje.", "Il suo insaziabile appetito gli fa spesso\ndimenticare di avere del cibo nascosto\nsotto il pelo.", "In its desperation to gulp down\nfood, it forgets about the food it\nhas hidden under its fur.") },
            { PBESpecies.Riolu, new PBELocalizedString("かんじょうで　かたちが　かわる\nはどうを　だしあって　なかまどうし\nコミュニケーションを　とっている。", "감정에 따라 모양이 변하는\n파동을 서로 내어 동료끼리\n커뮤니케이션을 취하고 있다.", "Il communique avec ses semblables\ngrâce à des ondes qui sont modulées\nen fonction de ses émotions.", "Es kommuniziert mit seinen Artgenossen\nüber Wellen, die je nach Gefühlslage\neine andere Form annehmen.", "Se comunica con los suyos mediante la\nemisión de unas ondas que cambian de\nforma en función de los sentimientos.", "Comunica con i suoi simili tramite delle\nonde che cambiano forma a seconda del\nsentimento che prova.", "It uses the shapes of auras,\nwhich change according to emotion,\nto communicate with others.") },
            { PBESpecies.Lucario, new PBELocalizedString("あらゆる　ものが　だす　はどうを\nよみとることで　\xFF11キロさきに　いる\nあいての　きもちも　りかいできる。", "모든 물건이 내는 파동을\n읽어내어 1km 앞에 있는\n상대의 마음도 이해할 수 있다.", "Il peut sentir et identifier les émotions\nde quelqu'un à plus d'un kilomètre.", "Kann aus einem Kilometer Entfernung die\nGefühle anderer Wesen erfassen, indem\nes die Wellen liest, die sie aussenden.", "Emite unas ondas que le permiten percibir\ntodo lo que se encuentre a 1 km, incluso\nlos sentimientos de otras personas.", "Sa decifrare le onde emesse da ogni cosa.\nQuesto gli permette di capire le emozioni\ndi creature lontane anche 1 km.", "By reading the auras of all things,\nit can tell how others are feeling\nfrom over half a mile away.") },
            // { PBESpecies.449, new PBELocalizedString("はなの　あなを　ぴたりと　とじてから\nすなのなかを　あるくように　すすむ。\n\xFF11\xFF10ぴきていどの　むれで　くらす。", "콧구멍을 꽉 막고\n모래 속을 마치 걷듯이 다닌다.\n10마리 정도의 무리로 생활한다.", "Il peut obturer ses narines et\ntraverser le sable comme un ver.\nIl vit en colonies de 10 individus.", "Es schließt seine Nasenlöcher und\nreist dann durch den Sand. Bildet\nKolonien mit einer Größe von ca. 10.", "Cierra la nariz y luego atraviesa la\narena con total tranquilidad. Suele\nformar colonias de diez individuos.", "Chiude le narici e poi si sposta\nattraverso la sabbia. Vive in gruppi\ndi dieci.", "It shuts its nostrils tight then\ntravels through sand as if walking.\nThey form colonies of around 10.") },
            // { PBESpecies.450, new PBELocalizedString("いがいと　おこりっぽい　ポケモンで\nくちを　おおきく　あけることで\nまわりに　つよさを　アピールする。", "의외로 화를 잘 내는 포켓몬으로\n입을 크게 벌리는 것으로\n주변에 자신의 강함을 어필한다.", "Facilement irritable, il ouvre ses\nmâchoires au maximum pour intimider\nses adversaires.", "Es wird überraschend schnell wütend.\nAls Zeichen seiner Stärke sperrt es\nsein Maul auf.", "Mantiene la boca abierta para mostrar\nsu fuerza. Se enfada con sorprendente\nrapidez.", "Si infuria molto facilmente. Per mostrare\nla sua forza tiene la bocca spalancata.", "It is surprisingly quick to anger.\nIt holds its mouth agape as a\ndisplay of its strength.") },
            // { PBESpecies.451, new PBELocalizedString("かんそうした　とちに　くらし\nいちねんかん　なにも　たべずに\nえものを　まちぶせ　できる。", "건조한 토지에 살며\n1년간 아무것도 먹지 않고\n먹이를 숨어서 기다릴 수 있다.", "Il vit dans les régions arides et peut\nattendre une proie une année entière\nsans se nourrir.", "Es lebt in trockenen Regionen. Dort kann\nes ein ganzes Jahr lang ohne Nahrung\nauf Beute lauern.", "Vive en regiones áridas. Puede aguantar\nun año sin comer mientras espera\na su presa.", "Vive in territori aridi e può aspettare\nimmobile la sua preda per un anno intero\nsenza bisogno di mangiare.", "It lives in arid regions and\ncan go without food for a year\nwhile waiting for prey.") },
            // { PBESpecies.452, new PBELocalizedString("じまんの　パワーで　あいてを\nばらばらに　できるのに　さらに\nもうどくで　とどめを　さすのだ。", "자랑거리인 파워로 상대를\n조각조각 낼 수 있으며 게다가\n맹독으로 마무리한다.", "Il met ses adversaires en pièces grâce à\nsa prodigieuse force, puis donne le coup\nde grâce avec son violent poison.", "Es bringt seine Gegner mit starkem Gift\nzur Strecke, obwohl es weiß, dass es\nstark genug ist, um sie zu zerfetzen.", "Aunque sabe que puede aplastar al rival\ncon su gran fuerza, le gusta dar el golpe\nde gracia con su virulento veneno.", "Va fiero della sua forza con cui può fare\na pezzi il nemico, ma in genere preferisce\nfinirlo usando le sue tossine.", "It takes pride in its strength.\nEven though it can tear foes apart,\nit finishes them off with powerful poison.") },
            // { PBESpecies.453, new PBELocalizedString("どくぶくろを　ふくらませて　ならし\nあたりに　ぶきみな　おとを　ひびかせ\nあいてが　ひるむと　どくづきをする。", "독주머니를 부풀려서 울어\n주변에 으스스한 소리를 퍼트려\n상대가 풀죽으면 독찌르기를 한다.", "Ses glandes se gonflent de venin tout en\némettant un son effrayant, le laissant\nainsi empoisonner ses proies pétrifiées.", "Bläst es seine Giftbeutel auf, ertönt\nein unheimliches Geräusch, das Gegner\nzurückschrecken lässt und vergiftet.", "Infla sus bolsas venenosas para emitir\nun sonido macabro mientras asesta golpes\nque hacen retroceder a los rivales.", "Gonfia le sue sacche di veleno emettendo\nun verso sinistro che può far tentennare\nl'avversario, poi lo avvelena.", "Inflating its poison sacs, it fills the\narea with an odd sound and hits\nflinching opponents with a poison jab.") },
            // { PBESpecies.454, new PBELocalizedString("ドクロッグが　たたかいの　まえに\nのどを　ならすのは　どくぶくろに\nためこんだ　どくを　ねりこむためだ。", "독개굴이 싸움 전에\n목을 울리는 것은 독주머니에\n모은 독을 잘 섞기 위해서다.", "Avant de se battre, il coasse pour\nremuer le poison stocké sous sa\ngorge et le rendre plus efficace.", "Vor einem Kampf gibt es einen Quaklaut\nvon sich, um das Gift in seinem Giftbeutel\numzurühren.", "Antes de un combate, Toxicroak emite\nun alarido que relaja su bolsa de veneno\ny libera toxinas.", "Il verso che emette prima della lotta\nserve in realtà a rimescolare il veleno\ncontenuto nella sua sacca.", "The croaking that Toxicroak produces\nbefore a battle is for churning the\npoison it has stored in its poison sac.") },
            // { PBESpecies.455, new PBELocalizedString("しょくしゅで　きのえだに　まきつき\nだえきの　あまい　かおりで　えものが\nさそわれてくるのを　まっている。", "촉수로 나뭇가지에 엉겨 붙어\n타액의 달콤한 냄새로 먹이가\n다가오는 것을 기다리고 있다.", "Il se suspend aux arbres avec ses\ntentacules, puis il attire ses proies\navec sa salive à l'odeur enivrante.", "Es wickelt sich um Äste und wartet\ndarauf, dass seine Beute vom süßen\nDuft seines Speichels angelockt wird.", "Se aferra a las ramas de los árboles con\nsus tentáculos y segrega una saliva de\ndulce aroma que atrae a sus presas.", "Si attacca ai rami degli alberi con i suoi\ntentacoli, in attesa che il dolce aroma\ndella sua saliva attiri una preda.", "Using its tentacles to lash itself to\ntrees, it lies in wait for prey, luring it\nclose with sweet-smelling drool.") },
            // { PBESpecies.456, new PBELocalizedString("からだの　よこがわにある　ラインは\nたいようのひかりを　ためておける。\nよるになると　あざやかに　かがやく。", "몸의 옆쪽에 있는 줄에\n태양빛을 모아둘 수 있다.\n밤이 되면 아름답게 빛난다.", "La ligne qui fait le tour de son\ncorps stocke l'énergie solaire\net brille dans la nuit.", "Die Linie an seiner Seite kann\nSonnenlicht speichern. Nachts\nleuchtet es sehr intensiv.", "La línea que le recorre el costado\npuede almacenar luz solar. Brilla\ncon mucha fuerza por la noche.", "La linea che contorna il suo corpo\nimmagazzina la luce solare. Di notte\nsi illumina di una luce splendente.", "The line running down its side can\nstore sunlight. It shines vividly at\nnight.") },
            // { PBESpecies.457, new PBELocalizedString("ながい　ひれを　あしのように\nつかって　かいていを　はっている。\nランターンと　えものを　とりあう。", "긴 지느러미를 다리처럼\n써서 해저를 기어다닌다.\n랜턴과 먹이다툼을 한다.", "Il rampe au fond de l'océan grâce\naux nageoires de son torse.\nLe Lanturn est son rival.", "Kriecht mit seinen langen\nVorderflossen über den Meeresboden.\nKonkurriert mit Lanturn um Futter.", "Se arrastra por el fondo marino\ncon sus largas aletas frontales.\nCompite con Lanturn por la comida.", "Si sposta sui fondali con le lunghe pinne\nanteriori. Lanturn è suo rivale nella\nricerca del cibo.", "It crawls along the seafloor using\nits long front fins like legs. It\ncompetes for food with Lanturn.") },
            // { PBESpecies.458, new PBELocalizedString("せなかの　もようは　ちいきによって\nことなっている。テッポウオの　むれに\nまざって　およぐことが　おおい。", "등의 무늬는 지역에 따라\n달라진다. 총어 무리에\n섞여 헤엄치는 일이 많다.", "Les motifs sur son dos sont différents\nselon les régions. On le voit souvent\ndans des bancs de Rémoraid.", "Ihre Rücken sind je nach Region\nunterschiedlich gemustert. Oft mischen\nsie sich unter Remoraid-Schwärme.", "Los símbolos de su espalda cambian según\nla región. A veces se mezcla con bancos\nde Remoraid y nada junto a ellos.", "Il disegno sul suo dorso cambia a seconda\ndella regione. Nuota spesso assieme ai\nbranchi di Remoraid.", "The pattern on its back\nvaries by region. It often\nswims in a school of Remoraid.") },
            // { PBESpecies.459, new PBELocalizedString("にんげんに　きょうみが　あるのか\nゆきやまで　あしあとを　みつけると\nそのまわりに　あつまってくる。", "인간에게 흥미가 있는지\n설산에서 발자국을 발견하면\n그 주변에 모여든다.", "Curieux de rencontrer des gens, ils\nse rassemblent autour des traces\nde pas trouvées dans la montagne.", "Neugierig auf Menschen versammeln\nsie sich bei Fußspuren, die sie auf\nverschneiten Bergen finden.", "Siente mucha curiosidad por los\nhumanos. Si uno encuentra huellas\nen la nieve, acuden todos a mirar.", "Gli uomini lo incuriosiscono molto. Si\nraduna in gruppi attorno alle impronte\nsulle montagne innevate.", "Seemingly curious about people,\nthey gather around footsteps they\nfind on snowy mountains.") },
            // { PBESpecies.460, new PBELocalizedString("ゆきのはなが　さくころ　どこからか\nすがたを　あらわし　はながちると\nまた　どこかに　すがたを　かくす。", "눈꽃이 필 무렵 어디선가\n나타나며 꽃이 지면\n또 어딘가로 모습을 감춘다.", "Il apparaît quand les fleurs des\nterres enneigées fleurissent et\nse retire quand elles se fanent.", "Sie erscheinen beim Blühen der\nSchneeblumen und verschwinden\nwieder, sobald diese verblüht sind.", "Aparece con las flores de nieve y\nse retira cuando se les caen los\npétalos. No se sabe adónde va.", "Appare quando sbocciano i fiori invernali.\nQuando i petali cadono si ritira in luoghi\nsconosciuti.", "They appear when the snow flowers\nbloom. When the petals fall, they\nretreat to places unknown again.") },
            // { PBESpecies.461, new PBELocalizedString("ツメで　いしに　サインをのこし\nコミュニケーションを　とりながら\nれんけいプレイで　てきを　おいこむ。", "발톱으로 돌에 사인을 남겨\n커뮤니케이션을 취하면서\n연계플레이로 상대를 몰아붙인다.", "Ils communiquent entre eux en griffant\ndes signes dans la roche et travaillent\nen groupe pour chasser l'ennemi.", "Sie sprechen sich miteinander ab, indem\nsie Muster in Steine ritzen, um ihre\nGegner dann gemeinsam einzukreisen.", "Se comunican mediante símbolos que tallan\nen las rocas con sus garras y así se\ncoordinan para rodear al enemigo.", "Comunicano con i compagni incidendo dei\nmessaggi sulle rocce con gli artigli. Con\nquesta tattica, circondano i nemici.", "They communicate by clawing\nsigns in boulders and work\ntogether to surround enemies.") },
            // { PBESpecies.462, new PBELocalizedString("つよすぎる　じりょくを　だして\nジバコイルどうし　ひきよせあって\nまったく　うごけなくなったりする。", "너무 강한 자력을 내어\n자포코일끼리 끌어당겨\n전혀 못 움직이기도 한다.", "Le champ magnétique qu'ils émettent est\ntel qu'ils ont tendance à s'attirer\nmutuellement et à s'empêcher de bouger.", "Gelegentlich erzeugen sie so starke\nMagnetfelder, dass sie sich gegenseitig\nanziehen und einander immobilisieren.", "Emiten campos magnéticos tan potentes\nque se atraen entre sí e incluso pueden\nllegar a inmovilizarse.", "A volte si attraggono l'un l'altro con la\nloro potentissima carica magnetica, e poi\nnon riescono più a muoversi.", "Sometimes the magnetism emitted by\nMagnezone is too strong, making them\nattract each other so they cannot move.") },
            // { PBESpecies.463, new PBELocalizedString("だえきには　どんな　ものも　とかす\nせいぶんが　たっぷり　ふくまれており\nなめられると　いつまでも　しびれる。", "타액에는 어떤 것도 녹이는\n성분이 충분히 포함되어 있어\n핥으면 언제까지나 마비된다.", "Sa bave anesthésiante est chargée\nd'une substance capable de faire\nfondre n'importe quelle matière.", "Ihr Speichel enthält eine ätzende\nSubstanz, die bei Kontakt mit der\nHaut anhaltende Taubheit erzeugt.", "La alta concentración de sustancias en\nsu saliva lo disuelve todo. Un lametón\nprovoca un entumecimiento permanente.", "La sua saliva contiene una sostanza che\nscioglie qualsiasi cosa e causa la paralisi\nse si viene leccati.", "Their saliva contains lots of components\nthat can dissolve anything. The numbness\ncaused by their lick does not dissipate.") },
            // { PBESpecies.464, new PBELocalizedString("きんにくに　ちからを　こめて\nしゅんかんてきに　ふくらませることで\nてにした　いしを　ふんしゅつできる。", "근육에 힘을 모아\n순간적으로 부풀리는 것으로\n손에 넣은 돌을 분출시킬 수 있다.", "Il peut lancer des pierres à une\nvitesse saisissante en bandant et\nrelâchant ses muscles en un éclair.", "Kann durch augenblickliche\nMuskelbewegungen einen Felsen in seiner\nHand wie ein Geschoss abfeuern.", "Si tensa y expande los músculos muy\nrápido, puede disparar las rocas que\ntenga en la mano como misiles.", "Può gettare una roccia che tiene in\nmano come un missile contraendo ed\nestendendo velocemente i muscoli.", "It can launch a rock held in its\nhand like a missile by tightening\nthen expanding muscles instantly.") },
            // { PBESpecies.465, new PBELocalizedString("うでを　たべられても　へっちゃら。\nさいせいのうりょくが　たかいので\nあっ　というまに　もとどおりになる。", "팔을 먹혀도 문제없다.\n재생능력이 높아\n눈 깜짝할 사이에 원래대로 돌아간다.", "Il se moque de se faire dévorer un\nbras, car il pourra le faire repousser\nen un instant par régénération.", "Seine regenerativen Kräfte sind so\nstark, dass ein Arm sofort nachwächst,\nwenn er gefressen wird.", "Su capacidad regenerativa es tan alta\nque sus brazos crecen de nuevo con\nrapidez aunque se los hayan cortado.", "Non si preoccupa di perdere un arto. La\nsua forza rigeneratrice è così potente\nda farglielo ricrescere in un istante.", "Even if one of its arms is eaten,\nit's fine. The Pokémon regenerates\nquickly and will go right back to normal.") },
            // { PBESpecies.466, new PBELocalizedString("あいてに　しっぽのさきを　おしつけ\nしゅんじに　\xFF12まんボルト　いじょうの\nこうあつ　でんりゅうを　おくりこむ。", "상대에게 꼬리 끝을 밀어붙여\n순식간에 2만 볼트 이상의\n고압 전류를 흘려보낸다.", "Il touche l'ennemi avec ses queues\nafin de lui infliger une décharge\nde plus de 20 000 volts.", "Es berührt Gegner mit seinen beiden\nSchweifspitzen und entlädt dabei\ngeballte 20 000 Volt.", "Alcanza al enemigo con las puntas de sus\ncolas y lo electrocuta con una descarga\nde más de 20 000 voltios.", "Tocca il nemico con la punta delle code\nrilasciando in un istante una scarica\nad alta tensione di oltre 20.000 volt.", "The instant it presses the tips of its\ntails onto an opponent, it sends over\n20,000 volts of electricity into the foe.") },
            // { PBESpecies.467, new PBELocalizedString("うでのさきから　せっし\xFF12\xFF10\xFF10\xFF10どの\nひのたまを　うちだすとき　からだは\nねつのため　ほのかに　しろくなる。", "팔 끝에서 섭씨 2000도의\n불구슬을 쏘아낼 때 몸은\n열 때문에 약간 하얘진다.", "Les boules de feu à 2 000 °C qu'il lance\navec ses bras font pratiquement\nchauffer son corps à blanc.", "Während es 2 000 Grad heiße Feuerbälle\naus seinen Armen schießt, nimmt sein\nKörper einen weißlichen Farbton an.", "Al lanzar bolas de fuego de 2000° por\nlas manos, su cuerpo adopta un tono\nblanquecino debido a la temperatura.", "Spara palle di fuoco di oltre 2000°C e\nil suo corpo assume una tinta bianca a\ncausa del calore intenso.", "When shooting 3,600 degree F fireballs\nfrom its arms, its body takes on a\nwhitish hue from the intense heat.") },
            // { PBESpecies.468, new PBELocalizedString("おたがいの　そんざいを　みとめあい\nむだに　あらそわない　ひとのために\nさまざまな　めぐみを　わけあたえる。", "서로 존재를 인정하고 쓸데없는\n분쟁을 하지 않는 사람을 위해\n다양한 은총을 나누어 준다.", "Il apprécie particulièrement les\ngens qui respectent les autres\net évitent les conflits inutiles.", "Menschen, die unnötigen Streit\nvermeiden und sich gegenseitig\nrespektieren, ist es wohlgesonnen.", "Congenia muy bien con las personas\nque respetan los derechos de los\ndemás y evitan riñas innecesarias.", "La sua natura lo rende affine alle\npersone che rispettano i diritti altrui\ned evitano conflitti inutili.", "It shares many blessings with\npeople who respect one another's\nrights and avoid needless strife.") },
            // { PBESpecies.469, new PBELocalizedString("こうそくで　とんで　すれちがった\nあいての　くびを　いっしゅんで\nかみちぎる　たたかいかたを　このむ。", "고속으로 날아서 스친\n상대의 목을 한순간에\n물어뜯는 싸움법을 선호한다.", "Il excelle dans l'art de mordre\nses ennemis en plein vol,\net à grande vitesse.", "Seine bevorzugte Strategie besteht\ndarin, seine Gegner aus dem Flug\nblitzartig zur Strecke zu bringen.", "Su técnica favorita consiste en volar\na gran velocidad y despedazar con su\nmandíbula a su oponente en un instante.", "Preferisce piombare sui nemici a grande\nvelocità per tagliuzzarli a dovere in un\nbatter d'occhio.", "It prefers to battle by biting\napart foes' heads instantly\nwhile flying by at high speed.") },
            { PBESpecies.Leafeon, new PBELocalizedString("しょくぶつの　ような　さいぼうになり\nたいないで　こうごうせいを　して\nきれいな　くうきを　つくりだせる。", "세포가 식물 같이 되어\n체내에서 광합성을 하여\n깨끗한 공기를 만들어낼 수 있다.", "Il utilise la photosynthèse comme les\nplantes et produit ainsi un air pur.", "Da seine Zellstruktur der von Pflanzen\ngleicht, kann sein Körper Photosynthese\nbetreiben und saubere Luft erzeugen.", "Sus células son parecidas a las de las\nplantas, por lo que hace la fotosíntesis\nen su interior y expulsa oxígeno puro.", "Le sue cellule sono simili a quelle\ndelle piante. Rende l'aria più pulita\neffettuando la fotosintesi.", "With cells similar to those of plants,\nit performs photosynthesis inside its\nbody and creates pure air.") },
            { PBESpecies.Glaceon, new PBELocalizedString("たいおんを　さげることで　ぜんしんの\nたいもうを　こおらせて　するどく\nとがった　ハリのようにして　とばす。", "체온을 내리는 것으로 전신의\n털을 얼려서 날카롭고\n뾰족한 바늘처럼 만들어 날린다.", "Il abaisse la température de son corps\npour changer ses poils en aiguilles de\nglace qu'il projette sur l'ennemi.", "Wenn es seine Körpertemperatur senkt,\nerstarren die Haare seines Fells zu Eis\nund dienen ihm als nadelartige Geschosse.", "Al reducir su temperatura corporal,\nsu pelaje se congela y se convierte\nen afilados pinchos que puede disparar.", "Abbassa la temperatura del corpo per\nghiacciare i propri peli e lanciarli come\nmicidiali aghi sottilissimi.", "It lowers its body heat to freeze its\nfur. The hairs then become like needles\nit can fire.") },
            // { PBESpecies.472, new PBELocalizedString("おとをたてずに　そらを　まい\nえものに　ちかづくと　いっしゅんで\nきゅうしょを　ひとつき　するぞ\xFF01", "소리 내지 않고 하늘을 날아\n먹이에 가까이 가면 한순간에\n급소를 공격한다!", "Son vol silencieux lui permet d'approcher\ndiscrètement ses ennemis pour asséner\ndes coups critiques instantanément.", "Es fliegt lautlos am Himmel. Sobald es\nsich seiner Beute genähert hat, landet\nes augenblicklich einen Volltreffer.", "Planea en el aire sin hacer ruido alguno,\nse acerca a su presa sigilosamente y le\nasesta en un instante un golpe crítico.", "Si alza in volo e si accosta al nemico\nsenza fare il minimo rumore. In questo\nmodo può metterlo KO in un solo colpo.", "It dances silently through the sky.\nWhen it approaches prey, it can\nland a critical hit in an instant.") },
            // { PBESpecies.473, new PBELocalizedString("ひょうがきの　おわりに　きおんが\nたかくなって　おおくの　マンムーが\nすがたを　けしたと　いわれている。", "빙하기 말기에 기온이\n높아져 많은 맘모꾸리가\n모습을 감췄다고 전해진다.", "On dit que la plupart des spécimens\nont disparu à la fin de la dernière\npériode glaciaire.", "Man sagt, als gegen Ende der letzten\nEiszeit die Temperaturen wieder stiegen,\nseien viele Mamutel verschwunden.", "Se dice que, cuando las temperaturas\naumentaron tras la era glacial, muchos\nMamoswine desaparecieron del globo.", "Si dice che molti Mamoswine sparirono\nverso la fine dell'era glaciale a causa\ndell'aumento della temperatura.", "When the temperature rose at\nthe end of the ice age, most\nMamoswine disappeared.") },
            // { PBESpecies.474, new PBELocalizedString("いじげんでも　かつやく　できるよう\nプログラムを　しゅうせい　したが\nねらいどおりには　いかなかった。", "다른 차원에서도 활약할 수 있도록\n프로그램을 수정했지만\n바라는 대로는 되지 않았다.", "Il a été modifié pour être capable\nde travailler dans des dimensions\nparallèles, mais c'est un échec.", "Es wurde umprogrammiert, um in\naußerirdischen Dimensionen arbeiten\nzu können. Leider schlug das fehl.", "Se modificó su programación para que\npudiera trabajar en dimensiones\nalienígenas. Pero no funcionó.", "È stato riprogrammato per il lavoro in\ndimensioni sconosciute, ma pare non\nfunzionare correttamente.", "Its programming was modified to\nenable work in alien dimensions.\nIt did not work as planned.") },
            // { PBESpecies.475, new PBELocalizedString("だれかを　まもろうと　したとき\nひじをのばし　かたなのように\nへんか　させて　はげしく　たたかう。", "누군가를 지키려고 할 때는\n팔꿈치를 늘여서 칼처럼\n변화시키고 격렬하게 싸운다.", "Toujours prêt à protéger son prochain,\nil se bat férocement avec ses coudes\nen forme d'épées.", "Will es beschützen, streckt es seine\nEllbogen zu etwas Schwertähnlichem\nund kämpft auf wilde Art.", "Cuando quiere proteger a alguien,\nextiende los codos como si fueran\nespadas y lucha con fiereza.", "Quando protegge qualcuno estende\ni gomiti come se fossero spade e\ncombatte furiosamente.", "When trying to protect someone,\nit extends its elbows as if they\nwere swords and fights savagely.") },
            // { PBESpecies.476, new PBELocalizedString("チビノーズと　よばれる　\xFF13つの\nユニットを　じりょくを　つかって\nじゆうじざいに　あやつっている。", "꼬마코파스라고 불리는 3개의\n유닛을 자력을 사용하여\n자유자재로 조종한다.", "Il utilise sa force magnétique pour\ndiriger trois petites unités\nappelées Mini-nez.", "Es steuert drei kleine Einheiten\nmithilfe von starkem Magnetismus.\nMan nennt diese Einheiten Mininasen.", "Con el magnetismo que emite, controla\ntres unidades llamadas Mini-Narices.", "Controlla tre unità, dette Mininasi,\nusando la forza magnetica.", "It freely controls three units\ncalled Mini-Noses using\nmagnetic force.") },
            // { PBESpecies.477, new PBELocalizedString("だんりょくのある　からだの　なかに\nいきばのない　たましいを　とりこんで\nあのよに　つれていくと　いわれる。", "탄력 있는 몸 안에\n갈 곳 없는 영혼을 가두어\n저승으로 데려간다고 전해진다.", "Son corps se replie sur lui-même\npour emprisonner les esprits\nperdus et les ramener chez eux.", "Man sagt, dass es verlorene\nSeelen in seinem biegsamen\nKörper nach Hause geleite.", "Se dice que recoge en su cuerpo\nflexible a los espíritus extraviados\ny los guía hasta casa.", "Si dice che accolga gli spiriti smarriti\nnel suo corpo flessibile per riportarli\na casa.", "It is said to take lost spirits\ninto its pliant body and guide\nthem home.") },
            // { PBESpecies.478, new PBELocalizedString("マイナス\xFF15\xFF10どの　いきを　ふきかけ\nこおらせた　えものを　ひみつの\nばしょに　かざっていると　いわれる。", "마이너스 50도의 숨결을 뿜어서\n얼린 먹이를 비밀 장소에\n장식해 둔다고 전해진다.", "On dit que Momartik gèle ses proies\ngrâce à son souffle à -50 °C avant\nde les exposer dans sa tanière.", "Friert Beute durch seinen -50 Grad\nkalten Atem ein. Es soll diese\nBeute dann heimlich ausstellen.", "Congela a sus presas con su aliento\ngélido de 50° bajo cero. Se dice que\nluego las expone.", "Congela le prede con un alito glaciale\na -50°C. Si dice che poi le metta\nsegretamente in mostra.", "It freezes prey by blowing its -58\ndegrees F breath. It is said to\nthen secretly display its prey.") },
            { PBESpecies.Rotom, new PBELocalizedString("でんきのような　からだは　いちぶの\nきかいに　はいりこむことが　できる。\nそして　そのからだで　いたずらする。", "전기 같은 몸은 일부 기계에\n들어갈 수 있다. 그리고\n그 몸으로 장난을 친다.", "Son corps parcouru d'électricité\nlui permet de prendre le contrôle\nde certains appareils ménagers.", "Es kann mit seinem Körper in\nelektrische Geräte eindringen\nund dann für Chaos sorgen.", "Con su cuerpo eléctrico puede\ninfiltrarse en algunas máquinas\npara controlarlas y causar daños.", "Il suo corpo elettrico può introdursi\nin alcuni apparecchi, prendendone\nil controllo e creando caos.", "Its electric-like body can enter\nsome kinds of machines and take\ncontrol in order to make mischief.") },
            { PBESpecies.Uxie, new PBELocalizedString("ユクシーが　とびまわったことで\nひとびとに　ものごとを　かいけつする\nちえ　というものが　うまれた。", "유크시가 날아다님으로써\n사람들에게 세상사를 해결하는\n지혜가 생겨나게 되었다.", "Quand il prit son envol, les hommes\napprirent à résoudre les problèmes.\nLe savoir était né.", "Als Selfe flog, erlangten Menschen\ndie Fähigkeit, Probleme zu lösen.\nEs war die Geburt des Wissens.", "Voló, y las personas adquirieron la\ncapacidad para resolver problemas.\nAsí nació la sabiduría.", "Al volo di Uxie, gli uomini impararono\na risolvere i problemi. In tal modo\nnacque la conoscenza.", "When Uxie flew, people gained the\nability to solve problems.\nIt was the birth of knowledge.") },
            { PBESpecies.Mesprit, new PBELocalizedString("エムリットが　とびまわったことで\nひとびとに　いきるときの　よろこび\nかなしみ　というものが　うまれた。", "엠라이트가 날아다님으로써\n사람들에게 삶의 기쁨, 슬픔\n이라는 것이 생겨나게 되었다.", "Quand il prit son envol, les hommes\napprirent à ressentir la joie et la\npeine. L'émotion était née.", "Als Vesprit flog, lernten Menschen\nGlück und Trauer des Lebens kennen.\nDie Geburt der Gefühle.", "Voló, y los humanos aprendieron\nsobre la felicidad y la tristeza de\nvivir. Así nacieron las emociones.", "Al volo di Mesprit, gli uomini conobbero\nle gioie e i dolori della vita. In tal modo\nnacquero le emozioni.", "When Mesprit flew, people learned\nthe joy and sadness of living.\nIt was the birth of emotions.") },
            { PBESpecies.Azelf, new PBELocalizedString("アグノムが　とびまわったことで\nひとびとに　なにかを　するための\nけつい　というものが　うまれた。", "아그놈이 날아다님으로써\n사람들에게 뭔가를 하기 위한\n결의가 생겨나게 되었다.", "Quand il prit son envol, les hommes\nacquirent la détermination.\nLa volonté était née.", "Als Tobutz flog, erlangten\nMenschen die Entschlossenheit.\nEs war die Geburt der Willenskraft.", "Voló, y los humanos lograron la\ndeterminación para hacer cosas.\nAsí nació la voluntad.", "Al volo di Azelf, gli uomini impararono\nla determinazione nelle azioni. In tal\nmodo nacque la volontà.", "When Azelf flew, people gained the\ndetermination to do things.\nIt was the birth of willpower.") },
            { PBESpecies.Dialga, new PBELocalizedString("ディアルガの　しんぞうが　うごくと\nじかんは　ながれていくと　されている\nシンオウの　でんせつ　ポケモン。", "디아루가는 그 심장이 움직이면\n시간이 흘러간다고 여겨지는\n신오지방의 전설 포켓몬이다.", "On dit que le temps s'écoule au\nrythme des battements de cœur de\nce Pokémon légendaire de Sinnoh.", "Ein Legendäres Pokémon aus der\nSinnoh-Region. Schlägt das Herz\nvon Dialga, läuft die Zeit normal.", "Un Pokémon legendario de Sinnoh.\nSe dice que el tiempo avanza con\ncada latido de su corazón.", "Pokémon leggendario della regione di\nSinnoh. Si dice che il tempo scorra al\nbattere del suo cuore.", "A legendary Pokémon of Sinnoh.\nIt is said that time flows when\nDialga's heart beats.") },
            { PBESpecies.Palkia, new PBELocalizedString("パルキアが　こきゅうを　するたびに\nくうかんは　あんていすると　される\nシンオウの　でんせつの　ポケモン。", "펄기아는 호흡을 할 때마다\n공간을 안정시킨다고 여겨지는\n신오지방의 전설 포켓몬이다.", "On dit que la stabilité de l'espace\nest maintenue par le souffle de ce\nPokémon légendaire de Sinnoh.", "Ein Legendäres Pokémon aus der\nSinnoh-Region. Mit dem Atem von\nPalkia wird das Universum stabiler.", "Un Pokémon legendario de Sinnoh.\nSe dice que el espacio se vuelve más\nestable con cada respiración suya.", "Pokémon leggendario della regione di\nSinnoh. Si dice che lo spazio diventi\npiù stabile al suo respiro.", "A legendary Pokémon of Sinnoh.\nIt is said that space becomes more\nstable with Palkia's every breath.") },
            // { PBESpecies.485, new PBELocalizedString("がんじょうな　はがねの　からだだが\nじぶんが　はっする　こうねつの　ため\nところどころ　とけてしまっている。", "단단한 강철의 몸이지만\n자신이 내는 고열 때문에\n여기저기 녹아내리고 있다.", "Son corps est composé d'acier brut\ndont certaines parties ont fondu\nà cause de sa propre chaleur.", "Sein Körper besteht aus Stahl,\nhat aber aufgrund der eigenen\nTemperatur geschmolzene Stellen.", "Su cuerpo es de rugoso acero, pero\nsu propio calor corporal lo ha\nderretido en algunos puntos.", "Il suo corpo è fatto d'acciaio. Tuttavia,\nin alcune parti è sciolto a causa del suo\nstesso calore.", "Its body is made of rugged steel.\nHowever, it is partially melted in\nspots because of its own heat.") },
            // { PBESpecies.486, new PBELocalizedString("とくしゅな　ひょうざんや　がんせき\nマグマから　じぶんの　すがたに　にた\nポケモンを　つくったと　いわれる。", "특수한 빙산이나 암석,\n마그마에서 자신의 모습과 닮은\n포켓몬을 만들었다고 전해진다.", "On dit qu'il a créé des Pokémon\nà son image à partir de glace,\nde roche et de magma.", "Man sagt, es habe Pokémon aus\neinem Eisberg, Felsen und Magma\nnach seinem Abbild geschaffen.", "Se dice que usó rocas, magma y un hielo\nespecial de montaña para crear Pokémon\ncon su aspecto.", "Si dice che abbia creato dei Pokémon\nsimili a sé usando una montagna\nghiacciata, rocce e magma.", "It is said to have made Pokémon\nthat look like itself from a special\nice mountain, rocks, and magma.") },
            { PBESpecies.Giratina, new PBELocalizedString("あばれもの　ゆえ　おいだされたが\nやぶれたせかいと　いわれる　ばしょで\nしずかに　もとのせかいを　みていた。", "난폭하다는 이유로 쫓겨났지만\n깨어진 세계라고 전해지는 장소에서\n조용히 원래 세계를 보고 있었다.", "Sa grande violence lui a valu d'être\nbanni. Il observe les hommes en\nsilence depuis le Monde Distorsion.", "Es wurde aufgrund seines Verhaltens\nverbannt. Aus der Zerrwelt schaut es\nauf die alte Welt.", "Fue desterrado por su violencia.\nObserva el mundo en silencio desde\nel Mundo Distorsión.", "È stato bandito per la sua violenza.\nOsserva il vecchio mondo in silenzio\ndal Mondo Distorto.", "It was banished for its violence.\nIt silently gazed upon the old\nworld from the Distortion World.") },
            { PBESpecies.Cresselia, new PBELocalizedString("みかづきに　ちかい　よるほど\nしっぽから　のびる　オーロラは\nながく　うつくしくなる。", "초승달에 가까운 밤일수록\n꼬리에서 뻗어나는 오로라가\n길고 아름다워진다.", "Les nuits où le premier croissant\nde lune est visible, l'arc de sa\nqueue se déploie de façon superbe.", "In Nächten mit zunehmendem Mond\nstreckt sich das Licht von seinem\nSchweif und wellt sich wunderschön.", "En las noches de media luna, la\naurora de su cola se extiende y\nondea más hermosa que nunca.", "Nelle notti di luna crescente, l'aurora\ndella sua coda si spande e ondeggia\nin modo splendido.", "On nights around the quarter moon,\nthe aurora from its tail extends\nand undulates beautifully.") },
            // { PBESpecies.489, new PBELocalizedString("あたたかい　うみを　ただよっている。\nどんな　とおくに　ながされても\nうまれた　ばしょに　かならずもどる。", "따뜻한 바다를 떠돌고 있다.\n아무리 먼 곳으로 흘러가도\n태어난 장소로 반드시 돌아온다.", "Ce Pokémon des mers chaudes\nrevient toujours à son lieu de\nnaissance, peu importe la distance.", "Lässt sich in warmen Meeren\ntreiben, kehrt aber immer an\nden Platz seiner Geburt zurück.", "Va a la deriva por mares cálidos.\nSiempre vuelve a donde nació, por\nmucho que se haya alejado.", "Si sposta nei mari caldi. Torna sempre\ndove è nato, anche se si trova molto\nlontano.", "It drifts in warm seas. It always\nreturns to where it was born, no\nmatter how far it may have drifted.") },
            // { PBESpecies.490, new PBELocalizedString("うまれたときから　そなわっている\nふしぎな　ちからを　つかうと　どんな\nポケモンとも　こころが　かよいあう。", "태어났을 때부터 가지고 있는\n이상한 힘을 쓰면 어떤 포켓몬과도\n마음이 서로 통하게 된다.", "Il est né avec le pouvoir incroyable\nde créer des liens avec n'importe\nquel Pokémon.", "Es wird mit einer wundersamen Kraft\ngeboren, die eine Bindung zu jedem\nanderen Pokémon möglich macht.", "Nace con un maravilloso poder que\nle permite establecer vínculos con\ncualquier tipo de Pokémon.", "Dispone di un potere innato che lo fa\nlegare con qualsiasi specie di Pokémon.", "It is born with a wondrous power\nthat lets it bond with any kind of\nPokémon.") },
            { PBESpecies.Darkrai, new PBELocalizedString("じぶんを　まもるために　まわりの\nひとや　ポケモンに　あくむをみせるが\nダークライに　わるぎは　ないのだ。", "자신을 지키기 위해 주변의 사람이나\n포켓몬에게 악몽을 꾸게 하지만\n다크라이는 나쁜 뜻이 있는 게 아니다.", "Menacé, ce Pokémon se protège\nen créant des cauchemars dans\nl'esprit de ses ennemis.", "Verursacht bei in der Nähe Stehenden\nAlpträume. Dies tut es aber nur, um sich\nzu schützen.", "Para protegerse, causa pesadillas a\nlos que le rodean. Pero no lo hace\ncon intención de hacer daño.", "Per proteggersi, riempie di incubi\nla mente di chi gli sta intorno.\nTuttavia, non è di indole malvagia.", "To protect itself, it afflicts those\naround it with nightmares. However,\nit means no harm.") },
            // { PBESpecies.492, new PBELocalizedString("ひとに　やさしく　だきしめられ　\nありがとうの　きもちを　かんじると\nぜんしんの　はなが　ひらきだす。", "사람에게 부드럽게 껴안아져\n감사의 마음을 느끼면\n전신의 꽃이 피어난다.", "Les fleurs qui couvrent son corps\ns'ouvrent quand il est câliné avec\namour et perçoit de la gratitude.", "Wird es umarmt, empfindet es\nDankbarkeit, was wiederum dazu\nführt, dass seine Blumen blühen.", "Todas las flores de su cuerpo florecen\nsi se le abraza con amor y percibe\ngratitud.", "I fiori che lo ricoprono sbocciano se\nviene abbracciato con affetto e\nsi sente apprezzato.", "The flowers all over its body burst\ninto bloom if it is lovingly hugged\nand senses gratitude.") },
            { PBESpecies.Arceus, new PBELocalizedString("なにも　ない　ばしょに　あった\nタマゴのなかから　すがたを　あらわし\nせかいを　うみだしたと　されている。", "아무것도 없는 곳에 있던\n알에서 깨어나 세계를\n만들었다고 여겨진다.", "On dit que son œuf a éclos dans\nle néant et qu'il est à l'origine\nde la création du monde.", "Man sagt, es sei im Nichts aus\neinem Ei geschlüpft und\nhabe dann die Welt geformt.", "Se dice que surgió de un huevo en\nun lugar en el que no había nada.\nY luego dio forma al mundo.", "Si dice che sia nato da un uovo in mezzo\nal nulla e che poi abbia dato origine\nal mondo.", "It is said to have emerged from an\negg in a place where there was\nnothing then shaped the world.") },
            { PBESpecies.Victini, new PBELocalizedString("ビクティニが　むげんに　うみだす\nエネルギーを　わけあたえてもらうと\nぜんしんに　パワーが　あふれだす。", "비크티니가 무한히 만들어내는\n에너지를 나누어 받으면\n전신에 파워가 넘친다.", "L'énergie sans limites qu'il produit\ndonne une force incroyable à ceux\nqui entrent en contact avec elle.", "Jeder, dem Victini seine grenzenlose\nEnergie zuteilwerden lässt, strotzt\nnur so vor Kraft.", "Cuando Victini comparte su energía\nilimitada, esa persona o Pokémon\nirradia abundante poder.", "Può condividere l'energia infinita che\nemana, donando un potere immenso\na chi la riceve.", "When it shares the infinite energy\nit creates, that being's entire\nbody will be overflowing with power.") },
            { PBESpecies.Snivy, new PBELocalizedString("たいようの　ひかりを　あびると\nいつもよりも　すばやく　うごける。\nてよりも　ツルを　うまくつかう。", "태양의 빛을 받으면\n평소보다 빨리 움직일 수 있다.\n손보다 덩굴을 잘 사용한다.", "La lumière du soleil augmente fortement\nson agilité. Ses lianes sont plus habiles\nque ses mains.", "Im Sonnenlicht erhöht sich das Tempo\nseiner Bewegungen. Es ist mit seinen\nSchlingen geschickter als mit den Händen.", "Cuando recibe los rayos de sol, se mueve\nmucho más rápido que de costumbre. Usa\nmejor sus lianas que sus manos.", "Quando è esposto alla luce solare può\nmuoversi più velocemente. Usa le sue\nliane meglio dei suoi stessi arti.", "Being exposed to sunlight makes\nits movements swifter. It uses\nvines more adeptly than its hands.") },
            { PBESpecies.Servine, new PBELocalizedString("からだが　よごれると　はっぱで\nこうごうせいが　できなくなるので\nいつも　せいけつに　している。", "몸이 더러워지면 잎으로\n광합성을 할 수 없기 때문에\n항상 청결하게 하고 있다.", "La saleté l'empêchant d'utiliser la\nphotosynthèse, il prend grand soin\nd'être toujours propre.", "Es achtet stets auf Reinlichkeit,\nda es mit schmutzigen Blättern keine\nPhotosynthese betreiben kann.", "Cuando su cuerpo está sucio, no puede\nrealizar la fotosíntesis con sus hojas,\nasí que cuida mucho su higiene personal.", "Se si sporca, le sue foglie non possono\npiù effettuare la fotosintesi, perciò si\ntiene sempre molto pulito.", "When it gets dirty, its leaves\ncan't be used in photosynthesis,\nso it always keeps itself clean.") },
            { PBESpecies.Serperior, new PBELocalizedString("ジャローダの　けだかい　ひとみで\nいすくめられても　へいきな　つよい\nあいてにだけ　ほんきを　だす。", "샤로다의 고상한 눈동자로\n쏘아보아도 태연할 정도로 강한\n상대에게만 진정한 실력을 발휘한다.", "Il ne donnera tout son potentiel que\ncontre un ennemi puissant indifférent\nà son regard écrasant de noblesse.", "Im Kampf zeigt es nur Gegnern,\ndie seinem edlen Blick standhalten,\nseine wahre Kraft.", "Tan solo muestra su verdadero poder a\nquienes no se amedrentan ante su noble\npero inquisitoria mirada.", "Dà il meglio di sé solo contro chi non\nresta intimidito dal suo nobile sguardo.", "It only gives its all against strong\nopponents who are not fazed by the\nglare from Serperior's noble eyes.") },
            { PBESpecies.Tepig, new PBELocalizedString("やいた　きのみを　たべるのが\nだいすきだが　こうふんしすぎて\nときどき　まっくろこげに　しちゃう。", "구운 나무열매를 먹는 것을\n매우 좋아하지만 너무 흥분해서\n가끔 새까맣게 태워버린다.", "Il adore se goinfrer de Baies grillées,\nmais il lui arrive de les réduire en\ncendres dans son excitation.", "Floink liebt es, selbst geröstete Nüsse\nzu verspeisen. Ab und zu verkohlt es sie\njedoch ungewollt vor lauter Vorfreude.", "Le encanta comer bayas tostadas,\npero a veces se emociona demasiado\ny termina churruscándolas.", "Adora mangiare le bacche arrostite,\nma a volte si fa prendere la mano per\nl'eccitazione e le riduce in cenere.", "It loves to eat roasted berries,\nbut sometimes it gets too excited\nand burns them to a crisp.") },
            { PBESpecies.Pignite, new PBELocalizedString("たべるほどに　もやすものが　ふえて\nいぶくろないの　ほのおが　つよまり\nパワーも　どんどん　あふれだすのだ。", "먹을수록 태울 것이 많아져\n위 속의 불꽃이 강해지고\n파워도 점점 넘치게 된다.", "Plus il a mangé de Baies, plus il a de\ncombustible, et il peut donc dégager\ndavantage de flammes et de puissance.", "Je mehr es frisst, desto stärker werden\ndie Flammen in seinem Magen. Dies führt\nzu rapiden Energieschüben.", "Cuanto más come, más combustible tiene\nen su interior para avivar sus llamas,\ncon lo que también aumenta su poder.", "Più mangia e più le fiamme che bruciano\nnel suo stomaco si rinvigoriscono,\naumentando così il suo potere.", "The more it eats, the more fuel it has\nto make the fire in its stomach stronger.\nThis fills it with even more power.") },
            { PBESpecies.Emboar, new PBELocalizedString("ヒゲの　ほのおが　もえあがるのは\nきあいが　はいった　あかし。\nかずおおくの　わざを　つかいこなす。", "턱수염의 불꽃이 불타오르는 것은\n기합이 들어간 증거.\n수많은 기술을 능숙하게 다룬다.", "Sa barbe se ravive quand il libère sa\nfougue. Il maîtrise de nombreuses\ntechniques de combat.", "Lodert sein Backenbart auf, bedeutet\ndies, dass es in Kampflaune ist. Es\nbeherrscht viele verschiedene Attacken.", "El hecho de que su barba prenda en\nllamas es indicio de que tiene ganas de\nluchar. Domina numerosos movimientos.", "Le fiamme della sua barba ardono più\nintensamente quando fa sul serio. Può\nimparare un vasto numero di mosse.", "A flaring beard of fire is proof\nthat it is fired up. It is adept at\nusing many different moves.") },
            { PBESpecies.Oshawott, new PBELocalizedString("おなかに　できる　ホタチは\nたたかうとき　だけでなく　かたい\nきのみを　わるときにも　つかう。", "배에 생기는 가리비칼은\n싸울 때뿐 아니라 딱딱한\n나무열매를 쪼갤 때도 사용한다.", "Le coupillage sur son ventre lui sert\nnon seulement à combattre, mais aussi\nà trancher les Baies très dures.", "Die Muschel an seinem Bauch dient ihm\nnicht nur als Waffe, sondern auch als\nMesser, mit dem es Beeren aufschneidet.", "La vieira de su ombligo no solo sirve\ncomo arma, sino también como instrumento\npara cortar las bayas que estén duras.", "Non usa la conchiglia del suo ventre solo\ndurante la lotta, ma anche per tagliare\na metà le bacche.", "The scalchop on its stomach isn't\njust used for battle--it can be used\nto break open hard berries as well.") },
            { PBESpecies.Dewott, new PBELocalizedString("きびしい　しゅぎょうの　すえ\nフタチマルごとに　ことなる　かたの\nホタチさばきを　しゅうとく　する。", "혹독한 수행 끝에\n쌍검자비마다 다른 형태의\n가리비칼 다루는 기술을 습득한다.", "Chaque Mateloutre a sa propre technique\nd'escrime au coupillage, acquise grâce à\nun entraînement drastique.", "Jedes Zwottronin eignet sich über\nstrenges Training einen völlig eigenen\nMuschelkampfstil an.", "Tras un exhaustivo entrenamiento,\nDewott puede dominar diversas\ntécnicas para usar con sus vieiras.", "Le loro conchiglie sono tutte diverse\nnella forma e ogni Dewott si allena\nduramente per imparare ad usarle.", "As a result of strict training,\neach Dewott learns different\nforms for using the scalchops.") },
            { PBESpecies.Samurott, new PBELocalizedString("てきが　まばたきする　あいだに\nまえあしに　ついた　アシガタナで\nあいてを　きりつけ　もとにもどせる。", "상대가 눈을 깜빡이는 동안에\n앞다리에 붙어 있는 각검으로\n상대를 베고 원래대로 되돌린다.", "Il dissimule de grandes lames qu'il\ndégaine en un éclair des fourreaux\nde ses pattes antérieures.", "Ehe man sichs versieht, hat es schon das\nLangschwert aus seinen Vorderbeinen\ngezogen und seinen Gegner besiegt.", "En un abrir y cerrar de ojos, puede\ndesenvainar y envainar los sables\nque hay en sus patas delanteras.", "Riesce ad estrarre le sue spade, colpire\nil nemico e riporle al loro posto nelle\nzampe anteriori in un batter d'occhio.", "In the time it takes a foe to blink,\nit can draw and sheathe the seamitars\nattached to its front legs.") },
            { PBESpecies.Patrat, new PBELocalizedString("けいかいしんが　つよく　かならず\nいっぴきは　みはりを　しているのだが\nうしろからの　てきには　きづかない。", "경계심이 강해서 반드시\n한 마리는 망을 보고 있으나\n뒤에서 오는 상대는 알아차리지 못한다.", "Très prudent, il surveille attentivement\nson territoire, mais oublie souvent de\nregarder derrière lui.", "Eines dieser vorsichtigen Pokémon steht\nimmer vor ihrem Bau Wache. Nähert sich\njedoch ein Feind von hinten, ist es aus.", "Aunque es un Pokémon muy precavido y\nsiempre hay uno montando guardia, si se\nacercan por detrás, no se dará cuenta.", "Sono molto guardinghi, e almeno uno del\nbranco è sempre di guardia. Non vedono\nperò il nemico se li attacca da dietro.", "Extremely cautious, one of them\nwill always be on the lookout, but it\nwon't notice a foe coming from behind.") },
            { PBESpecies.Watchog, new PBELocalizedString("たいないの　はっこうぶっしつで\nめだまや　からだを　ひからせ\nおそってきた　てきを　ひるませる。", "체내의 발광물질로\n눈이나 몸을 빛나게 하여\n습격해 온 상대를 풀이 죽게 만든다.", "Il intimide l'ennemi en faisant briller\nson pelage et ses yeux grâce à une\nsubstance à l'intérieur de son corps.", "Es kann mit einer körpereigenen Substanz\nseine Augen und seinen Torso aufleuchten\nlassen, um Gegner zu erschrecken.", "Los componentes luminiscentes de su\ninterior hacen que sus ojos y su cuerpo\nbrillen, y así intimida a sus rivales.", "Fa tentennare il nemico facendo brillare\nocchi e pelliccia grazie a una sostanza\nfluorescente contenuta nel suo corpo.", "Using luminescent matter, it\nmakes its eyes and body glow\nand stuns attacking opponents.") },
            { PBESpecies.Lillipup, new PBELocalizedString("ゆうもうな　ポケモンだが　あいての\nつよさを　たしかめて　たたかいを\nさける　かしこさも　あわせもつ。", "용맹한 포켓몬이지만 상대의\n강함을 확인하고 싸움을\n피하는 영리함도 함께 갖추고 있다.", "Bien que vaillant, il a aussi l'intelligence\nd'analyser toutes les situations et de\nfuir quand il anticipe une défaite.", "Ein tapferes Pokémon, das jedoch klug\ngenug ist, seinen Gegner zu mustern,\nbevor es sich auf einen Kampf einlässt.", "Aunque se trata de un Pokémon valeroso,\ntambién es lo bastante inteligente como\npara escapar si el rival es muy fuerte.", "È un Pokémon molto intrepido, ma ha\nl'intelligenza di valutare la forza del\nnemico prima di decidere se lottare o no.", "Though it is a very brave Pokémon,\nit's also smart enough to check its\nfoe's strength and avoid battle.") },
            { PBESpecies.Herdier, new PBELocalizedString("トレーナーを　たすけながら\nほかの　ポケモンの　せわもする\nとても　ちゅうじつな　ポケモン。", "트레이너를 도와주면서\n다른 포켓몬을 돌보기도 하는\n매우 충실한 포켓몬.", "Un Pokémon très loyal qui aide aussi\nbien les Dresseurs que les autres\nPokémon qu'il rencontre.", "Dieses äußerst treue Pokémon geht\nnicht nur seinem Trainer zur Hand,\nsondern hilft auch anderen Pokémon.", "Este Pokémon es muy leal.\nNo solo ayuda a Entrenadores, sino que\ntambién se preocupa por otros Pokémon.", "È un Pokémon molto leale, che aiuta il suo\nAllenatore e al contempo si prende cura\ndegli altri Pokémon della squadra.", "This very loyal Pokémon\nhelps Trainers, and it also\ntakes care of other Pokémon.") },
            { PBESpecies.Stoutland, new PBELocalizedString("ながい　たいもうに　つつまれると\nふゆやまでも　ひとばん　へいきなほど\nあたたかく　とても　ここちよい。", "긴 털에 둘러싸이면 겨울 산에서\n하룻밤을 보내도 괜찮을 정도로\n따뜻하고 매우 기분이 좋다.", "Sa soyeuse fourrure à poils longs est\nassez chaude pour supporter de longues\nnuits d'hiver en montagne.", "Sein langes Fell ist sehr bequem und kann\neinen Menschen eine ganze Nacht lang auf\neinem schneebedeckten Berg warmhalten.", "Un humano podría pasar una noche gélida\nen las montañas sin pasar frío si se\ntapara con su largo y tupido pelaje.", "Avvolti nel suo caldo manto si può\ndormire all'addiaccio su una montagna\nin inverno senza correre alcun pericolo.", "Being wrapped in its long fur is so\ncomfortable that a person would be fine\neven overnight on a wintry mountain.") },
            { PBESpecies.Purrloin, new PBELocalizedString("かわいらしい　しぐさで　ゆだんさせ\nだいじな　ものを　ぬすむのは　ひとの\nこまった　ようすを　みたいから。", "귀여운 행동으로 방심하게 한 후\n소중한 물건을 훔치는 것은 사람의\n곤란해하는 모습을 보고 싶어서다.", "Il détourne l'attention de ses victimes\navec ses gestes mignons pour mieux les\ndétrousser et savourer leur désarroi.", "Lenkt Leute mit seinem süßen Verhalten\nab und stiehlt ihnen ihr Hab und Gut,\nnur um ihren verdutzten Blick zu sehen.", "Su aspecto tierno es una farsa.\nLo aprovechan para robar a los humanos\ny contemplar qué cara ponen.", "Distrae le persone con pose ammalianti\nper rubare loro oggetti cari e osservare\npoi come reagiscono.", "Their cute act is a ruse. They trick\npeople and steal their valuables\njust to see the looks on their faces.") },
            { PBESpecies.Liepard, new PBELocalizedString("うつくしい　スタイルは　ぜんしんの\nはったつした　きんにくの　おかげ。\nおともたてずに　よるを　かけぬける。", "아름다운 스타일은 전신의\n발달한 근육 덕분이다.\n소리도 내지 않고 밤을 달린다.", "Sa ligne élégante cache une musculature\nféline qui lui permet de surprendre lors\nde ses attaques nocturnes.", "Sein anmutiges Auftreten verdankt es\nden Muskeln, die es entwickelt hat.\nEs prescht lautlos durch die Nacht.", "Su bella y grácil silueta le viene dada\npor su desarrollada musculatura, que le\npermite andar de noche sin hacer ruido.", "I muscoli tonici del suo corpo gli donano\nuna figura davvero affascinante.\nSi aggira silenzioso nel buio della notte.", "Their beautiful form comes from\nthe muscles they have developed.\nThey run silently in the night.") },
            { PBESpecies.Pansage, new PBELocalizedString("きのみを　さがすのが　じょうずで\nあちこちで　あつめて　なかまに　\nわけあたえる　やさしさを　もつ。", "나무열매를 잘 찾아\n여기저기에서 모아 동료에게\n나누어 주는 상냥함을 가졌다.", "Il est très doué pour trouver des Baies\net aime les partager avec ses amis sans\nrien demander en échange.", "Ein nettes Kerlchen, das so talentiert\ndarin ist, Beeren aufzuspüren, dass es\nsie mit all seinen Kameraden teilt.", "Es todo un experto en la búsqueda de\nbayas y es tan gentil que las comparte\ncon todos sus compañeros.", "È un Pokémon molto generoso. Abilissimo\nnello scovare le bacche, va in giro a\nraccoglierle per poi condividerle.", "It's good at finding berries and gathers\nthem from all over. It's kind enough\nto share them with friends.") },
            { PBESpecies.Simisage, new PBELocalizedString("トゲのついた　しっぽを　ふりまわし\nたたきつけて　あいてを　こうげき。\nあたまの　はっぱは　とても　にがい。", "가시가 박힌 꼬리를 휘둘러\n힘껏 쳐서 상대를 공격한다.\n머리의 잎은 아주 쓰다.", "Il frappe ses ennemis avec sa queue\ncouverte d'épines. La feuille sur sa\ntête est très amère.", "Im Kampf schwingt es seinen dornigen\nSchweif umher. Die Kräuter, die auf\nseinem Kopf wachsen, sind sehr bitter.", "Agita su cola revestida de espinas\npara atacar a su enemigo. La hoja que\ncrece sobre su cabeza es muy amarga.", "Attacca il nemico colpendolo con la coda\nspinata. Le foglie che ha in testa sono\nestremamente amare.", "It strikes its enemies with\na thorn-covered tail.\nThe leaf on its head is bitter.") },
            { PBESpecies.Pansear, new PBELocalizedString("ちのうが　たかく　きのみは\nやいてから　たべる　しゅうせい。\nひとの　てつだいを　このんでいる。", "지능이 높고 나무열매는\n구운 뒤 먹는 습성이 있다.\n사람 도와주기를 좋아한다.", "Un Pokémon très intelligent qui adore\ncuire ses Baies avant de les manger.\nIl aime aussi aider les humains.", "Ein kultiviertes Pokémon, das Beeren vor\ndem Verzehr stets anbrät. Es bietet den\nMenschen gerne seine Hilfe an.", "Pokémon muy inteligente que tiene la\ncostumbre de tostar las bayas antes de\ncomérselas. Ayuda mucho a los humanos.", "È molto intelligente e ha l'abitudine di\narrostire le bacche prima di mangiarle.\nAdora aiutare gli esseri umani.", "Very intelligent, it roasts\nberries before eating them.\nIt likes to help people.") },
            { PBESpecies.Simisear, new PBELocalizedString("こうふんすると　あたまや　しっぽから\nひのこが　まいあがって　あつくなる。\nなぜか　あまいものが　だいこうぶつ。", "흥분하면 머리나 꼬리에서\n불티가 날아올라 뜨거워진다.\n왜인지 달콤한 것을 매우 좋아한다.", "Quand il est excité, des flammèches\nbrûlantes dansent sur sa tête et sa\nqueue. Il raffole des choses sucrées.", "Freut es sich, erhitzt sich sein Körper\nund aus seinem Kopf und Schweif\nsprühen Funken. Es liebt Süßigkeiten.", "Cuando se emociona, echa chispas por la\ncola y la cabeza, y calienta su cuerpo.\nPor alguna razón le encantan los dulces.", "Quando è concitato si scalda e iniziano a\nlevarsi scintille dalla testa e dalla coda.\nPer qualche motivo adora i dolci.", "When it gets excited, embers rise\nfrom its head and tail and it gets hot.\nFor some reason, it loves sweets.") },
            { PBESpecies.Panpour, new PBELocalizedString("あたまのふさに　ためこんだ　みずは\nえいよう　たっぷり。しっぽをつかって\nその　みずを　くさきに　かけている。", "머리 송아리에 모은 물은\n영양 듬뿍. 꼬리를 사용해서\n그 물을 초목에 뿌린다.", "Sa houppette est chargée d'eau et\nde nutriments. Il nourrit les plantes\net les arbres avec sa queue.", "Das Büschel auf seinem Kopf enthält eine\nsehr nahrhafte Flüssigkeit, mit der es\nüber seinen Schweif Pflanzen wässert.", "El agua acumulada en su mata de pelo\nes rica en nutrientes. Usa su cola para\nregar plantas con esa misma agua.", "L'acqua contenuta nel suo ciuffo è ricca\ndi nutrienti e la usa per annaffiare le\npiante con la coda.", "The water stored inside the tuft\non its head is full of nutrients.\nIt waters plants with it using its tail.") },
            { PBESpecies.Simipour, new PBELocalizedString("みずが　きれいな　ばしょを　このむ。\nあたまに　ためこんだ　みずがへると\nしっぽから　すいあげて　ほきゅう。", "물이 깨끗한 장소를 좋아한다.\n머리에 모아둔 물이 줄어들면\n꼬리에서 빨아올려 보급한다.", "Il aime les endroits où l'eau est pure.\nIl se ravitaille en eau en l'aspirant\navec sa queue.", "Hält sich bevorzugt in reinen Gewässern\nauf. Geht ihm das Wasser in seinem Kopf\naus, tankt es mit seinem Schweif nach.", "Le encantan los lugares con agua limpia.\nCuando desciende el nivel de agua de su\npelo, se abastece a través de su cola.", "Predilige i luoghi dove l'acqua è pura.\nSe l'acqua che ha sul capo diminuisce, ne\naggiunge altra aspirandola con la coda.", "It prefers places with clean water.\nWhen its tuft runs low, it replenishes\nit by siphoning up water with its tail.") },
            { PBESpecies.Munna, new PBELocalizedString("わるい　ゆめに　うなされている\nポケモンや　ひとの　まえに　あらわれ\nそのゆめを　たべてしまう　ポケモン。", "나쁜 꿈에 시달리고 있는\n포켓몬이나 사람 앞에 나타나\n그 꿈을 먹어버리는 포켓몬.", "Il apparaît aux humains et aux Pokémon\nqui font des mauvais rêves et mange\nleurs cauchemars pour les en libérer.", "Es erscheint vor schlafenden Menschen\nund Pokémon und frisst ihre Alpträume.", "Cuando un humano o un Pokémon sufre\nuna pesadilla, Munna se aparece ante\nellos y la engulle.", "Compare accanto a Pokémon e uomini\ntormentati dagli incubi per nutrirsi di\ntutti i loro brutti sogni.", "This Pokémon appears before people\nand Pokémon who are having nightmares\nand eats those dreams.") },
            { PBESpecies.Musharna, new PBELocalizedString("おでこから　でる　ゆめのけむりは\nたべた　ゆめの　ないようによって\nさまざまな　いろに　かわるのだ。", "이마에서 나오는 꿈연기는\n먹은 꿈의 내용에 따라\n여러 가지 색으로 변한다.", "La fumée qui sort de son front change\nde couleur selon le contenu des rêves\nqu'il a mangés.", "Je nach Inhalt der Träume, die es frisst,\nnimmt der Dunst, der aus seiner Stirn\naustritt, unterschiedliche Farben an.", "El color del humo que despide por su\nabultada frente varía según el contenido\nde los sueños que haya engullido.", "Il fumo che esce dalla sua fronte cambia\ncolore a seconda del contenuto del sogno\nche ha mangiato.", "The dream mist coming from its forehead\nchanges into many different colors\ndepending on the dream that was eaten.") },
            { PBESpecies.Pidove, new PBELocalizedString("とても　わすれっぽい　ポケモンで\nトレーナーに　めいれい　されたのに\nあたらしい　めいれいを　まっている。", "매우 건망증이 심한 포켓몬으로\n트레이너에게 명령을 받았어도\n새로운 명령을 기다리고 있다.", "Un Pokémon très distrait qui oublie les\nordres de son Dresseur et reste planté\nà en attendre de nouveaux.", "Wartet oft vergeblich auf Anweisungen,\nobwohl es bereits einen Befehl erhalten\nhat. Ein sehr zerstreutes Pokémon.", "Es un Pokémon muy despistado.\nAunque reciba órdenes de su Entrenador,\nse le olvidan, y se queda esperando.", "È un Pokémon un po' smemorato. A volte\ndimentica l'ordine appena ricevuto e\nallora aspetta di riceverne un altro.", "This very forgetful Pokémon will\nwait for a new order from its Trainer\neven though it already has one.") },
            { PBESpecies.Tranquill, new PBELocalizedString("せかいの　どこに　いても\nじぶんの　すの　ばしょは　わかるので\nトレーナーとも　はぐれたりしない。", "세계 어디에 있어도\n자신의 둥지가 있는 곳을 알 수 있어\n트레이너를 잃어버리지 않는다.", "Quel que soit le lieu où il se trouve,\nil arrive toujours à retrouver son\nDresseur comme son propre nid.", "Findet selbst von der anderen Seite des\nGlobus zu seinem Nest zurück. Nichts\nkann es von seinem Trainer trennen.", "Puede regresar sin problema alguno a\nsu nido desde cualquier lugar del globo\ny jamás se separa de quien lo entrena.", "Dovunque si trovi, è sempre in grado di\nritrovare il suo nido. Allo stesso modo,\nnon perde mai di vista il suo Allenatore.", "No matter where in the world it goes,\nit knows where its nest is, so it\nnever gets separated from its Trainer.") },
            { PBESpecies.Unfezant, new PBELocalizedString("あたまの　かざりを　ゆらして\nいかく　してくる　オスだが\nとぶのは　メスよりも　へただ。", "머리 장식을 흔들거리며\n위협하는 수컷이지만\n나는 것은 암컷보다 서툴다.", "Le mâle peut intimider ses ennemis\navec ses caroncules, mais la femelle\nvole mieux que lui.", "Männchen schrecken Gegner ab, indem sie\nihren Kopfschmuck schütteln. Weibchen\nverfügen über bessere Flugfertigkeiten.", "Los machos agitan el plumaje para\nintimidar, mientras que las hembras\nvuelan mejor.", "Il maschio sfrutta le piume che ha in\ntesta per minacciare i nemici, ma è meno\nabile della femmina nel volo.", "Males swing the plumage on\ntheir heads to threaten others,\nbut females are better at flying.") },
            { PBESpecies.Blitzle, new PBELocalizedString("ほうでんすると　たてがみが　ひかる。\nたてがみが　かがやく　かいすうや\nリズムで　なかまと　かいわしている。", "방전하면 갈기가 빛난다.\n갈기가 빛나는 횟수나\n리듬으로 동료와 대화한다.", "Sa crinière luit quand il lâche des\ndécharges. Il module leur rythme et leur\nnombre pour communiquer avec ses pairs.", "Um mit Artgenossen zu kommunizieren,\nnutzt es das Aufblitzen seiner Mähne\nbeim Entladen von Strom als Morsecode.", "Su crin brilla cuando emite una descarga\neléctrica. Se comunica con los suyos\nmediante el ritmo y el número de brillos.", "Se emette scariche la sua criniera brilla.\nComunica con i suoi simili tramite il ritmo\ne la frequenza delle pulsazioni luminose.", "Its mane shines when it discharges\nelectricity. They use the frequency and\nrhythm of these flashes to communicate.") },
            { PBESpecies.Zebstrika, new PBELocalizedString("はげしい　きしょうの　もちぬし。\nあらぶると　たてがみから　かみなりを\nしほうはっぽうに　ほうでんする。", "격렬한 기질의 소유자.\n날뛰면 갈기에서 번개를\n사방팔방으로 방전한다.", "De caractère violent, il envoie avec sa\ncrinière des arcs électriques de tous\nles côtés lorsqu'il se sent provoqué.", "Ein stürmischer Geselle. Wenn es wütend\nist, feuert es über seine Mähne in alle\nRichtungen Stromsalven ab.", "Es un Pokémon con mucho temperamento.\nCuando se enoja, lanza rayos desde\nsu crin en todas direcciones.", "Ha un temperamento sanguigno. Quando si\narrabbia dalla criniera lancia saette in\nogni direzione.", "When this ill-tempered Pokémon\nruns wild, it shoots lightning\nfrom its mane in all directions.") },
            { PBESpecies.Roggenrola, new PBELocalizedString("ろっかくけいの　あなは　みみ。\nおとの　なるほうに　あるいていく\nしゅうせいを　もっている。", "육각형의 구멍은 귀다.\n소리가 나는 쪽으로 걸어가는\n습성을 가지고 있다.", "La cavité hexagonale à la surface de\nson corps est en réalité une oreille.\nCe Pokémon est attiré par le bruit.", "Das sechseckige Loch dient ihm als Ohr.\nEs hat die Angewohnheit, sich immer auf\nGeräuschquellen zuzubewegen.", "El agujero hexagonal es su oído, y tiene\nel hábito de caminar en la dirección de\ndonde provienen los sonidos.", "La conca esagonale è il suo orecchio. Ha\nl'abitudine di camminare nella direzione\ndalla quale proviene il rumore.", "The hexagonal-shaped hole is its ear.\nIt has a tendency to walk in the\ndirection the sound is coming from.") },
            { PBESpecies.Boldore, new PBELocalizedString("げんきだと　コアが　とびだしてくる。\nからだの　むきを　かえることなく\nぜんごさゆうに　すばやく　うごける。", "기운이 넘치면 핵이 튀어나온다.\n몸의 방향을 바꾸지 않고\n전후좌우로 재빠르게 움직일 수 있다.", "Quand il est en forme, son noyau devient\nvisible. Il peut se déplacer dans toutes\nles directions sans se tourner.", "Ist es guter Dinge, kommt sein Kern zum\nVorschein. Kann blitzschnell die Richtung\nändern, ohne sich umdrehen zu müssen.", "Si se encuentra bien, deja entrever\nsu núcleo. Puede cambiar rápidamente\nla dirección en la que mira sin girarse.", "Se è in forma, il suo nucleo è visibile.\nSi sposta rapidamente nelle quattro\ndirezioni senza cambiare orientamento.", "When it is healthy, its core sticks out.\nAlways facing the same way, it swiftly\nmoves front to back and left to right.") },
            { PBESpecies.Gigalith, new PBELocalizedString("とりこんだ　たいようこうせんを\nエネルギーコアで　はんのう　させて\nひかりのたまとして　うちだしてくる。", "거두어들인 태양광선을\n에너지 코어로 반응시켜\n빛의 구슬로 쏘아낸다.", "Il amplifie dans son noyau l'énergie du\nsoleil absorbée par son corps et la\nprojette en une boule de lumière.", "Es verarbeitet Sonnenstrahlen in seinem\nEnergiekern zu Lichtkugeln weiter, um sie\nim Kampf auf seinen Gegner abzufeuern.", "Absorbe los rayos solares, procesa esa\nenergía en su núcleo y lanza poderosas\nbolas de luz a sus enemigos.", "Assorbe i raggi solari e, grazie al suo\nnucleo energetico, li trasforma in palle\ndi luce che poi spara.", "The solar rays it absorbs are\nprocessed in its energy core\nand fired as a ball of light.") },
            { PBESpecies.Woobat, new PBELocalizedString("コロモリの　はなを　くっつけた\nからだに　ハートがたの　あとがつくと\nいいことが　おこると　いわれている。", "또르박쥐의 코가 닿은\n몸에 하트 모양의 자국이 나면\n좋은 일이 일어난다고 전해진다.", "Son nez est comme une ventouse. Il\nlaisse une marque en forme de cœur\nqui, paraît-il, porte bonheur.", "Es verheißt Glück, wenn sich ein Fleknoil\nan einem Menschen festsaugt und auf ihm\neinen herzförmigen Fleck hinterlässt.", "Se dice que da buena suerte que un\nWoobat te deje una marca con forma\nde corazón.", "Quando preme il naso contro il corpo di\nqualcuno lascia un segno a forma di cuore\nche, dicono, porta fortuna.", "The heart-shaped mark left on a body\nafter a Woobat has been attached to it\nis said to bring good fortune.") },
            { PBESpecies.Swoobat, new PBELocalizedString("コンクリートも　こわせるほどの\nつよい　ちょうおんぱを　だすとき\nしっぽが　はげしく　ふるえる。", "콘크리트도 부술 정도로\n강한 초음파를 낼 때\n꼬리가 심하게 흔들린다.", "Sa queue s'agite frénétiquement quand\nil émet ses ultrasons assez puissants\npour pulvériser du béton.", "Beim Abfeuern seiner Ultraschallwellen,\nmit denen es selbst Beton zertrümmern\nkann, wedelt es eifrig mit dem Schweif.", "Cuando emite ondas ultrasónicas, que\nincluso pueden reventar el cemento,\nagita su cola con vehemencia.", "Quando emette delle onde ultrasoniche\ncosì forti da rompere il cemento, la coda\ngli oscilla con forza.", "It shakes its tail vigorously when it\nemits ultrasonic waves strong enough\nto reduce concrete to rubble.") },
            { PBESpecies.Drilbur, new PBELocalizedString("からだを　スピンさせることで\nじそく\xFF15\xFF10キロの　スピードのまま\nまっすぐ　じめんを　ほりすすむ。", "몸을 스핀시켜서\n시속 50km의 스피드를 유지하며\n똑바로 땅을 파서 나아간다.", "Il tourbillonne sur lui-même pour se\ndéplacer sous terre. Il peut atteindre\nles 50 km/h en ligne droite.", "Es gräbt sich mit 50 km/h schnurstracks\ndurch das Erdreich, indem es sich rapide\num die eigene Achse dreht.", "Puede girar su cuerpo a una velocidad\nde 50 km/h y, si la mantiene, puede\nperforar el suelo y atravesarlo.", "Quando gira su se stesso, scava la terra\nscendendo in verticale alla velocità di\n50 km/h.", "By spinning its body, it can dig\nstraight through the ground\nat a speed of 30 mph.") },
            { PBESpecies.Excadrill, new PBELocalizedString("はがねになった　ツメと　あたまで\nドリルを　つくり　どんなに\nぶあつい　てっぱんも　つらぬく。", "강철이 된 발톱과 머리로\n드릴을 만들어 어떠한\n두꺼운 철판도 꿰뚫는다.", "Il creuse des tunnels. Ses vrilles en\nacier peuvent transpercer des plaques\nde fer de n'importe quelle épaisseur.", "Es formt mit seinen zu Stahl verfeinerten\nExtremitäten einen Bohrer, der jede\nnoch so dicke Metallplatte kleinkriegt.", "Coloca sus garras y su cabeza de manera\nque se convierten en un taladro. Puede\nincluso taladrar una plancha de acero.", "Con la testa e gli artigli di acciaio\nforma una trivella in grado di perforare\nil metallo più spesso.", "Forming a drill with its steel claws\nand head, it can bore through a steel\nplate, no matter how thick it is.") },
            { PBESpecies.Audino, new PBELocalizedString("みみの　しょっかくで　あいての\nたいちょうや　タマゴから　ポケモンが\nいつ　でてくるのかも　わかるのだ。", "귀의 더듬이로 상대의\n컨디션이나 알에서 포켓몬이\n언제 나올지도 알 수 있다.", "Son ouïe est si développée qu'il arrive\nà juger de la santé des gens ou à savoir\nquand un Œuf va éclore.", "Über die Fühler an seinen Ohren kann es\nertasten, wie es einer Person geht oder\nwann ein Pokémon aus seinem Ei schlüpft.", "Con las antenas de sus oídos, perciben\nel estado de un rival o predicen cuándo\nva a eclosionar un Huevo Pokémon.", "Le sue orecchie sono antenne capaci di\nsondare lo stato di salute degli altri\no capire quando un uovo si schiuderà.", "Using the feelers on its ears,\nit can tell how someone is feeling\nor when an egg might hatch.") },
            { PBESpecies.Timburr, new PBELocalizedString("つねに　かくざいを　もちあるき\nどぼくこうじを　てつだう。そだつと\nおおきな　かくざいに　もちかえる。", "항상 각재를 들고 다니며\n토목공사를 도와준다. 자라면\n큰 각재로 바꿔 가진다.", "Il porte toujours une poutre en bois et\naime aider aux travaux. Il passe à un\nlourd madrier quand il grandit.", "Trägt stets einen Holzbalken bei sich und\nhilft auf Baustellen aus. Nach einer Weile\nsucht es sich einen größeren Balken.", "Siempre lleva una viga de madera y ayuda\nen las construcciones. Se busca una viga\nmás grande cuando se hace más fuerte.", "Porta con sé una tavola di legno e aiuta\nnei lavori edilizi. Quando cresce sceglie\noggetti più pesanti da trasportare.", "Always carrying squared logs,\nthey help out with construction.\nAs they grow, they carry bigger logs.") },
            { PBESpecies.Gurdurr, new PBELocalizedString("きたえあげた　きんにくの　もちぬし。\nてっこつを　たくみに　あやつって\nいっけんやを　かいたい　してくれる。", "단련된 근육의 소유자.\n철골을 능숙하게 조종하여\n집을 해체해준다.", "Ce Pokémon hyper musclé manipule avec\nhabileté les poutres métalliques et peut\ndémanteler un immeuble en un clin d'œil.", "Diese durchtrainierten Muskelprotze sind\nim Umgang mit Stahlträgern versiert und\nkönnen damit ganze Häuser abreißen.", "Gracias a su entrenada musculatura,\npuede blandir vigas de acero sin problema\npara así derribar edificios enteros.", "Ha un corpo pieno di muscoli e manovra\ncon abilità la sua trave d'acciaio, con\ncui può abbattere una casa intera.", "With strengthened bodies,\nthey skillfully wield steel beams\nto take down buildings.") },
            { PBESpecies.Conkeldurr, new PBELocalizedString("ちからに　たよらず　えんしんりょくを\nうまく　いかして　コンクリートを\nふりまわす　わざを　つかいこなせる。", "힘에 의지하지 않고 원심력을\n잘 활용하여 콘크리트를\n휘두르는 기술을 잘 다룬다.", "Il utilise l'effet centrifuge pour manier\nsans trop d'effort ses piliers de béton\net déclencher des attaques puissantes.", "Es setzt Attacken ein, die sich die\nZentrifugalkraft zunutze machen, indem\nes seine Betonpfeiler umherschwingt.", "En vez de hacer uso de la fuerza bruta,\nblande columnas de hormigón con la\nenergía centrífuga de sus movimientos.", "Non si affida solo ai muscoli, ma sfrutta\nla forza centrifuga per far roteare con\nmaestria i suoi pilastri di cemento.", "Rather than rely on force,\nthey master moves that utilize the\ncentrifugal force of spinning concrete.") },
            { PBESpecies.Tympole, new PBELocalizedString("ほほの　しんどうまくを　ふるわせ\nひとには　きこえない　おんぱを　だし\nなかまたちに　きけんを　つたえる。", "볼의 진동막을 떨게 하여\n사람에게는 들리지 않는 음파를 내어\n동료에게 위험을 전달한다.", "Il fait vibrer ses joues pour émettre\ndes sons inaudibles pour les humains et\nalerter ses semblables des dangers.", "Erzeugt mit seinen Wangen für Menschen\nunhörbare Schallwellen, um Artgenossen\nvor Gefahr zu warnen.", "Emite sonidos imperceptibles para los\nhumanos con la vibración de sus mejillas\ny advierte de algún peligro a los suyos.", "Fa vibrare le membrane sulle guance per\nemettere onde sonore, impercettibili agli\numani, con cui segnala un pericolo.", "By vibrating its cheeks, it emits\nsound waves imperceptible to humans\nand warns others of danger.") },
            { PBESpecies.Palpitoad, new PBELocalizedString("すいちゅうと　りくちで　くらす。\nながく　ねばねばする　ベロをつかって\nあいての　うごきを　ふうじこめる。", "수중과 육지에서 살며\n길고 끈적이는 혀를 사용하여\n상대의 움직임을 봉쇄한다.", "Il vit dans l'eau et sur la terre ferme.\nIl immobilise ses proies avec sa langue\nlongue et gluante.", "Es lebt zu Wasser und zu Lande.\nMit seiner langen, klebrigen Zunge raubt\nes Gegnern die Bewegungsfreiheit.", "Vive tanto en tierra como en el fondo\ndel mar. Con su larga y viscosa lengua,\ninmoviliza a sus contrincantes.", "Vive in acqua e sulla terraferma.\nImmobilizza la preda con la sua lunga\nlingua appiccicosa.", "It lives in the water and on land.\nIt uses its long, sticky tongue\nto immobilize its opponents.") },
            { PBESpecies.Seismitoad, new PBELocalizedString("コブに　ちからを　いれることで\nバイブレーションが　はっせいして\nパンチの　いりょくが　アップする。", "혹에 힘을 싣는 것으로\n바이브레이션이 발생하여\n펀치의 위력이 올라간다.", "Son coup de poing est plus fort quand\nil fait vibrer la pustule dessus.", "Konzentriert es all seine Energie auf\nseine Beulen, um sie vibrieren zu lassen,\nerhöht sich die Stärke seiner Hiebe.", "Reúne energía en sus bultos y crea\nvibraciones para propinar puñetazos\nmás poderosos.", "Usa le sue protuberanze per emettere\ndelle vibrazioni che aumentano la potenza\ndei suoi pugni.", "By putting power into its bumps,\nit creates vibrations and increases\nthe power of its punches.") },
            { PBESpecies.Throh, new PBELocalizedString("じぶんより　おおきな　あいてと\nであうと　むしょうに　なげたくなる。\nつよくなると　おびを　とりかえる。", "자신보다 큰 상대와 만나면\n이유 없이 내던지고 싶어 한다.\n강해지면 띠를 바꾼다.", "Ils aiment projeter ceux qui sont plus\ngrands qu'eux. Ils changent de ceinture\nquand ils progressent.", "Trifft es jemanden, der größer ist als\nes selbst, will es ihn unbedingt werfen.\nWird es stärker, wechselt es den Gürtel.", "Si se topa con un rival más fuerte, ansía\nlanzarlo por los aires. Al hacerse más\nfuerte, cambia su cinturón.", "Quando incontra un avversario più grande\ndi lui, lo assale l'istinto di lanciarlo via.\nCambia cintura quando diventa più forte.", "When it encounters a foe bigger than\nitself, it wants to throw it.\nIt changes belts as it gets stronger.") },
            { PBESpecies.Sawk, new PBELocalizedString("さいきょうの　からてチョップを\nもとめて　やまおくに　こもって\nねむることなく　しゅぎょうする。", "최강의 태권당수를\n목표로 산속에 틀어박혀\n잠도 없이 수행한다.", "Pour accéder à la maîtrise ultime du\nkaraté, il se retire dans les montagnes\net s'entraîne nuit et jour.", "Es lebt zurückgezogen in den Bergen\nund trainiert Tag und Nacht, um seinen\nKarateschlag zu perfektionieren.", "Para lograr dominar las técnicas de\nkárate más letales, se retiran a las\nmontañas y entrenan día y noche.", "Si allena senza posa, giorno e notte, sui\nmonti per potenziare al massimo i suoi\ncolpi di karate.", "Desiring the strongest karate chop,\nthey seclude themselves in\nmountains and train without sleeping.") },
            { PBESpecies.Sewaddle, new PBELocalizedString("はっぱから　ふくを　つくるので\nファッションデザイナーから\nマスコットとして　にんきがある。", "잎사귀로 옷을 만들기 때문에\n패션 디자이너에게\n마스코트로 인기가 있다.", "La mascotte des créateurs de mode.\nIl découpe ses vêtements dans les\nfeuilles qu'il trouve.", "Unter Modeschöpfern gilt es als\nbeliebtes Maskottchen, da es sich\naus Blättern Kleidchen schneidert.", "Sus hojas se usan como material para\nfabricar ropa, por lo que los diseñadores\nmás famosos los tienen como mascota.", "Taglia le foglie per farne vestiti. Per\nquesto motivo è la mascotte preferita di\nmolti stilisti.", "Since this Pokémon makes its own\nclothes out of leaves, it is a popular\nmascot for fashion designers.") },
            { PBESpecies.Swadloon, new PBELocalizedString("うすぐらく　じめじめした　ばしょを\nこのみ　じぶんの　まわりにある\nおちばを　たべて　いちにち　すごす。", "어두컴컴하고 눅눅한 장소를\n좋아하고 자신의 주변에 있는\n낙엽을 먹으며 하루를 보낸다.", "Il aime la fraîcheur et l'ombre des\nsous-bois. Il passe ses journées à\nmanger les feuilles tombées à terre.", "Es hält sich bevorzugt an finsteren,\nfeuchten Orten auf und knabbert den\nganzen Tag an zu Boden gefallenem Laub.", "Le gustan los lugares lóbregos y\nhúmedos. Se pasa todo el día comiendo\nlas hojas esparcidas por el suelo.", "Predilige i luoghi ombrosi e umidi. Passa\nle giornate mangiando le foglie cadute\ndagli alberi che trova attorno a sé.", "Preferring dark, damp places,\nit spends the entire day eating\nfallen leaves that lie around it.") },
            { PBESpecies.Leavanny, new PBELocalizedString("おさない　ポケモンを　みつけると\nくちから　だす　ねんちゃくいとで\nはっぱの　ふくを　ぬってあげる。", "어린 포켓몬을 보면\n입에서 내뿜는 점착실로\n잎사귀의 옷을 지어 준다.", "Il fabrique des vêtements de feuilles\npour les Pokémon encore jeunes grâce\nà son fil de soie adhésif.", "Begegnet es einem jungen Pokémon,\nnäht es ihm mit den klebrigen Fäden\naus seinem Mund ein Kleid aus Blättern.", "Si se encuentra con un Pokémon joven,\nsegrega por la boca hilos pegadizos\ncon los que le teje una prenda de ropa.", "Quando incontra un giovane Pokémon gli\nfa un vestito di foglie che cuce con il\nfilo appiccicoso prodotto dalla bocca.", "Upon finding a small Pokémon, it weaves\nclothing for it from leaves by using the\nsticky silk secreted from its mouth.") },
            { PBESpecies.Venipede, new PBELocalizedString("あたまと　しっぽの　しょっかくで\nくうきのゆれを　かんじとり　えものの\nいちや　ようすを　はあくしている。", "머리와 꼬리의 촉각으로\n공기의 흔들림을 감지해 먹이의\n위치나 모습을 파악하고 있다.", "Il sonde les alentours avec les\nantennes sur sa tête et sa queue\npour repérer ses proies.", "Analysiert mit den Fühlern an Kopf und\nSchweif Luftzüge, um seine Gegner\nzu orten und ihren Zustand zu erkennen.", "Percibe cambios en el aire mediante las\nantenas de su cola y de su cabeza, y así\ndescubre la ubicación y estado del rival.", "Individua la posizione e lo stato della\npreda percependo le vibrazioni dell'aria\ncon le antenne del capo e della coda.", "Using the feelers on its head and tail,\nit picks up vibrations in the air to\ndetermine its prey's location and state.") },
            { PBESpecies.Whirlipede, new PBELocalizedString("じっとして　しんかの　エネルギーを\nためているが　てきが　ちかづくと\nどくのトゲを　さすため　うごきだす。", "가만히 진화 에너지를\n모으고 있으나 상대가 가까이 오면\n독가시를 찌르기 위해 움직인다.", "Il reste le plus souvent immobile pour\npréparer son évolution, mais n'hésitera\npas à utiliser ses dards empoisonnés.", "Es spart sich seine Kraft für seine\nEntwicklung und bewegt sich nur, um sich\nmit seinen Giftspitzen zu verteidigen.", "Permanece quieto y acumula energía para\nsu evolución, pero, si un rival se acerca,\nse mueve y ataca con púas venenosas.", "Si muove poco in attesa dell'evoluzione,\nma se un nemico s'avvicina non esita a\ncolpirlo con le spine velenose.", "Storing energy for evolution, it sits.\nBut, when predators approach, it\nmoves to stab them with poison spikes.") },
            { PBESpecies.Scolipede, new PBELocalizedString("えものを　くびのツメで　はさみこみ\nみうごきを　とれなくしてから\nもうどくを　あたえ　とどめを　さす。", "먹이를 목의 가시에 끼워 넣어\n움직이지 못하게 한 후\n맹독을 퍼뜨려 마무리한다.", "Il paralyse l'ennemi avec les griffes\nde son cou avant de mettre fin au\ncombat grâce à son poison virulent.", "Lähmt seine Beute, indem es sie mit den\nZacken an seinem Hals aufspießt. Mit\neiner Ladung Gift gibt es ihr den Rest.", "Atenaza a sus presas con las garras que\nsobresalen de su cuello hasta que no se\npueden mover y las remata con veneno.", "Trafigge la preda con gli aculei del collo\ne dopo averla immobilizzata la finisce\ncon le sue tossine.", "It clasps its prey with the claws\non its neck until it stops moving.\nThen it finishes it off with deadly poison.") },
            { PBESpecies.Cottonee, new PBELocalizedString("しゅうだんで　いると　おちつくのか\nなかまを　みつけると　くっついて\nいつのまにか　くものように　なる。", "집단으로 있으면 편안한지\n동료를 발견하면 달라붙어\n어느새 구름처럼 된다.", "Pokémon à l'instinct grégaire, ils se\ncollent les uns aux autres et finissent\npar former un gros nuage.", "Sind sie mit Freunden unterwegs, hängen\nsie eng aufeinander wie Wolken, wohl weil\nsie sich in der Gruppe sicherer fühlen.", "Quizá por el hecho de que se relajan al\nestar con los suyos, forman un grupo al\nencontrar amigos y parecen nubes.", "Si sentono più sicuri in gruppo. Quando\nincontrano i loro simili, non li lasciano\ne insieme formano una grande nuvola.", "Perhaps because they feel more at ease\nin a group, they stick to others they\nfind. They end up looking like a cloud.") },
            { PBESpecies.Whimsicott, new PBELocalizedString("つむじかぜと　ともに　あらわれて\nいえのなかの　かぐを　うごかしたり\nわたを　のこす　いたずらをする。", "회오리바람과 함께 나타나\n집안의 가구를 움직이거나\n솜을 남기는 장난을 친다.", "Il apparaît dans un tourbillon de vent,\ns'introduit dans les maisons et y joue\nde mauvais tours.", "Sie erscheinen mit Orkanböen und spielen\nden Leuten Streiche, indem sie in Häusern\nMöbel verrücken oder Watte verstreuen.", "Aparecen en medio de un torbellino y\nentran en las casas para descolocar los\nmuebles o esparcir algodón por doquier.", "Appare con un vortice d'aria, facendo\npiccoli dispetti come spostare i mobili\nnelle case o lasciare cotone ovunque.", "They appear along with whirlwinds. They\npull pranks, such as moving furniture\nand leaving balls of cotton in homes.") },
            { PBESpecies.Petilil, new PBELocalizedString("ぬけおちても　すぐに　はえてくる\nあたまの　はっぱは　とても　にがいが\nかじれば　すぐ　げんきに　なれる。", "빠져도 바로 자라나는\n머리의 잎사귀는 아주 쓰지만\n갉아 먹으면 바로 기운이 난다.", "Les feuilles sur sa tête repoussent\ntrès vite. Elles sont très amères, mais\nrevigorent les corps les plus éreintés.", "Die Blätter auf seinem Kopf schmecken\näußerst bitter, wirken aber erfrischend.\nFallen sie aus, wachsen sie sofort nach.", "Las hojas de su cabeza vuelven a crecer\nrápidamente aunque se caigan. A pesar\nde ser amargas, restablecen la vitalidad.", "Se le foglie sul suo capo cadono,\nricrescono subito. Sono molto amare, ma\nse masticate rimettono subito in salute.", "The leaves on its head grow right back\neven if they fall out. These bitter\nleaves refresh those who eat them.") },
            { PBESpecies.Lilligant, new PBELocalizedString("あたまの　はなかざりから　はっする\nかおりを　かぐと　リラックスできるが\nていれが　とても　むずかしい。", "머리의 꽃 장식에서 나는\n향기를 맡으면 편안해지나\n손질이 아주 까다롭다.", "La fleur sur sa tête émet un parfum qui\napaise instantanément, mais elle requiert\nun entretien extrêmement délicat.", "Der Duft, den der Blumenschmuck auf\nseinem Kopf absondert, wirkt beruhigend,\naber es ist nicht gerade pflegeleicht.", "El aroma que despide la flor de su tocado\ntiene efectos tranquilizantes, pero este\nPokémon requiere muchos cuidados.", "I fiori che ha sulla testa emettono un\nprofumo davvero rilassante, ma è molto\ndifficile prendersene cura.", "The fragrance of the garland on its head\nhas a relaxing effect, but taking\ncare of it is very difficult.") },
            { PBESpecies.Basculin_Blue, new PBELocalizedString("とても　らんぼうで　いつも　あかと\nあおの　バスラオは　あらそっている。\nたべると　いがいと　おいしいらしい。", "아주 난폭하고 항상 빨강과\n파랑의 배쓰나이는 다투고 있다.\n먹으면 의외로 맛있다고 한다.", "Les rouges et les bleus se détestent\net se battent dès qu'ils s'aperçoivent.\nUn Pokémon violent mais délicieux.", "Sie gelten als Delikatesse. Aufgrund\nihrer brutalen Natur liegen rot und blau\ngestreifte Exemplare immer im Clinch.", "Los de color azul y los de color rojo\nsiempre se pelean. Son muy violentos,\npero su sabor es excepcional.", "I Basculin con la linea rossa e quelli con\nla linea blu sono molto violenti e litigano\nspesso.", "Red- and blue-striped Basculin are\nvery violent and always fighting.\nThey are also remarkably tasty.") },
            { PBESpecies.Sandile, new PBELocalizedString("たいおんを　さげないように\nさばくの　あつい　すなに　もぐり\nかくれながら　せいかつ　している。", "체온이 내려가지 않게\n사막의 뜨거운 모래에 들어가\n숨어 생활하고 있다.", "Il vit dans le sable des déserts.\nLe sable chauffé par le soleil le\nréchauffe et le cache à la fois.", "Es vergräbt sich im heißen Wüstensand,\num nicht auszukühlen, und fristet sein\nLeben im Verborgenen.", "Viven en los desiertos y se sumergen\nen las cálidas arenas para que su\ntemperatura corporal no se reduzca.", "Vive nascosto tra le calde sabbie del\ndeserto per evitare che la temperatura\ndel suo corpo diminuisca.", "They live hidden under hot desert\nsands in order to keep their body\ntemperature from dropping.") },
            { PBESpecies.Krokorok, new PBELocalizedString("うすい　まくで　おおわれている\nりょうめは　まよなかでも　みえる。\nすうひきの　むれで　くらしている。", "얇은 막으로 덮여 있는\n두 눈은 한밤중이라도 보인다.\n몇 마리의 무리로 생활한다.", "La membrane spéciale qui recouvre leurs\nyeux leur permet de voir dans le noir.\nIls se déplacent en petites bandes.", "Ihre Augen sind von einer dünnen Membran\numgeben und können auch nachts sehen.\nSie bilden kleine Rudel.", "Gracias a la película que recubre sus\nojos, pueden ver incluso de noche.\nViven en pequeñas manadas.", "I suoi occhi, coperti da una sottilissima\nmembrana, vedono anche di notte. Vive\ncon i suoi simili in piccoli branchi.", "Protected by thin membranes, their eyes\ncan see even in the dead of night.\nThey live in groups of a few individuals.") },
            { PBESpecies.Krookodile, new PBELocalizedString("とても　きょうぼうな　ポケモン。\nめのまえで　うごくものは　すべて\nおそいかかり　かみくだこうとする。", "아주 난폭한 포켓몬.\n눈앞에서 움직이는 것은 모두\n덮쳐서 깨물어 부수려고 한다.", "Un Pokémon extrêmement violent qui\nbroie tout ce qui lui passe sous les\nyeux avec ses mâchoires.", "Ein äußerst grausames Pokémon. Es greift\njeden, der ihm unter die Augen kommt, mit\nseinen scharfen Reißzähnen an.", "Un Pokémon bastante violento.\nAtaca todo lo que se mueva delante\nde él con sus mortíferas mandíbulas.", "È un Pokémon molto feroce. Attacca\ntutto ciò che gli si para davanti,\nprendendolo a morsi.", "Very violent Pokémon, they try\nto clamp down on anything that\nmoves in front of their eyes.") },
            { PBESpecies.Darumaka, new PBELocalizedString("ねるときは　てあしを　ひっこめ\nたいないで　もえている　\xFF16\xFF10\xFF10どの\nほのおも　ちいさくなり　おちつくよ。", "잠잘 때는 손발을 움츠리고\n체내에 타고 있는 600도의\n불꽃도 작아져서 차분해진다.", "Quand il dort, ses pattes se rétractent\net les flammes qui brûlent à 600 °C dans\nson corps s'apaisent.", "Zum Schlafen zieht es Arme und Beine ein\nund senkt seine innere Körpertemperatur\nauf 600 Grad, um sich zu entspannen.", "Cuando se dispone a dormir, retrae sus\npiernas y sus brazos, y reduce la llama\nde su interior a 600° para relajarse.", "Quando dorme ritrae gli arti. Anche\nil fuoco che gli brucia dentro a 600°C\nsi affievolisce.", "When it sleeps, it pulls its limbs\ninto its body and its internal fire\ngoes down to 1,100° F.") },
            { PBESpecies.Darmanitan, new PBELocalizedString("はげしい　たたかいで　きずつくと\nいわのように　かたまり　もっこうして\nこころを　とぎすませるのだ。", "격렬한 싸움으로 상처입으면\n바위처럼 굳어져 묵상하며\n마음을 연마한다.", "S'il est blessé dans un combat, il se fige\ncomme un rocher, fait le vide dans son\nesprit et aiguise ses sens.", "Nimmt es in einem heißen Kampf Schaden,\nwird es hart wie Stein und fällt in eine\nTrance, um seinen Verstand zu schärfen.", "Cuando resulta gravemente herido,\nse endurece como una piedra y\nmedita para agudizar la mente.", "Se resta ferito durante una battaglia\nviolenta, diventa duro come la pietra e\nmedita per purificare la mente.", "When one is injured in a fierce battle,\nit hardens into a stone-like form.\nThen it meditates and sharpens its mind.") },
            { PBESpecies.Maractus, new PBELocalizedString("リズミカルに　からだを　ゆすると\nマラカスに　にた　おとが　なりひびき\nおどろいた　ポケモンは　にげだす。", "리드미컬하게 몸을 흔들면\n마라카스와 비슷한 소리가 울려 퍼져\n놀란 포켓몬은 도망을 간다.", "Quand il bouge son corps en rythme,\nil fait un bruit de maracas qui fait\nfuir ses ennemis.", "Erzeugt durch rhythmische Bewegungen\nTöne, die dem Klang von Maracas ähneln\nund überraschte Pokémon verjagen.", "Mueven su cuerpo de manera rítmica y\nemiten un sonido como el de las maracas.\nLos Pokémon que se sorprenden huyen.", "Se muove il corpo a tempo produce un\nsuono di maracas che sorprende gli altri\nPokémon, mettendoli in fuga.", "When it moves rhythmically,\nit makes a sound similar to maracas,\nmaking the surprised Pokémon flee.") },
            { PBESpecies.Dwebble, new PBELocalizedString("てごろな　サイズの　いしが　あると\nくちから　えきたいを　ぶんぴつして\nなかに　はいるための　あなをあける。", "적당한 사이즈의 돌이 있으면\n입에서 액체를 분비해서\n안에 들어가기 위한 구멍을 판다.", "Lorsqu'il trouve un caillou à sa taille, il\ny creuse un trou avec le fluide qui sort\nde sa bouche et s'en sert comme maison.", "Sobald es einen angemessen großen Stein\nfindet, höhlt es ihn mit einem ätzenden\nSekret aus und kriecht hinein.", "Si encuentran una piedra de tamaño ideal,\nsegregan un líquido por la boca para\ncrear un agujero y deslizarse dentro.", "Quando trova una pietra della sua misura\ncrea un buco con il liquido che secerne\ndalla bocca e ci si infila dentro.", "When it finds a stone of a suitable\nsize, it secretes a liquid from its\nmouth to open up a hole to crawl into.") },
            { PBESpecies.Crustle, new PBELocalizedString("テリトリー　あらそいの　ときに\nせおっている　いわを　こわされると\nふあんを　かんじて　よわっていく。", "영역 다툼을 할 때\n짊어진 바위가 부숴지면\n불안을 느껴 약해진다.", "Si le rocher sur son dos est brisé\nlors d'un combat territorial, il se\nsent menacé et dépérit.", "Wird bei Revierkämpfen der Stein auf\nseinem Rücken zerschlagen, fühlt es sich\nverwundbar und wird langsam schwächer.", "Si la roca que lleva sobre sus espaldas\nse quiebra en un combate territorial,\nse siente inseguro y se hace más débil.", "Se durante una lotta per il territorio\nla sua roccia viene distrutta, si fa\nprendere dall'ansia e diventa più debole.", "When its boulder is broken\nin battles for territory, it feels\nunsure and begins to weaken.") },
            { PBESpecies.Scraggy, new PBELocalizedString("がんじょうな　ずがいこつが　じまん。\nいきなり　ずつきを　かましてくるが\nおもさで　じぶんも　フラフラしてる。", "튼튼한 두개골이 자랑이다.\n느닷없이 박치기를 하려고 하지만\n무게로 자신도 휘청거린다.", "Ses coups de tête sont sa fierté.\nSeul problème: sa tête est un peu trop\nlourde, et il perd souvent l'équilibre.", "Verteilt gerne unvermittelt Kopfnüsse,\nderen Wucht auch seine Sinne vernebelt.\nEs ist stolz auf seinen robusten Schädel.", "Está orgulloso de su sólido cráneo.\nReparte cabezazos a diestro y siniestro\ncon tal vehemencia que él mismo se marea.", "Va fiero del suo robustissimo cranio.\nTira senza preavviso testate così forti\nda farlo barcollare.", "Proud of its sturdy skull,\nit suddenly headbutts everything,\nbut its weight makes it unstable, too.") },
            { PBESpecies.Scrafty, new PBELocalizedString("だっぴした　かわを　ずりあげて\nダメージを　へらしつつ　キック\xFF01\nとさかが　おおきいほど　えらそうだ。", "탈피한 가죽을 끌어 올려\n데미지를 줄이면서 킥!\n볏이 클수록 거만하다.", "Son baggy de peau le protège quand il\ndonne des coups de pied. Les meneurs\nsont ceux qui ont la plus grande crête.", "Es wehrt Angriffe mit seiner alten Haut\nab und kontert mit Tritten. Sein Ego\nentspricht der Größe seines Kamms.", "Se protege de los ataques con la muda de\nsu piel mientras reparte patadas. Cuanto\nmayor es su cresta, más se le respeta.", "Quando tira calci, si protegge dai danni\ncon la pelle della muta. Più grande è la\ncresta e più arie si dà.", "It pulls up its shed skin to protect\nitself while it kicks. The bigger the\ncrest, the more respected it is.") },
            { PBESpecies.Sigilyph, new PBELocalizedString("こだいとしの　まもりがみ。\nいつも　おなじルートを　じゅんかいし\nしんにゅうしゃを　みはっていた。", "고대 도시의 수호신.\n항상 같은 루트를 순회하며\n침입자를 감시하고 있었다.", "Dieu protecteur d'une ville antique, il\nsuivait toujours le même itinéraire afin\nde prévenir tout risque d'invasion.", "Vor langer Zeit war es der Wächter einer\nStadt. Es fliegt auf der Suche nach\nEindringlingen immer dieselbe Route ab.", "Deidad protectora de una antigua ciudad.\nSiempre merodea por la misma ruta y\npermanece alerta en busca de intrusos.", "Era lo spirito custode di un'antica città.\nPercorreva sempre lo stesso percorso\nper assicurarsi non ci fossero intrusi.", "The guardians of an ancient city, they\nalways fly the same route while\nkeeping watch for invaders.") },
            { PBESpecies.Yamask, new PBELocalizedString("おはかに　まいそうされた　ひとの\nたましいが　ポケモンに　へんかした。\nしぬまえの　きおくが　のこっている。", "무덤에 매장된 사람의\n영혼이 포켓몬으로 변했다.\n죽기 전 기억이 남아 있다.", "Il est né de l'âme d'un défunt inhumé\ndans une tombe antique. Il a conservé\nses anciens souvenirs.", "Es entsteht aus den Seelen von längst\nbegrabenen Menschen und kann sich immer\nnoch an deren Vergangenheit erinnern.", "Almas de humanos sepultados en tumbas\nque han adquirido forma de Pokémon.\nRecuerdan su vida antes de la muerte.", "Erano un tempo spettri che riposavano\nin antiche tombe. Conservano la memoria\ndella loro vita mortale.", "These Pokémon arose from the spirits of\npeople interred in graves. Each retains\nmemories of its former life.") },
            { PBESpecies.Cofagrigus, new PBELocalizedString("ほんものの　かんおけと　まちがえ\nちかよってきた　はかドロボウを\nからだの　なかに　とじこめてしまう。", "진짜 관과 착각해서\n다가온 도굴꾼을\n몸속에 가둬버린다.", "Il prend l'apparence d'un beau cercueil.\nLes pilleurs de tombes imprudents\nfinissent enfermés à l'intérieur.", "Grabräuber, die es mit einem echten Sarg\nverwechseln und ihm zu nahe kommen, hält\nes im Inneren seines Körpers gefangen.", "Atrapan en su interior a los ladrones\nde tumbas que los confunden con\nataúdes de verdad.", "Imprigiona nel suo corpo i razziatori\ndi tombe che gli vanno vicino pensando\nche si tratti di un sarcofago vero.", "Grave robbers who mistake them\nfor real coffins and get too close\nend up trapped inside their bodies.") },
            { PBESpecies.Tirtouga, new PBELocalizedString("かせきから　ふっかつした　ポケモン。\nたっしゃに　およいで　ふかさ\n\xFF11\xFF10\xFF10\xFF10メートルまで　もぐっていた。", "화석에서 부활한 포켓몬.\n능숙하게 헤엄쳐 깊이\n1000m까지 잠수했었다.", "Un Pokémon recréé à partir d'un fossile.\nC'est un excellent nageur qui peut\nplonger jusqu'à 1 000 m de profondeur.", "Es wurde aus einem urzeitlichen Fossil\nreanimiert. Einst schwamm es geschickt\ndurch Untiefen von bis zu 1 000 Metern.", "Pokémon renacido a partir de un fósil.\nEs muy hábil nadando y puede sumergirse\na una profundidad de 1000 m.", "È stato rigenerato da un fossile.\nNuotatore provetto, si immergeva\na una profondità di ben 1000 metri.", "This Pokémon was restored from a fossil.\nIt swam skillfully and dove\nto depths beyond half a mile.") },
            { PBESpecies.Carracosta, new PBELocalizedString("はったつした　まえあしで　あいてを\nひっぱたき　きぜつさせると　カラや\nホネまで　まるごと　かみくだいた。", "발달한 앞다리로 상대를\n세게 쳐서 기절시켜 껍데기나\n뼈까지 통째로 깨물어 부쉈다.", "Ses bras puissants serrent ses proies\njusqu'à l'évanouissement. Il les dévore\nensuite, carapace et os compris.", "Ein Schlag mit seinen ausgeprägten\nVorderflossen brachte Gegner zu Fall\nund brach ihre Knochen oder Schale.", "Un golpe con sus desarrolladas aletas\ndelanteras puede hacer perder a un rival\nel conocimiento o romperle los huesos.", "Un singolo colpo dei suoi arti anteriori\npuò bastare a far perdere i sensi alla\npreda e romperne ossa e corazza.", "It could knock out a foe with a slap from\none of its developed front appendages\nand chew it up, shell or bones and all.") },
            { PBESpecies.Archen, new PBELocalizedString("こだいの　かせきから　ふっかつした。\nきのうえで　くらしているが　とべず\nえだから　えだを　とびうつっていた。", "고대 화석에서 부활했다.\n나무 위에서 살고 있으나 날지 못해\n가지에서 가지 사이를 뛰어 옮겨 다닌다.", "Un Pokémon recréé à partir d'un fossile.\nIl vit à la cime des arbres, mais ne peut\nvoler et saute de branche en branche.", "Es wurde aus einem Fossil reanimiert.\nDa es nicht fliegen kann, bewegt es\nsich hüpfend von Ast zu Ast.", "Ha renacido a partir de fósiles antiguos.\nVive en la copa de los árboles y salta de\nuna rama a otra porque no puede volar.", "Rigenerato da un fossile, viveva sugli\nalberi e rincorreva le prede saltando di\nramo in ramo perché non sapeva volare.", "It was revived from an ancient fossil.\nNot able to fly, it lived in treetops and\nhopped from one branch to another.") },
            { PBESpecies.Archeops, new PBELocalizedString("とぶよりも　はしるほうが　とくいで\nじそく\xFF14\xFF10キロで　かけぬけた\nいきおいで　おおぞらに　はばたく。", "나는 것보다 달리는 것이 특기로\n시속 40km로 달리던 기세로\n넓은 하늘로 날아 오른다.", "Il est plus doué pour courir que pour\nvoler. Il doit s'élancer à 40 km/h\navant de pouvoir s'envoler.", "Zu Fuß ist es schneller als in der Luft.\nEs muss ein Tempo von 40 km/h erreichen,\nbevor es sich in die Lüfte aufschwingt.", "Corre a mayor velocidad de la que puede\nvolar. Alcanza una velocidad de 40 km/h\nantes de alzarse en vuelo hacia el cielo.", "È più versato nella corsa che nel volo.\nSi lancia in aria a una velocità di 40 km/h\nsbattendo le ali.", "It runs better than it flies.\nIt takes off into the sky by\nrunning at a speed of 25 mph.") },
            { PBESpecies.Trubbish, new PBELocalizedString("さらなる　ゴミを　もとめて\nポイすてをする　ひとを　つけまわす。\nいつも　どくガスを　はきだしている。", "더 많은 쓰레기를 찾아\n무단 투기하는 사람을 쫓아다닌다.\n항상 독가스를 토해내고 있다.", "Il suit les humains sales à la recherche\nde nouveaux déchets. Il rote souvent,\nlibérant un gaz toxique.", "Um an frischen Müll zu kommen, heftet\nes sich Umweltsündern an die Fersen.\nEs speit unaufhörlich giftige Gase.", "Para hacerse con más basura, sigue a\ngente que arroja desperdicios al suelo.\nDespide continuamente gases nocivos.", "Dato che è attratto dalla spazzatura,\nsegue gli umani che la buttano per terra.\nRilascia gas tossici di continuo.", "Wanting more garbage, they\nfollow people who litter.\nThey always belch poison gas.") },
            { PBESpecies.Garbodor, new PBELocalizedString("ゴミを　すいとっては　たいないで\nあたらしい　しゅるいの　どくガスや\nどくの　えきたいを　うみだしている。", "쓰레기를 흡수해서 체내에서\n새로운 종류의 독가스나\n독의 액체를 만들어낸다.", "Il aspire les déchets et les intègre à\nson corps pour produire des gaz et\ndes fluides toxiques.", "Jedes Mal, wenn es frischen Müll in sich\naufsaugt, erzeugt es völlig neue Formen\nvon Giftgasen und Toxinen.", "Absorbe y procesa en su interior basura\npara generar nuevos gases nocivos y\nlíquidos venenosos de alta virulencia.", "Assorbe la spazzatura nel suo corpo\nper creare dei liquidi velenosi e dei gas\ntossici sempre nuovi.", "Consuming garbage makes\nnew kinds of poison gases\nand liquids inside their bodies.") },
            { PBESpecies.Zorua, new PBELocalizedString("あいてそっくりに　ばけているように\nみせかけ　だましたり　おどろかして\nそのすきに　にげだすことが　おおい。", "상대와 똑 닮게 둔갑한 것처럼\n보이게 하여 속이거나 놀라게 해서\n그 틈에 도망가는 일이 많다.", "Il prend l'apparence de son adversaire\npour le désorienter et prendre la fuite\ngrâce à la confusion causée.", "Nicht selten überrumpelt es Gegner,\nindem es ihre Gestalt annimmt und den\nÜberraschungseffekt zur Flucht nutzt.", "Adopta la apariencia de su enemigo\npara engañarlo vilmente y aprovecha\nsu estupor para poner tierra por medio.", "Inganna spesso il nemico assumendone\nla forma e lasciandolo esterrefatto,\nper poi darsi alla fuga.", "It changes so it looks just\nlike its foe, tricks it, and then\nuses that opportunity to flee.") },
            { PBESpecies.Zoroark, new PBELocalizedString("ゾロアークを　とらえようとした\nひとを　まぼろしの　けしきのなかに\nとじこめ　こらしめた　といわれる。", "조로아크를 잡으려 한\n사람을 환영의 경치 속에\n가둬서 혼내줬다고 전해진다.", "On dit que ceux qui osent essayer de le\ncapturer restent prisonniers des\npaysages illusoires qu'il peut créer.", "Es heißt, Zoroark verbanne jeden, der\nes zu fangen versucht, zur Strafe in\neine Welt der Illusionen.", "Se dice que Zoroark atrapa en un mundo\nde ilusiones a quien lo intenta atrapar\ny que, de esta manera, lo castiga.", "Gira voce che quelli che osano cercare\ndi catturarlo restano imprigionati dentro\nmondi di fantasia che lui stesso crea.", "Stories say those who tried\nto catch Zoroark were trapped\nin an illusion and punished.") },
            { PBESpecies.Minccino, new PBELocalizedString("おたがいの　しっぽで　あいてを\nとことん　きれいに　してあげるのが\nチラーミィどうしの　あいさつ。", "서로의 꼬리로 상대를\n철저히 깨끗하게 만드는 것이\n치라미끼리의 인사다.", "Ils se saluent en s'époussetant les\nuns les autres avec leur queue qui\nleur sert de plumeau.", "Sie begrüßen einander, indem\nsie ihr Gegenüber mithilfe ihres\nSchweifs säubern.", "Se saludan entre sí frotándose con\nla cola y limpiándose a conciencia.", "Si salutano pulendosi l'un l'altro con le\nloro code.", "Minccino greet each other\nby grooming one another\nthoroughly with their tails.") },
            { PBESpecies.Cinccino, new PBELocalizedString("チラチーノの　からだは　とくべつな\nあぶらで　おおわれており　パンチなど\nあいての　こうげきを　うけながす。", "치라치노의 몸은 특별한\n기름으로 뒤덮여 있어 펀치 등\n상대의 공격을 받아넘긴다.", "Son corps est recouvert d'une sorte\nde lubrifiant qui fait glisser les coups\nsur lui comme si de rien n'était.", "Sein Körper ist mit einem speziellen Öl\nüberzogen, an dem gegnerische Hiebe\nund ähnliche Angriffe einfach abgleiten.", "El cuerpo de Cinccino está recubierto\npor una grasa especial que hace que los\ngolpes y ataques enemigos no acierten.", "Il suo corpo è ricoperto di un grasso\nspeciale sul quale scivolano via i colpi\ne i pugni dell'avversario.", "Cinccino's body is coated\nin a special oil that helps it\ndeflect attacks, such as punches.") },
            { PBESpecies.Gothita, new PBELocalizedString("なんでも　じっと　みつめている。\nかんさつに　むちゅうに　なってしまい\nこうげきに　きづかないことも　ある。", "뭐든지 가만히 바라본다.\n관찰에 몰두해 버려서\n공격을 눈치채지 못할 때도 있다.", "Son regard est constamment fixé sur son\nadversaire. À tel point qu'il ne remarque\nparfois même pas quand on l'attaque.", "Es mustert alles immer so gründlich, dass\nes gelegentlich nicht einmal mitbekommt,\nwenn es angegriffen wird.", "Observa fijamente cualquier cosa, tanto\nque, en más de una ocasión, no se da\ncuenta de que un enemigo lo ataca.", "Osserva con attenzione qualsiasi cosa.\nA volte è così preso a guardare che non\nsi accorge degli attacchi.", "It stares intently at everything.\nIt can become so obsessed with\nwatching that it doesn't notice attacks.") },
            { PBESpecies.Gothorita, new PBELocalizedString("ほしあかりが　かがやく　よるに\nねている　こどもたちを　あやつって\nあそぶ　はなしが　おおく　のこる。", "별빛이 빛나는 밤에\n잠자는 아이들을 조종해서\n논다는 이야기가 많이 남아 있다.", "On dit qu'ils apparaissent les nuits\nétoilées et manipulent les enfants\npour jouer avec eux.", "Erzählungen zufolge machen sie sich einen\nSpaß daraus, in sternklaren Nächten von\nschlafenden Kindern Besitz zu ergreifen.", "Según muchas leyendas, durante las\nnoches estrelladas controlan a los niños\nque duermen, tan solo como diversión.", "Si racconta che nelle notti stellate,\nper giocare con i bambini addormentati,\nsi diverta a muoverli come pupazzi.", "According to many old tales, it creates\nfriends for itself by controlling\nsleeping children on starry nights.") },
            { PBESpecies.Gothitelle, new PBELocalizedString("ほしの　うごきから　みらいを　よむ。\nトレーナーの　じゅみょうを　しった\nゴチルゼルは　さけび　かなしむ。", "별의 움직임에서 미래를 읽는다.\n트레이너의 수명을 알게 된\n고디모아젤은 부르짖으며 슬퍼한다.", "Il prédit l'avenir à partir du mouvement\ndes étoiles et devient triste après avoir\nperçu l'espérance de vie des Dresseurs.", "Es kann anhand der Gestirne die Zukunft\nvorhersagen. Wenn es erfährt, wann sein\nTrainer sterben wird, jault es laut auf.", "Predice el futuro a partir del movimiento\nde las estrellas. Al saber cuándo morirá\nsu Entrenador, emite alaridos de pena.", "Legge il futuro nei moti delle stelle.\nQuando scopre la durata della vita del\nsuo Allenatore, si abbandona al pianto.", "It can see the future from the movement\nof the stars. When it learns its\nTrainer's life span, it cries in sadness.") },
            { PBESpecies.Solosis, new PBELocalizedString("からだが　とくしゅな　えきたいに\nつつまれているので　どんな　きびしい\nじょうきょうでも　へいきなのだ。", "몸이 특수한 액체로\n둘러싸여 있어 어떤 곤란한\n상황이라도 문제없다.", "Son corps est enrobé dans un fluide\nspécial, ce qui lui permet de vivre\ndans n'importe quel environnement.", "Die spezielle Flüssigkeit, die es umgibt,\nbietet ihm in jeder noch so gefährlichen\nSituation Schutz.", "Gracias a la sustancia viscosa que\nenvuelve su cuerpo, permanece tranquilo\npor dura o rigurosa que sea la situación.", "Il liquido speciale in cui è avvolto\nil suo corpo gli permette di resistere\nalle condizioni più estreme.", "Because their bodies are enveloped\nin a special liquid, they are fine in any\nenvironment, no matter how severe.") },
            { PBESpecies.Duosion, new PBELocalizedString("ぶんれつした　\xFF12つの　のうみそで\nおなじことを　かんがえると　だせる\nサイコパワーは　さいこうと　なる。", "분열한 2개의 뇌로\n같은 생각을 하면 낼 수 있는\n사이코 파워는 최고가 된다.", "Il dégage le maximum de sa puissance\npsychique quand ses deux cerveaux\nréfléchissent à la même chose.", "Wenn beide Hälften seines gespaltenen\nDenkapparates an dasselbe denken,\nsind seine Psycho-Kräfte am stärksten.", "Cuando las dos partes de su cerebro\npiensan lo mismo, saca todo su poder\na relucir.", "I suoi poteri psichici sono al massimo\nquando le due parti in cui è diviso il suo\ncervello pensano la stessa cosa.", "When their two divided brains\nthink the same thoughts,\ntheir psychic power is maximized.") },
            { PBESpecies.Reuniclus, new PBELocalizedString("はっきした　サイコパワーを　つかい\nとくしゅな　えきたいで　つくられた\nうでを　あやつり　いわを　くだく。", "발휘한 사이코 파워를 사용해\n특수한 액체로 만들어진\n팔을 조종해서 바위를 부순다.", "Ses bras, faits d'une matière conduisant\nses pouvoirs psychiques, sont assez\npuissants pour broyer des rochers.", "Seine Arme bestehen aus einer speziellen\nFlüssigkeit. Dank seiner Psycho-Kräfte\nkann es mit ihnen Felsen zerschmettern.", "Hacen gala de su poder psíquico y mueven\nsus brazos compuestos de líquido para\ncontrolar rocas y hacerlas añicos.", "Le sue braccia, piene di un liquido che\nconvoglia i suoi poteri psichici, sono\nanche in grado di frantumare le rocce.", "They use psychic power to control their\narms, which are made of a special liquid.\nThey can crush boulders psychically.") },
            { PBESpecies.Ducklett, new PBELocalizedString("とぶよりも　およぐのが　とくいで\nすいちゅうに　もぐっては　だいすきな\nみずゴケを　うれしそうに　たべる。", "나는 것보다 헤엄치는 것이 특기로\n수중에 잠수해서는 제일 좋아하는\n물이끼를 기쁘게 먹는다.", "Un Pokémon doué pour la plongée qui\npasse son temps sous l'eau à chercher\ndes sphaignes, son plat préféré.", "Es schwimmt besser, als es fliegen kann.\nAm liebsten taucht es ins kühle Nass ab,\num Torfmoos, seine Leibspeise, zu essen.", "Nada a mayor velocidad de la que puede\nvolar. Se sumerge en el agua para buscar\nmusgo acuático, su comida favorita.", "È più ferrato nel nuoto che nel volo.\nSi immerge nell'acqua per mangiare\ni licheni marini di cui va matto.", "They are better at swimming than flying,\nand they happily eat their favorite food,\npeat moss, as they dive underwater.") },
            { PBESpecies.Swanna, new PBELocalizedString("ゆうがな　みかけに　よらず\nつばさで　ちからづよく　はばたき　\nすうせんキロ　とびつづけられる。", "우아한 외모와 다르게\n날개로 힘차게 날개 치며\n수천 km를 계속 날 수 있다.", "Un Pokémon gracieux, mais aussi robuste.\nIl peut voler des milliers de kilomètres\ngrâce à ses ailes puissantes.", "Sie wirken zerbrechlich, aber ihre\nstarken Schwingen tragen sie in einem\nStück bis zu 1 000 Kilometer weit.", "Aunque no lo parezca por su grácil\nelegancia, puede batir con fuerza las\nalas y volar durante miles de kilómetros.", "Non è solo elegante. Con il poderoso\nbattito d'ali riesce a volare per migliaia\ndi chilometri senza fermarsi.", "Despite their elegant appearance,\nthey can flap their wings strongly\nand fly for thousands of miles.") },
            { PBESpecies.Vanillite, new PBELocalizedString("あさひを　あびた　つららから\nうまれたと　されている　ポケモン。\nマイナス\xFF15\xFF10どの　いきを　はく。", "아침 햇살을 받은 고드름에서\n태어났다고 하는 포켓몬.\n마이너스 50도의 숨결을 내뿜는다.", "Ce Pokémon est né d'une stalactite de\nglace baignée dans la lumière du matin.\nIl exhale une haleine à -50 °C.", "Ein Eiszapfen, der durch die Energie der\naufgehenden Sonne zum Pokémon wurde.\nEs speit minus 50 Grad kalten Odem.", "Pokémon que ha nacido de un carámbano\nbañado por el sol de la mañana. Espira\naliento a temperaturas de 50° bajo cero.", "Pokémon nato da una stalattite che ha\nricevuto l'energia del sole mattutino.\nLa temperatura del fiato è di -50°C.", "Theoretically, this Pokémon formed from\nicicles bathed in energy from the morning\nsun. Their breath is -58° F.") },
            { PBESpecies.Vanillish, new PBELocalizedString("あたりの　くうきを　ひやして\nこおりの　つぶを　はっせい　させて\nてきの　からだを　こおりつかせる。", "주변 공기를 차갑게 해서\n얼음 알갱이를 발생시켜서\n상대의 몸을 얼려버린다.", "Il pétrifie ses ennemis en refroidissant\nl'air ambiant et en le changeant en une\nmyriade de petites particules de glace.", "Es produziert Eiskörner, indem es die\nLuft um sich herum abkühlt, und zieht mit\nihnen eine Eisschicht um seinen Gegner.", "Enfrían el aire a su alrededor y crean\npartículas de hielo mediante las cuales\ncongelan a sus oponentes.", "Congela il corpo del nemico con\ngranelli di ghiaccio che genera\nraffreddando l'aria circostante.", "They cool down the surrounding air\nand create ice particles, which\nthey use to freeze their foes.") },
            { PBESpecies.Vanilluxe, new PBELocalizedString("たいりょうの　みずを　のみこんで\nからだのなかで　ゆきぐもに　かえる。\nおこると　もうふぶきを　まきおこす。", "대량의 물을 들이마셔\n몸 안에서 눈구름으로 바꾼다.\n화나면 강한 눈보라를 일으킨다.", "Il avale de grandes quantités d'eau\net la transforme en nuages de neige.\nIl souffle du blizzard quand il se fâche.", "Es verschluckt Unmengen an Wasser und\nwandelt es intern in Schneewolken um.\nIst es wütend, erzeugt es Schneestürme.", "Absorben grandes cantidades de agua y\nla transforman en ventisca en su cuerpo,\nexpulsándola cuando se enojan.", "Ingoia enormi quantità d'acqua che\ntrasforma in nuvole di neve. Quando si\narrabbia scatena una terribile bufera.", "Swallowing large amounts of water, they\nmake snow clouds inside their bodies and,\nwhen angry, cause violent blizzards.") },
            { PBESpecies.Deerling_Autumn, new PBELocalizedString("きせつが　かわったとき　だけでなく\nきおんや　しつどに　よっても\nからだのいろは　すこし　へんかする。", "계절이 바뀌었을 때뿐 아니라\n기온이나 습도에 따라서도\n몸의 색깔은 조금 변한다.", "Son pelage change selon la saison, et\ndans une moindre mesure en fonction\nde l'humidité et de la température.", "Unabhängig von der Jahreszeit ändert\nsich seine Farbe auch bei wechselnder\nTemperatur oder Luftfeuchtigkeit leicht.", "El color de su cuerpo cambia no solo\ncon las estaciones, sino también con\nlos cambios de humedad y temperatura.", "Il suo corpo muta non solo a seconda\ndella stagione ma in misura minore anche\nal cambiare di temperatura e umidità.", "Their coloring changes according to the\nseasons and can be slightly affected by\nthe temperature and humidity as well.") },
            { PBESpecies.Sawsbuck_Autumn, new PBELocalizedString("きせつの　うつりかわりと　ともに\nすみかを　かえるので　メブキジカが\nはるをはこぶと　いう　ひともいる。", "계절의 변화와 함께\n거처를 바꾸기에 바라철록이\n봄을 나른다고 말하는 사람도 있다.", "Il change d'habitat selon les saisons.\nCertains disent même qu'il est celui\nqui apporte le printemps.", "Mancherorts sagt man, sie brächten den\nFrühling, da sie je nach Jahreszeit ihr\nRevier wechseln.", "Migra con el cambio de estación, por lo\nque hay quien considera a Sawsbuck\nel heraldo de la primavera.", "Si spostano da un luogo all'altro al\nmutare delle stagioni, per questo alcuni\ndicono che portano con sé la primavera.", "They migrate according to the seasons,\nso some people call Sawsbuck\nthe harbingers of spring.") },
            { PBESpecies.Emolga, new PBELocalizedString("まくを　ひろげて　そらを　とびつつ\nほほの　でんきぶくろに　ためこんだ\nでんきで　あいてを　かんでんさせる。", "막을 펼쳐서 하늘을 날면서\n볼의 전기 주머니에 모은\n전기로 상대를 감전시킨다.", "Il peut planer grâce à ses membranes,\ntout en déchargeant sur ses ennemis\nl'électricité stockée dans ses bajoues.", "Wenn es seine Fluglappen ausspannt und\ndurch die Lüfte gleitet, entlädt es Strom\naus seinen Backentaschen.", "Puede volar al extender sus membranas\ny electrocutar a sus enemigos mediante\nla electricidad acumulada en sus mejillas.", "Vola usando la sua membrana e fulmina\nil nemico con l'energia accumulata nelle\nfossette elettriche sulle sue guance.", "It glides on its outstretched membrane\nwhile shocking foes with the electricity\nstored in the pouches on its cheeks.") },
            { PBESpecies.Karrablast, new PBELocalizedString("チョボマキを　おそっているときに\nでんきエネルギーを　あびると\nなぜだか　しんか　してしまうのだ。", "쪼마리를 덮쳤을 때\n전기 에너지를 받으면\n왜인지 진화해 버린다.", "Pour une raison inconnue, ce Pokémon\névolue s'il subit une décharge électrique\npendant qu'il attaque un Escargaume.", "Bekommt es im Kampf gegen Schnuthelm\nStrom ab, löst dies aus unerklärlichen\nGründen seine Entwicklung aus.", "Si recibe una descarga eléctrica durante\nun combate contra un Shelmet, puede\nevolucionar. Se desconoce el porqué.", "Per qualche motivo, si evolve a contatto\ndell'energia elettrica che si crea quando\nattacca Shelmet.", "For some reason they evolve when\nthey receive electrical energy while\nthey are attacking Shelmet.") },
            { PBESpecies.Escavalier, new PBELocalizedString("チョボマキから　うばった　カラで\nからだを　おおい　ガードしながら\n\xFF12ほんの　ヤリで　つついてくる。", "쪼마리에게서 뺏은 껍질로\n몸을 에워싸 가드하면서\n2개의 창으로 찔러온다.", "Ce Pokémon se protège avec la carapace\ndérobée à un Escargaume et attaque\navec ses deux redoutables lances.", "Eine von einem Schnuthelm gestohlene\nMuschel dient ihm als Helm. Es greift\nGegner mit seinen beiden Lanzen an.", "Se defienden de los ataques con el\ncaparazón que roban a los Shelmet.\nAtacan con sus dos mortíferas lanzas.", "Protegge il corpo con la conchiglia che\nha rubato a Shelmet mentre spunzona il\nnemico con due lance.", "Wearing the shell covering they stole\nfrom Shelmet, they defend themselves\nand attack with two lances.") },
            { PBESpecies.Foongus, new PBELocalizedString("モンスターボール　そっくりの\nもようで　ポケモンを　さそいこみ\nどくのほうしを　ふきかけてくる。", "몬스터볼과 똑 닮은\n무늬로 포켓몬을 유인해\n독포자를 뿌린다.", "Son apparence de Poké Ball trompe ses\nennemis, qu'il étourdit à l'aide de ses\nspores empoisonnées.", "Es ist gemustert wie ein Pokéball. Es\nlockt damit andere Pokémon an, um sie\ndann mit Giftsporen zu besprühen.", "Atraen a otros Pokémon gracias a su\nsimilitud con una Poké Ball y los atacan\nexpulsando esporas venenosas.", "Attira a sé altri Pokémon con la sua\nforma a Poké Ball e soffia su di loro le\nsue spore velenose.", "It lures Pokémon with its pattern\nthat looks just like a Poké Ball\nthen releases poison spores.") },
            { PBESpecies.Amoonguss, new PBELocalizedString("りょうての　かさを　うごかし\nえものを　さそう　ダンスを　おどる。\nじめじめした　ばしょを　このむ。", "양손의 삿갓을 움직여\n먹이를 유인하는 댄스를 춘다.\n눅눅한 장소를 좋아한다.", "On le trouve dans les endroits humides.\nIl fait danser ses ombrelles en forme de\nPoké Balls pour attirer ses proies.", "Es rüttelt die Hüte an seinen Armen und\nlockt Beute mit einem Tanz an. Es hält\nsich bevorzugt an feuchten Orten auf.", "Lleva a cabo una danza con la especie\nde sombrillas de sus manos para atraer\na presas. Le gustan los lugares húmedos.", "Muove le estremità degli arti in una danza\nper attrarre le prede. Predilige i luoghi\numidi.", "It moves the caps on both arms\nand does a dance to lure prey.\nIt prefers damp places.") },
            { PBESpecies.Frillish, new PBELocalizedString("ベールの　ような　てあしを　まきつけ\nしびれさせると　\xFF18\xFF10\xFF10\xFF10メートルの\nしんかいに　つれこんで　ころすのだ。", "베일 같은 손발을 휘감아\n마비시켜서 8000m의\n심해에 데려가 끝장낸다.", "Il enserre ses proies dans ses voiles et\nles entraîne sous la surface de la mer\njusqu'à plus de 8 000 m de profondeur.", "Es schlingt seine schleierartigen Arme um\nseine Beute und entführt sie 8 000 Meter\nin die Tiefe, wo es sie schließlich tötet.", "Rodea a sus presas con sus tentáculos,\nlas entumece y las arrastra a 8000 m de\nprofundidad hasta que las ahoga.", "Paralizza la preda con i suoi tentacoli\na forma di velo e poi la trascina a 8000\nmetri sotto il livello del mare.", "If its veil-like arms stun and wrap\na foe, that foe will be dragged miles\nbelow the surface, never to return.") },
            { PBESpecies.Jellicent, new PBELocalizedString("からだの　ほとんどが　かいすい。\nかいていには　ブルンゲルが　しずめた\nふねで　できた　しろが　あるという。", "몸 대부분이 해수다.\n해저에는 탱탱겔이 가라앉힌\n배로 만들어진 성이 있다고 한다.", "Il est presque entièrement fait d'eau de\nmer. On dit qu'il vit dans un palais fait\ndes épaves des bateaux qu'il a coulés.", "Es heißt, am Meeresboden gebe es einen\nPalast aus Schiffen, die es versenkt hat.\nEs besteht fast nur aus Meerwasser.", "Su cuerpo se compone de agua salada.\nDicen que ha construido un palacio en el\nfondo del mar con restos de barcos.", "È composto per lo più d'acqua marina.\nDicono che si sia costruito un castello\ncoi relitti delle navi che ha affondato.", "Its body is mostly seawater.\nIt's said there's a castle of ships\nJellicent have sunk on the seafloor.") },
            { PBESpecies.Alomomola, new PBELocalizedString("きずついたり　よわった　ポケモンを\nヒレで　やさしく　かかえながら\nとくしゅな　ねんまくで　なおすのだ。", "상처입거나 약해진 포켓몬을\n지느러미로 부드럽게 안으며\n특수한 점막으로 치료한다.", "Il berce les Pokémon blessés dans\nses nageoires et les guérit grâce à\nla membrane dont il est recouvert.", "Es umarmt verletzte und geschwächte\nPokémon liebevoll mit seinen Flossen und\nheilt sie mit einem speziellen Schleim.", "Abraza gentilmente con sus aletas a\nPokémon que están lastimados y cura\nsus heridas con su membrana especial.", "Abbraccia dolcemente con le sue pinne\ni Pokémon deboli o feriti e li guarisce\ngrazie a una speciale membrana mucosa.", "It gently holds injured and weak\nPokémon in its fins. Its special\nmembrane heals their wounds.") },
            { PBESpecies.Joltik, new PBELocalizedString("じぶんでは　でんきを　つくれないので\nほかの　おおきな　ポケモンに\nとりつき　せいでんきを　すいとる。", "스스로 전기를 만들 수 없어\n다른 큰 포켓몬에\n달라붙어 정전기를 흡수한다.", "Ne produisant pas lui-même d'électricité,\nil s'accroche aux Pokémon plus grands\net aspire leur électricité statique.", "Da es selbst keinen Strom erzeugen kann,\nklettert es auf andere Pokémon, um ihnen\nelektrostatische Energie abzusaugen.", "No puede generar electricidad por sí\nmismo, así que se encarama a Pokémon\ngrandes y absorbe su energía estática.", "Non può produrre elettricità da sé, per\ncui si attacca a Pokémon più grandi per\nsucchiarne l'energia elettrostatica.", "Since it can't generate its own\nelectricity, it sticks onto large-bodied\nPokémon and absorbs static electricity.") },
            { PBESpecies.Galvantula, new PBELocalizedString("でんきを　おびた　いとで　つくる\nバリアは　あいてを　しびれさせるので\nまもるだけでなく　ぶきにもなる。", "전기를 띤 실로 만드는\n배리어는 상대를 마비시키므로\n방어뿐 아니라 무기도 된다.", "Il tend des barrières de fils électrifiés\nqui lui servent aussi bien de bouclier\nque d'arme d'attaque.", "Errichtet mit elektrisch geladenen Fäden\nBarrieren, die lähmend wirken und ihm\nzur Verteidigung und zum Angriff dienen.", "Crea una barrera de hilos electrificados\nque aturde al enemigo, por lo que actúa\ncomo defensa y también como arma.", "Forma delle barriere con fili elettrificati\nche paralizzano il nemico, fungendo quindi\nnon solo da difesa ma anche da arma.", "It creates barriers from electrified silk\nthat stun foes. This works as a weapon\nas well as a defense.") },
            { PBESpecies.Ferroseed, new PBELocalizedString("ほらあなの　てんじょうに　つきささり\nいわの　てつぶんを　すいとる。\nきけんがせまると　トゲを　うちだす。", "동굴 천장에 박혀서\n바위의 철분을 흡수한다.\n위험이 닥치면 바늘을 쏜다.", "Il s'accroche aux parois des grottes et\nen absorbe les minéraux. Il projette\nses épines en cas de danger.", "Hakt sich an der Decke von Höhlen fest\nund saugt die Mineralien aus dem Gestein.\nBei Gefahr feuert es Dornen ab.", "Absorbe los componentes ferruginosos de\nlas rocas al colgarse del techo de las\ncuevas. Dispara púas si se ve en peligro.", "Si conficca nelle pareti delle grotte e\nassorbe i minerali delle rocce. Quando\navverte un pericolo, spara i suoi aculei.", "It absorbs the iron it finds in the\nrock while clinging to the ceiling.\nIt shoots spikes when in danger.") },
            { PBESpecies.Ferrothorn, new PBELocalizedString("\xFF13ぼんの　しょくしゅを　たたきつけ\nさらに　トゲを　とばして　あいてを\nあとかたのこらず　ふんさいする。", "3개의 촉수를 세게 내리치고\n거기에 가시를 날려 상대를\n흔적도 없이 분쇄한다.", "Il attaque grâce à ses trois tentacules\népineux et lance des épines d'acier pour\nréduire ses ennemis en poussière.", "Es macht mit Gegnern kurzen Prozess,\nindem es mit seinen 3 Schlingen auf sie\neindrischt und Dornen auf sie abfeuert.", "Azota al enemigo con sus tres tentáculos\ny después dispara púas hasta que no\ndeja ni rastro del rival.", "Fa a pezzi il nemico colpendolo prima con\nle sue tre antenne e poi sparandogli\naddosso i suoi aculei.", "By swinging around its three\nspiky feelers and shooting spikes,\nit can obliterate an opponent.") },
            { PBESpecies.Klink, new PBELocalizedString("かならず　きまった　くみあわせの\n\xFF12つの　からだを　かいてん　させて\nエネルギーを　うみだしている。", "반드시 정해진 조합의\n두 개의 몸을 회전시켜\n에너지를 만들고 있다.", "Il est constitué de deux rouages\nbien distincts tournant ensemble\npour produire de l'énergie.", "Sein Körper ist eine stets identische\nAnordnung von Einzelteilen, die Energie\nerzeugen, wenn sie gedreht werden.", "La combinación fija de dos cuerpos\nle permite generar energía cuando\nse ponen a girar.", "Le due parti che lo compongono possono\ncombinarsi solo in un determinato modo.\nProduce energia facendole ruotare.", "Two bodies comprise a fixed pair.\nThey spin around each other\nto generate energy.") },
            { PBESpecies.Klang, new PBELocalizedString("ちびギアと　でかギアに　わかれた。\nこうげきのため　とばした　ちびギアが\nもどってこないと　しんでしまう。", "꼬마기어와 왕기어로 나뉘었다.\n공격을 위해 날린 꼬마기어가\n돌아오지 않으면 죽게 된다.", "Le plus grand des rouages projette le\nplus petit pour attaquer. Ce dernier\nrisque de dépérir s'il ne revient pas.", "Besteht aus kleinen und großen Rädern.\nKehrt ein kleines Rad, das es abgefeuert\nhat, nicht zurück, wird es brenzlig.", "Se compone de una rueda dentada grande\ny otra pequeña. Lanza la pequeña para\natacar, pero se debilita si no regresa.", "È formato da un ingranaggio grande e uno\npiccolo. Attacca con quello piccolo ma,\nse non torna, è in seria difficoltà.", "A minigear and big gear comprise its\nbody. If the minigear it launches at\na foe doesn't return, it will die.") },
            { PBESpecies.Klinklang, new PBELocalizedString("ちびギアを　こうそくかいてん　させ\nあかいコアに　ためた　エネルギーを\nちびギアに　こめて　いっきにはなつ。", "꼬마기어를 고속 회전시켜서\n빨간 코어에 모은 에너지를\n꼬마기어에 담아 한 번에 발산한다.", "Le rouage doté d'un noyau rouge fournit\nau petit rouage l'énergie requise pour\nattaquer si ce dernier tourne très vite.", "Lässt das kleine Rad schnell rotieren\nund feuert es ab, indem darauf Energie\naus seinem roten Kern übertragen wird.", "Hace girar a gran velocidad la rueda\ndentada pequeña, le transmite la energía\nacumulada en el núcleo rojo y la dispara.", "L'ingranaggio con il nucleo rosso ruota e\ncosì fornisce all'ingranaggio più piccolo\nl'energia necessaria per attaccare.", "The minigear spins at high speed. Then\nthe energy from the red core charges\nthe minigear to make it ready to fire.") },
            { PBESpecies.Tynamo, new PBELocalizedString("よわい　でんきしか　だせないので\nたくさんの　シビシラスで　あつまり\nきょうりょくな　でんきを　はなつ。", "약한 전기밖에 낼 수 없어\n많은 저리어가 모여서\n강력한 전기를 발산한다.", "Tout seul, il ne dégage pas beaucoup\nd'électricité. Mais un banc d'Anchwatt\nproduit des décharges surpuissantes.", "Alleine erzeugen sie nur geringe Mengen\nan Elektrizität, aber im Schwarm können\nsie mächtige Stromsalven abfeuern.", "Apenas puede generar energía por sí\nmismo, pero un banco de Tynamo puede\ncrear violentas descargas eléctricas.", "Da soli producono poca elettricità,\nper cui formano dei grossi branchi se\nvogliono lanciare una scossa più potente.", "One alone can emit only a trickle of\nelectricity, so a group of them gathers\nto unleash a powerful electric shock.") },
            { PBESpecies.Eelektrik, new PBELocalizedString("あいてに　まきつき　まるい\nはんてんから　でんきを　ながして\nしびれたところを　まるかじりする。", "상대에 휘감겨 동그란\n반점에서 전기를 흘려보내\n마비된 것을 통째로 문다.", "Ses taches émettent de l'électricité\nquand il s'enroule autour de ses proies\npour les paralyser avant de les dévorer.", "Schlingt sich um Gegner, lähmt sie über\ndie rund gemaserten Flächen an seinem\nKörper mit Strom und beißt beherzt zu.", "Se enrolla alrededor de su presa, la\nparaliza con la electricidad de sus\nmarcas circulares y le asesta mordiscos.", "Si avvinghia alla preda e la paralizza\nrilasciando elettricità dalle macchie\ntonde, poi la ingoia intera.", "It wraps itself around its prey and\nparalyzes it with electricity from the\nround spots on its sides. Then it chomps.") },
            { PBESpecies.Eelektross, new PBELocalizedString("きゅうばんに　なっている　くちで\nはりついて　キバを　さしこみ\nきょうりょくな　でんきを　ながす。", "흡반으로 되어 있는 입으로\n들러붙어 이빨을 찔러 넣어\n강력한 전기를 흘려보낸다.", "Sa bouche agit comme une ventouse aux\ncrocs acérés qu'il plante dans sa proie\nen envoyant une décharge électrique.", "Es hakt sich mit dem Saugnapf an seinem\nMaul am Gegner fest und verpasst ihm mit\nseinen Fangzähnen starke Stromschläge.", "Pega la ventosa de su boca en su presa\ny la electrocuta con una gran descarga\nclavándole los colmillos.", "Si attacca alla preda con la bocca a\nventosa, conficca i denti nel suo corpo e\nrilascia una potente scarica elettrica.", "It latches on to prey with its sucker\nmouth, sinking in its fangs and shocking\nthe prey with powerful electricity.") },
            { PBESpecies.Elgyem, new PBELocalizedString("\xFF15\xFF10ねんまえ　\xFF35\xFF26\xFF2Fが\nついらくしたと　うわさされる\nさばくから　やってきたと　いわれる。", "50년 전 UFO가\n추락했다는 소문이 도는\n사막에서 왔다고 전해진다.", "On dit qu'il est apparu soudainement\nil y a 50 ans des confins d'un désert\noù un OVNI se serait écrasé.", "Man sagt, es sei vor 50 Jahren aus den\nTiefen einer Wüste erschienen, in der\nzuvor angeblich ein UFO abgestürzt war.", "Según cuentan los rumores, procede de\nun desierto donde hace 50 años se\nestrelló un ovni.", "Si dice che sia arrivato 50 anni fa da un\ndeserto in cui sembra si sia schiantato\nun UFO.", "Rumors of its origin are linked to a UFO\ncrash site in the desert 50 years ago.") },
            { PBESpecies.Beheeyem, new PBELocalizedString("ゆびさきを　てんめつ　させて\nかいわするらしいが　その　パターンは\nまだ　かいどく　できていない。", "손끝을 점멸시켜서\n대화하는 듯하나 그 패턴은\n아직 해독하지 못했다.", "Il fait clignoter ses doigts tricolores\npour communiquer avec ses semblables.\nSon langage reste un mystère.", "Es spricht, indem es seine Fingerspitzen\nleuchten lässt, doch noch konnte der\nCode dahinter nicht entziffert werden.", "Parece que se comunica haciendo brillar\nsus dedos tricolores, pero nadie ha\nconseguido descifrar aún su patrón.", "Dialoga con i suoi simili tramite le luci\ndei suoi arti, ma la sua lingua è ancora\nun mistero.", "Apparently, it communicates by flashing\nits three fingers, but those patterns\nhaven't been decoded.") },
            { PBESpecies.Litwick, new PBELocalizedString("ふだん　ほのおは　きえているが\nひとや　ポケモンの　せいめいりょくを\nすいとると　ほのおは　きらめく。", "평소 불꽃은 꺼져 있지만\n사람이나 포켓몬의 생명력을\n흡수하면 불꽃은 반짝인다.", "Sa flamme ne s'allume que lorsqu'il\naspire l'énergie vitale des gens et\ndes autres Pokémon.", "Seine Flamme entzündet sich erst, wenn\nes einem Menschen oder einem Pokémon\ndie Lebensenergie absaugt.", "Su llama suele estar apagada, pero puede\navivarla absorbiendo la energía vital\ntanto de humanos como de Pokémon.", "Di solito la sua fiamma è spenta, ma si\nriaccende quando succhia l'energia vitale\ndi Pokémon ed esseri umani.", "Its flame is usually out, but it starts\nshining when it absorbs life force\nfrom people or Pokémon.") },
            { PBESpecies.Lampent, new PBELocalizedString("たましいを　すいとり　ひをともす。\nひとが　しぬのを　まつため\nびょういんを　うろつくようになった。", "영혼을 빨아들여 불을 밝힌다.\n사람이 죽는 것을 기다리기 위해\n병원을 서성거리게 되었다.", "Il aspire les âmes pour entretenir sa\nflamme. Il erre dans les hôpitaux dans\nl'attente d'un trépas.", "Es nährt seine Flamme mit den Seelen\nseiner Opfer. Heutzutage irrt es auf der\nSuche nach Seelen durch Krankenhäuser.", "Al absorber almas, su llama se enciende.\nEspera a que la gente fallezca, así que\nsuele deambular por los hospitales.", "La sua fiamma si accende quando risucchia\ngli spettri. Si trova spesso nei pressi\ndei cimiteri, dove questi abbondano.", "The spirits it absorbs fuel its baleful\nfire. It hangs around hospitals waiting\nfor people to pass on.") },
            { PBESpecies.Chandelure, new PBELocalizedString("あやしげな　ほのおで　もやされた\nたましいは　いきばを　なくし\nこの　よを　えいえんに　さまよう。", "괴상한 불꽃으로 태워진\n영혼은 갈 곳을 잃고\n이승을 영원히 헤맨다.", "Les âmes consumées par ses flammes\nétranges sont condamnées à l'errance\npour l'éternité.", "Seelen, die das Feuer seiner schaurigen\nFlammen gekostet haben, irren bis ans\nEnde der Tage ziellos durch diese Welt.", "Las almas que han ardido bajo sus\noscuras llamas vagan sin rumbo y\neternamente por este mundo.", "Le anime bruciate dalle sue fiamme cupe\nperdono la strada e rimangono a vagare\nin questo mondo per l'eternità.", "The spirits burned up in its\nominous flame lose their way\nand wander this world forever.") },
            { PBESpecies.Axew, new PBELocalizedString("おおきな　キバは　まだ　もろく\nおれたりするが　はえかわるごとに\nかたく　じょうぶに　なっていく。", "큰 이빨은 아직 물러\n부러지기도 하나 새로 날 때마다\n견고하고 튼튼하게 된다.", "Ses crocs sont encore fragiles et se\ncassent facilement, mais ils repoussent\nvite et se renforcent à chaque fois.", "Ihre Hauer sind noch sehr zerbrechlich,\ndoch jedes neue Paar, das nachwächst,\nist etwas robuster als das letzte.", "Sus grandes colmillos aún son frágiles\ny suelen partirse, pero los nuevos que\nle crecen son más duros y resistentes.", "Le sue zanne sono ancora deboli e spesso\nsi spezzano, ma ogni volta che ricrescono\ndiventano sempre più robuste.", "Its large tusks have a tendency to\nbreak, but each time they grow back,\nthey grow in harder and sturdier.") },
            { PBESpecies.Fraxure, new PBELocalizedString("キバは　にどと　はえかわらないので\nたたかいおわると　かわらの　いわを\nつかって　たんねんに　みがきあげる。", "이빨은 다시는 나지 않기 때문에\n싸움이 끝나면 강가에 있는 바위를\n사용해서 정성껏 닦는다.", "Comme ses crocs brisés ne repoussent\npas, il les aiguise avec soin après le\ncombat sur les pierres des rivières.", "Da seine Hauer nicht mehr nachwachsen,\nwetzt es sie nach einem Kampf behutsam\nan den Felsen eines Flussbettes.", "Sus colmillos no vuelven a crecer, por lo\nque, al término de cada combate, los\nafila cuidadosamente con cantos de río.", "Le sue zanne non ricrescono più, per cui\nfinita una lotta se ne prende cura e le\naffila diligentemente con pietre di fiume.", "A broken tusk will not grow back, so\nit diligently sharpens its tusks on\nriver rocks after the end of a battle.") },
            { PBESpecies.Haxorus, new PBELocalizedString("キバの　はかいりょくは　ばつぐん。\nふとくかたい　こうてつの　はしらも\nいとも　かんたんに　きりさけるのだ。", "이빨의 파괴력은 훌륭하다.\n굵고 단단한 강철의 기둥도\n매우 간단히 베어 가른다.", "Ses crocs sont tellement puissants\nqu'ils peuvent découper des poutres\nd'acier sans problème.", "Seine zerstörerischen Hauer\ndurchbohren ohne Weiteres dicke\nPfeiler aus hartem Stahl.", "Sus colmillos poseen una increíble fuerza\ndestructiva, capaz de desgarrar incluso\nuna dura y espesa columna de acero.", "La forza distruttiva delle sue zanne non\nha paragoni. Trancia con estrema facilità\nanche spesse travi d'acciaio.", "Its tusks are incredibly destructive.\nThey can easily slice through a thick,\nsturdy steel column every time.") },
            { PBESpecies.Cubchoo, new PBELocalizedString("はなみずは　けんこうの　バロメータ。\nちょうしが　いいと　ねばりづよくなり\nこおりの　わざの　いりょくも　ます。", "콧물은 건강의 척도다.\n상태가 좋으면 점성이 높아지고\n얼음 기술의 위력도 증가한다.", "Sa roupie indique sa santé. S'il est en\nforme, elle sera épaisse et la puissance\nde ses attaques glacées augmentera.", "Fühlt es sich wohl, wird der Schleim, der\naus seiner Nase trieft, klebrig, und die\nStärke seiner Eis-Attacken nimmt zu.", "Sus mocos son su barómetro de salud. Si\nes buena, serán densos, y la fuerza de\nsus movimientos de tipo Hielo aumentará.", "La goccia del naso è il barometro della\nsua salute. Se sta bene è bella viscosa e\npotenzia le sue mosse di tipo Ghiaccio.", "Their snot is a barometer of health.\nWhen healthy, their snot is sticky and\nthe power of their ice moves increases.") },
            { PBESpecies.Beartic, new PBELocalizedString("きたの　つめたい　うみを　このむ。\nくちから　はきだした　いきをこおらせ\nうみのうえに　みちをつくり　あるく。", "북쪽의 차가운 바다를 좋아한다.\n입에서 내뿜는 숨을 얼려\n바다 위에 길을 만들어 걷는다.", "Il aime les mers glaciales du nord.\nIl y trace son chemin en créant des\nîlots de glace pour éviter de nager.", "Es liebt die kalten Meere im Norden und\nüberquert ihre Flächen auf Stegen, die\nes mit seinem gefrorenen Atem baut.", "Adoran los mares gélidos del norte.\nCongelan su aliento para crear sendas\npor las que caminar sobre las aguas.", "Predilige i freddi mari del nord. Crea\nstrade di ghiaccio soffiando con il suo\nalito gelido sulla superficie del mare.", "They love the cold seas of the north.\nThey create pathways across the ocean\nwaters by freezing their own breath.") },
            { PBESpecies.Cryogonal, new PBELocalizedString("こおりの　けっしょうで　できた\nくさりをつかい　えものを　からめとり\nマイナス\xFF11\xFF10\xFF10どに　こおらせる。", "얼음 결정으로 만들어진\n사슬로 먹이를 휘감아 잡고\n마이너스 100도로 얼린다.", "Il attrape ses proies à l'aide de sa\nchaîne faite de cristaux de givre et\nles gèle à près de -100 °C.", "Es fängt seine Beute mit Ketten aus\nEiskristallen und kühlt sie auf eine\nTemperatur von minus 100 Grad ab.", "Usa cadenas de cristales de hielo para\natrapar a sus presas y congelarlas\na temperaturas de hasta -100°.", "Cattura le sue prede con catene fatte di\ncristalli di ghiaccio, poi le congela a una\ntemperatura di -100°C.", "They are composed of ice crystals.\nThey capture prey with chains of ice,\nfreezing the prey at -148° F.") },
            { PBESpecies.Shelmet, new PBELocalizedString("カブルモと　いっしょに　いるときに\nでんきてきな　しげきを　うけると\nおたがいの　からだが　しんかする。", "딱정곤과 함께 있을 때\n전기적인 자극을 받으면\n서로의 몸이 진화한다.", "S'il est à proximité d'un Carabing et\nque les deux reçoivent une décharge\nélectrique, ils évoluent en même temps.", "Hält sich ein Laukaps in seiner Nähe auf\nund kommen beide mit Strom in Berührung,\nentwickeln sie sich.", "Si está junto a Karrablast, y ambos\nreciben una descarga eléctrica,\nevolucionan los dos a la vez.", "Quando incontra Karrablast si crea della\ncorrente elettrica che stimola entrambi\ni Pokémon causandone l'evoluzione.", "When it and Karrablast are together,\nand both receive electrical stimulation,\nthey both evolve.") },
            { PBESpecies.Accelgor, new PBELocalizedString("からだが　かんそうすると　よわるので\nねんまくで　おおって　まもりつつ\nどくえきを　とばして　たたかう。", "몸이 건조하면 약해지므로\n점막을 둘러싸서 보호하면서\n독액을 날려 싸운다.", "Il faiblit quand son corps s'assèche.\nIl se bat donc avec son poison tout en\nse protégeant avec une fine membrane.", "Da es ohne Flüssigkeit an Kraft verliert,\numgibt es sich mit einer schleimigen\nSchutzhaut und speit flüssiges Gift.", "Su cuerpo se debilita al deshidratarse,\npor lo que se envuelve en una membrana\nprotectora mientras escupe veneno.", "Si indebolisce se il suo corpo si secca.\nLotta avvolto in una membrana protettiva\nspruzzando un liquido velenoso.", "When its body dries out, it weakens.\nSo it wraps a membrane around itself\nfor protection while it spits poison.") },
            { PBESpecies.Stunfisk, new PBELocalizedString("あいてが　しびれてくれないときは\nよそうがいの　すばやさで　からだを\nくねらせ　とびはね　にげるのだ。", "상대가 마비되지 않을 때는\n예상외의 스피드로 몸을\n구부려서 튀어올라 도망친다.", "Quand sa proie ne cède pas à la paralysie\nprovoquée par ses décharges, il s'enfuit\nd'un bond à une vitesse déconcertante.", "Gelingt es ihm nicht, seinen Gegner zu\nlähmen, biegt es sich mit ungeahnter\nGeschwindigkeit und hüpft davon.", "Cuando no logra paralizar a su rival,\nflexiona su cuerpo para escapar saltando\ncon una inesperada velocidad.", "Quando non riesce a paralizzare il nemico\nsi dà alla fuga contorcendo il corpo e\nrimbalzando ad una velocità inaspettata.", "When its opponent can't be paralyzed,\nit contorts itself with unexpected speed\nand flops away.") },
            { PBESpecies.Mienfoo, new PBELocalizedString("わざをくりだす　スピードが　じまん。\nたとえ　パワーは　ひくくても\nてかずの　おおさで　カバーする。", "기술을 내보내는 스피드가 자랑이다.\n설령 파워는 낮더라도\n횟수의 많음으로 커버한다.", "Il se flatte d'être très rapide. Pour\ncompenser la faiblesse de ses coups,\nil en assène un très grand nombre.", "Schnelle Angriffe sind seine Spezialität.\nEs gleicht seine Schwächen mit der\nVielfalt seines Attackenrepertoires aus.", "La velocidad de sus ataques es su gran\norgullo. Lo que le falta de fuerza bruta\nlo compensa en cantidad de golpes.", "Va fiero della rapidità delle sue mosse.\nSopperisce a un'eventuale mancanza di\npotenza con il numero dei colpi.", "It takes pride in the speed at which it\ncan use moves. What it loses in power,\nit makes up for in quantity.") },
            { PBESpecies.Mienshao, new PBELocalizedString("りょうての　たいもうを　ムチのように\nつかいこなし　れんぞくこうげきを\nはじめると　だれにも　とめられない。", "양손의 털을 채찍처럼\n능숙하게 다뤄 연속공격을\n시작하면 아무도 멈출 수 없다.", "Il combat à l'aide des longs poils de ses\npattes antérieures. Une fois lancé dans\nses enchaînements, rien ne l'arrête.", "Niemand kann es aufhalten, wenn es eine\nAngriffsserie mit seinen peitschenartigen\nArmen startet.", "Usa el pelaje de sus brazos a modo de\nlátigos para encadenar ataques que\nnadie puede parar una vez iniciados.", "Usa i peli degli arti anteriori a mo' di\nfrusta e se inizia un attacco a catena\nnon c'è nessuno che lo possa fermare.", "Using the long fur on its arms like whips,\nit launches into combo attacks that,\nonce started, no one can stop.") },
            { PBESpecies.Druddigon, new PBELocalizedString("ドリュウズや　イワークが　ほった\nせまい　トンネルを　はしりまわって\nするどいツメで　えものを　とらえる。", "몰드류나 롱스톤이 파놓은\n좁은 터널을 뛰어다니며\n날카로운 발톱으로 먹이를 포획한다.", "Il apprécie les tunnels creusés par les\nOnix ou les Minotaupe, où il peut chasser\nses proies avec ses griffes acérées.", "Es jagt in schmalen, von Stalobor und\nOnix gegrabenen Schächten nach Beute\nund spießt sie mit spitzen Klauen auf.", "Recorre los estrechos túneles excavados\npor Excadrill y Onix, y captura a sus\npresas usando sus afiladas garras.", "Percorre gli stretti tunnel scavati da\nExcadrill e Onix, catturando le prede\ncon i suoi artigli affilati.", "It runs through the narrow tunnels\nformed by Excadrill and Onix.\nIt uses its sharp claws to catch prey.") },
            { PBESpecies.Golett, new PBELocalizedString("こだいの　かがくりょくに　よって\nねんどから　つくられた　ポケモン。\nすうせんねん　うごきつづける。", "고대 과학의 힘으로\n점토에서 만들어진 포켓몬.\n수천 년 동안 계속 움직일 수 있다.", "Ce Pokémon fait de terre glaise, produit\nde la technologie d'une civilisation\nantique, vit depuis des millénaires.", "Es wurde von einer uralten Kultur aus\nLehm erschaffen und kann mehrere\nJahrtausende in Bewegung bleiben.", "Un Pokémon creado a partir del barro\ngracias a la ciencia de antaño.\nLleva activo miles de años.", "È stato creato dall'argilla usando\nantiche conoscenze scientifiche.\nÈ vivo da più di mille anni.", "Ancient science fashioned this\nPokémon from clay. It's been\nactive for thousands of years.") },
            { PBESpecies.Golurk, new PBELocalizedString("ポケモンや　ひとを　まもるために\nこだいじんに　よって　うみだされた。\nなぞの　エネルギーで　かつどうする。", "포켓몬이나 사람을 지키기 위해\n고대인에 의해 만들어졌다.\n의문의 에너지로 활동한다.", "Créé à une lointaine époque pour\nprotéger les Pokémon et les gens. La\nsource de son énergie est inconnue.", "Eine uralte Kultur erschuf es als Hüter\nder Pokémon und Menschen. Es wird mit\neiner rätselhaften Energie betrieben.", "Los Golurk fueron creados antaño para\nproteger a humanos y a Pokémon.\nFuncionan con una extraña energía.", "È stato creato dagli antichi per\nproteggere gli uomini e i Pokémon.\nÈ mosso da un'energia misteriosa.", "Golurk were created to protect\npeople and Pokémon.\nThey run on a mysterious energy.") },
            { PBESpecies.Pawniard, new PBELocalizedString("じぶんが　きずついても　きにせず\nしゅうだんで　ぜんしんの　はものを\nくいこませ　あいてを　こうげきする。", "자신이 상처입어도 신경 쓰지 않고\n집단으로 전신의 칼날을\n박아서 상대를 공격한다.", "Ignorant leurs propres blessures, ils se\njettent en groupe sur l'ennemi pour le\ndéchirer de leur corps fait de lames.", "Selbst wenn sie verletzt sind, greifen sie\nihren Gegner unbeirrt in der Gruppe an,\nindem sie ihre Klingen in ihn hineinrammen.", "Ataca en grupo ignorando sus heridas\ny hundiendo en su presa las cuchillas\nque recubren su cuerpo.", "Incuranti di ferirsi, si lanciano in gruppo\naddosso alla preda infilzandola con le\nlame che hanno sul corpo.", "Ignoring their injuries, groups attack\nby sinking the blades that cover their\nbodies into their prey.") },
            { PBESpecies.Bisharp, new PBELocalizedString("すうひきの　コマタナを　たたかわせ\nきずつき　うごけなくなった　えものを\nまっぷたつにする　こわい　ポケモン。", "몇 마리의 자망칼을 싸우게 해서\n상처입고 움직일 수 없게 된 먹이를\n두 동강 내버리는 무서운 포켓몬.", "Un Pokémon sans pitié qui tranche en\ndeux ses proies immobilisées par les\ncohortes de Scalpion qu'il commande.", "Ein kaltblütiges Pokémon, das Gegner\nzunächst mit einer Schar von Gladiantri\nlähmt und dann zweiteilt.", "Un Pokémon temible que remata a su presa\nuna vez que su séquito de Pawniard la ha\ndebilitado e inmovilizado.", "È molto crudele. Lascia che un gruppo di\nPawniard attacchi la preda e, quando è\nferita e non può più muoversi, la finisce.", "This pitiless Pokémon commands a group\nof Pawniard to hound prey into immobility.\nIt then moves in to finish the prey off.") },
            { PBESpecies.Bouffalant, new PBELocalizedString("みさかいなく　とっしん　しており\nかれらの　テリトリーに　はいると\nれっしゃでも　ふきとばされてしまう。", "무작정 돌진하고 있어\n그들의 영역에 들어가면\n열차라도 날려져 버리고 만다.", "Il charge sans réfléchir sur tout ce qui\npénètre son territoire pour l'envoyer\nvoler dans les airs, fût-ce un train.", "Es rammt Gegner ungebändigt mit dem\nKopf und schleudert selbst Züge, die\nsein Revier durchkreuzen, hinfort.", "Embiste con su cabeza sin distinción.\nSería capaz de hacer descarrilar un tren\nsi este invadiera su territorio.", "Si lancia a testa bassa contro tutto ciò\nche minaccia di invadere il suo territorio,\ntreni compresi, e lo spedisce via lontano.", "They are known to charge so wildly\nthat if a train were to enter their\nterritory, they would send it flying.") },
            { PBESpecies.Rufflet, new PBELocalizedString("おおきな　あいてに　たちむかうのは\nゆうかん　ではなく　むぼうだから。\nでも　そうして　きたえ　つよくなる。", "커다란 상대에 맞서는 것은\n용감해서가 아니라 무모하기 때문이다.\n하지만 그렇게 단련해서 강해진다.", "Il brave n'importe quel ennemi, non par\ncourage, mais par inconscience. Il se\nrenforce en multipliant les combats.", "Dass es sich mit großen Gegnern anlegt,\nist kein Zeichen von Mut, sondern von\nUnüberlegtheit. Doch so wird es stärker.", "Se enfrentan a rivales mucho mayores,\nno por valentía, sino por pura temeridad.\nPero así es como se fortalecen.", "Sfida avversari più grandi di lui, più per\nsconsideratezza che per coraggio. È così\nche si allena per diventare più forte.", "It stands up to massive opponents, not\nout of courage, but out of recklessness.\nBut that is how it gets stronger.") },
            { PBESpecies.Braviary, new PBELocalizedString("なかまの　ためなら　どれだけ\nきずつこうとも　たたかいを　やめない\nゆうかんな　おおぞらの　せんし。", "동료를 위해서라면 아무리\n상처를 입더라도 싸움을 관두지 않는\n용감한 넓은 하늘의 전사.", "Un chevalier du ciel, brave et intrépide.\nPour les siens, il combat au mépris du\ndanger, sans jamais fléchir.", "Ein tapferer Krieger der Lüfte, der\nzum Schutz seiner Kameraden auch\nmit Verletzungen immer weiterkämpft.", "Un valiente guerrero del cielo que no\nduda en luchar por sus compañeros\npor graves que sean sus heridas.", "È l'intrepido guerriero del cielo.\nPer difendere i suoi simili, lotta fino\nall'ultimo senza badare alle ferite.", "For the sake of its friends, this brave\nwarrior of the sky will not stop battling,\neven if injured.") },
            { PBESpecies.Vullaby, new PBELocalizedString("つばさは　ちいさく　まだ　とべない。\nバルジーナが　あつめてきた\nガイコツで　おしりを　まもっている。", "날개는 작아서 아직 날 수 없다.\n버랜지나가 모아온\n해골로 엉덩이를 지키고 있다.", "Ses ailes sont trop petites pour voler.\nIl protège son croupion avec un crâne\napporté par un Vaututrice.", "Seine Flügel sind noch zu klein zum\nFliegen. Ein von Grypheldis beschaffter\nSchädel schützt seinen Bürzel.", "Sus pequeñas alas no le permiten volar.\nUsa una calavera que le dio Mandibuzz\npara proteger sus posaderas.", "Le sue ali sono ancora piccole e non\npuò volare. Usa delle ossa ricevute da\nMandibuzz per riparare il suo bacino.", "Their wings are too tiny to allow them to\nfly. They guard their posteriors with\nbones that were gathered by Mandibuzz.") },
            { PBESpecies.Mandibuzz, new PBELocalizedString("おおぞらで　えんをえがきつつ　とび\nえものを　みつけると　おそいかかって\nすまで　かるがると　はこんでいく。", "넓은 하늘에서 원을 그리며 날고\n먹이를 발견하면 덮쳐서\n둥지까지 가뿐히 나른다.", "Il tournoie dans les airs en quête d'une\nproie sur laquelle il fondra avant de\nl'emporter avec aisance à son nid.", "Es kreist am Himmel, bis es seine Beute\nfindet. Nach erfolgtem Angriff trägt es\nsie mühelos zu seinem Nest.", "Vuela en círculos. Cuando avista una\npresa, la ataca y la transporta a su nido\ncon suma facilidad.", "Vola in cerchio nel cielo e quando scorge\nuna preda le si lancia contro in picchiata\nper trasportarla al suo nido.", "They fly in circles around the sky.\nWhen they spot prey, they attack and\ncarry it back to their nest with ease.") },
            { PBESpecies.Heatmor, new PBELocalizedString("しっぽから　とりこんだ　くうきを\nほのおにかえて　ベロのように　つかい\nアイアントを　とかして　たべるぞ。", "꼬리에서 빨아들인 공기를\n불꽃으로 바꿔 혀처럼 사용해\n아이앤트를 녹여서 먹는다.", "Il aspire de l'air par la queue et le\ntransforme en une langue de feu qui fait\nfondre les Fermite dont il se régale.", "Über den Schweif aufgesaugte Luft wird\nin eine Feuerzunge verwandelt, um damit\nFermicula zu schmelzen und zu fressen.", "Absorbe aire por el orificio de su cola\npara prender una lengua de llamas con la\nque derrite a los Durant para comerlos.", "Converte l'aria che aspira dalla coda\nin una lingua di fiamme che usa per\nsciogliere i Durant prima di consumarli.", "It draws in air through its tail,\ntransforms it into fire, and uses it like\na tongue. It melts Durant and eats them.") },
            { PBESpecies.Durant, new PBELocalizedString("てんてきの　クイタランに　たいして\nみんなで　やくわりぶんたん　しながら　\nはんげきして　すから　おいはらう。", "천적인 앤티골에 대해서\n모두와 역할 분담을 하면서\n반격해 둥지에서 쫓아낸다.", "Ils travaillent de concert pour protéger\nleur colonie des terribles attaques de\nleur prédateur naturel, Aflamanoir.", "Eine ausgeklügelte Rollenverteilung hilft\nihnen dabei, ihren natürlichen Feind\nFurnifraß aus dem Nest zu verjagen.", "Actúan en grupo para expulsar\nde sus colonias a los Heatmor,\nsus depredadores naturales.", "Heatmor è il loro acerrimo nemico, e\nquando vogliono cacciarlo dalla tana si\ndividono i compiti e partono all'attacco!", "Individuals each play different roles in\ndriving Heatmor, their natural predator,\naway from their colony.") },
            { PBESpecies.Deino, new PBELocalizedString("まわりの　ようすが　わからないので\nてあたりしだいに　ぶつかっては\nうごくものに　かみつき　たべまくる。", "주변의 모습을 모르기 때문에\n닥치는 대로 부딪쳐서는\n움직이는 것을 물어 먹어치운다.", "Comme il ne voit rien, il perçoit\nson environnement en mordant\net en fonçant à tout va.", "Da es nichts sehen kann, rammt und\nfrisst es alles, was ihm auf dem Weg\nin die Quere kommt.", "No ve bien a su alrededor, por eso va\nchocándose a diestro y siniestro, y\nmordiendo todo lo que se mueve.", "Non vede bene ciò che lo circonda e\nsbatte qua e là mordendo e mangiando\ntutto ciò che si muove.", "Lacking sight, it's unaware of its\nsurroundings, so it bumps into things\nand eats anything that moves.") },
            { PBESpecies.Zweilous, new PBELocalizedString("\xFF12つの　あたまは　なかが　わるく\nあいてより　おおく　たべることで\nしゅどうけんを　にぎろうと　する。", "2개의 머리는 사이가 나빠서\n상대보다 많이 먹는 것으로\n주도권을 잡으려고 한다.", "Ses deux têtes s'entendent mal et sont\nen compétition permanente pour savoir\nqui mangera le plus et qui sera le chef.", "Seine zwei Köpfe sind sich spinnefeind.\nBeide versuchen, über Fresswettbewerbe\ndie Oberhand zu gewinnen.", "Sus dos cabezas se llevan fatal, y la\nque consigue comer más que la otra\nes la que lleva la voz cantante.", "Le due teste non vanno d'accordo e si\ncontendono la posizione di comando in\nbase a quale mangia di più.", "The two heads do not get along.\nWhichever head eats more than\nthe other gets to be the leader.") },
            { PBESpecies.Hydreigon, new PBELocalizedString("うごく　ものに　はんのうして\nおそいかかり　\xFF13つの　あたまで\nくらいつくす　おそろしい　ポケモン。", "움직이는 것에 반응하여\n덮쳐서 3개의 머리로\n먹어치우는 무시무시한 포켓몬.", "Un Pokémon effrayant.\nSes trois têtes dévorent tout\nce qui bouge jusqu'à satiété.", "Ein kaltblütiges Pokémon, das auf alles\nreagiert, was sich bewegt, indem es mit\nseinen drei Köpfen danach schnappt.", "Un Pokémon temible que ataca todo lo\nque se mueve y devora con sus tres\ncabezas cuanto halla a su paso.", "È davvero terrificante. Reagisce a ogni\ncosa che si muove, attaccandola e\nsbranandola con le sue tre teste.", "It responds to movement by attacking.\nThis scary, three-headed Pokémon\ndevours everything in its path!") },
            { PBESpecies.Larvesta, new PBELocalizedString("たいようから　うまれたと　いわれる。\nしんかするとき　ツノから　ふきだした\nほのおで　ぜんしんを　つつみこむ。", "태양에서 태어났다고 전해진다.\n진화할 때 뿔에서 뿜어져 나온\n불꽃으로 전신을 감싼다.", "On dit que ce Pokémon serait né du soleil.\nIl évolue en enveloppant son corps des\nflammes qui jaillissent de ses cornes.", "Es heißt, es sei ein Produkt der Sonne.\nWenn es sich entwickelt, hüllt es sich in\nFlammen, die es aus seinen Hörnern bläst.", "Se dice que nació del sol. Al evolucionar,\ncubre su cuerpo con llamas que brotan\nde sus cuernos.", "Si dice che sia nato dal sole. Prima di\nevolversi, avvolge tutto il suo corpo\nnelle fiamme emesse dai corni.", "Said to have been born from the sun,\nit spews fire from its horns and encases\nitself in a cocoon of fire when it evolves.") },
            { PBESpecies.Volcarona, new PBELocalizedString("たいようの　けしんと　される。\nさむさが　きびしい　ふゆに　あらわれ\nふるえる　ポケモンたちを　すくった。", "태양의 화신으로 여겨진다.\n추위가 혹독한 겨울에 나타나\n떨고 있는 포켓몬들을 구했다.", "Considéré comme l'incarnation du soleil.\nIl est venu réchauffer les Pokémon\ntransis de froid au cœur de l'hiver.", "Es erschien während eines harten Winters\nund rettete Pokémon vor dem Erfrieren.\nAngeblich eine Verkörperung der Sonne.", "Se cree que es la encarnación del sol.\nSalvó a muchos Pokémon de la congelación\nal surgir en mitad de un cruel invierno.", "Si pensa sia l'incarnazione del sole.\nComparve durante un rigido inverno\nper salvare i Pokémon dal freddo.", "Thought to be an embodiment of the sun,\nit appeared during a bitterly cold winter\nand saved Pokémon from freezing.") },
            { PBESpecies.Cobalion, new PBELocalizedString("はがねの　こころと　からだを　もつ。\nひとが　ポケモンを　きずつけたとき\nなかまとともに　ひとを　こらしめた。", "강철의 마음과 몸을 지녔다.\n사람이 포켓몬을 상처입혔을 때\n동료와 함께 사람을 벌했다.", "Un corps et un cœur en acier trempé,\njadis au service de la défense des\nPokémon blessés par les humains.", "Sein Körper und Herz sind aus Stahl.\nGemeinsam mit seinen Gefährten bestraft\nes alle Menschen, die Pokémon verletzen.", "Posee cuerpo y alma de acero. Junto\ncon sus compañeros, castiga a aquellas\npersonas que hacen daño a Pokémon.", "Ha un corpo e uno spirito d'acciaio.\nÈ comparso con i suoi compagni per punire\ncoloro che un tempo ferirono i Pokémon.", "It has a body and heart of steel.\nIt worked with its allies to punish\npeople when they hurt Pokémon.") },
            { PBESpecies.Terrakion, new PBELocalizedString("でんせつで　かたられる　ポケモン。\nポケモンを　まもるため　じまんの\nパワーで　しろを　こわした。", "전설로 전해지는 포켓몬.\n포켓몬을 지키기 위해 자랑스러운\n파워로 성을 부쉈다.", "Un Pokémon de légende. Grâce à sa\npuissance phénoménale, il aurait détruit\nun château pour sauver des Pokémon.", "Ein in Legenden besungenes Pokémon. Mit\nseinen einzigartigen Kräften zerstörte\nes zum Schutz der Pokémon ein Schloss.", "Las leyendas hablan de este Pokémon,\nque derribó un castillo con su propia\nfuerza para proteger a otros Pokémon.", "Si racconta di lui nelle leggende.\nPer salvare i Pokémon, ha distrutto un\ncastello con il suo immenso potere.", "Spoken of in legend, this Pokémon used\nits phenomenal power to destroy a castle\nin its effort to protect Pokémon.") },
            { PBESpecies.Virizion, new PBELocalizedString("すばやい　みのこなしで　あいてを\nほんろうして　ポケモンを　まもると\nでんせつで　つたえられている。", "재빠른 몸놀림으로 상대를\n농락해 포켓몬을 지킨다고\n전설로 전해져 온다.", "Il lacère ses ennemis avec une agilité\nsans égale. La légende raconte qu'il\nprotège les Pokémon.", "Legenden zufolge täuschte es seine\nGegner mit flinken Bewegungen und\nbeschützte so die Pokémon.", "Cuenta la leyenda que Virizion confunde\na sus rivales con rápidos movimientos\npara proteger a otros Pokémon.", "Le leggende dicono di lui che protegge i\nPokémon tenendo in scacco i nemici con i\nsuoi movimenti fulminei.", "Legends say this Pokémon\nconfounded opponents with\nits swift movements.") },
            { PBESpecies.Tornadus, new PBELocalizedString("しほうはっぽうを　とびまわる。\nこのときに　だす　かぜは　つよすぎて\nどんなものでも　ふきとばしてしまう。", "사방팔방 날아다닌다.\n이때 내는 바람은 너무 강해서\n어떤 것이라도 날려버리고 만다.", "Il voyage aux quatre vents. Son passage\nprovoque des tempêtes qui balayent tout\naux alentours.", "Es fliegt den gesamten Globus ab. Der\nWind, den es dabei erzeugt, ist so stark,\ndass er alles aus den Angeln hebt.", "Le gusta ir volando de un lado a otro,\ngenerando tempestades tan potentes\nque pueden echar abajo una casa.", "Vola nei cieli in perenne girovagare e\nproduce un vento così forte da spazzare\nvia ogni cosa incontri.", "In every direction it flies,\ncreating winds so powerful,\nthey blow everything away.") },
            { PBESpecies.Thundurus, new PBELocalizedString("おおぞらを　とびまわりながら\nあちこちに　カミナリを　おとして\nやまかじを　おこすので　きらわれる。", "넓은 하늘을 날아다니며\n여기저기 번개를 떨어뜨려\n산불을 내기 때문에 미움받는다.", "Il vole dans le ciel d'Unys et fait tomber\ndes éclairs, provoquant des incendies\nqui font sa mauvaise réputation.", "Es ist bei den Leuten verhasst, weil es\nauf seinen Rundflügen immer wieder Blitze\nerzeugt, die Waldbrände verursachen.", "Su gusto por surcar el cielo lanzando\nrayos y provocando incendios forestales\nle ha granjeado pocas simpatías.", "Non è molto amato perché durante i suoi\nperegrinaggi nei cieli fa cadere fulmini\nqua e là che causano incendi nei boschi.", "As it flies around, it shoots lightning all\nover the place and causes forest fires.\nIt is therefore disliked.") },
            { PBESpecies.Reshiram, new PBELocalizedString("ほのおで　せかいを　もやしつくせる\nでんせつの　ポケモン。しんじつの\nせかいを　きずく　ひとを　たすける。", "불꽃으로 세상을 태워버릴 수 있는\n전설의 포켓몬. 진실의 세계를\n구축하는 사람을 도와준다.", "Un Pokémon légendaire assez puissant\npour embraser le monde entier.\nIl soutient les défenseurs de la Réalité.", "Ein Legendäres Pokémon mit der Macht,\ndie Welt mit seinen Flammen einzuäschern.\nHilft allen, die nach Wirklichkeit streben.", "Pokémon legendario capaz de abrasar\nel mundo con sus llamas. Ayuda a quienes\npersiguen un mundo veraz.", "Questo Pokémon leggendario può rendere\nil mondo un inferno di fiamme. Aiuta chi\nvuole costruire un mondo di verità.", "This legendary Pokémon can scorch\nthe world with fire. It helps those\nwho want to build a world of truth.") },
            { PBESpecies.Zekrom, new PBELocalizedString("いなずまで　せかいを　やきつくせる\nでんせつの　ポケモン。りそうの\nせかいを　つくる　ひとを　ほさする。", "번개로 세상을 태워버릴 수 있는\n전설의 포켓몬. 이상의 세계를\n구축하는 사람을 보좌한다.", "Un Pokémon légendaire assez puissant\npour foudroyer le monde entier.\nIl soutient ceux qui suivent leur Idéal.", "Ein Legendäres Pokémon mit der Macht,\ndie Welt durch Donner einzuäschern. Hilft\nallen, die einer Welt der Wünsche harren.", "Pokémon legendario capaz de chamuscar\nel mundo con sus rayos. Ayuda a quienes\npersiguen un mundo de ideales.", "Questo Pokémon leggendario può riempire\nil mondo di fulmini e saette. Aiuta chi\nvuole costruire un mondo ideale.", "This legendary Pokémon can scorch\nthe world with lightning. It assists\nthose who want to build an ideal world.") },
            { PBESpecies.Landorus, new PBELocalizedString("かぜや　かみなりを　とりこみ　かえた\nエネルギーが　つちに　えいようを\nあたえて　だいちを　ゆたかに　する。", "바람이나 번개를 거둬들여 바꾼\n에너지가 흙에 영양을\n주어 대지를 풍족하게 한다.", "Il utilise l'énergie qu'il tire du vent\net de la foudre pour enrichir les sols\nen nutriments pour les cultures.", "Seine aus Wind und Donner gewonnene\nEnergie sorgt für reiche Ernten, da sie\nden Boden mit Nährstoffen anreichert.", "Utiliza energía que obtiene del viento\ny del relámpago para nutrir el suelo\ny generar abundantes cosechas.", "Rende fertile la terra trasformando\nl'energia del vento e dei fulmini in\nnutrimento per il suolo.", "From the forces of lightning and wind,\nit creates energy to give nutrients to\nthe soil and make the land abundant.") },
            { PBESpecies.Kyurem, new PBELocalizedString("うしなった　からだを　しんじつと\nりそうで　うめてくれる　えいゆうを\nまつ　こおりの　でんせつポケモン。", "잃어버린 몸을 진실과\n이상으로 채워줄 영웅을\n기다리는 얼음의 전설 포켓몬.", "Il attend le héros qui saura réanimer son\ncorps de glace incomplet en partageant\navec lui son Idéal et sa Réalité.", "Ein Legendäres Eis-Pokémon, das auf den\nHelden wartet, der seinen verstümmelten\nKörper mit Wunsch und Wirklichkeit heilt.", "Pokémon legendario que aguarda al héroe\nque compense el vacío de su cuerpo\nde hielo con verdad e ideales.", "Questo leggendario Pokémon dei ghiacci\nattende l'eroe che gli restituirà le sue\nvere sembianze con gli ideali o la verità.", "This legendary ice Pokémon waits for\na hero to fill in the missing parts\nof its body with truth or ideals.") },
            { PBESpecies.Keldeo, new PBELocalizedString("かくごを　きめることで　ぜんしんに\nちからが　みなぎって　すばやくなり\nとびはねると　ざんぞうが　みえる。", "각오를 굳히는 것으로 전신에\n힘이 넘쳐흘러 재빨라지며\n뛰어오르면 잔상이 보인다.", "Lorsqu'il est résolu, de l'énergie sature\nson corps et le propulse à des vitesses\nqui dépassent la perception humaine.", "Ist es sich seiner Sache sicher, strotzt\nes vor Kraft und seine Sprünge werden\nzu schnell für das menschliche Auge.", "Cuando está decidido, su cuerpo rebosa\nbrío, y es capaz de saltar más alto y\ncorrer más de lo que la vista alcanza.", "Quando è pronto a passare all'azione,\nsi carica d'energia e diventa così veloce\nche è impossibile seguirlo con gli occhi.", "When it is resolute, its body fills\nwith power and it becomes swifter.\nIts jumps are then too fast to follow.") },
            { PBESpecies.Meloetta, new PBELocalizedString("メロエッタの　かなでる　せんりつは\nまわりの　ポケモンを　よろこばせたり\nかなしませるほどの　パワーがある。", "메로엣타가 연주하는 선율에는\n주위 포켓몬을 기쁘게 하거나\n슬프게 할 정도의 힘이 있다.", "Les mélodies enivrantes de Meloetta\ntouchent les Pokémon, pouvant les\nrendre heureux ou tristes.", "Es besitzt die Macht, Pokémon, die sich in\nseiner Nähe aufhalten, mit seinen\nMelodien froh oder traurig zu stimmen.", "Las melodías que canta Meloetta tienen\nel poder de hacer sentir felicidad a\nlos Pokémon que hay a su alrededor.", "Canta una melodia che ha il potere di\nportare la gioia o la tristezza nel cuore\ndei Pokémon che l'ascoltano.", "The melodies sung by Meloetta have\nthe power to make Pokémon that\nhear them happy or sad.") },
            { PBESpecies.Genesect, new PBELocalizedString("\xFF13おくねんまえに　いた　ポケモン。\nプラズマだんに　かいぞう　され\nせなかに　ほうだいを　つけられた。", "3억 년 전에 있었던 포켓몬.\n플라스마단에 개조당해\n등에 대포가 붙여졌다.", "Un Pokémon existant depuis 300 millions\nd'années, et modifié par la Team Plasma.\nIl a maintenant un canon dans le dos.", "Es lebte vor 300 Millionen Jahren.\nTeam Plasma modifizierte es und pflanzte\nihm am Rücken eine Kanone ein.", "Un Pokémon de hace 300 millones de años\ny alterado por el Equipo Plasma, quienes\nle han equipado con un cañón en el lomo.", "Esiste da più di 300 milioni di anni.\nIl Team Plasma ne ha modificato il corpo\nmontandogli un cannone sul dorso.", "This Pokémon existed 300 million years\nago. Team Plasma altered it and\nattached a cannon to its back.") }
